INSERT INTO `ps_product_lang` VALUES (14,1,1,'<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-phat-white-crimson-grey-gs','Nike Air Jordan I Phat White/Crimson/Grey GS AJ 1 2012 Women',NULL,'Air Jordan I Phat White/Crimson/Grey GS','Air Jordan I Phat White/Crimson/Grey GS',NULL,NULL),(14,1,2,'<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2012</p>','air-jordan-i-phat-white-crimson-grey-gs','Nike Air Jordan I Phat White/Crimson/Grey GS AJ 1 2012 Women',NULL,'Air Jordan I Phat White/Crimson/Grey GS','Air Jordan I Phat White/Crimson/Grey GS',NULL,NULL),(14,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(14,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(14,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(15,1,1,'<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-phat-olympic-white-navy-gold-gs','Nike Air Jordan I Phat Olympic White/Navy/Gold GS AJ 1 2012 Women',NULL,'Air Jordan I Phat Olympic White/Navy/Gold GS','Air Jordan I Phat Olympic White/Navy/Gold GS',NULL,NULL),(15,1,2,'<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2012</p>','air-jordan-i-phat-olympic-white-navy-gold-gs','Nike Air Jordan I Phat Olympic White/Navy/Gold GS AJ 1 2012 Women',NULL,'Air Jordan I Phat Olympic White/Navy/Gold GS','Air Jordan I Phat Olympic White/Navy/Gold GS',NULL,NULL),(15,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(15,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(15,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(24,1,1,'<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2011</p>','air-jordan-iii-true-blue-kid','Nike Air Jordan III True Blue Kid retro AJ 3 2011',NULL,'Air Jordan III True Blue Kid','Air Jordan III True Blue Kid',NULL,NULL),(24,1,2,'<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2011</p>','air-jordan-iii-true-blue-kid','Nike Air Jordan III True Blue Kid retro AJ 3 2011',NULL,'Air Jordan III True Blue Kid','Air Jordan III True Blue Kid',NULL,NULL),(24,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(24,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(24,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(26,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-white-cement-gs','Nike Air Jordan IV White/Cement GS retro ladies AJ 4 2012 women',NULL,'Air Jordan IV White/Cement GS','Air Jordan IV White/Cement GS',NULL,NULL),(26,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-white-cement-gs','Nike Air Jordan IV White/Cement GS retro ladies AJ 4 2012 women',NULL,'Air Jordan IV White/Cement GS','Air Jordan IV White/Cement GS',NULL,NULL),(26,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(26,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(26,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(29,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-cavs-gs','Nike Air Jordan IV Cavs GS retro ladies AJ 4 2012 women Cleveland Cavaliers the Shot',NULL,'Air Jordan IV Cavs GS','Air Jordan IV Cavs GS',NULL,NULL),(29,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-cavs-gs','Nike Air Jordan IV Cavs GS retro ladies AJ 4 2012 women Cleveland Cavaliers the Shot',NULL,'Air Jordan IV Cavs GS','Air Jordan IV Cavs GS',NULL,NULL),(29,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(29,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(29,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(33,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-white-cement-baby','Nike Air Jordan IV White/Cement GS retro baby kids toddler AJ 4 2012 women',NULL,'Air Jordan IV White/Cement Baby','Air Jordan IV White/Cement Baby',NULL,NULL),(33,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-white-cement-baby','Nike Air Jordan IV White/Cement GS retro baby kids toddler AJ 4 2012 women',NULL,'Air Jordan IV White/Cement Baby','Air Jordan IV White/Cement Baby',NULL,NULL),(33,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(33,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(33,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(44,1,1,'<p>Year of release: 2012</p>\r\n<p>The AJKO was originally released in 1985, the same year as Air Jordan I. It is very similar to it but was made of canvas instead of leather and AJKO is written on the Jordan wings logo instead of \"Air Jordan\". The meaning of the name \"KO\" is a bit mysterious, could be Knock Out, or Knock Off.</p>\r\n<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-ko-white-black-varsity-red','Nike Air Jordan I KO White/Black/Varsity Red AJ 1 2012',NULL,'Air Jordan I KO White/Black/Varsity Red','Air Jordan I KO White/Black/Varsity Red',NULL,NULL),(44,1,2,'<p>Année de sortie: 2012</p>\r\n<p>Le modèle AJKO original a vu le jour en 1985, année de la sortie de la Air Jordan I. Les 2 modèles sont très proches, principales différences: la AJKO est faite de toile et non de cuir, le logo Jordan Wings porte l\'inscription \"AJKO\" au lieu de \"Air Jordan\". La signification du nom \"KO\" reste mystérieuse, ça peut être \"Knock Out\" ou \"Knock Off\".</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2012</p>','air-jordan-i-ko-white-black-varsity-red','Nike Air Jordan I KO White/Black/Varsity Red AJ 1 2012',NULL,'Air Jordan I KO White/Black/Varsity Red','Air Jordan I KO White/Black/Varsity Red',NULL,NULL),(44,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(44,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(44,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(65,1,1,'<p>About Air Jordan VIII:</p>\r\n<p>Year of release of OG model: 1992</p>\r\n<p>In 1993, Michael Jordan and the Bulls win their 3rd NBA title in a row against Charles Barkley’s Phoenix Suns. MJ is once again MVP of the NBA finals.</p>\r\n<p>The most popular colorway of Air Jordan VIII, called « Aqua », was only worn once by MJ : during ’93 NBA All Star Game in Salt Lake City.<br />The shoe uses advanced technology, anti-inversion straps, soles in polycarbonate. The colors are even more aggressive. The Air Jordan VIII changed the way high performance shoes were designed technologically and aesthetically. High-top sneaker made of black velours with diagonal <br />applications allover the lacing parts and an additional slim velcro. Perforations on the side parts.</p>','<p>Year of release: 2007</p>','air-jordan-viii-white-stealth-orange','Nike Air Jordan VIII White/Stealth/Orange AJ 8 Vintage 1991',NULL,'Air Jordan VIII White/Stealth/Orange','Air Jordan VIII White/Stealth/Orange',NULL,NULL),(65,1,2,'<p>A propos de la Air Jordan VIII:</p>\r\n<p>Date de sortie du modèle original: 1992</p>\r\n<p>A l’issue de la saison 1992-93, Micheal Jordan et les Bulls remportent leur 3ème titre NBA consécutif, face aux Phoenix Suns emmenés par Charles Barkley. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Le colori le plus populaire parmi les Air Jordan VIII, appelé « Aqua », a été porté une seule fois par MJ lors du NBA All Star Game ’93 à Salt Lake City. <br />La chaussure emploie des technologies de pointe pour l\'époque : des straps inédits et une semelle en polycarbonate. Les couleurs sont encore plus agressives. La Air Jordan VIII a changé la façon dont les chaussures de haute performance étaient conçues, techniquement et esthétiquement.</p>','<p>Année de sortie: 2007</p>','air-jordan-viii-white-stealth-orange','Nike Air Jordan VIII White/Stealth/Orange AJ 8 Vintage 1992',NULL,'Air Jordan VIII White/Stealth/Orange','Air Jordan VIII White/Stealth/Orange',NULL,NULL),(65,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(65,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(65,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(87,1,1,'<p>In 2008, Jordan Brand released 11 different Countdown packages (almost one per month) in order to commemorate Air Jordans\' legacy. For each pack, the sum of the two pairs equals to 23. Countdown packages were the opportunity for Jordan Brand to offer to the fans reissues of each Air Jordan (from 1 to 22).</p>\r\n<p> </p>\r\n<p>About Air Jordan II:</p>\r\n<p>Year of release of OG model: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p>In the 86-87 season, MJ scored an average 37.1 points per game and became the first player since Wilt Chamberlain to top 3,000 points in a season. Michael also played in the All-Star Game and won the Slam-Dunk Contest. <br />The Air Jordan II was designed by Bruce Kilgore and just as its predecessor it showed a great innovative design. Surprisingly, this is the only Air Jordan ever that has not been made in a black version (except retro versions). Nike swoosh logo disappears. Full-grain leather upper. Polyurethane midsole, encapsulated Air-Sole® unit in heel. Rubber outsole.</p>','<p>Year of release: 2008</p>','air-jordan-countdown-package-ii-xxi','Nike Air Jordan Countdown Package II & XXI AJ 2 21 2008',NULL,'Air Jordan Countdown Package II & XXI','Air Jordan Countdown Package II & XXI',NULL,NULL),(87,1,2,'<p>Au cours de l\'année 2008, Jordan Brand a sorti 11 Countdown packages afin de célébrer la \"dynastie\" des Air Jordan. Pour chaque pack, la somme des 2 paires est toujours égale à 23. Ces packs ont été l\'occasion pour Jordan Brand de rééditer l\'ensemble des modèles (de la Jordan 1 à la 22).</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan II:</p>\r\n<p>Date de sortie du modèle original: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p>Durant la saison 86-87, Jordan marqua 37.1 points de moyenne par match et devint le premier joueur depuis Wilt Chamberlian a dépasser les 3000 points marqués dans une saison. Michael Jordan fut sélectionné pour son 2éme All-star game et remporta le slam-dunk contest. La Air <br />Jordan II a été dessinée par Bruce Kilgore et, comme la Jordan I, son design est particulièrement novateur.<br />Ce sera la seule Air Jordan à ne pas posséder de version noire (modèles retro exceptés). Coté design, le swoosh disparaît. Cuir supérieur veiné, semelle intermédaire en polyuréthane, système air dans la semelle au niveau du talon. Semelle en caoutchouc.</p>','<p>Année de sortie: 2008</p>','air-jordan-countdown-package-ii-xxi','Nike Air Jordan Countdown Package II & XXI AJ 2 21 2008',NULL,'Air Jordan Countdown Package II & XXI','Air Jordan Countdown Package II & XXI',NULL,NULL),(87,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(87,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(87,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(88,1,1,'<p>About Air Jordan XXIII:</p>\r\n<p>Year of release of OG model: 2008</p>\r\n<p>With the 23<sup>rd</sup> Jordan pair, Jordan Brand innovated again, starting from the toe. The toe cap has Jordan’s signature embossed. The side of the shoe features a stitched pattern that gives the shoes strength in addition to cosmetic effect. The tongue of the left and right are different for a first time with a Jumpman logo on the right shoe and the number 23 embedded on the left shoe. The Jumpman is completely missing on the left sneaker, except on the ends of the shoelaces. The shoe also features a glittery panel that covers the midsole body of the sneaker. This was the first Air Jordan that was engineered to not use any glue in order to make it more environmentally friendly, while the soles (which are designed from Jordan\'s own fingerprint) are made from recycled rubber.</p>\r\n<p>It is considered the most technologically advanced Jordan model to date, and according to Gentry Humphrey, the head of the Jordan design team, it may be the last actual Air Jordan. The shoe was released in three different colorways from January to February 2008, with a limited edition release where 23 retailers around the world sold the shoe, before its international release in February.</p>','<p>Year of release: 2008</p>','air-jordan-xxiii-black-varsity-red','Nike Air Jordan XXIII Black/Varsity Red AJ 23 2008',NULL,'Air Jordan XXIII Black/Varsity Red','Air Jordan XXIII Black/Varsity Red',NULL,NULL),(88,1,2,'<p>A propos de la Air Jordan XXIII:</p>\r\n<p>Date de sortie du modèle original: 2008</p>\r\n<p>Avec cette 23<sup>ème</sup> paire de Jordan, Jordan Brand propose encore un design novateur en commençant par la partie latérale avant de la chaussure qui porte la signature de Jordan en relief.  Les cotés de la chaussure sont recouverts de surpiqûres multicolores qui renforcent à la fois la rigidité et l’aspect « design » de la chaussure.</p>\r\n<p>Les languettes gauche et droite sont différentes sur ce modèle. La droite porte le Jumpman alors que, sur  la gauche apparaît uniquement le N°23. Excepté la languette droite et les lacets, le Jumpan est complètement absent de ce modèle. La semelle intermédiaire est recouverte d’une partie plastifiée brillante dont les tons varient en fonction de la luminosité.</p>\r\n<p>La Air Jordan 23 est la première paire de Jordan à être constituée de caoutchouc recyclé et à ne pas utiliser de colle. Cette paire est considérée à ce jour comme la plus aboutie au niveau des technologies utilisées et, selon Gentry Humphrey (Responsable du design chez Jordan Brand), il est possible que cela soit le dernier « vrai » modèle de Air Jordan.</p>\r\n<p>Avant sa sortie officielle en Février 2008, la AJ23 a été distribuée en avant première et dans trois coloris en Janvier dans 23 magasins à travers le monde.</p>','<p>Année de sortie: 2008</p>','air-jordan-xxiii-black-varsity-red','Nike Air Jordan XXIII Black/Varsity Red AJ 23 2008',NULL,'Air Jordan XXIII Black/Varsity Red','Air Jordan XXIII Black/Varsity Red',NULL,NULL),(88,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(88,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(88,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(89,1,1,'<p>About Air Jordan XXIII:</p>\r\n<p>Year of release of OG model: 2008</p>\r\n<p>With the 23<sup>rd</sup> Jordan pair, Jordan Brand innovated again, starting from the toe. The toe cap has Jordan’s signature embossed. The side of the shoe features a stitched pattern that gives the shoes strength in addition to cosmetic effect. The tongue of the left and right are different for a first time with a Jumpman logo on the right shoe and the number 23 embedded on the left shoe. The Jumpman is completely missing on the left sneaker, except on the ends of the shoelaces. The shoe also features a glittery panel that covers the midsole body of the sneaker. This was the first Air Jordan that was engineered to not use any glue in order to make it more environmentally friendly, while the soles (which are designed from Jordan\'s own fingerprint) are made from recycled rubber.</p>\r\n<p>It is considered the most technologically advanced Jordan model to date, and according to Gentry Humphrey, the head of the Jordan design team, it may be the last actual Air Jordan. The shoe was released in three different colorways from January to February 2008, with a limited edition release where 23 retailers around the world sold the shoe, before its international release in February.</p>','<p>Year of release: 2008</p>','air-jordan-xxiii-motorsports','Nike Air Jordan XXIII Motorsports AJ 23 2008',NULL,'Air Jordan XXIII Motorsports','Air Jordan XXIII Motorsports',NULL,NULL),(89,1,2,'<p>A propos de la Air Jordan XXIII:</p>\r\n<p>Date de sortie du modèle original: 2008</p>\r\n<p>Avec cette 23<sup>ème</sup> paire de Jordan, Jordan Brand propose encore un design novateur en commençant par la partie latérale avant de la chaussure qui porte la signature de Jordan en relief.  Les cotés de la chaussure sont recouverts de surpiqûres multicolores qui renforcent à la fois la rigidité et l’aspect « design » de la chaussure.</p>\r\n<p>Les languettes gauche et droite sont différentes sur ce modèle. La droite porte le Jumpman alors que, sur  la gauche apparaît uniquement le N°23. Excepté la languette droite et les lacets, le Jumpan est complètement absent de ce modèle. La semelle intermédiaire est recouverte d’une partie plastifiée brillante dont les tons varient en fonction de la luminosité.</p>\r\n<p>La Air Jordan 23 est la première paire de Jordan à être constituée de caoutchouc recyclé et à ne pas utiliser de colle. Cette paire est considérée à ce jour comme la plus aboutie au niveau des technologies utilisées et, selon Gentry Humphrey (Responsable du design chez Jordan Brand), il est possible que cela soit le dernier « vrai » modèle de Air Jordan.</p>\r\n<p>Avant sa sortie officielle en Février 2008, la AJ23 a été distribuée en avant première et dans trois coloris en Janvier dans 23 magasins à travers le monde.</p>','<p>Année de sortie: 2008</p>','air-jordan-xxiii-motorsports','Nike Air Jordan XXIII Motorsports AJ 23 2008',NULL,'Air Jordan XXIII Motorsports','Air Jordan XXIII Motorsports',NULL,NULL),(89,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(89,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(89,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(90,1,1,'<p>About Air Jordan Spizike:</p>\r\n<p>Year of release of OG model: 2006</p>\r\n<p>The Air Jordan Spiz’ike was made to show appreciation to Mars Blackmon aka Spike Lee. Spike’s <br />part in the rising of the Air Jordan was very crucial. A lot of people may remember Spike Lee’s funny commercials starring Mars Blackmon (character from his movie She’s Gotta Have it). The Spiz’ike, after the Dub Zero model, was the second Jordan fusion to be released. In fact, it was <br />made up of a total of 5 different Air Jordans, the Jordan III(midsole), Jordan IV(Wings), Jordan <br />V(Uppers), Jordan VI(Tongue) &amp; Jordan IX (Pull Tab). <br />The Spiz’ike already released in dozens of colorways and more are yet to come. The cement colorway, released in 2008, is after the Air Jordan IV colorway, which was also featured in Spike Lee’s movie “Do the Right Thing” where Buggin’ Out had his brand new Air Jordan’s scuffed by a pedestrian walking his bike.</p>','<p>Year of release: 2010</p>','air-jordan-spizike-white-black-infrared','Nike Air Jordan Spizike White/Black/Infrared AJ Spizike 2010',NULL,'Air Jordan Spizike White/Black/Infrared','Air Jordan Spizike White/Black/Infrared',NULL,NULL),(90,1,2,'<p>A propos de la Air Jordan Spizike:</p>\r\n<p>Date de sortie du modèle original: 2006</p>\r\n<p>La Air Jordan Spiz’ike a été créée pour rendre hommage à Spike Lee tant pour son rôle primordial <br />dans le succès planétaire des Air Jordan que pour sa collaboration avec Nike et MJ. Nombreux sont ceux qui se rappellent ses spots publicitaires comiques tournés avec Jordan pour Nike mettant en scène son personnage « Mars Blackman » (tiré de son film : « She’s Gotta Have it »). <br />Après la Jordan Dub-Zero, la Spiz’ike a été le deuxième modèle « fusion » sorti par Jordan Brand. <br />La Spiz’ike est faite d’éléments inspirés de 5 Jordan différentes :les Jordan III (semelle intermédiaire), IV (passants pour lacets), V (col), VI (languette) &amp; IX (languette arrière). La Spiz’ike existe déja en de nombreux coloris qui sont parfois inspirés de Jordan emblématiques comme le modèle « Cement » qui reprend les couleurs de la Jordan IV vue dans une scène culte de « Do the Right Thing » où un passant à vélo souille la Jordan IV de Buggin’ Out.</p>','<p>Année de sortie: 2010</p>','air-jordan-spizike-white-black-infrared','Nike Air Jordan Spizike White/Black/Infrared AJ 2010',NULL,'Air Jordan Spizike White/Black/Infrared','Air Jordan Spizike White/Black/Infrared',NULL,NULL),(90,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(90,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(90,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,