t White/Black 2005',NULL,'Huarache Light Burst White/Black','Huarache Light Burst White/Black',NULL,NULL),(106,1,2,NULL,'<p>Année de sortie: 2005</p>','huarache-light-burst-white-black','Nike Huarache Light Burst White/Black 2005',NULL,'Huarache Light Burst White/Black','Huarache Light Burst White/Black',NULL,NULL),(106,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(106,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(106,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(107,1,1,NULL,'<p>Year of release: 2006</p>','air-force-25-supreme-black-chrome','Nike Air Force 25 Supreme Black/Chrome 2006',NULL,'Air Force 25 Supreme Black/Chrome','Air Force 25 Supreme Black/Chrome',NULL,NULL),(107,1,2,NULL,'<p>Année de sortie: 2006</p>','air-force-25-supreme-black-chrome','Nike Air Force 25 Supreme Black/Chrome 2006',NULL,'Air Force 25 Supreme Black/Chrome','Air Force 25 Supreme Black/Chrome',NULL,NULL),(107,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(107,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(107,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(111,1,1,'<p>About Adidas Superstar:</p>\r\n<p>Year of release of OG Model: 1969</p>\r\n<p>The Superstar was produced in 1969 as a low Pro Model version and was the first basketball sneaker made of leather. Unmistakable because of the shelltop made of rubber.</p>\r\n<p>With his typical styling and his bulky looking. Hip Hop artists like RUN-DMC made it to an icon. Their track My Adidas paid tribute to the brand and let the group have their own personalized Adidas shoes and clothing.</p>','<p>Year of release: 2007</p>','adidas-superstar-white-caramel','Adidas Superstar White/Caramel 2007',NULL,'Adidas Superstar White/Caramel','Adidas Superstar White/Caramel',NULL,NULL),(111,1,2,'<p>A propos de la Adidas Superstar:</p>\r\n<p>Année de sortie du modèle original: 1969</p>\r\n<p>La superstar a été produite en 1969 comme une version basse de la Pro Model et a été la première chaussure de basket-ball toute en cuir. Cette chaussure est incomparable en raison de sa coque en caoutchouc renforcée à l’avant du pied. Avec son style atypique et sa forme volumineuse.</p>\r\n<p>Des artistes Hip Hop comme RUN-DMC ont fait de cette chaussure un phénomène. Leur chanson «My Adidas » a rendu hommage à la marque et a conduit le groupe à avoir leur propre ligne de vêtements et de chaussures Adidas.</p>','<p>Année de sortie: 2007</p>','adidas-superstar-white-caramel','Adidas Superstar White/Caramel 2007',NULL,'Adidas Superstar White/Caramel','Adidas Superstar 2 White/Caramel',NULL,NULL),(111,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(111,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(111,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(112,1,1,NULL,'<p>Year of release: 2007</p>','adidas-zx800-boston-super','Adidas ZX800 Boston Super 2007 running celtics',NULL,'Adidas ZX800 Boston Super','Adidas ZX800 Boston Super',NULL,NULL),(112,1,2,NULL,'<p>Année de sortie: 2007</p>','adidas-zx800-boston-super','Adidas ZX800 Boston Super 2007 running celtics',NULL,'Adidas ZX800 Boston Super','Adidas ZX800 Boston Super',NULL,NULL),(112,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(112,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(112,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(114,1,1,NULL,'<p>Year of release: 2007</p>','adidas-tennis-pro-white-red','Adidas Tennis Pro White/Red 2007',NULL,'Adidas Tennis Pro White/Red','Adidas Tennis Pro White/Red',NULL,NULL),(114,1,2,NULL,'<p>Année de sortie: 2007</p>','adidas-tennis-pro-white-red','Adidas Tennis Pro White/Red 2007',NULL,'Adidas Tennis Pro White/Red','Adidas Tennis Pro White/Red',NULL,NULL),(114,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(114,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(114,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(115,1,1,'<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2010</p>','air-jordan-vi-black-varsity-red-baby','Nike Air Jordan VI Black/Varsity Red Baby AJ 6 2010 Bulls',NULL,'Air Jordan VI Black/Varsity Red Baby','Air Jordan VI Black/Varsity Red Baby',NULL,NULL),(115,1,2,'<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2010</p>','air-jordan-vi-black-varsity-red-baby','Nike Air Jordan VI Black/Varsity Red Baby AJ 6 2010 Bulls',NULL,'Air Jordan VI Black/Varsity Red Baby','Air Jordan VI Black/Varsity Red Baby',NULL,NULL),(115,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(115,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(115,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(116,1,1,'<p style=\"text-align: justify;\">About Air Structure Triax 91:</p>\r\n<p style=\"text-align: justify;\">Year of release of OG model: 1991</p>\r\n<p style=\"text-align: justify;\">First released back in 1991, the Nike Air Structure Triax immediately became an iconic shoe combining the Nike Footbridge technology with the Air unit plus infrared accents on its insteps. The original colorway of the Nike Air Structure (Metallic Summit White/Teal-Black-Infrared) had a classic shape made of smooth black/grey suede, white mesh accents and the lovely teal swoosh. The Air Structure was retroed for the first time in 2008.</p>','<p>Year of release: 2008</p>','air-structure-triax-91-purple-green-white-black','Nike Air Structure Triax 91 Purple/Green/White/Black 2008',NULL,'Air Structure Triax 91 Purple/Green/White/Black','Air Structure Triax 91 Purple/Green/White/Black',NULL,NULL),(116,1,2,'<p style=\"text-align: justify;\">A propos de la Air Structure Triax 91:</p>\r\n<p style=\"text-align: justify;\">Date de sortie du modèle original: 1991</p>\r\n<p style=\"text-align: justify;\">Sortie en 1991, la Nike Air Structure Triax s’est rapidement imposée comme un modèle emblématique grâce aux formes et couleurs atypiques de ses bulles d’air et à la combinaison de la technologie Footbridge et du système air. Le colori original (Gris/Turquoise/Noir/Infrared) était composé de parties en daim noir et turquoise, de maille de couleur blanche et d’un swoosh turquoise. La Air Structure a été rééditée pour la première fois en 2008.</p>','<p>Année de sortie: 2008</p>','air-structure-triax-91-purple-green-white-black','Nike Air Structure Triax 91 Purple/Green/White/Black 2008',NULL,'Air Structure Triax 91 Purple/Green/White/Black','Air Structure Triax 91 Purple/Green/White/Black',NULL,NULL),(116,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(116,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(116,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(117,1,1,'<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2008</p>','air-max-1-white-blue','Nike Air Max 1 White/Blue 2008 Deadstock AM1',NULL,'Air Max 1 White/Blue','Air Max 1 White/Blue',NULL,NULL),(117,1,2,'<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2008</p>','air-max-1-white-blue','Nike Air Max 1 White/Blue 2008 Deadstock AM1',NULL,'Air Max 1 White/Blue','Air Max 1 White/Blue',NULL,NULL),(117,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(117,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(117,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(119,1,1,'<p>Year of release: 2004</p>\r\n<p> </p>\r\n<p>About Air Huarache Light:</p>\r\n<p>Year of release of OG model: 1993</p>\r\n<p style=\"text-align: justify;\">In 1993, its unusual styling made it less popular than the Air Huarache but in 2002 new colourways versions were produced and gave the Light a new fan base. The characteristics of the Huarache light are unique because of the breathable stretch mesh upper , the nylon eyelets and the low-profile outsole.<br /><br /></p>','<p>Year of release: 2004</p>','huarache-light-midnight-navy','Nike Huarache Light Midnight Navy White/Blue 2004',NULL,'Huarache Light Midnight Navy','Huarache Light Midnight Navy',NULL,NULL),(119,1,2,'<p>Année de sortie: 2004</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">A propos de la Air Huarache Light:<br />Date de sortie du modèle original: 1993</p>\r\n<p style=\"text-align: justify;\"><br />Ce modèle fut moins populaire que la Air Huarache en raison d’un design inhabituel pour l’époque, néanmoins un nouveau cercle de fan apparut avec la sortie en 2002 de nouveaux coloris. <br />La light possède un design unique, elle a été conçue pour permettre aux pieds de respirer avec des mailles extensibles, des œillets en nylon et une semelle au profil épuré.</p>','<p>Année de sortie: 2004</p>','huarache-light-midnight-navy','Nike Huarache Light Midnight Navy White/Blue 2004',NULL,'Huarache Light Midnight Navy','Huarache Light Midnight Navy',NULL,NULL),(119,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(119,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(119,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(124,1,1,'<p>Ivan Lendl is a Czechoslovakian tennis player who  became a U.S. citizen in 1992. Lendl marked the history of tennis (Number 1 tennis player in 1983)<br />In 1984, Adidas began producing a signature range of clothing and footwear for Ivan Lendl.<br />The Ivan Lendl Competition (IL COMP) sneaker made its debut in 1984 and was recognized among the most effective models of the time. It was a tennis shoe dedicated to fast surface.</p>','<p>Year of release: 2010</p>','adidas-ivan-lendl-comp-white-navy','Adidas Ivan Lendl Comp White/Navy IL Comp 2010',NULL,'Adidas Ivan Lendl Comp White/Navy','Adidas Ivan Lendl Comp White/Navy',NULL,NULL),(124,1,2,'<p>Ivan Lendl est un joueur de tennis tchécoslovaque, devenu citoyen américain en 1992. Lendl a marqué l\'histoire du tennis (numéro 1 mondial en 1983).<br />En 1984, Adidas commença à produire une gamme de chaussures et vêtements portant la signature d’Ivan Lendl.<br />Adidas lança la IL COMP en 1984 qui fut reconnue parmi les modèles les plus performants de l’époque. Il s’agit d’une chaussure de tennis pour surface rapide.</p>','<p>Année de sortie: 2010</p>','adidas-ivan-lendl-comp-white-navy','Adidas Ivan Lendl Comp White/Navy IL Comp 2010',NULL,'Adidas Ivan Lendl Comp White/Navy','Adidas Ivan Lendl Comp White/Navy',NULL,NULL),(124,1,3,NULL,NULL,'adidas-il-comp',NULL,NULL,NULL,'adidas IL Comp',NULL,NULL),(124,1,4,NULL,NULL,'adidas-il-comp',NULL,NULL,NULL,'adidas IL Comp',NULL,NULL),(124,1,5,NULL,NULL,'adidas-il-comp',NULL,NULL,NULL,'adidas IL Comp',NULL,NULL),(126,1,1,NULL,'<p>Year of release: 2009</p>','adidas-nastase-super-tournament-edition-','Adidas Nastase Super Tournament Edition White Black Ilie Tennis 2009',NULL,'Adidas Nastase Super Tournament Edition','Adidas Nastase Super Tournament Edition ',NULL,NULL),(126,1,2,NULL,'<p>Année de sortie: 2009</p>','adidas-nastase-super-tournament-edition','Adidas Nastase Super Tournament Edition White Black Ilie Tennis 2009',NULL,'Adidas Nastase Super Tournament Edition','Adidas Nastase Super Tournament Edition',NULL,NULL),(126,1,3,NULL,NULL,'adidas-nastase-super-tournament-edition-white-black',NULL,NULL,NULL,'Adidas Nastase Super Tournament Edition White/Black',NULL,NULL),(126,1,4,NULL,NULL,'adidas-nastase-super-tournament-edition-white-black',NULL,NULL,NULL,'Adidas Nastase Super Tournament Edition White/Black',NULL,NULL),(126,1,5,NULL,NULL,'adidas-nastase-super-tournament-edition-white-black',NULL,NULL,NULL,'Adidas Nastase Super Tournament Edition White/Black',NULL,NULL),(128,1,1,NULL,'<p>Year of release: 2007</p>','new-balance-centennial-black-gold','New Balance Centennial Black/Gold NB 2007',NULL,'New Balance Centennial Black/Gold','New Balance 554 Centennial Black/Gold',NULL,NULL),(128,1,2,NULL,'<p>Année de sortie: 2007</p>','new-balance-centennial-black-gold','New Balance Centennial Black/Gold NB 2007',NULL,'New Balance Centennial Black/Gold','New Balance 554 Centennial Black/Gold',NULL,NULL),(128,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(128,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(128,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(129,1,1,'<p>The adidas kegler uses the peg system. The peg system consists of there variable-density hell pegs, which are adjusted  to customize the shoe’s cushioning. However the most interesting feature of this shoe is the suede strip that wraps around the toe guard, extending all the way to the bottom of the shoe to cover the midsole and the outsole. </p>','<p>year of release: 2009</p>','adidas-kegler-super-original','Adidas Kegler Super Original White/Blue/Red 2009',NULL,'Adidas Kegler Super Original','Adidas Kegler Super Original',NULL,NULL),(129,1,2,'<p>La adidas kegler utilise le système d’amorti « peg ». Ce système permet de modifier la densité du système d’amortissement au niveau du talon par l’intermédiaire de trois piquets échangeables.</p>\r\n<p>Toutefois, le plus intéressant avec cette chaussure est la partie en daim qui entoure le bout du pied, qui s’étend sur la semelle intermédiaire et extérieure, et qui couvre une partie de l’avant du pied.</p>','<p>année de sortie: 2009</p>','adidas-kegler-super-original','Adidas Kegler Super Original White/Blue/Red 2009',NULL,'Adidas Kegler Super Original','Adidas Kegler Super Original',NULL,NULL),(129,1,3,NULL,NULL,'adidas-kegler-super-original',NULL,NULL,NULL,'Adidas Kegler Super Original',NULL,NULL),(129,1,4,NULL,NULL,'adidas-kegler-super-original',NULL,NULL,NULL,'Adidas Kegler Super Original',NULL,NULL),(129,1,5,NULL,NULL,'adidas-kegler-super-original',NULL,NULL,NULL,'Adidas Kegler Super Original',NULL,NULL),(130,1,1,'<p>About Adidas Superstar:</p>\r\n<p>Year of release of OG Model: 1969</p>\r\n<p>The Superstar was produced in 1969 as a low Pro Model version and was the first basketball sneaker made of leather. Unmistakable because of the shelltop made of rubber.</p>\r\n<p>With his typical styling and his bulky looking. Hip Hop artists like RUN-DMC made it to an icon. Their track My Adidas paid tribute to the brand and let the group have their own personalized Adidas shoes and clothing.</p>','<p>Year of release: 2012</p>','adidas-superstar-kazuki-x-clot','Adidas Superstar Kazuki x Clot Limited edition 2012',NULL,'Adidas Superstar Kazuki x Clot','Adidas Superstar Kazuki x Clot',NULL,NULL),(130,1,2,'<p>A propos de la Adidas Superstar:</p>\r\n<p>Année de sortie du modèle original: 1969</p>\r\n<p>La superstar a été produite en 1969 comme une version basse de la Pro Model et a été la première chaussure de basket-ball toute en cuir. Cette chaussure est incomparable en raison de sa coque en caoutchouc renforcée à l’avant du pied. Avec son style atypique et sa forme volumineuse.</p>\r\n<p>Des artistes Hip Hop comme RUN-DMC ont fait de cette chaussure un phénomène. Leur chanson « My Adidas » a rendu hommage à la marque et a conduit le groupe à avoir leur propre ligne de vêtements et de chaussures Adidas.</p>','<p>Année de sortie: 2012</p>','adidas-superstar-kazuki-x-clot','Adidas Superstar Kazuki x Clot Limited edition 2012',NULL,'Adidas Superstar Kazuki x Clot','Adidas Superstar Kazuki x Clot',NULL,NULL),(130,1,3,NULL,NULL,'adidas-superstar-kazuki-x-clot',NULL,NULL,NULL,'Adidas Superstar Kazuki x Clot',NULL,NULL),(130,1,4,NULL,NULL,'adidas-superstar-kazuki-x-clot',NULL,NULL,NULL,'Adidas Superstar Kazuki x Clot',NULL,NULL),(130,1,5,NULL,NULL,'adidas-superstar-kazuki-x-clot',NULL,NULL,NULL,'Adidas Superstar Kazuki x Clot',NULL,NULL),(133,1,1,NULL,'<p>year of release: 2012</p>','lebron-9-ps-elite-south-beach','Nike Air Lebron 9 P.S. Elite South Beach 2012 LBJ Lebron James',NULL,'Lebron 9 P.S. Elite South Beach','Lebron 9 P.S. Elite South Beach',NULL,NULL),(133,1,2,NULL,'<p>année de sortie: 2012</p>','nike-air-lebron-9-ps-elite-south-beach','Nike Air Lebron 9 P.S. Elite South Beach 2012 LBJ Lebron James',NULL,'Lebron 9 P.S. Elite South Beach','Lebron 9 P.S. Elite South Beach',NULL,NULL),(133,1,3,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(133,1,4,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(133,1,5,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(134,1,1,'<p>New Balance CM 996 Collab Undefeated x Stüssy x Hectic Limited Edition</p>\r\n<p>This limited edition is the result of a collab\' between Undefeated (UNDFTD), Stüssy and Mad Hectic. The shoe uses blue suede and mesh. It comes with an extra pair of laces.</p>','<p>Year of release: 2012</p>','new-balance-cm996-undefeated-x-stussy-x-hectic','New Balance CM996 Undefeated x Stüssy x Hectic Limited edition Undftd Navy Blue/Yellow/White',NULL,'New Balance CM996 Undefeated x Stüssy x Hectic','New Balance CM996 Undefeated x Stüssy x Hectic',NULL,NULL),(134,1,2,'<p class=\"Style7\">New Balance CM 996 Collab Undefeated x Stüssy x Hectic Edition Limitée</p>\r\n<p class=\"Style7\">Cette édition limitée provient d\'une collab\' entre Undefeated (UNDFTD), Stüssy et Mad Hectic. La paire est composée de daim et mesh bleu. Elle est livrée avec une paire de lacets supplémentaire.</p>','<p>Année de sortie: 2012</p>','new-balance-cm996-undefeated-x-stussy-x-hectic','New Balance CM996 Undefeated x Stüssy x Hectic Limited edition Undftd Navy Blue/Yellow/White',NULL,'New Balance CM996 Undefeated x Stüssy x Hectic','New Balance CM996 Undefeated x Stüssy x Hectic',NULL,NULL),(134,1,3,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(134,1,4,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(134,1,5,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(137,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','lebron-9-galaxy','Lebron 9 Galaxy Big Bang 2012 LB9 Lebron James',NULL,'Lebron 9 Galaxy','Lebron 9 Galaxy',NULL,NULL),(137,1,2,'<p>Année de sortie: 2012</p>','<p>Année de sortie: 2012</p>','lebron-9-galaxy','Lebron 9 Galaxy Big Bang 2012 LB9 Lebron James',NULL,'Lebron 9 Galaxy','Lebron 9 Galaxy',NULL,NULL),(137,1,3,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(137,1,4,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(137,1,5,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(138,1,1,NULL,'<p>Year of release: 2012</p>','lebron-9-black-history-month-2012','Lebron 9 BHM Black History Month 2012 Nike Air LB9 Lebron James',NULL,'Lebron 9 Black History Month 2012','Lebron 9 Black History Month 2012',NULL,NULL),(138,1,2,NULL,'<p>Année de sortie: 2012</p>','lebron-9-black-history-month-2012','Lebron 9 BHM Black History Month 2012 Nike Air LB9 Lebron James',NULL,'Lebron 9 Black History Month 2012','Lebron 9 Black History Month 2012',NULL,NULL),(138,1,3,NULL,NULL,'nike-air-lebron-9-black-history-month',NULL,NULL,NULL,'nike air lebron 9 black history month',NULL,NULL),(138,1,4,NULL,NULL,'nike-air-lebron-9-black-history-month',NULL,NULL,NULL,'nike air lebron 9 black history month',NULL,NULL),(138,1,5,NULL,NULL,'nike-air-lebron-9-black-history-month',NULL,NULL,NULL,'nike air lebron 9 black history month',NULL,NULL),(141,1,1,NULL,'<p>year of release: 2012</p>','air-zoom-vapor-tour-9-nyc','nike air zoom vapor tour 9 NYC roger federer US OPEN 2012 limited edition',NULL,'Air Zoom Vapor Tour 9 NYC','Air Zoom Vapor Tour 9 NYC',NULL,NULL),(141,1,2,NULL,'<p>année de sortie: 2012</p>','nike-air-zoom-vapor-tour-9-nyc','nike air zoom vapor tour 9 NYC roger federer US OPEN 2012 limited edition',NULL,'Air Zoom Vapor Tour 9 NYC','Air Zoom Vapor Tour 9 NYC',NULL,NULL),(141,1,3,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(141,1,4,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(141,1,5,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(142,1,1,'<p>The original version of this model was inspired by hiking shoes. It was developed to be a very functional basketball shoe and it was the first Nike basketball shoe to feature the full-length Nike Air Sole. The strap made the fit secure and was used to prevent ankle injury. At first, this model was only produced in high and low; the mid version was produced later. The Air Force 1 has become popular on the hip-hop scene, partly owing to the huge range of colorways that have been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2007</p>','air-force-1-low-white-green','nike Air Force 1 Low White/Green 2007',NULL,'Air Force 1 Low White/Green','Air Force 1 Low White/Green',NULL,NULL),(142,1,2,'<p>La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard.<br />La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2007</p>','air-force-1-low-white-green','nike Air Force 1 Low White/Green 2007',NULL,'Air Force 1 Low White/Green','Air Force 1 Low White/Green',NULL,NULL),(142,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(142,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(142,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(144,1,1,'<p>Originally designed for tennis, these shoes have been re-issued by Adidas in some cool, classic colours for casual wear. The upper sees leather all over except on the toe (suede), with perf holes on both sides and on the tongue.</p>','<p>Year of release: 2007</p>','adidas-adv-white-blue-red','Adidas ADV White/Blue/Red 2007 Great Britain Advantage',NULL,'Adidas ADV White/Blue/Red','Adidas ADV White/Blue/Red',NULL,NULL),(144,1,2,'<p>À l’origine dessinée pour le Tennis, la ADV est relancée par Adidas dans des coloris classiques pour un usage urbain. L’ensemble de la chaussure est en cuir, avec une partie en daim au bout de la chaussure. On note que les deux côtés de la languette sont perforés.</p>','<p>Année de sortie: 2007</p>','adidas-adv-white-blue-red','Adidas ADV White/Blue/Red 2007 Great Britain Advantage',NULL,'Adidas ADV White/Blue/Red','Adidas ADV White/Blue/Red',NULL,NULL),(144,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(144,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(144,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(145,1,1,'<p>Year of release: 2008</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2008</p>','asics-gel-lyte-iii-black-white-dark-green-purple-yellow','Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow 2008 Foot Locker Exclusive',NULL,'Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow','Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow',NULL,NULL),(145,1,2,'<p>Année de sortie: 2008</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2008</p>','asics-gel-lyte-iii-black-white-dark-green-purple-yellow','Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow 2008 Foot Locker Exclusive',NULL,'Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow','Asics Gel Lyte III Black/White/Dark Green/Purple/Yellow',NULL,NULL),(145,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(145,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(145,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(146,1,1,'<p>About Air Stab:</p>\r\n<p>Year of release of OG Model: 1988</p>\r\n<p>Designer : Tinker Hatfield</p>\r\n<p>This shoe featured Nike’s footbridge stability device. Big \"AIR STAB\" letters on the thermoplastic heelcap are best visible. Plus the forkstabs in the Air-window give this shoe an aggressive flavour. Nike stopped making the Air Stab in 1990 to the dismay of numerous fans. The Air Stab was designed by Tinker Hatfield.</p>','<p>Year of release: 2006</p>','air-stab-purple-green-red','Nike Air Stab Purple/Green/Red 2006',NULL,'Air Stab Purple/Green/Red','Air Stab Purple/Green/Red',NULL,NULL),(146,1,2,'<p>A propos de la Air Stab:</p>\r\n<p>Année de sortie du modèle original: 1988</p>\r\n<p>Designer : Tinker Hatfield</p>\r\n<p>Cette chaussure possède le dispositif de stabilité Nike Footbridge. Un très large lettrage AIR STAB au niveau de la protection thermoplastique du talon, plus la fourche Stab au niveau de la bulle d’air, donnant à la chaussure un design agressif. Nike stoppa la fabrication de la Air Stab en 1990 au grand désarroi de nombreux fans. Le design de la Air Stab a été conçu par Tinker Hatfield.</p>','<p>Année de sortie: 2006</p>','air-stab-purple-green-red','Nike Air Stab Purple/Green/Red 2006',NULL,'Air Stab Purple/Green/Red','Air Stab Purple/Green/Red',NULL,NULL),(146,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(146,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(146,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(147,1,1,'<p>Puma celebrates the 40th anniversary of an event that remains etched in the memory of the Olympic Games: in 1968 the victory of Tommie Smith in the 200-meter Olympic Games of Mexico. On the podium, Tommie Smith withdraws its Puma and raises his fist black-gloved to protest against the racial segregation which was at the heart of the controversy in those years. The record \"19.83\" produced over 200 meters appears on the tongue and the gold medal is marked on the top of the heel. The insole is customized with the colors of Mexico City. Basketball suede, with 4 pairs of fat laces (Navy blue, white, gold and multi-color).</p>\r\n<p> </p>\r\n<p>About Puma Clyde:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Also known as Puma States or Puma Suede in the case of the signature version. The Clyde has become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar, the Clyde was the staple of every b-boy’s daily outfit. The Puma Clyde was inspired by New York Knicks’ star Walt Frazier.<br /><br /></p>','<p>Year of release: 2008</p>','puma-clyde-tommie-smith-mexico-1968','Puma Clyde Tommie Smith Mexico 1968 2008 Olympic Games',NULL,'Puma Clyde Tommie Smith Mexico 1968','Puma Clyde Tommie Smith Mexico 1968',NULL,NULL),(147,1,2,'<p class=\"Style6\" align=\"justify\"><span class=\"Style7\">Puma fête les 40 ans d’un évènement qui restera gravé dans la mémoire des Jeux Olympiques: en 1968 la victoire de Tommie Smith au 200m des JO de Mexico. Au moment de monter sur le podium, Tommie Smith retire ses Puma Clyde et lève son poing ganté de noir en signe de protestation envers la ségrégation raciale qui était au coeur de la controverse à cette époque.<br />Le record \"19.83\" obtenu sur 200 mètres apparaît sur la languette et sa médaille d\'or est matérialisée sur le haut du talon. La semelle intérieure est customisée aux couleurs de la ville de Mexico. Basket en daim, fournie avec 4 paires de fat laces (bleu marine, blanc, or et multi-color).</span></p>\r\n<p class=\"Style6\" align=\"justify\"><span class=\"Style7\"><br /></span></p>\r\n<p>A propos de la Puma Clyde:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>Aussi connue sous le nom de Puma States ou Suede, selon la signature du modèle. La Clyde est un des modèles les plus emblématiques de la culture sneaker. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la « Adidas Superstar », la Clyde était l\'accessoire de base des B-Boy\'s. La Puma Clyde a été inspirée par la star des New York Knicks Walt Frazier.</p>\r\n<p> </p>','<p>Année de sortie: 2008</p>','puma-clyde-tommie-smith-mexico-1968','Puma Clyde Tommie Smith Mexico 1968 2008 Olympic Games',NULL,'Puma Clyde Tommie Smith Mexico 1968','Puma Clyde Tommie Smith Mexico 1968',NULL,NULL),(147,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(147,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(147,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(148,1,1,'<p>Year of release: 2005</p>\r\n<p>About Air 180:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p style=\"text-align: justify;\">This revolutionary shoe contained fifty per cent more air than previous Air Max models. During 1991 – 92, a variety of colourways was produced. A basketball version of this model, the Air Force 180, was worn by NBA star Charles Barkley at the 1992 Barcelona Olympics.</p>','<p>Year of release: 2005</p>','air-180-hot-lime','Nike Air 180 \"Hot Lime\" 2005',NULL,'Air 180 \"Hot Lime\"','Air 180 \"Hot Lime\"',NULL,NULL),(148,1,2,'<p>Année de sortie: 2005</p>\r\n<p style=\"text-align: justify;\">A propos de la Air 180:<br />Date de sortie du modèle original: 1991<br />Cette chaussure révolutionnaire contient 50 % d’air de plus que les autres modèles Air Max de l\'époque. Ce modèle a été produit durant la saison 1991 – 92 dans une grande variété de couleurs. Une version basketball portant ce même système air, la Air force 180, a été rendue célèbre par le basketteur Charles Barkley, star de la NBA (notamment durant les jeux olympiques de Barcelone en 1992). </p>','<p>Année de sortie: 2005</p>','air-180-hot-lime','Nike Air 180 \"Hot Lime\" 2005',NULL,'Air 180 \"Hot Lime\"','Air 180 \"Hot Lime\"',NULL,NULL),(148,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(148,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(148,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(149,1,1,'<p>My Adidas! Straight outta the \'80\'s come these classic b-ball inspired adidas desgined by Run-DMC lost group member Jason Mizell aka Jam Master Jay. Soft smooth white leather upper in a low basketball style with perforated toe two-color side stripes and sporty overlays. Oversized tongue with bold classic adidas trefoil logo with front notch and keeper straps for authentic laceless wear.</p>','<p>Year of release: 2004</p>','adidas-brougham-white-black-red','Adidas Brougham White/Black/Red Basketball Jam Master Jay JMJ 2004',NULL,'Adidas Brougham White/Black/Red','Adidas Brougham White/Black/Red',NULL,NULL),(149,1,2,'<p>My Adidas! Sortie dans les années 80, et imaginée par Jason Mizell (alias Jam Master Jay, membre fondateur du groupe Run DMC, décédé en 2002), la Brougham est directement inspirée des modèles classiques de basket de cette époque. Chaussure basse en cuir doux perforé au niveau de la \"toe-box\", 3 bandes bi-colores. Languette surdimensionnée frappée du trèfle Adidas et équipée de straps permettant de les porter sans lacets (comme le faisaient Run DMC avec \"leurs\" Adidas).</p>','<p>Année de sortie: 2004</p>','adidas-brougham-white-black-red','Adidas Brougham White/Black/Red Basketball Jam Master Jay JMJ 2004',NULL,'Adidas Brougham White/Black/Red','Adidas Brougham White/Black/Red',NULL,NULL),(149,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(149,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(149,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(150,1,1,'<p>The original version of this model was inspired by hiking shoes. It was developed to be a very functional basketball shoe and it was the first Nike basketball shoe to feature the full-length Nike Air Sole. The strap made the fit secure and was used to prevent ankle injury. At first, this model was only produced in high and low; the mid version was produced later. The Air Force 1 has become popular on the hip-hop scene, partly owing to the huge range of colorways that have been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2012</p>','air-force-1-low-supreme-year-of-the-dragon','nike Air Force 1 Low Supreme i/o tz \"Year of the Dragon\" YOTD 2012 Tier Zero',NULL,'Air Force 1 Low Supreme \"Year of the Dragon\"','Air Force 1 Low Supreme \"Year of the Dragon\"',NULL,NULL),(150,1,2,'<p>La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard. La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2012</p>','air-force-1-low-supreme-year-of-the-dragon','nike Air Force 1 Low Supreme i/o tz \"Year of the Dragon\" YOTD 2012 Tier Zero',NULL,'Air Force 1 Low Supreme \"Year of the Dragon\"','Air Force 1 Low Supreme \"Year of the Dragon\"',NULL,NULL),(150,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(150,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(150,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(152,1,1,'<p class=\"Style13\" align=\"justify\">This model is an hybrid using Nike Free technology (sole) and the shape of Nike Air Flight Huarache (originally released in 1991).</p>\r\n<p class=\"Style13\" align=\"justify\">This sneaker and colorway were made famous by Scottie Pippen (who wore it during 1992 NBA All Star Game in Orlando) and the legendary Fab 5, NCAA Michigan University starting lineup of the beginning of the 90\'s (composed of 3 NBA future stars: Chris Webber, Jalen Rose and Juwan Howard) who wore it too.</p>','<p>Year of release: 2011</p>','air-huarache-free-basketball-qs','nike Air Huarache Free Basketball QS 2011 Quick Strike',NULL,'Air Huarache Free Basketball QS','Air Huarache Free Basketball QS',NULL,NULL),(152,1,2,'<p class=\"Style14\" align=\"justify\">Ce modèle est un hybrid utilisant la technologie Nike Free (semelle) et la forme de la Nike Air Flight Huarache (sortie en 1991).</p>\r\n<p class=\"Style14\" align=\"justify\">Cette paire et ce colori ont été rendus célèbres par Scottie Pippen (qui a porté ce modèle lors du NBA All Star Game 1992 à Orlando) et par les Fab 5 (5 majeur légendaire de l\'équipe universitaire de Michigan du début des années 90, composé de 3 futurs joueurs majeurs NBA: Chris Webber, Jalen Rose et Juwan Howard).</p>','<p>Année de sortie: 2011</p>','air-huarache-free-basketball-qs','nike Air Huarache Free Basketball QS 2011 Quick Strike',NULL,'Air Huarache Free Basketball QS','Air Huarache Free Basketball QS',NULL,NULL),(152,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(152,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(152,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(155,1,1,'<p>About Air Max 90:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Introduced in 1990 as the Nike Air Max III, the Air Max 90 turned more heads with an even larger visible Air unit and greater stability and cushioning. It has been re-released as a retro version with an unmeasurable amount of colorways and themes. The Air Max 90 was referred to as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2011</p>','air-max-90-vt-prm-qs-haystack','Nike Air Max 90 VT PRM QS Haystack 2011 Quick Strike',NULL,'Air Max 90 VT PRM QS Haystack','Air Max 90 VT PRM QS Haystack',NULL,NULL),(155,1,2,'<p>A propos de la Air Max 90:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2011</p>','air-max-90-vt-prm-qs-haystack','Nike Air Max 90 VT PRM QS Haystack 2011 Quick Strike',NULL,'Air Max 90 VT PRM QS Haystack','Air Max 90 VT PRM QS Haystack',NULL,NULL),(155,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(155,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(155,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(156,1,1,'<p>Year of release: 2009</p>\r\n<p> </p>\r\n<div id=\"product-description\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\">About ZX 7000:</p>\r\n<p>Year of release of OG Model: 1988</p>\r\nThe ZX 7000 was the evolution of the running shoes from the early 80s, but this shoe is probably the best known ZX model today. Originally launched in 1988 with flamboyant colors and loaded with technologies like Soft Cell and the now well-known TORSION Technology. Luxury material and fresh colors made it one of the most popular running shoes.</div>','<p>Year of release: 2009</p>','adidas-torsion-zx7000-grey-beige-blue-red','Adidas Torsion ZX7000 Grey/Beige/Blue/Red 2009 running',NULL,'Adidas Torsion ZX7000 Grey/Beige/Blue/Red','Adidas Torsion ZX7000 Grey/Beige/Blue/Red',NULL,NULL),(156,1,2,'<p>Année de sortie: 2009</p>\r\n<p> </p>\r\n<div id=\"product-description\">\r\n<p style=\"text-align: justify;\">A propos de la ZX 7000:</p>\r\n<p>Année de sortie du modèle original: 1988</p>\r\nLa ZX 7000 représente l’évolution des chaussures de course à pied à partir du début des années 80, mais cette chaussure est probablement la plus connue de la gamme ZX. Elle a été lancée en 1988, avec des couleurs flamboyantes, des technologies telles que « Soft Cell » et le désormais bien connu système TORSION. Les matériaux techniques et les nouveaux coloris ont fait de ce modèle un des plus populaires parmi les chaussures de course à pied.</div>','<p>Année de sortie: 2009</p>','adidas-torsion-zx7000-grey-beige-blue-red','Adidas Torsion ZX7000 Grey/Beige/Blue/Red 2009 running',NULL,'Adidas Torsion ZX7000 Grey/Beige/Blue/Red','Adidas Torsion ZX7000 Grey/Beige/Blue/Red',NULL,NULL),(156,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(156,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(156,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(158,1,1,'<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2010</p>','air-jordan-vi-lakers-baby','Nike Air Jordan VI Lakers Baby AJ 6 2010 LA',NULL,'Air Jordan VI Lakers Baby','Air Jordan VI Lakers Baby',NULL,NULL),(158,1,2,'<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2010</p>','air-jordan-vi-lakers-baby','Nike Air Jordan VI Lakers Baby AJ 6 2010 LA',NULL,'Air Jordan VI Lakers Baby','Air Jordan VI Lakers Baby',NULL,NULL),(158,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(158,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(158,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(159,1,1,'<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2010</p>','air-jordan-vi-oreo-baby','Nike Air Jordan VI Oreo Baby AJ 6 2010',NULL,'Air Jordan VI Oreo Baby','Air Jordan VI Oreo Baby',NULL,NULL),(159,1,2,'<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jorda