-torsion-eqt-support-white-black-green','Adidas Torsion EQT Support White/Black/Green 2010 equipment retro running',NULL,'Adidas Torsion EQT Equipment Support White/Black/Green','Adidas Torsion EQT Support White/Black/Green',NULL,NULL),(163,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(163,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(163,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(164,1,1,'<p>Year of release: 2011</p>\r\n<p> </p>\r\n<p>About Air Trainer 1:</p>\r\n<p>Year of release of OG Model: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>The Air Trainer 1 is a multipurpose sneaker created by Tinker Hatfield. He was inspired to create this model when he noticed people in his local gym using two pairs of sneakers, one for running and one for weightlifting.</p>\r\n<p>The Nike Air Trainer 1 is well known for being worn by tennis star John McEnroe and NBA players in the late 80’s.</p>','<p>Year of release: 2011</p>','air-trainer-1-black-white-neutral-grey-dark-shadow','Nike Air Trainer 1 Black / White-Neutral Grey-Dark Shadow 2011',NULL,'Air Trainer 1 Black / White-Neutral Grey-Dark Shadow','Air Trainer 1 Black/White-Neutral Grey-Dark Shadow',NULL,NULL),(164,1,2,'<p>Année de sortie: 2011</p>\r\n<p> </p>\r\n<p>A propos de la Air Trainer 1:</p>\r\n<p>Année de sortie du modèle original: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>La Air Trainer 1 est une paire multi-usages dessinée par Tinker Hatfield. Il a eu l’idée de créer ce modèle en voyant, dans la salle de sport de son quartier, que les clients apportaient deux paires de chaussures, une pour courir et une pour soulever des poids.</p>\r\n<p>La Air Trainer 1 a été rendue célèbre pour avoir été portée par John McEnroe et des joueurs NBA à la fin des années 80.</p>','<p>Année de sortie: 2011</p>','air-trainer-1-black-white-neutral-grey-dark-shadow','Nike Air Trainer 1 Black / White-Neutral Grey-Dark Shadow 2011',NULL,'Air Trainer 1 Black / White-Neutral Grey-Dark Shadow','Air Trainer 1 Black/White-Neutral Grey-Dark Shadow',NULL,NULL),(164,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(164,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(164,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(165,1,1,'<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2011</p>','dunk-sb-low-space-jam-qs','Nike Dunk SB Low Space Jam QS 2011 quickstrike limited skateboard',NULL,'Dunk SB Low Space Jam QS','Dunk SB Low Space Jam QS',NULL,NULL),(165,1,2,'<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>','<p>Année de sortie: 2011</p>','dunk-sb-low-space-jam-qs','Nike Dunk SB Low Space Jam QS 2011 quickstrike limited skateboard',NULL,'Dunk SB Low Space Jam QS','Dunk SB Low Space Jam QS',NULL,NULL),(165,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(165,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(165,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(166,1,1,'<p>About Air Max 90:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Introduced in 1990 as the Nike Air Max III, the Air Max 90 turned more heads with an even larger visible Air unit and greater stability and cushioning. It has been re-released as a retro version with an unmeasurable amount of colorways and themes. The Air Max 90 was referred to as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2008</p>','air-max-90-olympic-black-silver-gold','Nike Air Max 90 Olympic Black/Silver/Gold 2008 Beijing Pékin',NULL,'Air Max 90 Olympic Black/Silver/Gold','Air Max 90 Olympic Black/Silver/Gold',NULL,NULL),(166,1,2,'<p>A propos de la Air Max 90:</p>\r\n<p> </p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p> </p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2008</p>','air-max-90-olympic-black-silver-gold','Nike Air Max 90 Olympic Black/Silver/Gold 2008 Beijing Pékin',NULL,'Air Max 90 Olympic Black/Silver/Gold','Air Max 90 Olympic Black/Silver/Gold',NULL,NULL),(166,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(166,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(166,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(168,1,1,'<p>About Court Force:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>The Nike Court Force  is one of Nike\'s earlier basketball shoes. It has all the history of its more famous cousins, like the Nike Air Force One and the Nike Dunk, but with half the hype. This retro style, classic shape is continuously updated in low and high versions with a variety of colors and materials and seems to be a favorite for designers and customizers everywhere.</p>','<p>Year of release: 2006</p>','court-force-hi-olive','Nike Court Force Hi Olive Green Hemp 2006',NULL,'Court Force Olive','Court Force Hi Olive',NULL,NULL),(168,1,2,'<p>A propos de la Court Force:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>La Nike Court Force est l\'une des plus anciennes paires de basket-ball fabriquées par Nike. Elle a la même histoire que ses célèbres cousines, la Nike Air Force One et la Nike Dunk, mais avec une notoriété moindre. Avec son style rétro, sa forme classique, la Court Force est constamment mise à jour en versions basse et haute avec une grande variété de couleurs et de matériaux et semble être devenu un must dans le monde des designers et professionnels de la customisation.</p>','<p>Année de sortie: 2006</p>','court-force-hi-olive','Nike Court Force Hi Olive Green Hemp 2006',NULL,'Court Force Hi Olive','Court Force Hi Olive',NULL,NULL),(168,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(168,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(168,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(171,1,1,'<p>The Reebok Pump Omni had a starring role in the 1991 NBA Slam Dunk Contest. The competition winner, Dee Brown, player of the Boston Celtics, was wearing the Pump Omni Lite and make them famous by pumpin’ them up in front of the cameras right before his « no look » slam. <br />The Pump chambers in the ankle collar offered the ultimate in comfort and fit technology. The Pump wasn’t its only exciting feature. It also included Hexalite system in the heel. The Pump Omni Lite was reissued in 2002 and produced in a variety of new colourways.</p>','<p>Year of release: 2009</p>','reebok-pump-omni-lite-dee-brown-black-white-orange','Reebok Pump Omni Lite Dee Brown Black/White/Orange Slam Dunk no look 1991',NULL,'Reebok Pump Omni Lite Dee Brown Black/White/Orange','Reebok Pump Omni Lite Dee Brown Black/White/Orange',NULL,NULL),(171,1,2,'<p>Les Reebok Pump Omni ont eu leur moment de gloire lors du Slam Dunk Contest du NBA All Star Game de 1991. Le vainqueur du concours, Dee Brown, joueur des Boston Celtics, portait les Pump Omni Lite et les rendit célèbres en les gonflant devant les caméras juste avant de s’élancer pour son dunk « aveugle ».</p>\r\n<p>Les systèmes Pump situés au niveau du col de la cheville offrent un grand confort et une technologie appropriée. Le Pump n’est pas la seule caractéristique de ce modèle, la Omni Lite comprend également le système Hexalite au niveau du talon. La Pump Omni Lite a été rééditée en 2002 et produite dans une nouvelle variété de coloris.</p>','<p>Année de sortie: 2009</p>','reebok-pump-omni-lite-dee-brown-black-white-orange','Reebok Pump Omni Lite Dee Brown Black/White/Orange Slam Dunk no look 1991',NULL,'Reebok Pump Omni Lite Dee Brown Black/White/Orange','Reebok Pump Omni Lite Dee Brown Black/White/Orange',NULL,NULL),(171,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(171,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(171,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(172,1,1,'<p>About Adidas Decade:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>This sleek, high-performance basketball shoe was produced in both high and low-top versions. The high top featured adidas’s patented crisscross one-piece ankle-bracing system, which provided great external and internal ankle support. The decade was designed and made in France.</p>','<p>Year of release: 2009</p>','adidas-decade-hi-white-blue-silver','Adidas Decade Hi White/Blue/Silver 2009',NULL,'Adidas Decade Hi White/Blue/Silver','Adidas Decade Hi White/Blue/Silver',NULL,NULL),(172,1,2,'<p>A propos de la Adidas Decade:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>Cette chaussure de basket-ball élégante, très performante, a été produite à la fois en version montante et basse. La partie supérieure de la version montante utilise un système Adidas breveté d’une pièce de cuir entrecroisée, renforçant le soutien à la fois externe et interne de la cheville. La décade fut conçue et fabriquée en France.</p>','<p>Année de sortie: 2009</p>','adidas-decade-hi-white-blue-silver','Adidas Decade Hi White/Blue/Silver 2009',NULL,'Adidas Decade Hi White/Blue/Silver','Adidas Decade Hi White/Blue/Silver',NULL,NULL),(172,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(172,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(172,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(173,1,1,'<p>About Adidas Forum:</p>\r\n<p>Year of release of OG Model: 1984</p>\r\n<p>The Adidas Forum, first released in 1984, was the first Adidas basketball shoe that was produced in high, mid and low-top versions. One of Adidas\' most popular basketball shoes, the Forum is now regarded as one of the most iconic Adidas styles ever produced. The Forum was very popular at the time of its release due to the high level of detail that Adidas ensured on the shoe.</p>','<p>Year of release: 2010</p>','adidas-forum-low-ny-knicks','Adidas Forum Low NY Knicks 2010 New York retro white/Blue/Orange',NULL,'Adidas Forum Low NY Knicks','Adidas Forum Low NY Knicks',NULL,NULL),(173,1,2,'<p>A propos de la Adidas Forum:</p>\r\n<p>Année de sortie du modèle original: 1984</p>\r\n<p>La Forum adidas, produite en 1984, a été la première chaussure de basket Adidas à être produite à la fois en version montante, mid et basse. Une des chaussures de basketball les plus populaires de la marque, la Forum est aujourd\'hui considérée comme l\'un des modèles les plus emblématiques de la gamme Adidas. La Forum a été très remarquée à l\'époque de sa sortie en raison de son haut niveau de finition.</p>','<p>Année de sortie: 2010</p>','adidas-forum-low-ny-knicks','Adidas Forum Low NY Knicks 2010 New York retro white/Blue/Orange',NULL,'Adidas Forum Low NY Knicks','Adidas Forum Low NY Knicks',NULL,NULL),(173,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(173,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(173,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(175,1,1,'<p>About Blazer:</p>\r\n<p>Year of release of OG model: 1972</p>\r\n<p>The Nike designers wanted the swoosh on this model to be really big so that everybody would notice it. The Blazer was worn and represented by Basketball legend George Gervin, AKA « the Ice Man ». The Blazer didn’t have great technology, but the process of fusing the outsole to the upper was pretty extreme.</p>','<p>Year of release: 2012</p>','blazer-mid-prm-leather-white-green','Blazer Mid PRM Leather White/Green 2012 Vintage',NULL,'Blazer Mid PRM Leather White/Green','Blazer Mid PRM Leather White/Green',NULL,NULL),(175,1,2,'<p>A propos de la Blazer:</p>\r\n<p>Date de sortie du modèle original: 1972</p>\r\n<p>Ce qui caractérise ce modèle à l’époque c’est l’énorme « swoosh », la virgule devait être la plus grosse possible pour que tout le monde puisse la remarquer. Le basketteur associé à la Blazer était George Gervin alias « the Ice Man ». Ce modèle n’avait rien de révolutionnaire, mais le fait de fusionner la semelle avec le bout renforcé était assez innovant pour l’époque.</p>','<p>Année de sortie: 2012</p>','blazer-vintage-premium-leather-white-green','Blazer Mid PRM Leather White/Green 2012 Vinta