 as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2010</p>','air-max-90-concord','Air Max 90 Concord White/Pink/Navy/Grey 2010',NULL,'Air Max 90 Concord','Air Max 90 Concord',NULL,NULL),(178,1,2,'<p>A propos de la Air Max 90:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2010</p>','air-max-90-concord','Air Max 90 Concord White/Pink/Navy/Grey 2010',NULL,'Air Max 90 Concord','Air Max 90 Concord',NULL,NULL),(178,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(178,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(178,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(179,1,1,'<p>About Air Structure Triax 91:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>First released back in 1991, the Nike Air Structure Triax immediately became an iconic shoe combining the Nike Footbridge technology with the Air unit plus infrared accents on its insteps. <br />The original colorway of the Nike Air Structure (Metallic Summit White/Teal-Black-Infrared) had a classic shape made of smooth black/grey suede, white mesh accents and the lovely teal swoosh. <br />The Air Structure was retroed for the first time in 2008.</p>','<p>Year of release: 2008</p>','air-structure-triax-91-white-purple-berry','Nike Air Structure Triax 91 White/Purple Berry 2008',NULL,'Air Structure Triax 91 White/Purple Berry','Air Structure Triax 91 White/Purple Berry',NULL,NULL),(179,1,2,'<p>A propos de la Air Structure Triax 91:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Sortie en 1991, la Nike Air Structure Triax s’est rapidement imposée comme un modèle emblématique grâce aux formes et couleurs atypiques de ses bulles d’air et à la combinaison de la technologie Footbridge et du système air. Le colori original (Gris/Turquoise/Noir/Infrared) était composé de parties en daim noir et turquoise, de maille de couleur blanche et d’un swoosh turquoise. La Air Structure a été rééditée pour la première fois en 2008.</p>','<p>Année de sortie: 2008</p>','air-structure-triax-91-white-purple-berry','Nike Air Structure Triax 91 White/Purple Berry 2008',NULL,'Air Structure Triax 91 White/Purple Berry','Air Structure Triax 91 White/Purple Berry',NULL,NULL),(179,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(179,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(179,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(180,1,1,'<p>About Air Structure Triax 91:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>First released back in 1991, the Nike Air Structure Triax immediately became an iconic shoe combining the Nike Footbridge technology with the Air unit plus infrared accents on its insteps. <br />The original colorway of the Nike Air Structure (Metallic Summit White/Teal-Black-Infrared) had a classic shape made of smooth black/grey suede, white mesh accents and the lovely teal swoosh. <br />The Air Structure was retroed for the first time in 2008.</p>','<p>Year of release: 2009</p>','air-structure-triax-91-white-turquoise','Nike Air Structure Triax 91 White/Turquoise/Pink 2009',NULL,'Air Structure Triax 91 White/Turquoise','Air Structure Triax 91 White/Turquoise',NULL,NULL),(180,1,2,'<p>A propos de la Air Structure Triax 91:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Sortie en 1991, la Nike Air Structure Triax s’est rapidement imposée comme un modèle emblématique grâce aux formes et couleurs atypiques de ses bulles d’air et à la combinaison de la technologie Footbridge et du système air. Le colori original (Gris/Turquoise/Noir/Infrared) était composé de parties en daim noir et turquoise, de maille de couleur blanche et d’un swoosh turquoise. La Air Structure a été rééditée pour la première fois en 2008.</p>','<p>Année de sortie: 2009</p>','air-structure-triax-91-white-turquoise','Nike Air Structure Triax 91 White/Turquoise/Pink 2009',NULL,'Air Structure Triax 91 White/Turquoise','Air Structure Triax 91 White/Turquoise',NULL,NULL),(180,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(180,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(180,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(181,1,1,'<p>About Air Max Light:</p>\r\n<p>Year of release of OG model: 1989</p>\r\n<p>The Air Max Light dropped in stores in 1989, it was also known as the Air Max 2 (it came out after the Air Max 1, released in 1987). Its resemblances with the Air Max 1 are the upper features, thermoplastic straps, breathable Nylon mesh and, of course, the visible Air-Sole Unit. The Air Max Light main addition is the Forefoot Air-Sole Unit which improves cushioning and flexibility.</p>','<p>Year of release: 2011</p>','air-max-light-vintage-qs-red','Nike Air Max Light Vintage QS Red 2011',NULL,'Air Max Light Vintage QS Red','Air Max Light Vintage QS Red',NULL,NULL),(181,1,2,'<p>A propos de la Air Max Light:</p>\r\n<p>Date de sortie du modèle original: 1989</p>\r\n<p>Egalement nommée Air Max 2, la Air Max Light est sortie en 1989. Ses nombreuses similitudes avec la Air Max 1 sont notamment le col, les œillets en plastique, les parties en maille et, évidemment, la bulle d’air visible. Le principal apport de la Air Max Light par rapport à la Air Max 1 est le système air intégré à la partie avant de la semelle qui renforce la flexibilité et l’amorti de la chaussure.</p>','<p>Année de sortie: 2011</p>','air-max-light-vintage-qs-red','Nike Air Max Light Vintage QS Red 2011',NULL,'Air Max Light Vintage QS Red','Air Max Light Vintage QS Red',NULL,NULL),(181,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(181,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(181,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(182,1,1,'<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2012</p>','air-max-1-hyperfuse-qs-white-blue','Nike Air Max 1 Hyperfuse QS White/Blue 2012 Quickstrike AM1',NULL,'Air Max 1 Hyperfuse QS White/Blue','Air Max 1 Hyperfuse QS White/Blue',NULL,NULL),(182,1,2,'<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2012</p>','air-max-1-hyperfuse-qs-white-blue','Nike Air Max 1 Hyperfuse QS White/Blue 2012 Quickstrike AM1',NULL,'Nike Air Max 1 Hyperfuse QS White/Blue','Air Max 1 Hyperfuse QS White/Blue',NULL,NULL),(182,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(182,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(182,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(183,1,1,'<p style=\"text-align: justify;\">This Air Max 1 was inspired by Zhu Jianhua, a Chinese athlete who set the High Jump record at 2.39 meters at the 1984 Los Angeles Olympic Games. « Zhu » Nike Air Max 1 features a white leather upper, a white perforated leather toebox, red midsole and Swoosh, plus a graphic of Zhu on the outer heel, and a clear outsole.</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2008</p>','air-max-1-bt-china-1984-olympics-pack','Nike Air Max 1 BT china 1984 Olympics pack tribute to zhu jianhua asia exclusive limited edition 2008 Deadsock AM1',NULL,'Air Max 1 BT China 1984 Olympics pack','Air Max 1 BT China 1984 Olympics pack',NULL,NULL),(183,1,2,'<p style=\"text-align: justify;\">Ce modèle a été inspiré par l’athlète chinois Zhu Jianhua, qui établit un nouveau record du monde en saut en hauteur, 2,39 mètres, lors des Jeux Olympiques de Los Angeles de 1984. La air max 1 « Zhu » se caractérise par un cuir blanc au niveau supérieur puis perforé sur la partie avant,  une semelle intermédiaire et un swoosh de couleur rouge, une représentation graphique de Zhu au niveau du talon extérieur et une semelle translucide.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2008</p>','air-max-1-bt-china-1984-olympics-pack','Nike Air Max 1 BT china 1984 Olympics pack tribute to zhu jianhua asia exclusive limited edition 2008 Deadsock AM1',NULL,'Air Max 1 BT China 1984 Olympics pack','Air Max 1 BT China 1984 Olympics pack',NULL,NULL),(183,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(183,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(183,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(184,1,1,'<p>About Cortez:</p>\r\n<p>Year of release of OG model: 1972</p>\r\n<p>This is probably one of the most important sneaker in history. The Nike Cortez was released in 1967 as the « Tiger Corsair », but in 1972 it was renamed the Cortez after the partnership between Nike (still called Blue Ribbon Sports at the time) and Onitsuka Tiger disintegrated. The original model was made of leather, but was also produced in nylon and suede models in the 70\'s. A women\'s version was also released called the « Senorita Cortez ».</p>\r\n<p> </p>','<p>Year of release: 2011</p>','cortez-nylon-navy-red-white','Nike Cortez Nylon Navy/Red/White 2011',NULL,'Cortez Nylon Navy/Red/White','Cortez Nylon Navy/Red/White',NULL,NULL),(184,1,2,'<p>A propos de la Cortez:</p>\r\n<p>Date de sortie du modèle original: 1972</p>\r\n<p>Il s’agit probablement de la sneaker la plus importante de l’histoire. La Nike Cortez fut créée en 1967 sous le nom « Tiger Corsair » et fut rebaptisée « Cortez » en 1972 après la séparation de Nike (appelée Blue Ribbon Sports à l’époque) et Onitsuka Tiger. Le modèle d’origine fut fabriqué en cuir et dans les années 70 de nouveaux modèles furent produits en daim et en nylon. Une version pour femme appelée « Senorita Cortez » fut également produit.</p>\r\n<p> </p>','<p>Année de sortie: 2011</p>','cortez-nylon-navy-red-white','Nike Cortez Nylon Navy/Red/White 2011',NULL,'Cortez Nylon Navy/Red/White','Cortez Nylon Navy/Red/White',NULL,NULL),(184,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(184,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(184,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(185,1,1,'<p>About Cortez:</p>\r\n<p>Year of release of OG model: 1972</p>\r\n<p>This is probably one of the most important sneaker in history. The Nike Cortez was released in 1967 as the « Tiger Corsair », but in 1972 it was renamed the Cortez after the partnership between