as made of leather, but was also produced in nylon and suede models in the 70\'s. A women\'s version was also released called the « Senorita Cortez ».</p>\r\n<p> </p>','<p>Year of release: 2009</p>','cortez-nylon-white-blue-red-forrest-gump','Nike Cortez Nylon White/Blue/Red \"Forrest Gump\" 2011',NULL,'Cortez Nylon White/Blue/Red \"Forrest Gump\"','Cortez Nylon White/Blue/Red \"Forrest Gump\"',NULL,NULL),(186,1,2,'<p>A propos de la Cortez:</p>\r\n<p>Date de sortie du modèle original: 1972</p>\r\n<p>Il s’agit probablement de la sneaker la plus importante de l’histoire. La Nike Cortez fut créée en 1967 sous le nom « Tiger Corsair » et fut rebaptisée « Cortez » en 1972 après la séparation de Nike (appelée Blue Ribbon Sports à l’époque) et Onitsuka Tiger. Le modèle d’origine fut fabriqué en cuir et dans les années 70 de nouveaux modèles furent produits en daim et en nylon. Une version pour femme appelée « Senorita Cortez » fut également produit.</p>\r\n<p> </p>','<p>Année de sortie: 2009</p>','cortez-nylon-white-blue-red-forrest-gump','Nike Cortez Nylon White/Blue/Red \"Forrest Gump\" 2011',NULL,'Cortez Nylon White/Blue/Red \"Forrest Gump\"','Cortez Nylon White/Blue/Red \"Forrest Gump\"',NULL,NULL),(186,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(186,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(186,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(187,1,1,'<p>Retro model of the Air Jordan VII only worn by Michael Jordan during the 1992 Olympic Games in Barcelona. The shoe bears the number 9 on the heel, which was Jordan\'s jersey number in the \"Dream team\".</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>\r\n<p> </p>','<p>Year of release: 2012</p>','air-jordan-vii-olympic-gs','Nike Air Jordan VII Olympic GS AJ 7 2012',NULL,'Air Jordan VII Olympic GS','Air Jordan VII Olympic GS',NULL,NULL),(187,1,2,'<p>Modèle Retro de la Air Jordan VII portée par Michael Jordan exclusivement durant le tournoi Olympique de Barcelone. Sur chaque talon, la paire est frappée du numéro 9, qui était le numéro de Jordan au sein de la \"Dream Team\".</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2012</p>','air-jordan-vii-olympic-gs','Nike Air Jordan VII Olympic GS AJ 7 2012',NULL,'Air Jordan VII Olympic GS','Air Jordan VII Olympic GS',NULL,NULL),(187,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(187,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(187,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(188,1,1,'<p>The original version of this model was inspired by hiking shoes. It was developed to be a very functional basketball shoe and it was the first Nike basketball shoe to feature the full-length Nike Air Sole. The strap made the fit secure and was used to prevent ankle injury. At first, this model was only produced in high and low; the mid version was produced later. The Air Force 1 has become popular on the hip-hop scene, partly owing to the huge range of colorways that have been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2009</p>','air-force-1-low-prm-qk-dj-clark-kent-all-star-2009','nike Air Force 1 Low PRM QK DJ Clark Kent All Star 2009 Quickstrike',NULL,'Air Force 1 Low PRM QK DJ Clark Kent All Star 2009','Air Force 1 Low PRM QK DJ Clark Kent All Star 2009',NULL,NULL),(188,1,2,'<p>La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard.<br />La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2009</p>','air-force-1-low-prm-qk-dj-clark-kent-all-star-2009','nike Air Force 1 Low PRM QK DJ Clark Kent All Star 2009 Quickstrike',NULL,'Air Force 1 Low PRM QK DJ Clark Kent All Star 2009','Air Force 1 Low PRM QK DJ Clark Kent All Star 2009',NULL,NULL),(188,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(188,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(188,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(189,1,1,'<p>About Air Structure Triax 91:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>First released back in 1991, the Nike Air Structure Triax immediately became an iconic shoe combining the Nike Footbridge technology with the Air unit plus infrared accents on its insteps. <br />The original colorway of the Nike Air Structure (Metallic Summit White/Teal-Black-Infrared) had a classic shape made of smooth black/grey suede, white mesh accents and the lovely teal swoosh. <br />The Air Structure was retroed for the first time in 2008.</p>','<p>Year of release: 2008</p>','air-structure-triax-91-grey-black-green','Nike Air Structure Triax 91 Grey/Black/Green 2008',NULL,'Air Structure Triax 91 Grey/Black/Green','Air Structure Triax 91 Grey/Black/Green',NULL,NULL),(189,1,2,'<p>A propos de la Air Structure Triax 91:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Sortie en 1991, la Nike Air Structure Triax s’est rapidement imposée comme un modèle emblématique grâce aux formes et couleurs atypiques de ses bulles d’air et à la combinaison de la technologie Footbridge et du système air. Le colori original (Gris/Turquoise/Noir/Infrared) était composé de parties en daim noir et turquoise, de maille de couleur blanche et d’un swoosh turquoise. La Air Structure a été rééditée pour la première fois en 2008.</p>','<p>Année de sortie: 2008</p>','air-structure-triax-91-grey-black-green','Nike Air Structure Triax 91 Grey/Black/Green 2008',NULL,'Air Structure Triax 91 Grey/Black/Green','Air Structure Triax 91 Grey/Black/Green',NULL,NULL),(189,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(189,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(189,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(190,1,1,'<p>About Air Structure Triax 91:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>First released back in 1991, the Nike Air Structure Triax immediately became an iconic shoe combining the Nike Footbridge technology with the Air unit plus infrared accents on its insteps. <br />The original colorway of the Nike Air Structure (Metallic Summit White/Teal-Black-Infrared) had a classic shape made of smooth black/grey suede, white mesh accents and the lovely teal swoosh. <br />The Air Structure was retroed for the first time in 2008.</p>','<p>Year of release: 2008</p>','air-structure-triax-91-black-blue-grey-white','Nike Air Structure Triax 91 Black/Blue/Grey/White 2008',NULL,'Air Structure Triax 91 Black/Blue/Grey/White','Air Structure Triax 91 Black/Blue/Grey/White',NULL,NULL),(190,1,2,'<p>A propos de la Air Structure Triax 91:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Sortie en 1991, la Nike Air Structure Triax s’est rapidement imposée comme un modèle emblématique grâce aux formes et couleurs atypiques de ses bulles d’air et à la combinaison de la technologie Footbridge et du système air. Le colori original (Gris/Turquoise/Noir/Infrared) était composé de parties en daim noir et turquoise, de maille de couleur blanche et d’un swoosh turquoise. La Air Structure a été rééditée pour la première fois en 2008.</p>','<p>Année de sortie: 2008</p>','air-structure-triax-91-black-blue-grey-white','Nike Air Structure Triax 91 Black/Blue/Grey/White 2008',NULL,'Air Structure Triax 91 Black/Blue/Grey/White','Air Structure Triax 91 Black/Blue/Grey/White',NULL,NULL),(190,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(190,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(190,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(191,1,1,'<p>About Air Structure Triax 91:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>First released back in 1991, the Nike Air Structure Triax immediately became an iconic shoe combining the Nike Footbridge technology with the Air unit plus infrared accents on its insteps. <br />The original colorway of the Nike Air Structure (Metallic Summit White/Teal-Black-Infrared) had a classic shape made of smooth black/grey suede, white mesh accents and the lovely teal swoosh. <br />The Air Structure was retroed for the first time in 2008.</p>','<p>Year of release: 2007</p>','air-structure-triax-91-white-blue-grey-black','Nike Air Structure Triax 91 White/Blue/Grey/Black Retro 2007 OG colorway',NULL,'Air Structure Triax 91 White/Blue/Grey/Black','Air Structure Triax 91 White/Blue/Grey/Black',NULL,NULL),(191,1,2,'<p>A propos de la Air Structure Triax 91:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Sortie en 1991, la Nike Air Structure Triax s’est rapidement imposée comme un modèle emblématique grâce aux formes et couleurs atypiques de ses bulles d’air et à la combinaison de la technologie Footbridge et du système air. Le colori original (Gris/Turquoise/Noir/Infrared) était composé de parties en daim noir et turquoise, de maille de couleur blanche et d’un swoosh turquoise. La Air Structure a été rééditée pour la première fois en 2008.</p>','<p>Année de sortie: 2007</p>','air-structure-triax-91-white-blue-grey-black','Nike Air Structure Triax 91 White/Blue/Grey/Black Retro 2007 OG colorway',NULL,'Air Structure Triax 91 White/Blue/Grey/Black','Air Structure Triax 91 White/Blue/Grey/Black',NULL,NULL),(191,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(191,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(191,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(192,1,1,NULL,'<p>Year of release: 2008</p>','reebok-workout-plus-mid-classic-white-blue-red','Reebok Workout Plus Mid Classic White/Blue/Red',NULL,'Reebok Workout Plus Mid Classic White/Blue/Red','Reebok Workout Plus Mid Classic White/Blue/Red',NULL,NULL),(192,1,2,NULL,'<p>Année de sortie: 2008</p>','reebok-workout-plus-mid-classic-white-blue-red','Reebok Workout Plus Mid Classic White/Blue/Red',NULL,'Reebok Workout Plus Mid Classic White/Blue/Red','Reebok Workout Plus Mid Classic White/Blue/Red',NULL,NULL),(192,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(192,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(192,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(193,1,1,'<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2008</p>','air-max-1-gold-medal-beijing-olympics-2008-pack','Nike Air Max 1 Gold Medal \"Beijing Olympics 2008 pack exclusive limited edition Deadstock AM1',NULL,'Air Max 1 Gold Medal \"Beijing Olympics 2008 pack\"','Air Max 1 Gold Medal \"Beijing Olympics 2008 pack\"',NULL,NULL),(193,1,2,'<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2008</p>','air-max-1-gold-medal-beijing-olympics-2008-pack','Nike Air Max 1 Gold Medal \"Beijing Olympics 2008 pack exclusive limited edition Deadstock AM1',NULL,'Air Max 1 Gold Medal \"Beijing Olympics 2008 pack\"','Air Max 1 Gold Medal \"Beijing Olympics 2008 pack\"',NULL,NULL),(193,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(193,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(193,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(194,1,1,'<p>Adidas decided to produce a high-end re-release of the Forum in a mid size and in the original colorway.  The shoe features a nice, clean white and blue base accompanied by a white and blue upper featuring alligator embossed leather and patent leather lining. </p>\r\n<p> </p>\r\n<p>About Adidas Forum:</p>\r\n<p>Year of release of OG Model: 1984</p>\r\n<p>The Adidas Forum, first released in 1984, was the first Adidas basketball shoe that was produced in high, mid and low-top versions. One of Adidas\' most popular basketball shoes, the Forum is now regarded as one of the most iconic Adidas styles ever produced. The Forum was very popular at the time of its release due to the high level of detail that Adidas ensured on the shoe.</p>','<p>Year of release: 2008</p>','adidas-forum-mid-craftsmanship-pack-white-blue','Adidas Forum Mid Craftsmanship Pack White/Blue 2008 retro limited edition',NULL,'Adidas Forum Mid Craftsmanship Pack White/Blue','Adidas Forum Mid Craftsmanship Pack White/Blue',NULL,NULL),(194,1,2,'<div class=\"Style7\" align=\"justify\">Adidas a décidé de rééditer une Forum Mid haut de gamme dans son colori original. La chaussure comporte donc un colori de base, blanc et bleu accompagné par un cuir haut de gamme en alligator gaufré avec doublure de cuir verni.</div>\r\n<div class=\"Style7\" align=\"justify\"> </div>\r\n<p>A propos de la Adidas Forum:</p>\r\n<p>Année de sortie du modèle original: 1984</p>\r\n<p>La Forum adidas, produite en 1984, a été la première chaussure de basket Adidas à être produite à la fois en version montante, mid et basse. Une des chaussures de basketball les plus populaires de la marque, la Forum est aujourd\'hui considérée comme l\'un des modèles les plus emblématiques de la gamme Adidas. La Forum a été très remarquée à l\'époque de sa sortie en raison de son haut niveau de finition.</p>','<p>Année de sortie: 2008</p>','adidas-forum-mid-craftsmanship-pack-white-blue','Adidas Forum Mid Craftsmanship Pack White/Blue 2008 retro limited edition',NULL,'Adidas Forum Mid Craftsmanship Pack White/Blue','Adidas Forum Mid Craftsmanship Pack White/Blue',NULL,NULL),(194,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(194,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(194,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(195,1,1,'<p>About Adidas Superstar:</p>\r\n<p>Year of release of OG Model: 1969</p>\r\n<p>The Superstar was produced in 1969 as a low Pro Model version and was the first basketball sneaker made of leather. Unmistakable because of the shelltop made of rubber.</p>\r\n<p>With his typical styling and his bulky looking. Hip Hop artists like RUN-DMC made it to an icon. Their track My Adidas paid tribute to the brand and let the group have their own personalized Adidas shoes and clothing.</p>','<p>Year of release: 2008</p>','adidas-superstar-80-s-white-blue','Adidas Superstar 80\'s White/Blue 2008 Retro Vintage',NULL,'Adidas Superstar 80\'s White/Blue','Adidas Superstar 80\'s White/Blue',NULL,NULL),(195,1,2,'<p>A propos de la Adidas Superstar:</p>\r\n<p>Année de sortie du modèle original: 1969</p>\r\n<p>La superstar a été produite en 1969 comme une version basse de la Pro Model et a été la première chaussure de basket-ball toute en cuir. Cette chaussure est incomparable en raison de sa coque en caoutchouc renforcée à l’avant du pied. Avec son style atypique et sa forme volumineuse.</p>\r\n<p>Des artistes Hip Hop comme RUN-DMC ont fait de cette chaussure un phénomène. Leur chanson «My Adidas » a rendu hommage à la marque et a conduit le groupe à avoir leur propre ligne de vêtements et de chaussures Adidas.</p>','<p>Année de sortie: 2008</p>','adidas-superstar-80-s-white-blue','Adidas Superstar 80\'s White/Blue 2008 Retro Vintage',NULL,'Adidas Superstar 80\'s White/Blue','Adidas Superstar 80\'s White/Blue',NULL,NULL),(195,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(195,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(195,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(196,1,1,'<p>About Adidas Training:</p>\r\n<p>Year of release of OG Model: 1972</p>\r\n<p>Launched initially for the Olympic Games of 1972 under the name of Olympia, the Adidas Training ‘72 have been created for athletes and coaches for the summer games in Munich in 1972.</p>\r\n<p> </p>','<p>Year of release: 2008</p>','adidas-training-72-white-green','Adidas Trai