1990 to the dismay of numerous fans. The Air Stab was designed by Tinker Hatfield.</p>','<p>Year of release: 2006</p>','air-stab-prm-purple-air-u-breathe-x-hitomi-yokoyama','Air Stab PRM Purple \"Air U Breathe\" x Hitomi Yokoyama 2006 Limited Edition',NULL,'Air Stab PRM Purple \"Air U Breathe\" x Hitomi Yokoyama','Air Stab PRM Purple \"Air U Breathe\" x Hitomi Yokoyama',NULL,NULL),(202,1,2,'<p>A propos de la Air Stab:</p>\r\n<p>Année de sortie du modèle original: 1988</p>\r\n<p>Designer : Tinker Hatfield</p>\r\n<p>Cette chaussure possède le dispositif de stabilité Nike Footbridge. Un très large lettrage AIR STAB au niveau de la protection thermoplastique du talon, plus la fourche Stab au niveau de la bulle d’air, donnant à la chaussure un design agressif. Nike stoppa la fabrication de la Air Stab en 1990 au grand désarroi de nombreux fans. Le design de la Air Stab a été conçu par Tinker Hatfield.</p>','<p>Année de sortie: 2006</p>','air-stab-prm-purple-air-u-breathe-x-hitomi-yokoyama','Air Stab PRM Purple \"Air U Breathe\" x Hitomi Yokoyama 2006 Limited Edition',NULL,'Air Stab PRM Purple \"Air U Breathe\" x Hitomi Yokoyama','Air Stab PRM Purple \"Air U Breathe\" x Hitomi Yokoyama',NULL,NULL),(202,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(202,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(202,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(203,1,1,'<p>About Adidas Americana:</p>\r\n<p>Year of release of OG Model: 1971</p>\r\n<p>The Adidas Americana first appeared in the 1970s on the basketball courts of the ABA. The blue and red Adidas stripes matched the ABA’s colours. The Americana has been through some changes over the years. The early models had a mesh upper with a leather toe box, whilst those of the mid-1970s featured a half-suede. At the tail end of the 70s, Adidas produced a nylon mesh upper with a suede toe box.</p>\r\n<p> </p>','<p>Year of release: 2008</p>','adidas-americana-low-royal-blue-white-red','Adidas Americana Low Royal Blue/White/Red 2008 Retro Vintage',NULL,'Adidas Americana Low Royal Blue/White/Red','Adidas Americana Low Royal Blue/White/Red',NULL,NULL),(203,1,2,'<p>A propos de la Adidas Americana:</p>\r\n<p>Année de sortie du modèle original: 1971</p>\r\n<p>Le tout premier modèle est apparu en 1970 sur les terrains de basket-ball de l’ABA. Les bandes bleues et rouges représentaient les couleurs de la ligue. Elles ont subi diverses modifications au cours des années. Les premiers modèles étaient fabriqués dans une toile en nylon, le bout était renforcé de cuir puis au milieu des années 70 le bout a été remplacé par du daim.</p>','<p>Année de sortie: 2008</p>','adidas-americana-low-royal-blue-white-red','Adidas Americana Low Royal Blue/White/Red 2008 Retro Vintage',NULL,'Adidas Americana Low Royal Blue/White/Red','Adidas Americana Low Royal Blue/White/Red',NULL,NULL),(203,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(203,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(203,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(205,1,1,'<p>About Adidas Superstar:</p>\r\n<p>Year of release of OG Model: 1969</p>\r\n<p>The Superstar was produced in 1969 as a low Pro Model version and was the first basketball sneaker made of leather. Unmistakable because of the shelltop made of rubber.</p>\r\n<p>With his typical styling and his bulky looking. Hip Hop artists like RUN-DMC made it to an icon. Their track My Adidas paid tribute to the brand and let the group have their own personalized Adidas shoes and clothing.</p>','<p>Year of release: 2008</p>','adidas-superstar-80-s-black-green','Adidas Superstar 80\'s Black/Green 2008 Retro Vintage',NULL,'Adidas Super