L),(209,1,1,'<p>About Court Force:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>The Nike Court Force  is one of Nike\'s earlier basketball shoes. It has all the history of its <br />more famous cousins, like the Nike Air Force One and the Nike Dunk, but with half the <br />hype. This retro style, classic shape is continuously updated in low and high versions with <br />a variety of colors and materials and seems to be a favorite for designers and customizers <br />everywhere.</p>','<p>Year of release: 2009</p>','court-force-hi-women-grey-neon-turquoise-purple-pink','Nike Court Force Hi Women Grey/Neon Turquoise/Purple/Pink 2009',NULL,'Court Force Hi Women Grey/Neon Turquoise/Purple/Pink','Court Force Hi Women Grey/Neon Turquoise/Purple/Pink',NULL,NULL),(209,1,2,'<p>A propos de la Court Force:<br />Date de sortie du modèle original: 1987<br />La Nike Court Force est l\'une des plus anciennes paires de basket-ball fabriquées par Nike.  Elle a la même histoire que ses célèbres cousines, la Nike Air Force One et la Nike Dunk,  mais avec une notoriété moindre. Avec son style rétro, sa forme classique, la Court Force  est constamment mise à jour en versions basse et haute avec une grande variété de  couleurs et de matériaux et semble être devenu un must dans le monde des designers et  professionnels de la customisation.</p>','<p>Année de sortie: 2009</p>','court-force-hi-women-grey-neon-turquoise-purple-pink','Nike Court Force Hi Women Grey/Neon Turquoise/Purple/Pink 2009',NULL,'Court Force Hi Women Grey/Neon Turquoise/Purple/Pink','Court Force Hi Women Grey/Neon Turquoise/Purple/Pink',NULL,NULL),(209,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(209,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(209,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(210,1,1,'<p>About Court Force:</p