ore famous cousins, like the Nike Air Force One and the Nike Dunk, but with half the hype. This retro style, classic shape is continuously updated in low and high versions with a variety of colors and materials and seems to be a favorite for designers and customizers everywhere.</p>','<p>Year of release: 2008</p>','court-force-hi-infrared','Nike Court Force Hi Infrared 2008',NULL,'Court Force Hi Infrared','Court Force Hi Infrared',NULL,NULL),(211,1,2,'<p>A propos de la Court Force:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>La Nike Court Force est l\'une des plus anciennes paires de basket-ball fabriquées par Nike. Elle a la même histoire que ses célèbres cousines, la Nike Air Force One et la Nike Dunk, mais avec une notoriété moindre. Avec son style rétro, sa forme classique, la Court Force est constamment mise à jour en versions basse et haute avec une grande variété de couleurs et de matériaux et semble être devenu un must dans le monde des designers et professionnels de la customisation.</p>','<p>Année de sortie: 2008</p>','court-force-hi-infrared','Nike Court Force Hi Infrared 2008',NULL,'Court Force Hi Infrared','Court Force Hi Infrared',NULL,NULL),(211,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(211,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(211,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(212,1,1,'<p>Nike Air Flight ‘89 has always been one of the classic Nike Basketball shoes from the 1980’s and now, twenty years later, Nike comes up with a stylish high-top version of the Flight ‘89 called the Nike Air Flight Condor. The first version of the Nike Air Flight Condor was a low cut version, First released Spring 2009.<br /> The Air Flight Condor gets a nice boost from its obvious similarities to the Air Jordan IV, particularly on the midsoles, giving to the shoe a familiar classic shape. Obviously, the original source of influence for the general design comes from the early 80s and 90s aesthetic.</p>','<p>Year of release: 2009</p>','air-flight-condor-hi-white-grey-red','Nike Air Flight Condor Hi White/Grey/Red 2009',NULL,'Air Flight Condor Hi White/Grey/Red','Air Flight Condor Hi White/Grey/Red',NULL,NULL),(212,1,2,'<p>La Nike Air Flight \'89 est l\'un des classiques des années 80 de la gamme basket-ball Nike. Vingt ans plus tard, Nike décide de sortir une nouvelle version montante toute en élégance de la Flight 89 : la Nike Air Flight Condor. La version basse de la Nike Air Flight Condor est sortie au printemps 2009. Le design de la Air Flight Condor obtient un bon coup de pouce de ses similarités évidentes avec la Air Jordan IV, notamment la semelle intermédiaire, ce qui lui donne cette forme classique si familière. Evidemment, l’influence générale du design prend sa source dans l’esthétique des années 80 et début 90.</p>','<p>Année de sortie: 2009</p>','air-flight-condor-hi-white-grey-red','Nike Air Flight Condor Hi White/Grey/Red 2009',NULL,'Air Flight Condor Hi White/Grey/Red','Air Flight Condor Hi White/Grey/Red',NULL,NULL),(212,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(212,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(212,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(213,1,1,'<p>About Adidas Stan Smith:</p>\r\n<p>Year of release of OG Model: 1964</p>\r\n<p>The earliest version of this shoe was produced in 1964 with the coopeartion of French player Robert Haillet. In 1965, American tennis pro Stan Smith came to the attention of Adidas. Haillet’s name was replaced with Smith’s, and subsequent models had his face and signature on the tongue. Over the years, the Stan Smith has been a constant presence in the Adidas catalogue. The sneakerhead’s favourite is the original Robert Haillet version.</p>','<p>Year of release: 2009</p>','adidas-stan-smith-vintage-cardinal-red-suede','Adidas Stan Smith Vintage Cardinal Red Suede 2009 Retro Vintage',NULL,'Adidas Stan Smith Vintage Cardinal Red Suede','Adidas Stan Smith Vintage Cardinal Red Suede',NULL,NULL),(213,1,2,'<p>A propos de la Adidas Stan Smith:</p>\r\n<p>Année de sortie du modèle original: 1964</p>\r\n<p>La première version de cette chaussure a été produite en 1964 en coopération avec le joueur de tennis français Robert Haillet. En 1965, le joueur de tennis américain Stan Smith est remarqué par Adidas. Le visage et la signature de Haillet sur la languette disparaissent et sont remplacés par ceux de Stan Smith. Au fil des ans, la Stan Smith est restée présente dans le catalogue Adidas. Le modèle original de Robert Haillet est la version la plus recherchée par les sneakerheads.</p>','<p>Année de sortie: 2009</p>','adidas-stan-smith-vintage-cardinal-red-suede','Adidas Stan Smith Vintage Cardinal Red Suede 2009 Retro Vintage',NULL,'Adidas Stan Smith Vintage Cardinal Red Suede','Adidas Stan Smith Vintage Cardinal Red Suede',NULL,NULL),(213,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(213,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(213,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(214,1,1,'<p>About Adidas Stan Smith:</p>\r\n<p>Year of release of OG Model: 1964</p>\r\n<p>The earliest version of this shoe was produced in 1964 with the coopeartion of French player Robert Haillet. In 1965, American tennis pro Stan Smith came to the attention of Adidas. Haillet’s name was replaced with Smith’s, and subsequent models had his face and signature on the tongue. Over the years, the Stan Smith has been a constant presence in the Adidas catalogue. The sneakerhead’s favourite is the original Robert Haillet version.</p>','<p>Year of release: 2010</p>','adidas-stan-smith-vintage-white-black','Adidas Stan Smith Vintage White/Black 2010 Retro Vintage',NULL,'Adidas Stan Smith Vintage White/Black','Adidas Stan Smith Vintage White/Black',NULL,NULL),(214,1,2,'<p>A propos de la Adidas Stan Smith:</p>\r\n<p>Année de sortie du modèle original: 1964</p>\r\n<p>La première version de cette chaussure a été produite en 1964 en coopération avec le joueur de tennis français Robert Haillet. En 1965, le joueur de tennis américain Stan Smith est remarqué par Adidas. Le visage et la signature de Haillet sur la languette disparaissent et sont remplacés par ceux de Stan Smith. Au fil des ans, la Stan Smith est restée présente dans le catalogue Adidas. Le modèle original de Robert Haillet est la version la plus recherchée par les sneakerheads.</p>','<p>Année de sortie: 2010</p>','adidas-stan-smith-vintage-white-black','Adidas Stan Smith Vintage White/Black 2010 Retro Vintage',NULL,'Adidas Stan Smith Vintage White/Black','Adidas Stan Smith Vintage White/Black',NULL,NULL),(214,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(214,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(214,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(215,1,1,'<p>About Adidas Gazelle:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>There is much speculation about the Gazelle’s original purpose. Its silhouette suggests that it could be an indoor soccer shoe, and over the years it has gained immense popularity among soccer fans. It has also been suggested that the shoe was designed for running. However, the general consensus seems to be that this model was originally intended as an athletic training shoe. Whatever its initial function, the Gazelle is certainly a beautiful shoe: the streamlined wedge shape, simple styling and flat sole are topped off with the suede upper to create a classic piece of design.</p>','<p>Year of release: 2009</p>','adidas-gazelle-brown-beige','Adidas Gazelle Brown/Beige 2009 Retro Vintage',NULL,'Adidas Gazelle Brown/Beige','Adidas Gazelle Brown/Beige',NULL,NULL),(215,1,2,'<p>A propos de la Adidas Gazelle:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>Il y a beaucoup de spéculation autour du but original de la Gazelle. Sa silhouette suggère que cela pourrait être une chaussure dédiée au football en salle, et au cours des années ce modèle gagna en popularité chez les fans de football. Il a aussi été suggéré que cette chaussure ait été conçue pour la course à pied. Cependant, le consensus général semble être que ce modèle était destiné à un usage multiple. Quelque soit sa fonction initiale, la Gazelle est sans aucun doute une réussite, un classique: avec sa forme aérodynamique, simple, sa semelle plate souple couronnée d’applications en daim.</p>','<p>Année de sortie: 2009</p>','adidas-gazelle-brown-beige','Adidas Gazelle Brown/Beige 2009 Retro Vintage',NULL,'Adidas Gazelle Brown/Beige','Adidas Gazelle Brown/Beige',NULL,NULL),(215,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(215,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(215,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(218,1,1,'<p>About Puma Suede:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Puma Suede is typically a classic model that stood the test of time, it has now become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar and Puma Clyde, the Suede was the staple of every b-boy’s daily outfit. <br /><br /></p>\r\n<p> </p>','<p>Year of release: 2009</p>','puma-suede-red-blue','Puma Suede Red/Blue 1968 2009 Retro',NULL,'Puma Suede Red/Blue','Puma Suede Red/Blue',NULL,NULL),(218,1,2,'<p>A propos de la Puma Suede:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>La Puma Suede est l’archétype du modèle classique dont le style a traversé les époques sans jamais prendre une ride. Elle fait désormais partie des modèles les plus appréciés internationalement. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la Adidas Superstar et la Puma Clyde, la Suede était l\'accessoire de base des B-Boy\'s.</p>','<p>Année de sortie: 2009</p>','puma-suede-red-blue','Puma Suede Red/Blue 1968 2009 Retro',NULL,'Puma Suede Red/Blue','Puma Suede Red/Blue',NULL,NULL),(218,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(218,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(218,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(219,1,1,'<p>About Puma Clyde:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Also known as Puma States or Puma Suede in the case of the signature version. The Clyde has become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar, the Clyde was the staple of every b-boy’s daily outfit. The Puma Clyde was inspired by New York Knicks’ star Walt Frazier.<br /><br /></p>','<p>Year of release: 2009</p>','puma-clyde-brings-back-blue','Puma Clyde \"Brings Back\" Snorkel Blue/White 2009 Retro',NULL,'Puma Clyde \"Brings Back\" Snorkel Blue/White','Puma Clyde \"Brings Back\" Blue',NULL,NULL),(219,1,2,'<p>A propos de la Puma Clyde:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>Aussi connue sous le nom de Puma States ou Suede, selon la signature du modèle. La Clyde est un des modèles les plus emblématiques de la culture sneaker. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la « Adidas Superstar », la Clyde était l\'accessoire de base des B-Boy\'s. La Puma Clyde a été inspirée par la star des New York Knicks Walt Frazier.</p>\r\n<p> </p>','<p>Année de sortie: 2009</p>','puma-clyde-brings-back-snorkel-blue-white','Puma Clyde \"Brings Back\" Snorkel Blue/White 2009 Retro',NULL,'Puma Clyde \"Brings Back\" Snorkel Blue/White','Puma Clyde \"Brings Back\" Snorkel Blue/White',NULL,NULL),(219,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(219,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(219,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(220,1,1,'<p>About Puma Clyde:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Also known as Puma States or Puma Suede in the case of the signature version. The Clyde has become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar, the Clyde was the staple of every b-boy’s daily outfit. The Puma Clyde was inspired by New York Knicks’ star Walt Frazier.<br /><br /></p>','<p>Year of release: 2009</p>','puma-clyde-hall-of-game-purple-yellow-black','Puma Clyde \"Hall of Game\" Purple/Yellow/Black Los Angeles LA Lakers 2009 Retro',NULL,'Puma Clyde \"Hall of Game\" Purple/Yellow/Black','Puma Clyde \"Hall of Game\" Purple/Yellow/Black',NULL,NULL),(220,1,2,'<p>A propos de la Puma Clyde:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>Aussi connue sous le nom de Puma States ou Suede, selon la signature du modèle. La Clyde est un des modèles les plus emblématiques de la culture sneaker. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la « Adidas Superstar », la Clyde était l\'accessoire de base des B-Boy\'s. La Puma Clyde a été inspirée par la star des New York Knicks Walt Frazier.</p>\r\n<p> </p>','<p>Année de sortie: 2009</p>','puma-clyde-hall-of-game-purple-yellow-black','Puma Clyde \"Hall of Game\" Purple/Yellow/Black Los Angeles LA Lakers 2009 Retro',NULL,'Puma Clyde \"Hall of Game\" Purple/Yellow/Black','Puma Clyde \"Hall of Game\" Purple/Yellow/Black',NULL,NULL),(220,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(220,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(220,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(221,1,1,'<p>About Puma Suede:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Puma Suede is typically a classic model that stood the test of time, it has now become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar and Puma Clyde, the Suede was the staple of every b-boy’s daily outfit. <br /><br /></p>\r\n<p> </p>','<p>Year of release: 2009</p>','puma-suede-coffee','Puma Suede \"Coffee\" Beige Yellow Brown 2009 Retro',NULL,'Puma Suede \"Coffee\"','Puma Suede \"Coffee\"',NULL,NULL),(221,1,2,'<p>A propos de la Puma Suede:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>La Puma Suede est l’archétype du modèle classique dont le style a traversé les époques sans jamais prendre une ride. Elle fait désormais partie des modèles les plus appréciés internationalement. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la Adidas Superstar et la Puma Clyde, la Suede était l\'accessoire de base des B-Boy\'s.</p>','<p>Année de sortie: 2009</p>','puma-suede-coffee','Puma Suede \"Coffee\" Beige Yellow Brown 2009 Retro',NULL,'Puma Suede \"Coffee\"','Puma Suede \"Coffee\"',NULL,NULL),(221,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(221,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(221,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(222,1,1,'<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2008</p>','dunk-hi-women-white-pale-blue-sail','Nike Dunk Hi Women White/Pale Blue/Sail 2008',NULL,'Dunk Hi Women White/Pale Blue/Sail','Dunk Hi Women White/Pale Blue/Sail',NULL,NULL),(222,1,2,'<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>\r\n<p> </p>','<p>Année de sortie: 2008</p>','dunk-hi-women-white-pale-blue-sail','Nike Dunk Hi Women White/Pale Blue/Sail 2008',NULL,'Nike Dunk Hi Women White/Pale Blue/Sail','Dunk Hi Women White/Pale Blue/Sail',NULL,NULL),(222,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(222,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(222,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(223,1,1,'<p class=\"Style8\" align=\"justify\">This M577 is the result of a Collab\' between Overkill and New Balance, it commemorates the 20th anniversary of Berlin Wall\'s fall. The blue model stands for USA, the red one symbolizes USSR. Each colorway was a <strong>limited release of 577 pairs worldwide</strong>. The pair features printed insoles remembering Berlin wall.</p>\r\n<p class=\"Style8\" align=\"justify\">New Balance M577 uses ENCAP system in the midsole for stability and shock reduction.</p>','<p>Year of release: 2010</p>','new-balance-577-berlin-wall-pack-red-x-overkill','New Balance M577 \"Berlin Wall Pack\" Red x Overkill Shop collab 1989 2010 ',NULL,'New Balance M577 \"Berlin Wall Pack\" Red x Overkill','New Balance M577 \"Berlin Wall Pack\" Red x Overkill',NULL,NULL),(223,1,2,'<div class=\"Style8\" align=\"justify\">\r\n<p>Ce modèle de M577 provient d\'une collab\' entre Overkill et New Balance commémorant le vingtième anniversaire de la chute du mur de Berlin. La bleue représente les Etats Unis et la rouge, l\'URSS. Chaque colori est <strong>limité à 577 exemplaires au monde</strong>. La paire possède des semelles internes imprimées sur le thème du mur de Berlin.</p>\r\n<p>La New Balance M577 utilise, au niveau de la semelle intérieure, le système ENCAP permettant une meilleure stabilité et une absorption des chocs.</p>\r\n</div>','<p>Année de sortie: 2010</p>','new-balance-577-berlin-wall-pack-red-x-overkill','New Balance M577 \"Berlin Wall Pack\" Red x Overkill Shop collab 1989 2010',NULL,'New Balance M577 \"Berlin Wall Pack\" Red x Overkill','New Balance M577 \"Berlin Wall Pack\" Red x Overkill',NULL,NULL),(223,1,3,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(223,1,4,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(223,1,5,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(227,1,1,'<p>About Puma Suede:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Puma Suede is typically a classic model that stood the test of time, it has now become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar and Puma Clyde, the Suede was the staple of every b-boy’s daily outfit. <br /><br /></p>\r\n<p> </p>','<p>Year of release: 2009</p>','puma-suede-brown-beige','Puma Suede Brown/Beige 1968 2009 Retro',NULL,'Puma Suede Brown/Beige','Puma Suede Brown/Beige',NULL,NULL),(227,1,2,'<p>A propos de la Puma Suede:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>La Puma Suede est l’archétype du modèle classique dont le style a traversé les époques sans jamais prendre une ride. Elle fait désormais partie des modèles les plus appréciés internationalement. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la Adidas Superstar et la Puma Clyde, la Suede était l\'accessoire de base des B-Boy\'s.</p>','<p>Année de sortie: 2009</p>','puma-suede-brown-beige','Puma Suede Brown/Beige 1968 2009 Retro',NULL,'Puma Suede Brown/Beige','Puma Suede Brown/Beige',NULL,NULL),(227,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(227,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(227,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(228,1,1,'<p>About Puma Suede:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Puma Suede is typically a classic model that stood the test of time, it has now become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar and Puma Clyde, the Suede was the staple of every b-boy’s daily outfit.<br /><br /></p>','<p>Year of release: 2010</p>','puma-suede-women-black-white','Puma Suede Women Black/White 2010 Retro',NULL,'Puma Suede Women Black/White','Puma Suede Women Black/White',NULL,NULL),(228,1,2,'<p>A propos de la Puma Suede:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>La Puma Suede est l’archétype du modèle classique dont le style a traversé les époques sans jamais prendre une ride. Elle fait désormais partie des modèles les plus appréciés internationalement. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la Adidas Superstar et la Puma Clyde, la Suede était l\'accessoire de base des B-Boy\'s.</p>','<p>Année de sortie: 2010</p>','puma-suede-women-black-white','Puma Suede Women Black/White 2010 Retro',NULL,'Puma Suede Women Black/White','Puma Suede Women Black/White',NULL,NULL),(228,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(228,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(228,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(230,1,1,NULL,'<p>Year of release: 1987</p>','adidas-stefan-edberg-og-white-green-yellow','Adidas Stefan Edberg OG White/Green/Yellow Vintage Tennis 1987',NULL,'Adidas Stefan Edberg OG White/Green/Yellow','Adidas Stefan Edberg OG White/Green/Yellow',NULL,NULL),(230,1,2,NULL,'<p>Année de sortie: 1987</p>','adidas-stefan-edberg-og-white-green-yellow','Adidas Stefan Edberg OG White/Green/Yellow Vintage Tennis 1987',NULL,'Adidas Stefan Edberg OG White/Green/Yellow','Adidas Stefan Edberg OG White/Green/Yellow',NULL,NULL),(230,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(230,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(230,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(233,1,1,'<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2011</p>','dunk-hi-mighty-crown-qs','Nike Dunk Hi Mighty Crown QS 2011',NULL,'Dunk Hi Mighty Crown QS','Dunk Hi Mighty Crown QS',NULL,NULL),(233,1,2,'<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>\r\n<p> </p>','<p>Année de sortie: 2011</p>','dunk-hi-mighty-crown-qs','Nike Dunk Hi Mighty Crown QS 2011',NULL,'Dunk Hi Mighty Crown QS','Dunk Hi Mighty Crown QS',NULL,NULL),(233,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(233,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(233,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(234,1,1,'<p>About Blazer:</p>\r\n<p>Year of release of OG model: 1972</p>\r\n<p>The Nike designers wanted the swoosh on this model to be really big so that everybody would notice it. The Blazer was worn and represented by Basketball legend George Gervin, AKA « the Ice Man ». The Blazer didn’t have great technology, but the process of fusing the outsole to the upper was pretty extreme.</p>','<p>Year of release: 2011</p>','blazer-hi-prm-gym-red-white','Blazer Hi PRM Gym Red/White 2011 Vintage Suede',NULL,'Blazer Hi PRM Gym Red/White','Blazer Mid Vintage Green/White',NULL,NULL),(234,1,2,'<p>A propos de la Blazer:</p>\r\n<p>Date de sortie du modèle original: 1972</p>\r\n<p>Ce qui caractérise ce modèle à l’époque c’est l’énorme « swoosh », la virgule devait être la plus grosse possible pour que tout le monde puisse la remarquer. Le basketteur associé à la Blazer était George Gervin alias « the Ice Man ». Ce modèle n’avait rien de révolutionnaire, mais le fait de fusionner la semelle avec le bout renforcé était assez innovant pour l’époque.</p>','<p>Année de sortie: 2011</p>','blazer-hi-prm-gym-red-white','Blazer Hi PRM Gym Red/White 2011 Vintage Suede',NULL,'Blazer Hi PRM Gym Red/White','Blazer Mid Vintage Green/White',NULL,NULL),(234,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(234,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(234,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(235,1,1,'<p>About Blazer:</p>\r\n<p>Year of release of OG model: 1972</p>\r\n<p>The Nike designers wanted the swoosh on this model to be really big so that everybody would notice it. The Blazer was worn and represented by Basketball legend George Gervin, AKA « the Ice Man ». The Blazer didn’t have great technology, but the process of fusing the outsole to the upper was pretty extreme.</p>','<p>Year of release: 2009</p>','blazer-sb-black-white','Nike Blazer SB Black/White 2009 Suede',NULL,'Blazer SB Black/White','Blazer SB Black/White',NULL,NULL),(235,1,2,'<p>A propos de la Blazer:</p>\r\n<p>Date de sortie du modèle original: 1972</p>\r\n<p>Ce qui caractérise ce modèle à l’époque c’est l’énorme « swoosh », la virgule devait être la plus grosse possible pour que tout le monde puisse la remarquer. Le basketteur associé à la Blazer était George Gervin alias « the Ice Man ». Ce modèle n’avait rien de révolutionnaire, mais le fait de fusionner la semelle avec le bout renforcé était assez innovant pour l’époque.</p>','<p>Année de sortie: 2009</p>','blazer-sb-black-white','Nike Blazer SB Black/White 2009 Suede',NULL,'Blazer SB Black/White','Blazer SB Black/White',NULL,NULL),(235,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(235,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(235,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(240,1,1,'<p>Limited edition (441 pairs worldwide)</p>','<p>Year of release: 2011</p>','reebok-pump-omni-zone-dominique-wilkins-x-packer-black-white-grey-orange','Reebok Pump Omni Zone Dominique Wilkins x Packer Black/White/Grey/Orange 2011 Retro',NULL,'Reebok Pump Omni Zone Dominique Wilkins x Packer Black/White/Grey/Orange','Reebok Pump Omni Zone Dominique Wilkins x Packer',NULL,NULL),(240,1,2,'<p>Edition limitée (441 paires au monde)</p>','<p>Année de sortie: 2011</p>','reebok-pump-omni-zone-dominique-wilkins-x-packer-black-white-grey-orange','Reebok Pump Omni Zone Dominique Wilkins x Packer Black/White/Grey/Orange 2011 Retro',NULL,'Reebok Pump Omni Zone Dominique Wilkins x Packer Black/White/Grey/Orange','Reebok Pump Omni Zone Dominique Wilkins x Packer ',NULL,NULL),(240,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(240,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(240,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(242,1,1,'<p>Year of release: 2012</p>\r\n<p>The AJKO was originally released in 1985, the same year as Air Jordan I. It is very similar to it but was made of canvas instead of leather and AJKO is written on the Jordan wings logo instead of \"Air Jordan\". The meaning of the name \"KO\" is a bit mysterious, could be Knock Out, or Knock Off.</p>\r\n<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-ko-black-varsity-red','Nike Air Jordan I KO Black/Varsity Red AJ 1 2012',NULL,'Air Jordan I KO Black/Varsity Red','Air Jordan I KO Black/Varsity Red',NULL,NULL),(242,1,2,'<p>Année de sortie: 2012</p>\r\n<p>Le modèle AJKO original a vu le jour en 1985, année de la sortie de la Air Jordan I. Les 2 modèles sont très proches, principales différences: la AJKO est faite de toile et non de cuir, le logo Jordan Wings porte l\'inscription \"AJKO\" au lieu de \"Air Jordan\". La signification du nom \"KO\" reste mystérieuse, ça peut être \"Knock Out\" ou \"Knock Off\".</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2012</p>','air-jordan-i-ko-black-varsity-red','Nike Air Jordan I KO Black/Varsity Red AJ 1 2012',NULL,'Air Jordan I KO Black/Varsity Red','Air Jordan I KO Black/Varsity Red',NULL,NULL),(242,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(242,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(242,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(243,1,1,'<p>Year of release: 2012</p>\r\n<p>The AJKO was originally released in 1985, the same year as Air Jordan I. It is very similar to it but was made of canvas instead of leather and AJKO is written on the Jordan wings logo instead of \"Air Jord