ordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 1990</p>','air-jordan-vi-maroon','Nike Air Jordan VI Maroon OG AJ 6 Vintage',NULL,'Air Jordan VI Maroon','Air Jordan VI Maroon',NULL,NULL),(272,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(272,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(272,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(277,1,1,'<p><span style=\"color: #000000;\">Year of release: 1991</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 1991</p>','air-jordan-vii-bordeaux-og','Nike Air Jordan VII Bordeaux OG 1992 AJ 7 All Star Game',NULL,'Air Jordan VII Bordeaux OG','Air Jordan VII Bordeaux OG',NULL,NULL),(277,1,2,'<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span></p>\r\n<p>Année de sortie: 1991</p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 1991</p>','air-jordan-vii-bordeaux-og','Nike Air Jordan VII Bordeaux OG 1992 AJ 7 All Star Game',NULL,'Air Jordan VII Bordeaux OG','Air Jordan VII Bordeaux OG',NULL,NULL),(277,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(277,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(277,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(278,1,1,'<p><span style=\"color: #000000;\">Year of release: 1991</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong><br /></strong></span></p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year 