</p>\r\n<p> </p>','<p>Year of release: 2012</p>','air-jordan-vii-golden-moment-gs','Nike Air Jordan VII Golden Moment GS AJ 7 GMP 2012',NULL,'Air Jordan VII Golden Moment GS','Air Jordan VII Golden Moment GS',NULL,NULL),(282,1,2,'<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2012</p>','air-jordan-vii-golden-moment-gs','Nike Air Jordan VII Golden Moment GS AJ 7 GMP 2012',NULL,'Air Jordan VII Golden Moment GS','Air Jordan VII Golden Moment GS',NULL,NULL),(282,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(282,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(282,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(283,1,1,'<p><span style=\"color: #000000;\">Year of release: 1992</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p>OG box missing.</p>\r\n<p> </p>\r\n<p>About Air Jordan VIII:</p>\r\n<p>Year of release of OG model: 1992</p>\r\n<p>In 1993, Michael Jordan and the Bulls win their 3rd NBA title in a row against Charles Barkley’s Phoenix Suns. MJ is once again MVP of the NBA finals.</p>\r\n<p>The most popular colorway of Air Jordan VIII, called « Aqua », was only worn once by MJ : during ’93 NBA All Star Game in Salt Lake City.<br />The shoe uses advanced technology, anti-inversion straps, soles in polycarbonate. The colors are even more aggressive. The Air Jordan VIII changed the way high performance shoes were designed technologically and aesthetically. High-top sneaker made of black velours with diagonal <br />applications allover the lacing parts and an additional slim velcro. Perforations on the side parts.</p>','<p>Year of release: 1992</p>','air-jordan-viii-playoffs-og','Nike Air Jordan VIII Playoffs OG AJ 8 Vintage 1991',NULL,'Air Jordan VIII Playoffs OG','Air Jordan VIII Playoffs OG',NULL,NULL),(283,1,2,'<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span></p>\r\n<p>Année de sortie: 1992</p>\r\n<p>Boîte d\'origine manquante.</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VIII:</p>\r\n<p>Date de sortie du modèle original: 1992</p>\r\n<p>A l’issue de la saison 1992-93, Micheal Jordan et les Bulls remportent leur 3ème titre NBA consécutif, face aux Phoenix Suns emmenés par Charles Barkley. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Le colori le plus populaire parmi les Air Jordan VIII, appelé « Aqua », a été porté une seule fois par MJ lors du NBA All Star Game ’93 à Salt Lake City. <br />La chaussure emploie des technologies de pointe pour l\'époque : des straps inédits et une semelle en polycarbonate. Les couleurs sont encore plus agressives. La Air Jordan VIII a changé la façon dont les chaussures de haute performance étaient conçues, techniquement et esthétiquement.</p>','<p>Année de sortie: 1992</p>','air-jordan-viii-playoffs-og','Nike Air Jordan VIII Playoffs OG AJ 8 Vintage 1991',NULL,'Air Jordan VIII Playoffs OG','Air Jordan VIII Playoffs OG',NULL,NULL),(283,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(283,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(283,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(288,1,1,'<p>About Air Jordan IX:</p>\r\n<p>Year of release of OG model: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This pair was released in late 1993. Some weeks before its release, MJ had announced his retirement from the NBA at 30 (following the death of his father, murdered in North <br />Carolina). Therefore, this is the first shoe he did not wear in an NBA season game, but some other players did, such as Penny Hardaway, Kendall Gill or Mitch Richmond. As MJ then decided to start a new career in Baseball, Nike created a version of the model with cleats.</p>\r\n<p>The shoe uses advanced technology: dynamic-Fit inner bootie, encapsulated Air-Sole unit (forefoot), large volume Air-Sole unit (heel), polyurethane midsole and “one-pull” lacing system. Tinker Hatfield said he was inspired by Japanese design to create this model, a way for him to <br />show that MJ had become a worldwide icon. This is also shown on the soles that feature words like « freedom », « independance », « force » and « athletic » in several languages from every continent.</p>','<p>Year of release: 2010</p>','air-jordan-ix-for-the-love-of-the-game','Nike Air Jordan IX For the Love of the Game AJ 9 Retro 2010 Limited edition',NULL,'Air Jordan IX For the Love of the Game','Air Jordan IX For the Love of the Game',NULL,NULL),(288,1,2,'<p>A propos de la Air Jordan IX:</p>\r\n<p>Date de sortie du modèle original: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan IX est sortie fin 1993. Quelques semaines avant sa sortie, MJ avait annoncé sa retraite à l’âge de 30 ans (après le décès de son père, assassiné en Caroline du Nord). Par conséquent, il s\'agit de la première Air Jordan qu’il n’ait pas portée lors d’un match officiel, mais d’autres joueurs, tels que Penny Hardaway, Kendall Gill ou Mitch Richmond, l’ont étrennée sur les parquets NBA. Comme MJ avait alors décidé de se lancer dans le baseball, Nike a spécialement créé une version du modèle avec des crampons. La chaussure utilise des technologies avancées: chausson interne « dynamique-Fit », double système Air-Sole intégré (un à l’avant-pied et un grand au talon), midsole en polyuréthanne et système de laçage \"one pull\". Tinker Hatfield a dit s’être inspiré du design japonais pour la conception de ce modèle, une façon pour lui de montrer que MJ était devenu une icône dans le monde entier. Ceci est également mis en avant sur les semelles qui comportent des mots comme «liberté», «indépendance», «force» et «athlétique» dans différentes langues venues des quatre coins du monde.</p>','<p>Année de sortie: 2010</p>','air-jordan-ix-for-the-love-of-the-game','Nike Air Jordan IX For the Love of the Game AJ 9 Retro 2010 Limited edition',NULL,'Air Jordan IX For the Love of the Game','Air Jordan IX For the Love of the Game',NULL,NULL),(288,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(288,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(288,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(289,1,1,'<p>About Air Jordan IX:</p>\r\n<p>Year of release of OG model: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This pair was released in late 1993. Some weeks before its release, MJ had announced his retirement from the NBA at 30 (following the death of his father, murdered in North <br />Carolina). Therefore, this is the first shoe he did not wear in an NBA season game, but