ase: 1993</p>','air-jordan-ix-white-black-og','Nike Air Jordan IX White/Black OG Vintage AJ 9 1993',NULL,'Air Jordan IX White/Black OG','Air Jordan IX White/Black OG',NULL,NULL),(293,1,2,'<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span></p>\r\n<p>Année de sortie: 1993</p>\r\n<p>A propos de la Air Jordan IX:</p>\r\n<p>Date de sortie du modèle original: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan IX est sortie fin 1993. Quelques semaines avant sa sortie, MJ avait annoncé sa retraite à l’âge de 30 ans (après le décès de son père, assassiné en Caroline du Nord). Par conséquent, il s\'agit de la première Air Jordan qu’il n’ait pas portée lors d’un match officiel, mais d’autres joueurs, tels que Penny Hardaway, Kendall Gill ou Mitch Richmond, l’ont étrennée sur les parquets NBA. Comme MJ avait alors décidé de se lancer dans le baseball, Nike a spécialement créé une version du modèle avec des crampons. La chaussure utilise des technologies avancées: chausson interne « dynamique-Fit », double système Air-Sole intégré (un à l’avant-pied et un grand au talon), midsole en polyuréthanne et système de laçage \"one pull\". Tinker Hatfield a dit s’être inspiré du design japonais pour la conception de ce modèle, une façon pour lui de montrer que MJ était devenu une icône dans le monde entier. Ceci est également mis en avant sur les semelles qui comportent des mots comme «liberté», «indépendance», «force» et «athlétique» dans différentes langues venues des quatre coins du monde.</p>','<p>Année de sortie: 1993</p>','air-jordan-ix-white-black-og','Nike Air Jordan IX White/Black OG Vintage AJ 9 1993',NULL,'Air Jordan IX White/Black OG','Air Jordan IX White/Black OG',NULL,NULL),(293,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(293,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(293,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(294,1,1,'<p>About Air Jordan X:</p>\r\n<p>Year of release of OG model: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>AJ X could have been the last Air Jordan. In 1994, Jordan had already retired from the NBA (following the murder of his father during summer ’93) and had decided to start a new career in baseball with the Chicago White Sox.  This explains the presence of the 10 lines of MJ’s main achievements on the sole of the shoe. After suffering a failure in baseball, MJ decides to make his come back in the NBA in march 1995. He’s back, wearing the AJX on court, with the Bulls but without his #23  (which had been retired). His come back is a success as he helps the Bulls qualify for the Playoffs. They finally lose against Shaq’s Orlando Magic which will then be swept by the Houston Rockets in the ’95 NBA Finals.</p>','<p>Year of release: 2012</p>','air-jordan-x-chicago','Nike Air Jordan X Chicago AJ 10 2012',NULL,'Air Jordan X Chicago','Air Jordan X Chicago',NULL,NULL),(294,1,2,'<p>A propos de la Air Jordan X:</p>\r\n<p>Date de sortie du modèle original: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La AJ X a bien failli être la dernière de la série. En 1994, Jordan, retraité de la NBA à la suite de l’assassinat de son père, décida de tenter une carrière professionnelle dans le baseball en intégrant les Chicago White Sox. Ceci explique que la semelle du modèle porte, sur 10 lignes, le palmarès <br />de MJ. Après avoir essuyé un échec au baseball, il décide de revenir aux affaires en NBA en mars 1995. Il est donc de retour, avec les Bulls, Jordan X aux pieds, mais sans son numéro 23 (qui avait été retiré lors de sa retraite). Son retour est un succès, il aide les Bulls à se qualifier pour les <br />Playoffs. Ils perdent finalement face aux Orlando Magic de Shaquille O’Neal qui seront à leur tour balayés par les Houston Rockets en finale NBA.</p>','<p>Année de sortie: 2012</p>','air-jordan-x-chicago','Nike Air Jordan X Chicago AJ 10 2012',NULL,'Air Jordan X Chicago','Air Jordan X Chicago',NULL,NULL),(294,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(294,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(294,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(295,1,1,'<p>About Air Jordan X:</p>\r\n<p>Year of release of OG model: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>AJ X could have been the last Air Jordan. In 1994, Jordan had already retired from the NBA (following the murder of his father during summer ’93) and had decided to start a new career in baseball with the Chicago White Sox.  This explains the presence of the 10 lines of MJ’s main achievements on the sole of the shoe. After suffering a failure in baseball, MJ decides to make his come back in the NBA in march 1995. He’s back, wearing the AJX on court, with the Bulls but without his #23  (which had been retired). His come back is a success as he helps the Bulls qualify for the Playoffs. They finally lose against Shaq’s Orlando Magic which will then be swept by the Houston Rockets in the ’95 NBA Finals.</p>','<p>Year of release: 2012</p>','air-jordan-x-chicago-gs','Nike Air Jordan X Chicago GS AJ 10 2012 women ladies',NULL,'Air Jordan X Chicago GS','Air Jordan X Chicago GS',NULL,NULL),(295,1,2,'<p>A propos de la Air Jordan X:</p>\r\n<p>Date de sortie du modèle original: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La AJ X a bien failli être la dernière de la série. En 1994, Jordan, retraité de la NBA à la suite de l’assassinat de son père, décida de tenter une carrière professionnelle dans le baseball en intégrant les Chicago White Sox. Ceci explique que la semelle du modèle porte, sur 10 lignes, le 