llait perdurer jusque la Jordan XVI (excepté la XII).</p>','<p>Année de sortie: 2012</p>','air-jordan-xi-low-white-varsity-red-black','NikeAir Jordan XI Low White/Varsity Red/Black AJ 11 2012 limited edition',NULL,'Air Jordan XI Low White/Varsity Red/Black','Air Jordan XI Low White/Varsity Red/Black',NULL,NULL),(301,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(301,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(301,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(302,1,1,'<p>About Air Jordan XII:</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In the 96/97 season Jordan saw himself being bounced off the MVP throne by Karl Malone, who won the honor with the slimmest margin one can think of. Jordan got his revenge in the finals though, and led the Bulls past Malone\'s Utah Jazz and also picked up the Finals MVP honors for the fifth time. In game 5 of the 1997 NBA Finals against Utah, MJ reminds everyone why he is unstoppable. Michael plays through the game with a severe flu. Despite riding on no sleepand no energy, Michael leads Chicago to victory with 38 points and a game-winning three-pointer. <br />Air Jordan XII was again something totally new when it came to design. Full-grain floater leather upper. Phylon™ midsole, full-length Zoom Air™ unit. 3/4-length carbon fiber shank. Modified herringbone outsole. The way the ribbed leather seemed to go all the way down to the ground due to the match in colour with the midsoles, really made people turn their heads. This unique design was partly inspired by the flag of the Japanese Army &amp; Navy in which the red circle is surrounded by a \"sunset\". The XII\'s were also one of the most durable AJ\'s to date. It seemed almost nothing could break these shoes down. One major disadvantage was that they pretty easily got dirty and was hard to clean. Especially the ones with white midsoles/soles.</p>','<p>Year of release: 2009</p>','air-jordan-xii-flu-game','Nike Air Jordan XII Flu Game AJ 12 2009',NULL,'Air Jordan XII Flu Game','Air Jordan XII Flu Game',NULL,NULL),(302,1,2,'<p>A propos de la Air Jordan XII:</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Durant la saison 96/97 Jordan s\'est vu ravir le titre de MVP par Karl Malone. MJ aura sa revanche en Finale NBA 1997 où il conduira les Bulls à leur 5ème titre de la décennie et obtiendra au passage le titre de MVP des finales pour la cinquième fois. Lors du match 5, il rappelle à tout le monde à quel point il est inarrêtable. Bien que souffrant de la grippe, et malgré le manque de sommeil et d\'énergie, il mène Chicago à la victoire en inscrivant 38 points dont un tir à trois points décisif en toute fin de match. Avec la AJ12, Nike a à nouveau innové au niveau du design et de la conception. Cuir de haute qualité. Semelle intermédiaire en mousse Phylon ™ ultra légère, système Zoom Air ™ tout au long de la semelle, et une tige en fibre de carbone sur _ de la longueur de la chaussure. Le cuir nervuré donne l’impression d’aller du haut de la chaussure jusqu’au talon car il se confond avec la couleur de la midsole. Cette conception unique a été en partie inspirée par le drapeau de l\'armée japonaise sur lequel apparaît un coucher de soleil. La AJ12 est également réputée pour être l\'une des Jordan les plus résistantes. Seul inconvénient, les modèles avec semelles et midsoles blanches sont très salissants.</p>','<p>Année de sortie: 2009</p>','air-jordan-xii-flu-game','Nike Air Jordan XII Flu Game AJ 12 2009',NULL,'Air Jordan XII Flu Game','Air Jordan XII Flu Game',NULL,NULL),(302,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(302,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Ph