énient, les modèles avec semelles et midsoles blanches sont très salissants.</p>','<p>Année de sortie: 2009</p>','air-jordan-xii-rising-sun','Nike Air Jordan XII Rising Sun AJ 12 2009',NULL,'Air Jordan XII Rising Sun','Air Jordan XII Rising Sun',NULL,NULL),(305,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(305,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(305,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(306,1,1,'<p><span style=\"color: #000000;\">Year of release: 1997</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Jordan XIII:</p>\r\n<p>Year of release of OG model: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>The Air Jordan XIII features quilted leather upper with suede trim and unique hidden lacing system. Low-profile leather wrapped Phylon™ midsole with heel and forefoot Zoom Air™ units. Midfoot carbon fiber composite plate. Tinker Hatfield kept on making original designs. <br />The AJXIII featured a nice hologram on the ankle and the design was inspired by a panther (one of MJ’s nicknames). The outsole with pads like a paw and circles representing whiskers. The hologram shows a basketball; the number 23 &amp; the jumpman logo. On December 30th 1997, Jordan broke Kareem Abdul-Jabbar\'s NBA record, by scoring in double-digits for the 788th consecutive game. He also led the Bulls to their sixth NBA Championship title before retiring from the game (for the second time). We must precise that during the 1998 NBA Finals, which were his last games with the Bulls, MJ was (already) wearing the new Air Jordan XIV.</p>','<p>Year of release: 1997</p>','air-jordan-xiii-low-chutney-black-og','Nike Air Jordan XIII Low Chutney/Black OG AJ 13 1997',NULL,'Air Jordan XIII Low Chutney/Black OG','Air Jordan XIII Low Chutney/Black OG',NULL,NULL),(306,1,2,'<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span></p>\r\n<p>Année de sortie: 1997</p>\r\n<p>A propos de la Air Jordan XIII:</p>\r\n<p>Date de sortie du modèle original: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan XIII est composée de cuir moltoné et de parties latérales en daim ainsi que d’un système unique dissimulant le laçage. La semelle intermédiaire en Phylon ™, englobe un double système Zoom Air ™ (talon et semelle avant). La partie centrale de la semelle est faite d’une plaque en fibre de carbone composite. Tinker Hatfield continue de proposer des concepts originaux. Le design de la AJXIII s’inspire de l’un des surnoms de Jordan : « the black cat » (la panthère noire). La semelle extérieure rappelle les coussinets et les cercles représentant les moustaches de la panthère. Au niveau de la cheville figure un hologramme faisant apparaître un ballon de basket ; le numéro 23&amp; le logo Jumpman. <br />Le 30 Décembre 1997, Jordan a battu le record de Kareem Abdul-Jabbar en devenant le premier joueur NBA à marquer plus de 10 points au cours de 788 matchs consécutifs. En 1998, il a également emmené les Bulls jusqu’à leur sixième titre de champion NBA avant de prendre sa retraite sportive (pour la deuxième fois). Il faut préciser que lors de son dernier match avec les Bulls, en Finale NBA, MJ portait (déjà) la future Air Jordan XIV.</p>','<p>Année de sortie: 1997</p>','air-jordan-xiii-low-chutney-black-og','Nike Air Jordan XIII Low Chutney/Black OG AJ 13 1997',NULL,'Air Jordan XIII Low Chutney/Black OG','Air Jordan XIII Low Chutney/Black OG',NULL,NULL),(306,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(306,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(306,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(308,1,1,'<p>About Air Jordan XIII:</p>\r\n<p>Year of release of OG model: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>The Air Jordan XIII features quilted leather upper with suede trim and unique hidden lacing system. Low-profile leather wrapped Phylon™ midsole with heel and forefoot Zoom Air™ units. Midfoot carbon fiber composite plate. Tinker Hatfield kept on making original designs. <br />The AJXIII featured a nice hologram on the ankle and the design was inspired by a panther (one of MJ’s nicknames). The outsole with pads like a paw and circles representing whiskers. The hologram shows a basketball; the number 23 &amp; the jumpman logo. On December 30th 1997, Jordan broke Kareem Abdul-Jabbar\'s NBA record, by scoring in double-digits for the 788th consecutive game. He also led the Bulls to their sixth NBA Championship title before retiring from the game (for the second time). We must precise that during the 1998 NBA Finals, which were his last games with the Bulls, MJ was (already) wearing the new Air Jordan XIV.</p>','<p>Year of release: 2010</p>','air-jordan-xiii-white-varsity-red','Nike Air Jordan XIII White/Varsity Red AJ 13 2010',NULL,'Air Jordan XIII White/Varsity Red','Air Jordan XIII White/Varsity Red',NULL,NULL),(308,1,2,'<p>A propos de la Air Jordan XIII:</p>\r\n<p>Date de sortie du modèle original: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan XIII est composée de cuir moltoné et de parties latérales en daim ainsi que d’un système unique dissimulant le laçage. La semelle intermédiaire en Phylon ™, englobe un double système Zoom Air ™ (talon et semelle avant). La partie centrale de la semelle est faite d’une plaque en fibre de carbone composite. Tinker Hatfield continue de proposer des concepts originaux. Le design de la AJXIII s’inspire de l’un des surnoms de Jordan : « the black cat » (la panthère noire). La semelle extérieure rappelle les coussinets et les cercles représentant les moustaches de la panthère. Au niveau de la cheville figure un hologramme faisant apparaître un ballon de basket ; le numéro 23&amp; le logo Jumpman. <br />Le 30 Décembre 1997, Jordan a battu le record de Kareem Abdul-Jabbar en devenant le premier joueur NBA à marquer plus de 10 points au cours de 788 matchs consécutifs. En 1998, il a également emmené les Bulls jusqu’à leur sixième titre de champion NBA avant de prendre sa retraite sportive (pour la deuxième fois). Il faut préciser que lors de son dernier match avec les Bulls, en Finale NBA, MJ portait (déjà) la future Air Jordan XIV.</p>','<p>Année de sortie: 2010</p>','air-jordan-xiii-white-varsity-red','Nike Air Jordan XIII White/Varsity Red AJ 13 2010',NULL,'Air Jordan XIII White/Varsity Red','Air Jordan XIII White/Varsity Red',NULL,NULL),(308,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(308,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(308,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(309,1,1,NULL,'<p>Year of release: 2012</p>','adidas-jeremy-scott-denim-kids','Adidas Jeremy Scott Denim Kids 2012',NULL,'Adidas Jeremy Scott Denim Kids','Adidas Jeremy Scott Denim Kids',NULL,NULL),(309,1,2,NULL,'<p>Année de sortie: 2012</p>','adidas-jeremy-scott-denim-kids','Adidas Jeremy Scott Denim Kids 2012',NULL,'Adidas Jeremy Scott Denim Kids','Adidas Jeremy Scott Denim Kids',NULL,NULL),(309,1,3,NULL,NULL,'adidas-jeremy-scott-leopard',NULL,NULL,NULL,'Adidas Jeremy Scott Leopard',NULL,NULL),(309,1,4,NULL,NULL,'adidas-jeremy-scott-leopard',NULL,NULL,NULL,'Adidas Jeremy Scott Leopard',NULL,NULL),(309,1,5,NULL,NULL,'adidas-jeremy-scott-leopard',NULL,NULL,NULL,'Adidas Jeremy Scott Leopard',NULL,NULL),(310,1,1,NULL,'<p>Year of release: 2012</p>','adidas-jeremy-scott-leopard-kids','Adidas Jeremy Scott Leopard Kids Safari JS 2012',NULL,'Adidas Jeremy Scott Leopard Kids','Adidas Jeremy Scott Leopard Kids',NULL,NULL),(310,1,2,NULL,'<p>Année de sortie: 2012</p>','adidas-jeremy-scott-leopard-kids','Adidas Jeremy Scott Leopard Kids Safari JS 2012',NULL,'Adidas Jeremy Scott Leopard Kids','Adidas Jeremy Scott Leopard Kids',NULL,NULL),(310,1,3,NULL,NULL,'adidas-jeremy-scott-leopard',NULL,NULL,NULL,'Adidas Jeremy Scott Leopard',NULL,NULL),(310,1,4,NULL,NULL,'adidas-jeremy-scott-leopard',NULL,NULL,NULL,'Adidas Jeremy Scott Leopard',NULL,NULL),(310,1,5,NULL,NULL,'adidas-jeremy-scott-leopard',NULL,NULL,NULL,'Adidas Jeremy Scott Leopard',NULL,NULL),(311,1,1,'<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2012</p>','air-max-1-prm-red-black-white','Nike Air Max 1 PRM Red/Black/White 2012',NULL,'Air Max 1 PRM Red/Black/White','Air Max 1 PRM Red/Black/White',NULL,NULL),(311,1,2,'<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2012</p>','air-max-1-prm-red-black-white','Nike Air Max 1 PRM Red/Black/White 2012',NULL,'Air Max 1 PRM Red/Black/White','Air Max 1 PRM Red/Black/White',NULL,NULL),(311,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(311,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(311,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(312,1,1,'<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2012</p>','air-max-1-prm-blue-grey-white','Nike Air Max 1 PRM Blue/Grey/White 2012',NULL,'Air Max 1 PRM Blue/Grey/White','Air Max 1 PRM Blue/Grey/White',NULL,NULL),(312,1,2,'<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2012</p>','air-max-1-prm-blue-grey-white','Nike Air Max 1 PRM Blue/Grey/White 2012',NULL,'Air Max 1 PRM Blue/Grey/White','Air Max 1 PRM Blue/Grey/White',NULL,NULL),(312,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(312,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(312,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(314,1,1,'<p>About Air Stab:</p>\r\n<p>Year of release of OG Model: 1988</p>\r\n<p>Designer : Tinker Hatfield</p>\r\n<p>This shoe featured Nike’s footbridge stability device. Big \"AIR STAB\" letters on the thermoplastic heelcap are best visible. Plus the forkstabs in the Air-window give this shoe an aggressive flavour. Nike stopped making the Air Stab in 1990 to the dismay of numerous fans. The Air Stab was designed by Tinker Hatfield.</p>','<p>Year of release: 1989</p>','air-stab-og-white-black-grey-red','Nike Air Stab OG White/Black/Grey/Red 1989 Vintage',NULL,'Air Stab OG White/Black/Grey/Red','Air Stab OG White/Black/Grey/Red',NULL,NULL),(314,1,2,'<p>A propos de la Air Stab:</p>\r\n<p>Année de sortie du modèle original: 1988</p>\r\n<p>Designer : Tinker Hatfield</p>\r\n<p>Cette chaussure possède le dispositif de stabilité Nike Footbridge. Un très large lettrage AIR STAB au niveau de la protection thermoplastique du talon, plus la fourche Stab au niveau de la bulle d’air, donnant à la chaussure un design agressif. Nike stoppa la fabrication de la Air Stab en 1990 au grand désarroi de nombreux fans. Le design de la Air Stab a été conçu par Tinker Hatfield.</p>','<p>Année de sortie: 1989</p>','air-stab-og-white-black-grey-red','Nike Air Stab OG White/Black/Grey/Red 1989 Vintage',NULL,'Air Stab OG White/Black/Grey/Red','Air Stab OG White/Black/Grey/Red',NULL,NULL),(314,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(314,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(314,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(315,1,1,NULL,'<p>Year of release: 2012</p>','air-trainer-classic-low-white-grey-turquoise','Nike Air Trainer Classic Low White/Grey/Turquoise 2012',NULL,'Air Trainer Classic Low White/Grey/Turquoise','Air Trainer Classic Low White/Grey/Turquoise',NULL,NULL),(315,1,2,NULL,'<p>Année de sortie: 2012</p>','air-trainer-classic-low-white-grey-turquoise','Nike Air Trainer Classic Low White/Grey/Turquoise 2012',NULL,'Air Trainer Classic Low White/Grey/Turquoise','Air Trainer Classic Low White/Grey/Turquoise',NULL,NULL),(315,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(315,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(315,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(317,1,1,'<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2008</p>','dunk-low-cl-black-purple-brown','Nike Dunk Low CL Black/Purple/Brown 2008',NULL,'Dunk Low CL Black/Purple/Brown','Dunk Low CL Black/Purple/Brown',NULL,NULL),(317,1,2,'<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>','<p>Année de sortie: 2008</p>','dunk-low-cl-black-purple-brown','Nike Dunk Low CL Black/Purple/Brown 2008',NULL,'Dunk Low CL Black/Purple/Brown','Dunk Low CL Black/Purple/Brown',NULL,NULL),(317,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(317,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(317,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(318,1,1,'<p>About Court Force:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>The Nike Court Force  is one of Nike\'s earlier basketball shoes. It has all the history of its more famous cousins, like the Nike Air Force One and the Nike Dunk, but with half the hype. This retro style, classic shape is continuously updated in low and high versions with a variety of colors and materials and seems to be a favorite for designers and customizers everywhere.</p>','<p>Year of release: 2006</p>','court-force-hi-world-cup','Nike Court Force Hi \"World cup\" Cappuccino/University Blue/Black 2006',NULL,'Court Force Hi \"World cup\"','Court Force Hi \"World cup\"',NULL,NULL),(318,1,2,'<p>A propos de la Court Force:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>La Nike Court Force est l\'une des plus anciennes paires de basket-ball fabriquées par Nike. Elle a la même histoire que ses célèbres cousines, la Nike Air Force One et la Nike Dunk, mais avec une notoriété moindre. Avec son style rétro, sa forme classique, la Court Force est constamment mise à jour en versions basse et haute avec une grande variété de couleurs et de matériaux et semble être devenu un must dans le monde des designers et professionnels de la customisation.</p>','<p>Année de sortie: 2006</p>','court-force-hi-world-cup','Nike Court Force Hi \"World cup\" Cappuccino/University Blue/Black 2006',NULL,'Court Force Hi \"World cup\"','Court Force Hi \"World cup\"',NULL,NULL),(318,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(318,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(318,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(319,1,1,'<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2012</p>','dunk-sb-low-nontourage-qs','Nike Dunk SB Low Nontourage QS 2012 quickstrike limited skateboard entourage',NULL,'Dunk SB Low Nontourage QS','Dunk SB Low Nontourage QS',NULL,NULL),(319,1,2,'<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>','<p>Année de sortie: 2012</p>','dunk-sb-low-nontourage-qs','Nike Dunk SB Low Nontourage QS 2012 quickstrike limited skateboard entourage',NULL,'Dunk SB Low Nontourage QS','Dunk SB Low Nontourage QS',NULL,NULL),(319,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(319,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(319,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(322,1,1,NULL,'<p>Year of release: 1991</p>','air-stab-og-white-black-grey-red','Nike Air Huarache LE White/Purple Punch/Black running OG 1991 Vintage',NULL,'Air Huarache LE White/Purple/Black OG','Air Huarache White/Purple Punch/Black OG',NULL,NULL),(322,1,2,NULL,'<p>Année de sortie: 1991</p>','air-huarache-le-white-purple-black-og','Nike Air Huarache LE White/Purple Punch/Black running OG 1991 Vintage',NULL,'Air Huarache LE White/Purple/Black OG','Air Huarache White/Purple Punch/Black OG',NULL,NULL),(322,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(322,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(322,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(325,1,1,'<p><span style=\"color: #000000;\">Year of release: 1980s</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong><br /></strong></span></p>\r\n<p>About Cortez:</p>\r\n<p>Year of release of OG model: 1972</p>\r\n<p>This is probably one of the most important sneaker in history. The Nike Cortez was released in 1967 as the « Tiger Corsair », but in 1972 it was renamed the Cortez after the partnership between Nike (still called Blue Ribbon Sports at the time) and Onitsuka Tiger disintegrated. The original model was made of leather, but was also produced in nylon and suede models in the 70\'s. A women\'s version was also released called the « Senorita Cortez ».</p>\r\n<p> </p>','<p>Year of release: 1980s</p>','cortez-lite-white-red-og','Nike Cortez Lite White/Red OG 1980 vintage',NULL,'Cortez Lite White/Red OG','Cortez Lite White/Red OG',NULL,NULL),(325,1,2,'<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 80, la porter pourrait la détériorer.</strong></span></p>\r\n<p>A propos de la Cortez:</p>\r\n<p>Date de sortie du modèle original: 1972</p>\r\n<p>Il s’agit probablement de la sneaker la plus importante de l’histoire. La Nike Cortez fut créée en 1967 sous le nom « Tiger Corsair » et fut rebaptisée « Cortez » en 1972 après la séparation de Nike (appelée Blue Ribbon Sports à l’époque) et Onitsuka Tiger. Le modèle d’origine fut fabriqué en cuir et dans les années 70 de nouveaux modèles furent produits en daim et en nylon. Une version pour femme appelée « Senorita Cortez » fut également produit.</p>\r\n<p> </p>','<p>Sortie: années 1980</p>','cortez-lite-white-red-og','Nike Cortez Lite White/Red OG 1980 vintage',NULL,'Cortez Lite White/Red OG','Cortez Lite White/Red OG',NULL,NULL),(325,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(325,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(325,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(329,1,1,NULL,'<p>Year of release: 2012</p>','lebron-9-low-easter','Nike Air Lebron 9 Low Easter 2012 LB9 Lebron James',NULL,'Lebron 9 Low Easter','Lebron 9 Low Easter',NULL,NULL),(329,1,2,NULL,'<p>Année de sortie: 2012</p>','lebron-9-low-easter','Nike Air Lebron 9 Low Easter 2012 LB9 Lebron James',NULL,'Lebron 9 Low Easter','Lebron 9 Low Easter',NULL,NULL),(329,1,3,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(329,1,4,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(329,1,5,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(335,1,1,NULL,'<p>Year of release: 2012</p>','zoom-kobe-7-barcelona-yellow-blue','Nike Air Zoom Kobe 7 \"Barcelona\" Yellow/Blue 2012 Bryant',NULL,'Zoom Kobe 7 \"Barcelona\" Yellow/Blue','Zoom Kobe 7 \"Barcelona\" Yellow/Blue',NULL,NULL),(335,1,2,NULL,'<p>Année de sortie: 2012</p>','zoom-kobe-7-barcelona-yellow-blue','Nike Air Zoom Kobe 7 \"Barcelona\" Yellow/Blue 2012 Bryant',NULL,'Zoom Kobe 7 \"Barcelona\" Yellow/Blue','Zoom Kobe 7 \"Barcelona\" Yellow/Blue',NULL,NULL),(335,1,3,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(335,1,4,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(335,1,5,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(336,1,1,'<p>Year of release: 2012</p>\r\n<p>This model is part of the Adidas Consortium “Your Story” collection. The theme of the pack was the Olympic Games (explaining the 5 colored dots on outsole). It was released some weeks before London 2012 Olympics.</p>\r\n<p>This ZX 500, in an OG colorway, was designed by Quote, artist from Berlin. His signature appears on the tongue (inside the shoe)</p>','<p>Year of release: 2012</p>','adidas-zx500-consortium-x-quote-your-story','Adidas ZX500 Consortium x Quote \"Your Story\" 2012 running Olympic Games London limited edition',NULL,'Adidas ZX500 Consortium x Quote \"Your Story\"','Adidas ZX500 Consortium x Quote \"Your Story\"',NULL,NULL),(336,1,2,'<p>Année de sortie: 2012</p>\r\n<p>Ce modèle fait partie de la collection Adidas Consortium “Your Story”. Le thème de ce pack était les Jeux Olympiques (thème rappelé par les 5 couleurs des anneaux olympiques présentes sur la semelle). La sortie de ce pack a eu lieu quelques semaines avant les Jeux Olympiques de Londres 2012.</p>\r\n<p>Cette ZX 500, dans un coloris d\'origine, a été dessinée par Quote, un artiste berlinois. Sa signature est visible sur la languette (à l\'intérieur de la chaussure)</p>','<p>Année de sortie: 2012</p>','adidas-zx500-consortium-x-quote-your-story','Adidas ZX500 Consortium x Quote \"Your Story\" 2012 running Olympic Games London limited edition',NULL,'Adidas ZX500 Consortium x Quote \"Your Story\"','Adidas ZX500 Consortium x Quote \"Your Story\"',NULL,NULL),(336,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(336,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(336,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(337,1,1,NULL,'<p>Year of release: 2012</p>','kd-iv-gold-medal','Nike Air KD IV \"Gold Medal\" Kevin Durant Olympics London 2012',NULL,'KD IV \"Gold Medal\"','KD IV \"Gold Medal\"',NULL,NULL),(337,1,2,NULL,'<p>Année de sortie: 2012</p>','kd-iv-gold-medal','Nike Air KD IV \"Gold Medal\" Kevin Durant Olympics London 2012',NULL,'Nike Air KD IV \"Gold Medal\"','KD IV \"Gold Medal\"',NULL,NULL),(337,1,3,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(337,1,4,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(337,1,5,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(338,1,1,NULL,'<p>Year of release: 2012</p>','lebron-10-sport-pack-gold-medal','Nike Lebron 10+ Sport Pack \"Gold Medal\" 2012 LB10 USA Olympics London Lebron James',NULL,'Lebron 10+ Sport Pack \"Gold Medal\"','Lebron 10+ Sport Pack \"Gold Medal\"',NULL,NULL),(338,1,2,NULL,'<p>Année de sortie: 2012</p>','lebron-10-sport-pack-gold-medal','Nike Lebron 10+ Sport Pack \"Gold Medal\" 2012 LB10 USA Olympics London Lebron James',NULL,'Lebron 10+ Sport Pack \"Gold Medal\"','Lebron 10+ Sport Pack \"Gold Medal\"',NULL,NULL),(338,1,3,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(338,1,4,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(338,1,5,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(341,1,1,'<p>Year of release: 2007</p>\r\n<p> </p>\r\n<p>About Air Tech Challenge IV:</p>\r\n<p>Year of release of OG Model: 1991</p>\r\n<p>1990-91 version dedicated to the tennis star André Agassi, who rocked this great sneaker. This season he won four tournaments but failed two grand slams finals (Roland Garros &amp; US Open). Air tech challenge models first fallen. Colours and patterns used are the same as the previous version. Neon yellow and purple zigzagging, retro stripe that connects the side and heel parts. You can notice some design modfications as the yellow tennis ball and the swoosh on the heel. Very special, light and solid sneaker! Should be part of every collection as this combines details and function to a masterpiece of sneaker culture!</p>','<p>Year of release: 2007</p>','air-tech-challenge-iv-white-black-sonic-yellow','Nike Air Tech Challenge IV White/Black/Sonic Yellow Agassi Retro 1991',NULL,'Air Tech Challenge IV White/Black/Sonic Yellow','Air Tech Challenge IV White/Black/Sonic Yellow',NULL,NULL),(341,1,2,'<p>Année de sortie: 2007</p>\r\n<p> </p>\r\n<p>A propos de la Air Tech Challenge IV:</p>\r\n<p>Année de sortie du modèle original: 1991</p>\r\n<p>André Agassi porta ces sneakers pendant la saison 1990-1991 durant laquelle il remporta quatre tournois mais perdit deux finales de tournois du grand chelem (Roland Garros &amp; US Open). Ce modèle est la première release des modèles Air tech challenge. Les couleurs et motifs utilisés sont les mêmes que ceux sortis à l\'époque, des bandes rétros jaunes fluos et rétros violettes en zigzag sur les côtés et sur le talon.</p>\r\n<p>Ce modèle a tout de même connu quelques modifications par rapport au modèle original comme la balle de tennis et la virgule Nike sur le talon. Il s’agit d’une chaussure très spéciale, légère et solide ! Ce modèle est une pièce maîtresse dans le monde et la culture sneakers!</p>','<p>Année de sortie: 2007</p>','air-tech-challenge-iv-white-black-sonic-yellow','Nike Air Tech Challenge IV White/Black/Sonic Yellow Agassi Retro 1991',NULL,'Air Tech Challenge IV White/Black/Sonic Yellow','Air Tech Challenge IV White/Black/Sonic Yellow',NULL,NULL),(341,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(341,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(341,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(346,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','reebok-pump-twilight-zone-black-white-red','Reebok Pump Twilight Zone Black/White/Red 1991',NULL,'Reebok Pump Twilight Zo