e de sortie: 2009</p>','<p>Année de sortie: 2009</p>','air-zoom-vapor-vi-tour-rf-us-open-black-red','Nike Air Zoom Vapor VI Tour RF US OPEN Night 2009 Black Leather/Red Roger Federer',NULL,'Air Zoom Vapor VI Tour RF US OPEN Black/Red','Air Zoom Vapor VI Tour RF US OPEN Black/Red',NULL,NULL),(350,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(350,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(350,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(352,1,1,'<p><span style=\"color: #000000;\">Year of release: 1993</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>','<p>Year of release: 1993</p>','ewing-wrap-hi-white-green-black','Ewing Wrap Hi OG White/Green/Black Vintage Patrick Ewing NBA Basketball 1993',NULL,'Ewing Wrap Hi OG White/Green/Black','Ewing Wrap Hi OG White/Green/Black',NULL,NULL),(352,1,2,'<p>Année de sortie: 1993</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span></p>','<p>Année de sortie: 1993</p>','ewing-wrap-hi-white-green-black','Ewing Wrap Hi OG White/Green/Black Vintage Patrick Ewing NBA Basketball 1993',NULL,'Ewing Wrap Hi OG White/Green/Black','Ewing Wrap Hi OG White/Green/Black',NULL,NULL),(352,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(352,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(352,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(353,1,1,'<p><span style=\"color: #000000;\">Year of release: 1994</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p>OG box missing.</p>\r\n<p> </p>\r\n<p>About Insta Pump Match:</p>\r\n<p>Year of release of OG Model: 1994</p>\r\n<p>The series of outstanding sneakers worn by Chang began with the Reebok Court Victory Pump, followed by the Court Victory II, but, in 1994 tennis season Chang took the court with the Instapump Match Hi. The Instapump used CO2 cartridges with a small gun named « Activator » and three high tech valves.</p>\r\n<p>This shoe featured three different air chambers (ankle, foot sides, tongue) giving one the most custom fit. Reebok also added Hexalite cushioned heel.</p>','<p>Year of release: 1994</p>','reebok-instapump-match-mid-white-lagoon-royal-blue-black','Reebok Instapump Match Mid White/Lagoon/Royal Blue/Black OG Vintage 1994 Michael Chang Tennis',NULL,'Reebok Instapump Match Mid White/Lagoon/Royal Blue/Black','Reebok Instapump Match Mid White/Lagoon/Royal Blue/Black',NULL,NULL),(353,1,2,'<p>Année de sortie: 1994</p>\r\n<p>Boîte d\'origine manquante.</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span></p>\r\n<p> </p>\r\n<p>A propos de la Insta Pump Match:</p>\r\n<p>Année de sortie du modèle original: 1994</p>\r\n<p>L’exceptionnelle série de tennis siglées Michael Chang commença par la Reebok Court Victory Pump suivie par la Court Victory II, puis pour la saison 1994-95 Michael Chang revint sur les courts avec la Reebok instapump Match Hi. Le but de l’Instapump : injecter du gaz carbonique par l’intermédiaire d’un petit pistolet, dans trois chambres situées au niveau de la cheville, sur les côtés du pied et la languette avec la possibilité de régler le gaz injecté par l’intermédiaire de 3 valves.</p>','<p>Année de sortie: 1994</p>','reebok-instapump-match-mid-white-lagoon-royal-blue-black','Reebok Instapump Match Mid White/Lagoon/Royal Blue/Black OG Vintage 1994 Michael Chang Tennis',NULL,'Reebok Instapump Match Mid White/Lagoon/Royal Blue/Black','Reebok Instapump Match Mid White/Lagoon/Royal Blue/Black',NULL,NULL),(353,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(353,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(353,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(360,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','lebron-10-cork-qs','Nike Lebron 10 Cork QS EXT 2013 LB10 Lebron James',NULL,'Lebron 10 Cork QS','Lebron 10 Cork QS',NULL,NULL),(360,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','lebron-10-cork-qs','Nike Lebron 10 Cork QS EXT 2013 LB10 Lebron James',NULL,'Lebron 10 Cork QS','Lebron 10 Cork QS',NULL,NULL),(360,1,3,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(360,1,4,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(360,1,5,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(362,1,1,'<p> </p>\r\n<p>- NBA Mitchell &amp; Ness Boston Celtics Stadium Snapback Hat - colour: Green/White - Vintage Logo</p>\r\n<p>- 80% acrylic/20% wool</p>\r\n<p>- Adjustable fit</p>',NULL,'boston-celtics-cap','Mitchell & Ness Boston Celtics Cap retro vintage classic green white NBA',NULL,'Casquette Boston Celtics Cap','Boston Celtics Snapback Hat',NULL,NULL),(362,1,2,'<p> </p>\r\n<p>- NBA Mitchell &amp; Ness Boston Celtics Stadium Snapback Hat - coloris: Vert/Blanc - Vintage Logo</p>\r\n<p>- 80% acrylique/20% laine</p>\r\n<p>- Taille ajustable</p>',NULL,'casquette-boston-celtics','Mitchell & Ness Casquette Boston Celtics retro vintage classic green white NBA