r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2011</p>','air-jordan-iii-black-cement','Nike Air Jordan III Black/Cement retro AJ 3 2011',NULL,'Air Jordan III Black/Cement','Air Jordan III Black/Cement',NULL,NULL),(365,1,2,'<p>Année de sortie: 2011</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2011</p>','air-jordan-iii-black-cement','Nike Air Jordan III Black/Cement retro AJ 3 2011',NULL,'Air Jordan III Black/Cement','Air Jordan III Black/Cement',NULL,NULL),(365,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(365,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(365,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(366,1,1,'<p>Year of release: 2011</p>\r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2011</p>','air-jordan-iii-black-cement-gs','Nike Air Jordan III Black/Cement GS retro AJ 3 2011',NULL,'Air Jordan III Black/Cement GS','Air Jordan III Black/Cement GS',NULL,NULL),(366,1,2,'<p>Année de sortie: 2011</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2011</p>','air-jordan-iii-black-cement-gs','Nike Air Jordan III Black/Cement GS retro AJ 3 2011',NULL,'Air Jordan III Black/Cement GS','Air Jordan III Black/Cement GS',NULL,NULL),(366,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(366,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(366,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(367,1,1,'<p>Size 5</p>\r\n<p>Year of release: 1992</p>',NULL,'adidas-mutombo-vintage-ball','Adidas Mutombo Vintage Ball basketball 1992',NULL,'Ballon Adidas Mutombo Vintage basketball 1992','Adidas Mutombo Vintage Ball',NULL,NULL),(367,1,2,'<p>Taille 5</p>\r\n<p>Année de sortie: 1992</p>',NULL,'ballon-adidas-mutombo-vintage','Ballon Adidas Mutombo Vintage basketball 1992',NULL,'Ballon Adidas Mutombo Vintage','Ballon Adidas Mutombo Vintage',NULL,NULL),(367,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(367,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(367,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(369,1,1,'<p>Year of release: 2011</p>\r\n<p>Limited edition to celebrate 10 ten years of Size?</p>\r\n<p>Advertising, Concept and innovations from Nike and Jordan Basketball for the Last 30 years</p>',NULL,'sole-provider-book-thirty-years-of-nike-basketball','Sole Provider Book - Thirty Years of Nike Basketball 2011',NULL,'Sole Provider Book - Thirty Years of Nike Basketball','Sole Provider - 30 Years of Nike Basketball',NULL,NULL),(369,1,2,'<p>Année de sortie: 2011</p>\r\n<p>Edition Limitée pour célébrer les dix ans de la marque Size?</p>\r\n<p>Ce bouquin met en avant les concepts, innovations et publicités Nike et Jordan dans le monde du Basketball, depuis les 30 dernières années.</p>',NULL,'sole-provider-book-thirty-years-of-nike-basketball','Sole Provider Book - Thirty Years of Nike Basketball 2011',NULL,'Sole Provider Book - Thirty Years of Nike Basketball','Sole Provider - 30 Years of Nike Basketball',NULL,NULL),(369,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(369,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(369,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(375,1,1,'<p>Year of release: 2011</p>\r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2011</p>','air-jordan-iii-black-flip-gs','Nike Air Jordan III Black Flip GS retro AJ 3 2011',NULL,'Air Jordan III Black Flip GS','Air Jordan III Black Flip GS',NULL,NULL),(375,1,2,'<p>Année de sortie: 2011</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2011</p>','air-jordan-iii-black-flip-gs','Nike Air Jordan III Black Flip GS retro AJ 3 2011',NULL,'Air Jordan III Black Flip GS','Air Jordan III Black Flip GS',NULL,NULL),(375,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(375,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(375,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(378,1,1,'<p>About Air Jordan V:</p>\r\n<p>Year of release of OG model: 1989</p>\r\n<p>Designer: Tinker Hatfield<br />Phil Jackson took over as head coach for the Bulls in the 89-90 season. This gave the Bull\'s an extra boost and everything was flying. Jordan kept on playing his game and set a personal best when scoring 69 points in a game against the Cleveland Cavaliers. Once again Hatfield came up with a revolutionary design for the new shoe.</p>\r\n<p>The AJ5 was inspired by World War II Fighter planes (Spitfire WWII) brought to light by The \"reverse flames\". The clear outsole was inspired by the clear panels of Marty MacFly\'s Back to the Future II boots which Tinker had designed for the movie. Tinker put a reflective 3M tongue with Jumpman embroidery. Whenever a photograph flash goes off, the tongue would light up and the tiny Jumpman would be highlighted in the background.</p>','<p>Year of release: 2009</p>','air-jordan-v-raging-bull','Nike Air Jordan V Raging Bull AJ 5 2009',NULL,'Air Jordan V Raging Bull','Air Jordan V Raging Bull',NULL,NULL),(378,1,2,'<p>A propos de la Air Jordan V:</p>\r\n<p>Date de sortie du modèle original: 1989</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Phil Jackson arrive à la tête des Bulls en 1989-90. Ce renfort donne des ailes à l’équipe. Michael Jordan établit un nouveau record personnel de 69 points marqués durant un match, contre les Cleveland Cavaliers. Tinker Hatfield puise cette fois son inspiration dans un avion de combat (le Spitfire WWII ), laissant apparaître des flammes inversées sur le côté de la chaussure. La semelle transparente a été inspirée par la paire de chaussure révolutionnaire (dessinée par Tinker hatfield) portée par Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2009</p>','air-jordan-v-raging-bull','Nike Air Jordan V Raging Bull AJ 5 2009',NULL,'Air Jordan V Raging Bull','Air Jordan V Raging Bull',NULL,NULL),(378,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(378,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(378,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(379,1,1,'<p><span style=\"color: #000000;\">Year of release: 1992</span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p>OG box missing.</p>','<p>Year of release: 1992</p>','adidas-mutombo-black-white-red','Adidas Mutombo OG Black/White/Red Vintage Basketball NBA 1992',NULL,'Adidas Mutombo OG Black/White/Red','Adidas Mutombo Black/White/Red',NULL,NULL),(379,1,2,'<p>Année de sortie: 1992</p>\r\n<p>Boîte d\'origine manquante.</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span></p>','<p>Année de sortie: 1992</p>','adidas-mutombo-black-white-red','Adidas Mutombo OG Black/White/Red Vintage Basketball NBA 1992',NULL,'Adidas Mutombo Black/White/Red','Adidas Mutombo Black/White/Red',NULL,NULL),(379,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(379,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(379,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(380,1,1,'<p>About Air Jordan XI:</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan was back for real and led the Bulls to another NBA victory. What a come back! If Jordan was back, so was Tinker Hatfield. A terrific design with a new patent leather and the return of the clear rubber sole made the Air Jordan XI the most appreciated Air Jordan model ever released. <br />With the XI\'s we also saw the return of low-tops. Something that would follow the Air Jordan\'s all the way to the XVI\'s (though skipping the XII\'s).</p>','<p>Year of release: 2011</p>','air-jordan-xi-concord','Nike Air Jordan XI Concord AJ 11 2011',NULL,'Air Jordan XI Concord','Air Jordan XI Concord',NULL,NULL),(380,1,2,'<p>A propos de la Air Jordan XI:</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan est de retour et il conduit les Bulls à un nouveau titre NBA. Quel retour! Tinker Hatfield est aussi de retour. Un design superbe avec un nouveau cuir verni, on note le retour de la semelle transparente qui fait de la Air Jordan XI le modèle le plus apprécié des Air Jordan. <br />Avec la Jordan XI on remarque aussi  le retour des baskets semi-montantes.  Une forme qui allait perdurer jusque la Jordan XVI (excepté la XII).</p>','<p>Année de sortie: 2011</p>','air-jordan-xi-concord','Nike Air Jordan XI Concord AJ 11 2011',NULL,'Air Jordan XI Concord','Air Jordan XI Concord',NULL,NULL),(380,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(380,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(380,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(381,1,1,'<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2012</p>','air-max-1-prm-green-grey-white','Nike Air Max 1 PRM Green/Grey/White 2012',NULL,'Air Max 1 PRM Green/Grey/White','Air Max 1 PRM Green/Grey/White',NULL,NULL),(381,1,2,'<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2012</p>','air-max-1-prm-green-grey-white','Nike Air Max 1 PRM Green/Grey/White 2012',NULL,'Air Max 1 PRM Green/Grey/White','Air Max 1 PRM Green/Grey/White',NULL,NULL),(381,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(381,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(381,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(382,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-cavs','Nike Air Jordan IV Cavs retro AJ 4 2012 Cleveland Cavaliers the Shot',NULL,'Air Jordan IV Cavs','Air Jordan IV Cavs',NULL,NULL),(382,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-cavs','Nike Air Jordan IV Cavs retro AJ 4 2012 Cleveland Cavaliers the Shot',NULL,'Air Jordan IV Cavs','Air Jordan IV Cavs',NULL,NULL),(382,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(382,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(382,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(384,1,1,'<p>Year of release: 2008</p>\r\n<p> </p>\r\n<p>About Air Tech Challenge II:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>There has been a lot of anticipation and discussion around this Nike Collector shoe release.</p>\r\n<p>This Andre Agassi classic first hit the scene in 1990. That year Andre Agassi lost 2 grand slams finals. The first in Roland Garros against the Ecuadorian Andres Gomez and the second at the U.S. Open against Pete Sampras. The Hot LAVA ATC II is probably the most sought after model in the entire Air Tech line. Nike did an excellent job on this retro which is almost identical to the original model.</p>','<p>Year of release: 2008</p>','air-tech-challenge-ii-hot-lava','Nike Air Tech Challenge II \"Hot Lava\" Agassi Retro 1990',NULL,'Air Tech Challenge II \"Hot Lava\"','Air Tech Challenge II \"Hot Lava\"',NULL,NULL),(384,1,2,'<p>Année de sortie: 2008</p>\r\n<p> </p>\r\n<p>A propos de la Air Tech Challenge II:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Il y a eu beaucoup de discussions autour de la sortie de ce modèle emblématique de chez Nike.</p>\r\n<p>Ce grand classique fut porté par Andre Agassi en 1990. Cette année-là, Agassi perdit 2 finales de Grand Chelem. La première à Roland Garros contre l\'Équatorien Andres Gomez et la deuxième à l\'US Open contre Pete Sampras. La Hot Lava est probablement le modèle le plus recherché dans la gamme Air Tech. Nike a fait un excellent travail sur cette rétro, en effet, la chaussure est quasi-identique à l\'originale.</p>','<p>Année de sortie: 2008</p>','air-tech-challenge-ii-hot-lava','Nike Air Tech Challenge II \"Hot Lava\" Agassi Retro 1990',NULL,'Air Tech Challenge II \"Hot Lava\"','Air Tech Challenge II \"Hot Lava\"',NULL,NULL),(384,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(384,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(384,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(385,1,1,'<p>About Air Jordan XIII:</p>\r\n<p>Year of release of OG model: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>The Air Jordan XIII features quilted leather upper with suede trim and unique hidden lacing system. Low-profile leather wrapped Phylon™ midsole with heel and forefoot Zoom Air™ units. Midfoot carbon fiber composite plate. Tinker Hatfield kept on making original designs. <br />The AJXIII featured a nice hologram on the ankle and the design was inspired by a panther (one of MJ’s nicknames). The outsole with pads like a paw and circles representing whiskers. The hologram shows a basketball; the number 23 &amp; the jumpman logo. On December 30th 1997, Jordan broke Kareem Abdul-Jabbar\'s NBA record, by scoring in double-digits for the 788th consecutive game. He also led the Bulls to their sixth NBA Championship title before retiring from the game (for the second time). We must precise that during the 1998 NBA Finals, which were his last games with the Bulls, MJ was (already) wearing the new Air Jordan XIV.</p>','<p>Year of release: 2011</p>','air-jordan-xiii-ray-allen-pe','Nike Air Jordan XIII Ray Allen PE player limited edition AJ 13 2011',NULL,'Air Jordan XIII Ray Allen PE','Air Jordan XIII Ray Allen PE',NULL,NULL),(385,1,2,'<p>A propos de la Air Jordan XIII:</p>\r\n<p>Date de sortie du modèle original: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan XIII est composée de cuir moltoné et de parties latérales en daim ainsi que d’un système unique dissimulant le laçage. La semelle intermédiaire en Phylon ™, englobe un double système Zoom Air ™ (talon et semelle avant). La partie centrale de la semelle est faite d’une plaque en fibre de carbone composite. Tinker Hatfield continue de proposer des concepts originaux. Le design de la AJXIII s’inspire de l’un des surnoms de Jordan : « the black cat » (la panthère noire). La semelle extérieure rappelle les coussinets et les cercles représentant les moustaches de la panthère. Au niveau de la cheville figure un hologramme faisant apparaître un ballon de basket ; le numéro 23&amp; le logo Jumpman. <br />Le 30 Décembre 1997, Jordan a battu le record de Kareem Abdul-Jabbar en devenant le premier joueur NBA à marquer plus de 10 points au cours de 788 matchs consécutifs. En 1998, il a également emmené les Bulls jusqu’à leur sixième titre de champion NBA avant de prendre sa retraite sportive (pour la deuxième fois). Il faut préciser que lors de son dernier match avec les Bulls, en Finale NBA, MJ portait (déjà) la future Air Jordan XIV.</p>','<p>Année de sortie: 2011</p>','air-jordan-xiii-ray-allen-pe','Nike Air Jordan XIII Ray Allen PE player limited edition AJ 13 2011',NULL,'Air Jordan XIII Ray Allen PE','Air Jordan XIII Ray Allen PE',NULL,NULL),(385,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(385,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(385,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(386,1,1,NULL,'<p>Year of release: 2011</p>','lebron-8-low-sprite','Lebron 8 Low Sprite LB8 Nike Air Lebron James',NULL,'Lebron 8 Low Sprite','Lebron 8 Low Sprite',NULL,NULL),(386,1,2,NULL,'<p>Année de sortie: 2011</p>','lebron-8-low-sprite','Lebron 8 Low Sprite LB8 Nike Air Lebron James',NULL,'Lebron 8 Low Sprite','Lebron 8 Low Sprite',NULL,NULL),(386,1,3,NULL,NULL,'nike-air-lebron-low-8-sprite',NULL,NULL,NULL,'nike air lebron low 8 sprite',NULL,NULL),(386,1,4,NULL,NULL,'nike-air-lebron-low-8-sprite',NULL,NULL,NULL,'nike air lebron low 8 sprite',NULL,NULL),(386,1,5,NULL,NULL,'nike-air-lebron-low-8-sprite',NULL,NULL,NULL,'nike air lebron low 8 sprite',NULL,NULL),(392,1,1,NULL,'<p>Year of release: 2012</p>','reebok-question-mid-white-red','Reebok Question Mid White/Red Allen Iverson 2012',NULL,'Reebok Question Mid White/Red','Reebok Question Mid White/Red',NULL,NULL),(392,1,2,NULL,'<p>Année de sortie: 2012</p>','reebok-question-mid-white-red','Reebok Question Mid White/Red Allen Iverson 2012',NULL,'Reebok Question Mid White/Red','Reebok Question Mid White/Red',NULL,NULL),(392,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(392,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(392,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(395,1,1,'<p>Year of release: 2007</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2007</p>','air-max-1-black-rasta','Nike Air Max 1 Black white yello red green Rastafari exclusive limited edition 2007 AM1 Deadstock',NULL,'Air Max 1 Black \"Rasta\"','Air Max 1 Black \"Rasta\"',NULL,NULL),(395,1,2,'<p>Année de sortie: 2007</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2007</p>','air-max-1-black-rasta','Nike Air Max 1 Black white yello red green Rastafari exclusive limited edition 2007 AM1 Deadstock',NULL,'Air Max 1 Black \"Rasta\"','Air Max 1 Black \"Rasta\"',NULL,NULL),(395,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(395,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(395,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(398,1,1,'<p>Year of release: 2003</p>\r\n<p> </p>\r\n<p>About Air Jordan VIII:</p>\r\n<p>Year of release of OG model: 1992</p>\r\n<p style=\"text-align: justify;\">In 1993, Michael Jordan and the Bulls win their 3rd NBA title in a row against Charles Barkley’s Phoenix Suns. MJ is once again MVP of the NBA finals.</p>\r\n<p style=\"text-align: justify;\">The most popular colorway of Air Jordan VIII, called « Aqua », was only worn once by MJ : during ’93 NBA All Star Game in Salt Lake City.<br />The shoe uses advanced technology, anti-inversion straps, soles in polycarbonate. The colors are even more aggressive. The Air Jordan VIII changed the way high performance shoes were designed technologically and aesthetically. High-top sneaker made of black velours with diagonal <br />applications allover the lacing parts and an additional slim velcro. Perforations on the side parts.</p>','<p>Year of release: 2003</p>','air-jordan-viii-white-black-red-03','Nike Air Jordan VIII White/Black/Red \'03 AJ 8 Deadstock 2003 Bugs Bunny',NULL,'Air Jordan VIII White/Black/Red \'03','Air Jordan VIII White/Black/Red \'03',NULL,NULL),(398,1,2,'<p>Année de sortie: 2003</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VIII:</p>\r\n<p>Date de sortie du modèle original: 1992</p>\r\n<p style=\"text-align: justify;\">A l’issue de la saison 1992-93, Micheal Jordan et les Bulls remportent leur 3ème titre NBA consécutif, face aux Phoenix Suns emmenés par Charles Barkley. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p style=\"text-align: justify;\">Le colori le plus populaire parmi les Air Jordan VIII, appelé « Aqua », a été porté une seule fois par MJ lors du NBA All Star Game ’93 à Salt Lake City. <br />La chaussure emploie des technologies de pointe pour l\'époque : des straps inédits et une semelle en polycarbonate. Les couleurs sont encore plus agressives. La Air Jordan VIII a changé la façon dont les chaussures de haute performance étaient conçues, techniquement et esthétiquement.</p>','<p>Année de sortie: 2003</p>','air-jordan-viii-white-black-red-03','Nike Air Jordan VIII White/Black/Red \'03 AJ 8 Deadstock 2003 Bugs Bunny',NULL,'Air Jordan VIII White/Black/Red \'03','Air Jordan VIII White/Black/Red \'03',NULL,NULL),(398,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(398,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(398,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(399,1,1,'<p>Year of release: 2002</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2002</p>','air-jordan-vii-raptor-02','Nike Air Jordan VII Raptor \'02 AJ 7 2002 Charcoal Deadstock',NULL,'Air Jordan VII Raptor \'02','Air Jordan VII Raptor \'02',NULL,NULL),(399,1,2,'<p>Année de sortie: 2002</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p style=\"text-align: justify;\">Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2002</p>','air-jordan-vii-raptor-02','Nike Air Jordan VII Raptor \'02 AJ 7 2002 Charcoal Deadstock',NULL,'Air Jordan VII Raptor \'02','Air Jordan VII Raptor \'02',NULL,NULL),(399,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(399,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(399,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(400,1,1,'<p>Year of release: 2004</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2004</p>','air-jordan-vii-olympic-04','Nike Air Jordan VII Olympic \'04 AJ 7 2004 Deadstock Barcelona Olympics 1992 Gold Medal Dream Team',NULL,'Air Jordan VII Olympic \'04','Air Jordan VII Olympic \'04',NULL,NULL),(400,1,2,'<p>Année de sortie: 2004</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p style=\"text-align: justify;\">Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2004</p>','air-jordan-vii-olympic-04','Nike Air Jordan VII Olympic \'04 AJ 7 2004 Deadstock Barcelona Olympics 1992 Gold Medal Dream Team',NULL,'Air Jordan VII Olympic \'04','Air Jordan VII Olympic \'04',NULL,NULL),(400,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(400,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(400,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(401,1,1,'<p>Year of release: 2006</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p style=\"text-align: justify;\">This Air Max 95 is a collab\' between graffiti artist Stash and Nike. Stash (A.K.A. Josh Franklin) is a graffiti artist/designer from New York who became famous during the 1980\'s. He\'s the co-founder of Recon and collaborates with Nike et Bathing Ape, among others.</p>\r\n<p style=\"text-align: justify;\">The Air Max 95 x Stash was the first to feature a speckled midsole. As many of his creations, the pair\'s colourway is composed of several shades of blue.</p>\r\n<p style=\"text-align: justify;\">Limited edition.</p>','<p>Year of release: 2006</p>','air-max-95-x-stash','Nike Air Max 95 x Stash harbor blue/black-varsity royal-midnight navy 2006',NULL,'Air Max 95 x Stash','Air Max 95 x Stash',NULL,NULL),(401,1,2,'<p>Année de sortie: 2006</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p style=\"text-align: justify;\">Cette Air Max 95 est le résultat d\'une collaboration entre l\'artiste Stash et Nike. Stash (de son vrai nom Josh Franklin) est un graffeur/designer New Yorkais qui s\'est fait connaître dans les années 1980. Il est l\'un des fondateurs de la marque Recon et collabore notamment avec Nike et Bathing Ape.</p>\r\n<p style=\"text-align: justify;\">La Air Max 95 x Stash a été la première Air Max 95 avec une semelle intermédiaire mouchetée. Comme sur la majorité des modèles signés par l\'artiste, la paire présente plusieurs nuances de bleu.</p>\r\n<p style=\"text-align: justify;\">Edition limitée.</p>','<p>Année de sortie: 2006</p>','air-max-95-x-stash','Nike Air Max 95 x Stash harbor blue/black-varsity royal-midnight navy 2006',NULL,'Air Max 95 x Stash','Air Max 95 x Stash',NULL,NULL),(401,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(401,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(401,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(402,1,1,'<p>Year of release: 1999</p>\r\n<p>Retro card and Nike Air tag included.</p>\r\n<p>OG box missing, delivered in a Jordan replacing box.</p>\r\n<p> </p>\r\n<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p style=\"text-align: justify;\">Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 1999</p>','air-jordan-iv-black-cement-99','Nike Air Jordan IV Black/Cement Grey \'99 retro AJ4 1999 Bred',NULL,'Air Jordan IV Black/Cement \'99','Air Jordan IV Black/Cement \'99',NULL,NULL),(402,1,2,'<p>Année de sortie: 1999</p>\r\n<p>Retro card et tag Nike Air inclus</p>\r\n<p>Boîte d\'origine manquante, livrée dans une boîte Jordan de remplacement.</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p style=\"text-align: justify;\">Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p style=\"text-align: justify;\">Système de stabilisation en plastique.</p>\r\n<p style=\"text-align: justify;\">Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p style=\"text-align: justify;\">Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 1999</p>','air-jordan-iv-black-cement-99','Nike Air Jordan IV Black/Cement Grey \'99 retro AJ4 1999 Bred',NULL,'Air Jordan IV Black/Cement \'99','Air Jordan IV Black/Cement \'99',NULL,NULL),(402,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(402,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(402,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(403,1,1,'<p>Year of release: 2006</p>\r\n<p>Limited retro edition of the famous model worn by Michael Chang back in the days (in the beginning of the 90\'s). This colorway is a collab\' between Reebok and Alife brand.</p>','<p>Year of release: 2006</p>','reebok-pump-court-victory-x-alife-tennis-ball-white','Reebok Pump Court Victory x Alife \"Tennis Ball\" White Limited edition white michael chang 1990',NULL,'Reebok Pump Court Victory x Alife \"Tennis Ball\" White','Reebok Pump Court Victory x Alife \"Tennis Ball\" White',NULL,NULL),(403,1,2,'<p>Année de sortie: 2006</p>\r\n<p>Ce modèle retro est une édition limitée des Court Victory portées par Michael Chang au début des années 90. Il s\'agit d\'une collab\' entre Reebok et Alife.</p>','<p>Année de sortie: 2006</p>','reebok-pump-court-victory-x-alife-tennis-ball-white','Reebok Pump Court Victory x Alife \"Tennis Ball\" White Limited edition white michael chang 1990',NULL,'Reebok Pump Court Victory x Alife \"Tennis Ball\" White','Reebok Pump Court Victory x Alife \"Tennis Ball\" White',NULL,NULL),(403,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(403,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(403,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(404,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','reebok-pump-twilight-zone-white-grey-red','Reebok Pump Twilight Zone White/Grey/Red 1991',NULL,'Reebok Pump Twilight Zone White/Grey/Red','Reebok Pump Twilight Zone White/Grey/Red',NULL,NULL),(404,1,2,'<p>Année de sortie: 2012</p>','<p>Année de sortie: 2012</p>','reebok-pump-twilight-zone-white-grey-red','Reebok Pump Twilight Zone White/Grey/Red 1991',NULL,'Reebok Pump Twilight Zone White/Grey/Red','Reebok Pump Twilight Zone White/Grey/Red',NULL,NULL),(404,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(404,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(404,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(406,1,1,'<p>Year of release: 2004</p>\r\n<p> </p>\r\n<p>About Air Jordan XIII:</p>\r\n<p>Year of release of OG model: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">The Air Jordan XIII features quilted leather upper with suede trim and unique hidden lacing system. Low-profile leather wrapped Phylon™ midsole with heel and forefoot Zoom Air™ units. Midfoot carbon fiber composite plate. Tinker Hatfield kept on making original designs. <br />The AJXIII featured a nice hologram on the ankle and the design was inspired by a panther (one of MJ’s nicknames). The outsole with pads like a paw and circles representing whiskers. The hologram shows a basketball; the number 23 &amp; the jumpman logo. On December 30th 1997, Jordan broke Kareem Abdul-Jabbar\'s NBA record, by scoring in double-digits for the 788th consecutive game. He also led the Bulls to their sixth NBA Championship title before retiring from the game (for the second time). We must precise that during the 1998 NBA Finals, which were his last games with the Bulls, MJ was (already) wearing the new Air Jordan XIV.</p>','<p>Year of release: 2004</p>','air-jordan-xiii-black-true-red-04','Nike Air Jordan XIII Black/True Red \'04 AJ 13 2004 Deadstock',NULL,'Air Jordan XIII Black/True Red \'04','Air Jordan XIII Black/True Red \'04',NULL,NULL),(406,1,2,'<p>Année de sortie: 2004</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan XIII:</p>\r\n<p>Date de sortie du modèle original: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">La Air Jordan XIII est composée de cuir moltoné et de parties latérales en daim ainsi que d’un système unique dissimulant le laçage. La semelle intermédiaire en Phylon ™, englobe un double système Zoom Air ™ (talon et semelle avant). La partie centrale de la semelle est faite d’une plaque en fibre de carbone composite. Tinker Hatfield continue de proposer des concepts originaux. Le design de la AJXIII s’inspire de l’un des surnoms de Jordan : « the black cat » (la panthère noire). La semelle extérieure rappelle les coussinets et les cercles représentant les moustaches de la panthère. Au niveau de la cheville figure un hologramme faisant apparaître un ballon de basket ; le numéro 23&amp; le logo Jumpman. <br />Le 30 Décembre 1997, Jordan a battu le record de Kareem Abdul-Jabbar en devenant le premier joueur NBA à marquer plus de 10 points au cours de 788 matchs consécutifs. En 1998, il a également emmené les Bulls jusqu’à leur sixième titre de champion NBA avant de prendre sa retraite sportive (pour la deuxième fois). Il faut préciser que lors de son dernier match avec les Bulls, en Finale NBA, MJ portait (déjà) la future Air Jordan XIV.</p>','<p>Année de sortie: 2004</p>','air-jordan-xiii-black-true-red-04','Nike Air Jordan XIII Black/True Red \'04 AJ 13 2004 Deadstock',NULL,'Air Jordan XIII Black/True Red \'04','Air Jordan XIII Black/True Red \'04',NULL,NULL),(406,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(406,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(406,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(407,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','lebron-9-low-floridians','Lebron 9 Low Miami Floridians 2012 LB9 Lebron James',NULL,'Lebron 9 Low Floridians','Lebron 9 Low Floridians',NULL,NULL),(407,1,2,'<p>Année de sortie: 2012</p>','<p>Année de sortie: 2012</p>','lebron-9-low-floridians','Lebron 9 Low Miami Floridians 2012 LB9 Lebron James',NULL,'Lebron 9 Low Floridians','Lebron 9 Low Floridians',NULL,NULL),(407,1,3,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(407,1,4,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(407,1,5,NULL,NULL,'nike-air-lebron-9-galaxy',NULL,NULL,NULL,'nike air lebron 9 Galaxy',NULL,NULL),(408,1,1,'<p>Year of release: 2007</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2007</p>','air-max-1-kakigoori-pack','Nike Air Max 1 Kakigoori Pack rainbow white yellow blue orange exclusive limited edition 2007 AM1 Deadstock',NULL,'Air Max 1 Kakigoori Pack','Air Max 1 Kakigoori Pack',NULL,NULL),(408,1,2,'<p>Année de sortie: 2007</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2007</p>','air-max-1-kakigoori-pack','Nike Air Max 1 Kakigoori Pack rainbow white yellow blue orange exclusive limited edition 2007 AM1 Deadstock',NULL,'Air Max 1 Kakigoori Pack','Air Max 1 Kakigoori Pack',NULL,NULL),(408,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(408,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(408,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(409,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','air-force-180-mid-black-atomic-teal-violet','Nike Air Force 180 Mid Black/Atomic Teal/Violet Aqua 2013 David Robinson Retro',NULL,'Air Force 180 Mid Black/Atomic Teal/Violet','Air Force 180 Mid Black/Atomic Teal/Violet',NULL,NULL),(409,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','air-force-180-mid-black-atomic-teal-violet','Nike Air Force 180 Mid Black/Atomic Teal/Violet Aqua 2013 David Robinson Retro',NULL,'Air Force 180 Mid Black/Atomic Teal/Violet','Air Force 180 Mid Black/Atomic Teal/Violet',NULL,NULL),(409,1,3,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(409,1,4,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(409,1,5,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S El