-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(412,1,1,NULL,'<p>Year of release: 2012</p>','air-foamposite-pro-crimson','Nike Air Foamposite Pro \"Crimson\" 2012',NULL,'Air Foamposite Pro \"Crimson\"','Air Foamposite Pro \"Crimson\"',NULL,NULL),(412,1,2,NULL,'<p>Année de sortie: 2012</p>','air-foamposite-pro-crimson','Nike Air Foamposite Pro \"Crimson\" 2012',NULL,'Air Foamposite Pro \"Crimson\"','Air Foamposite Pro \"Crimson\"',NULL,NULL),(412,1,3,NULL,NULL,'nike-air-foamposite-pro-crimson',NULL,NULL,NULL,'nike air foamposite pro crimson',NULL,NULL),(412,1,4,NULL,NULL,'nike-air-foamposite-pro-crimson',NULL,NULL,NULL,'nike air foamposite pro crimson',NULL,NULL),(412,1,5,NULL,NULL,'nike-air-foamposite-pro-crimson',NULL,NULL,NULL,'nike air foamposite pro crimson',NULL,NULL),(413,1,1,NULL,'<p>Year of release: 2012</p>','puma-disc-blaze-og-cove-x-ronnie-fieg','Puma Disc Blaze OG “Cove” x Ronnie Fieg Black Blue the Cove 2012 Limited Edition',NULL,'Puma Disc Blaze OG “Cove” x Ronnie Fieg','Puma Disc Blaze OG “Cove” x Ronnie Fieg',NULL,NULL),(413,1,2,NULL,'<p>Année de sortie: 2012</p>','puma-disc-blaze-og-cove-x-ronnie-fieg','Puma Disc Blaze OG “Cove” x Ronnie Fieg Black Blue the Cove 2012 Limited Edition',NULL,'Puma Disc Blaze OG “Cove” x Ronnie Fieg','Puma Disc Blaze OG “Cove” x Ronnie Fieg',NULL,NULL),(413,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(413,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(413,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(415,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','asics-gel-saga-navy-lime-green-sprite','Asics Gel Saga Navy/Lime Green \"Sprite\" 2013 GL3 Running retro',NULL,'Asics Gel Saga Navy/Lime Green \"Sprite\"','Asics Gel Saga Navy/Lime Green \"Sprite\"',NULL,NULL),(415,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','asics-gel-saga-navy-lime-green-sprite','Asics Gel Saga Navy/Lime Green \"Sprite\" 2013 GL3 Running retro',NULL,'Asics Gel Saga Navy/Lime Green \"Sprite\"','Asics Gel Saga Navy/Lime Green \"Sprite\"',NULL,NULL),(415,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(415,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(415,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(420,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About ZX 8000:<br />Year of release of OG Model: 1988</p>\r\n<p style=\"text-align: justify;\"><br />The Adidas ZX8000 was produced in 1988 and was the first in a series of Adidas shoes to use the company’s Torsion system, designed specifically to support the midfoot and allow movement. Not only does the system help to improve running technique, but it also reduces the volume of midsole material in the midfoot area, resulting in a lighter shoe. It is visble on the bottom of the outsole and can even be touched.<br /><br /></p>','<p>Year of release: 2012</p>','adidas-torsion-zx8000-white-red-black','Adidas Torsion ZX8000 White/Red/Black 2012 running adi archive',NULL,'Adidas Torsion ZX8000 White/Red/Black','Adidas Torsion ZX8000 White/Red/Black',NULL,NULL),(420,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">A propos de la ZX 8000:</p>\r\n<p style=\"text-align: justify;\">Année de sortie du modèle original: 1988</p>\r\n<p style=\"text-align: justify;\"><br />La ZX8000 a été produite en 1988 et a été la première à utiliser le système Adidas torsion, conçu spécifiquement pour soutenir la plante du pied et permettre le mouvement. Non seulement le système aide à améliorer la technique de course, mais il réduit également le volume de la semelle au niveau de la plante des pieds, permettant une grande légèreté. Ce système est visible au fond de la semelle et peut même être touché.</p>','<p>Année de sortie: 2012</p>','adidas-torsion-zx8000-white-red-black','Adidas Torsion ZX8000 White/Red/Black 2012 running adi archive',NULL,'Adidas Torsion ZX8000 White/Red/Black','Adidas Torsion ZX8000 White/Red/Black',NULL,NULL),(420,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(420,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(420,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(421,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About ZX 8000:<br />Year of release of OG Model: 1988</p>\r\n<p style=\"text-align: justify;\"><br />The Adidas ZX8000 was produced in 1988 and was the first in a series of Adidas shoes to use the company’s Torsion system, designed specifically to support the midfoot and allow movement. Not only does the system help to improve running technique, but it also reduces the volume of midsole material in the midfoot area, resulting in a lighter shoe. It is visble on the bottom of the outsole and can even be touched.<br /><br /></p>','<p>Year of release: 2012</p>','adidas-torsion-zx8000-blue-orange-black','Adidas Torsion ZX8000 Blue/Orange/Black 2012 running adi archive',NULL,'Adidas Torsion ZX8000 Blue/Orange/Black','Adidas Torsion ZX8000 Blue/Orange/Black',NULL,NULL),(421,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la ZX 8000:<br />Année de sortie du modèle original: 1988</p>\r\n<p style=\"text-align: justify;\"><br />La ZX8000 a été produite en 1988 et a été la première à utiliser le système Adidas torsion, conçu spécifiquement pour soutenir la plante du pied et permettre le mouvement. Non seulement le système aide à améliorer la technique de course, mais il réduit également le volume de la semelle au niveau de la plante des pieds, permettant une grande légèreté. Ce système est visible au fond de la semelle et peut même être touché.</p>','<p>Année de sortie: 2012</p>','adidas-torsion-zx8000-blue-orange-black','Adidas Torsion ZX8000 Blue/Orange/Black 2012 running adi archive',NULL,'Adidas Torsion ZX8000 Blue/Orange/Black','Adidas Torsion ZX8000 Blue/Orange/Black',NULL,NULL),(421,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(421,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(421,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(422,1,1,'<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2010</p>','air-jordan-vi-black-varsity-red','Nike Air Jordan VI Black/Varsity Red AJ 6 2010 Bulls',NULL,'Air Jordan VI Black/Varsity Red','Air Jordan VI Black/Varsity Red',NULL,NULL),(422,1,2,'<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2010</p>','air-jordan-vi-black-varsity-red','Nike Air Jordan VI Black/Varsity Red AJ 6 2010 Bulls',NULL,'Air Jordan VI Black/Varsity Red','Air Jordan VI Black/Varsity Red',NULL,NULL),(422,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(422,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(422,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(423,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2013</p>','asics-gel-lyte-iii-grey-royal-blue','Asics Gel Lyte III Grey/Royal Blue 2013 Green/Pink',NULL,'Asics Gel Lyte III Grey/Royal Blue','Asics Gel Lyte III Grey/Royal Blue',NULL,NULL),(423,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2013</p>','asics-gel-lyte-iii-grey-royal-blue','Asics Gel Lyte III Grey/Royal Blue 2013 Green/Pink',NULL,'Asics Gel Lyte III Grey/Royal Blue','Asics Gel Lyte III Grey/Royal Blue',NULL,NULL),(423,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(423,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(423,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(424,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2013</p>','asics-gel-lyte-iii-navy-orange','Asics Gel Lyte III Navy/Orange 2013 Blue Suede',NULL,'Asics Gel Lyte III Navy/Orange','Asics Gel Lyte III Navy/Orange',NULL,NULL),(424,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2013</p>','asics-gel-lyte-iii-navy-orange','Asics Gel Lyte III Navy/Orange 2013 Blue Suede',NULL,'Asics Gel Lyte III Navy/Orange','Asics Gel Lyte III Navy/Orange',NULL,NULL),(424,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(424,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(424,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(425,1,1,'<p>About Air Jordan IX:</p>\r\n<p>Year of release of OG model: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This pair was released in late 1993. Some weeks before its release, MJ had announced his retirement from the NBA at 30 (following the death of his father, murdered in North <br />Carolina). Therefore, this is the first shoe he did not wear in an NBA season game, but some other players did, such as Penny Hardaway, Kendall Gill or Mitch Richmond. As MJ then decided to start a new career in Baseball, Nike created a version of the model with cleats.</p>\r\n<p>The shoe uses advanced technology: dynamic-Fit inner bootie, encapsulated Air-Sole unit (forefoot), large volume Air-Sole unit (heel), polyurethane midsole and “one-pull” lacing system. Tinker Hatfield said he was inspired by Japanese design to create this model, a way for him to <br />show that MJ had become a worldwide icon. This is also shown on the soles that feature words like « freedom », « independance », « force » and « athletic » in several languages from every continent.</p>','<p>Year of release: 2012</p>','air-jordan-ix-motorboat-jones','Nike Air Jordan IX Motorboat Jones Johnny Kilroy Pack AJ 9 2012',NULL,'Air Jordan IX Motorboat Jones','Air Jordan IX Motorboat Jones',NULL,NULL),(425,1,2,'<p>A propos de la Air Jordan IX:</p>\r\n<p>Date de sortie du modèle original: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan IX est sortie fin 1993. Quelques semaines avant sa sortie, MJ avait annoncé sa retraite à l’âge de 30 ans (après le décès de son père, assassiné en Caroline du Nord). Par conséquent, il s\'agit de la première Air Jordan qu’il n’ait pas portée lors d’un match officiel, mais d’autres joueurs, tels que Penny Hardaway, Kendall Gill ou Mitch Richmond, l’ont étrennée sur les parquets NBA. Comme MJ avait alors décidé de se lancer dans le baseball, Nike a spécialement créé une version du modèle avec des crampons. La chaussure utilise des technologies avancées: chausson interne « dynamique-Fit », double système Air-Sole intégré (un à l’avant-pied et un grand au talon), midsole en polyuréthanne et système de laçage \"one pull\". Tinker Hatfield a dit s’être inspiré du design japonais pour la conception de ce modèle, une façon pour lui de montrer que MJ était devenu une icône dans le monde entier. Ceci est également mis en avant sur les semelles qui comportent des mots comme «liberté», «indépendance», «force» et «athlétique» dans différentes langues venues des quatre coins du monde.</p>','<p>Année de sortie: 2012</p>','air-jordan-ix-motorboat-jones','Nike Air Jordan IX Motorboat Jones Johnny Kilroy Pack AJ 9 2012',NULL,'Air Jordan IX Motorboat Jones','Air Jordan IX Motorboat Jones',NULL,NULL),(425,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(425,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(425,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(429,1,1,'<p> </p>\r\n<p style=\"text-align: justify;\">Year of release: 2012</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">About Pre Montreal Racer:</p>\r\n<p style=\"text-align: justify;\">Year of release of OG model: 1973</p>\r\n<p style=\"text-align: justify;\">Montreal racer is among the first running shoes released by Nike (after the Cortez). The \"Pre\" in the name of the shoe refers to American long distance runner Steve Prefontaine, who was trained by Bill Bowerman in Oregon University in the beginning of the 70\'s.</p>\r\n<p style=\"text-align: justify;\">In 1972, he set a new US record of the 5000m that allowed him to participate to Munich Olympic Games, but he did not succeed to win a medal, as he finished at the 4th place. After the race, he promised to win in Montreal in 1976. He was supposed to wear this running shoe in Montreal Olympics but was unfortunately killed in a car accident in 1975. He remains very famous in the US for being one of the first major long distance runners.</p>\r\n<p> </p>','<p>Year of release: 2012</p>','pre-montreal-racer-vintage-blue-red-white','Nike Pre Montreal Racer Vintage Blue/Red/White Retro 2012',NULL,'Pre Montreal Racer Vintage Blue/Red/White','Pre Montreal Racer Vintage Blue/Red/White',NULL,NULL),(429,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">A propos de la Pre Montreal Racer:</p>\r\n<p style=\"text-align: justify;\">Date de sortie du modèle original: 1973</p>\r\n<p style=\"text-align: justify;\">La Montreal racer fait partie des premiers modèles running sortis par Nike (après la Cortez). Le terme \"Pre\" dans le nom du modèle fait référence à Steve Prefontaine, star Américaine des courses de fond, entrainé par Bill Bowerman (co-fondateur de Blue Ribbon Sport, devenu Nike en 1972) à l\'Université d\'Oregon au début des années 1970.</p>\r\n<p style=\"text-align: justify;\">En 1972, il bat le record des Etats Unis du 5000m, ce qui lui permet d\'être qualifié pour les Jeux Olympiques de Munich, où il ne gagnera pas de médaille et terminera à la quatrième place. Après cette course, il promit de gagner à Montreal en 1976. Il devait porter cette paire lors des Jeux Olympiques de Montreal mais il se tua dans un accident de voiture en 1975. Il reste très populaire aux Etats Unis pour avoir été parmi les premiers coureurs de fond américains.</p>','<p>Année de sortie: 2012</p>','pre-montreal-racer-vintage-blue-red-white','Nike Pre Montreal Racer Vintage Blue/Red/White Retro 2012',NULL,'Pre Montreal Racer Vintage Blue/Red/White','Pre Montreal Racer Vintage Blue/Red/White',NULL,NULL),(429,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(429,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(429,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(430,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About ZX 8000:<br />Year of release of OG Model: 1988</p>\r\n<p style=\"text-align: justify;\"><br />The Adidas ZX8000 was produced in 1988 and was the first in a series of Adidas shoes to use the company’s Torsion system, designed specifically to support the midfoot and allow movement. Not only does the system help to improve running technique, but it also reduces the volume of midsole material in the midfoot area, resulting in a lighter shoe. It is visble on the bottom of the outsole and can even be touched.</p>','<p>Year of release: 2013</p>','adidas-torsion-zx8000-laqua-blue-yellow','Adidas Torsion ZX8000 Laqua Blue/Yellow 2013 running adi archive retro',NULL,'Adidas Torsion ZX8000 Laqua Blue/Yellow','Adidas Torsion ZX8000 Laqua Blue/Yellow',NULL,NULL),(430,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la ZX 8000:<br />Année de sortie du modèle original: 1988</p>\r\n<p style=\"text-align: justify;\"><br />La ZX8000 a été produite en 1988 et a été la première à utiliser le système Adidas torsion, conçu spécifiquement pour soutenir la plante du pied et permettre le mouvement. Non seulement le système aide à améliorer la technique de course, mais il réduit également le volume de la semelle au niveau de la plante des pieds, permettant une grande légèreté. Ce système est visible au fond de la semelle et peut même être touché.</p>','<p>Année de sortie: 2013</p>','adidas-torsion-zx8000-laqua-blue-yellow','Adidas Torsion ZX8000 Laqua Blue/Yellow 2013 running adi archive retro',NULL,'Adidas Torsion ZX8000 Laqua Blue/Yellow','Adidas Torsion ZX8000 Laqua Blue/Yellow',NULL,NULL),(430,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(430,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(430,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(431,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">About ZX 8000:<br />Year of release of OG Model: 1988</p>\r\n<p style=\"text-align: justify;\"><br />The Adidas ZX8000 was produced in 1988 and was the first in a series of Adidas shoes to use the company’s Torsion system, designed specifically to support the midfoot and allow movement. Not only does the system help to improve running technique, but it also reduces the volume of midsole material in the midfoot area, resulting in a lighter shoe. It is visble on the bottom of the outsole and can even be touched.<br /><br /></p>','<p>Year of release: 2013</p>','adidas-torsion-zx8000-white-navy-yellow','Adidas Torsion ZX8000 White/Navy/Yellow 2013 running adi archive retro',NULL,'Adidas Torsion ZX8000 White/Navy/Yellow','Adidas Torsion ZX8000 White/Navy/Yellow',NULL,NULL),(431,1,2,'<p>Année de sortie: 2013</p>\r\n<p>A propos de la ZX 8000:<br />Année de sortie du modèle original: 1988</p>\r\n<p style=\"text-align: justify;\"><br />La ZX8000 a été produite en 1988 et a été la première à utiliser le système Adidas torsion, conçu spécifiquement pour soutenir la plante du pied et permettre le mouvement. Non seulement le système aide à améliorer la technique de course, mais il réduit également le volume de la semelle au niveau de la plante des pieds, permettant une grande légèreté. Ce système est visible au fond de la semelle et peut même être touché.</p>','<p>Année de sortie: 2013</p>','adidas-torsion-zx8000-white-navy-yellow','Adidas Torsion ZX8000 White/Navy/Yellow 2013 running adi archive retro',NULL,'Adidas Torsion ZX8000 White/Navy/Yellow','Adidas Torsion ZX8000 White/Navy/Yellow',NULL,NULL),(431,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(431,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(431,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(432,1,1,'<p>Year of release: 2011</p>','<p>Year of release: 2011</p>','new-balance-m1500-black-grey-red','New Balance M1500 Black/Grey/Red 2011 RBB',NULL,'New Balance M1500 Black/Grey/Red 2011','New Balance M1500 Black/Grey/Red',NULL,NULL),(432,1,2,'<p class=\"Style7\">Année de sortie: 2011</p>','<p>Année de sortie: 2011</p>','new-balance-m1500-black-grey-red','New Balance M1500 Black/Grey/Red 2011 RBB',NULL,'New Balance M1500 Black/Grey/Red','New Balance M1500 Black/Grey/Red',NULL,NULL),(432,1,3,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(432,1,4,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(432,1,5,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(433,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','new-balance-m1500-mahogany-white-curry','New Balance M1500 \"Mahogany\" White/Curry 2013 TWS',NULL,'New Balance M1500 \"Mahogany\" White/Curry','New Balance M1500 \"Mahogany\" White/Curry',NULL,NULL),(433,1,2,'<p class=\"Style7\">Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','new-balance-m1500-mahogany-white-curry','New Balance M1500 \"Mahogany\" White/Curry 2013 TWS',NULL,'New Balance M1500 \"Mahogany\" White/Curry','New Balance M1500 \"Mahogany\" White/Curry',NULL,NULL),(433,1,3,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(433,1,4,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(433,1,5,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(435,1,1,'<p>Year of release: 2013</p>\r\n<p><span class=\"Style8\">Sneaker Freaker Special Edition to celebrate Pony\'s 40th Anniversary.<br /></span></p>',NULL,'sneaker-freaker-x-pony-40th-anniversary','Sneaker Freaker x Pony 40th Anniversary Book 2013 SF',NULL,'Sneaker Freaker x Pony 40th Anniversary','Sneaker Freaker x Pony 40th Anniversary',NULL,NULL),(435,1,2,'<p>Année de sortie: 2013</p>\r\n<p><span class=\"Style8\">Hors série Sneaker Freaker pour les 40 ans de la marque Pony.</span></p>',NULL,'sneaker-freaker-x-pony-40th-anniversary','Sneaker Freaker x Pony 40th Anniversary Book 2013 SF',NULL,'Sneaker Freaker x Pony 40th Anniversary','Sneaker Freaker x Pony 40th Anniversary',NULL,NULL),(435,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(435,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(435,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(436,1,1,'<p>Année de sortie: 2013</p>\r\n<p><span class=\"Style8\">Sneaker Freaker #25<br /></span></p>',NULL,'sneaker-freaker-issue-25-patrick-ewing','Sneaker Freaker Issue 25 - Patrick Ewing Book 2013 SF',NULL,'Sneaker Freaker Issue 25 - Patrick Ewing','Sneaker Freaker Issue 25 - Patrick Ewing',NULL,NULL),(436,1,2,'<p>Année de sortie: 2013</p>\r\n<p><span class=\"Style8\">Sneaker Freaker #25<br /></span></p>',NULL,'sneaker-freaker-issue-25-patrick-ewing','Sneaker Freaker Issue 25 - Patrick Ewing Book 2013 SF',NULL,'Sneaker Freaker Issue 25 - Patrick Ewing','Sneaker Freaker Issue 25 - Patrick Ewing',NULL,NULL),(436,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(436,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(436,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(438,1,1,'<p>Year of release: 2007</p>\r\n<p> </p>\r\n<p>About Air Tech Challenge IV:</p>\r\n<p>Year of release of OG Model: 1991</p>\r\n<p>1990-91 version dedicated to the tennis star André Agassi, who rocked this great sneaker. This season he won four tournaments but failed two grand slams finals (Roland Garros &amp; US Open). Air tech challenge models first fallen. Colours and patterns used are the same as the previous version. Neon yellow and purple zigzagging, retro stripe that connects the side and heel parts. You can notice some design modfications as the yellow tennis ball and the swoosh on the heel. Very special, light and solid sneaker! Should be part of every collection as this combines details and function to a masterpiece of sneaker culture!</p>','<p>Year of release: 2007</p>','air-tech-challenge-iv-white-black-sonic-yellow','Nike Air Tech Challenge IV White/Black/Sonic Yellow Agassi Retro 1991',NULL,'Air Tech Challenge IV White/Black/Sonic Yellow','Air Tech Challenge IV White/Black/Sonic Yellow',NULL,NULL),(438,1,2,'<p>Année de sortie: 2007</p>\r\n<p> </p>\r\n<p>A propos de la Air Tech Challenge IV:</p>\r\n<p>Année de sortie du modèle original: 1991</p>\r\n<p>André Agassi porta ces sneakers pendant la saison 1990-1991 durant laquelle il remporta quatre tournois mais perdit deux finales de tournois du grand chelem (Roland Garros &amp; US Open). Ce modèle est la première release des modèles Air tech challenge. Les couleurs et motifs utilisés sont les mêmes que ceux sortis à l\'époque, des bandes rétros jaunes fluos et rétros violettes en zigzag sur les côtés et sur le talon.</p>\r\n<p>Ce modèle a tout de même connu quelques modifications par rapport au modèle original comme la balle de tennis et la virgule Nike sur le talon. Il s’agit d’une chaussure très spéciale, légère et solide ! Ce modèle est une pièce maîtresse dans le monde et la culture sneakers!</p>','<p>Année de sortie: 2007</p>','air-tech-challenge-iv-white-black-sonic-yellow','Nike Air Tech Challenge IV White/Black/Sonic Yellow Agassi Retro 1991',NULL,'Air Tech Challenge IV White/Black/Sonic Yellow','Air Tech Challenge IV White/Black/Sonic Yellow',NULL,NULL),(438,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(438,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(438,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(440,1,1,'<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2013</p>','air-jordan-iii-white-cement-retro-88','Nike Air Jordan III White/Cement Retro \'88 AJ 3 2013 1988 OG',NULL,'Air Jordan III White/Cement Retro \'88','Air Jordan III White/Cement Retro \'88',NULL,NULL),(440,1,2,'<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2013</p>','air-jordan-iii-white-cement-retro-88','Nike Air Jordan III White/Cement Retro \'88 AJ 3 2013 1988 OG',NULL,'Air Jordan III White/Cement Retro \'88','Air Jordan III White/Cement Retro \'88',NULL,NULL),(440,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(440,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(440,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(441,1,1,'<p>Year of release: 1989</p>\r\n<p>Nike Challenge Court Vintage Racquet Bag, brought to light by Andre Agassi in the late 80\'s.</p>\r\n<p>100% cotton</p>','<p>Year of release: 1989</p>','tennis-racquet-bag-nike-challenge-court-denim','Tennis Racquet Bag Nike Challenge Court Denim Andre Agassi Vintage 1989',NULL,'Tennis Racquet Bag Nike Challenge Court Denim','Tennis Racquet Bag Nike Challenge Court Denim',NULL,NULL),(441,1,2,'<p>Année de sortie: 1989</p>\r\n<p>Sac Vintage Nike Challenge Court, rendu célèbre par Andre Agassi à la fin des années 80.</p>\r\n<p>100% coton</p>','<p>Année de sortie: 1989</p>','sac-de-tennis-nike-challenge-court-denim','Sac de Tennis Nike Challenge Court Denim Neon Colors Tennis Racquet Bag Vintage',NULL,'Sac de Tennis Nike Challenge Court Denim Vintage','Sac de Tennis Nike Challenge Court Denim',NULL,NULL),(441,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(441,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(441,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(445,1,1,'<p>Year of release: 1991</p>\r\n<p>David Wheaton &amp; Jim Courier collection</p>\r\n<p>Size: Large</p>\r\n<p> </p>','<p>Year of release: 1991</p>','t-shirt-nike-supreme-court-purple','T-shirt Nike Supreme Court Purple Tennis Vintage 1991',NULL,'T-shirt Nike Supreme Court Purple','T-shirt Nike Supreme Court Purple',NULL,NULL),(445,1,2,'<p>Année de sortie: 1991</p>\r\n<p>Collection David Wheaton &amp; Jim Courier</p>\r\n<p>Taille: Large</p>\r\n<p> </p>\r\n<p> </p>','<p>Année de sortie: 1991</p>','t-shirt-nike-supreme-court-purple','T-shirt Nike Supreme Court Purple Tennis Vintage 1991',NULL,'T-shirt Nike Supreme Court Purple','T-shirt Nike Supreme Court Purple',NULL,NULL),(445,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(445,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(445,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(446,1,1,'<p>Year of release: 1991</p>\r\n<p>Size: Small</p>\r\n<p> </p>','<p>Year of release: 1991</p>','short-nike-challenge-court-andre-agassi','Short Nike Challenge Court Andre Agassi Denim Tennis Vintage 1991',NULL,'Short Nike Challenge Court Andre Agassi','Short Nike Challenge Court Andre Agassi',NULL,NULL),(446,1,2,'<p>Année de sortie: 1991</p>\r\n<p>Taille: Small</p>\r\n<p> </p>','<p>Année de sortie: 1991</p>','short-nike-challenge-court-andre-agassi','Short Nike Challenge Court Andre Agassi Denim Tennis Vintage 1991',NULL,'Short Nike Challenge Court Andre Agassi','Short Nike Challenge Court Andre Agassi',NULL,NULL),(446,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(446,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(446,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(447,1,1,'<p>Year of release: 1991</p>\r\n<p>100% Cotton</p>\r\n<p> </p>','<p>Year of release: 1991</p>','towel-nike-challenge-court-andre-agassi','Towel Nike Challenge Court Andre Agassi Blue Tennis Vintage 1991',NULL,'Towel Nike Challenge Court Andre Agassi','Towel Nike Challenge Court Andre Agassi',NULL,NULL),(447,1,2,'<p>Année de sortie: 1991</p>\r\n<p>100% Coton</p>\r\n<p> </p>','<p>Année de sortie: 1991</p>','serviette-nike-challenge-court-andre-agassi','Serviette Nike Challenge Court Andre Agassi Blue Tennis Vintage 1991',NULL,'Serviette Nike Challenge Court Andre Agassi','Serviette Nike Challenge Court Andre Agassi',NULL,NULL),(447,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(447,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(447,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(451,1,1,'<p>Year of release: 1995</p>\r\n<p>Size: Large</p>\r\n<p> </p>','<p>Year of release: 1995</p>','starter-phoenix-suns-vintage-windbreaker','Starter Phoenix Suns Vintage Windbreaker NBA Basketball Charles Barkley',NULL,'Starter Phoenix Suns Vintage Windbreaker','Starter Phoenix Suns Vintage Windbreaker',NULL,NULL),(451,1,2,'<p>Année de sortie: 1995</p>\r\n<p>Taille: Large</p>\r\n<p> </p>','<p>Année de sortie: 1995</p>','veste-starter-phoenix-suns-vintage','Veste Starter Phoenix Suns Vintage NBA Basketball Charles Barkley',NULL,'Veste Starter Phoenix Suns Vintage','Veste Starter Phoenix Suns Vintage',NULL,NULL),(451,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(451,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(451,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(452,1,1,'<p>Limited edition</p>\r\n<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','asics-tiger-corsair-mexico-1969-white-blue-red','Asics Tiger Corsair Mexico 1969 White/Blue/Red onitsuka limited edition 2013',NULL,'Asics Tiger Corsair Mexico 1969 White/Blue/Red','Asics Tiger Corsair Mexico 1969 White/Blue/Red',NULL,NULL),(452,1,2,'<p>Edition limitée</p>\r\n<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','asics-tiger-corsair-mexico-1969-white-blue-red','Asics Tiger Corsair Mexico 1969 White/Blue/Red onitsuka limited edition 2013',NULL,'Asics Tiger Corsair Mexico 1969 White/Blue/Red','Asics Tiger Corsair Mexico 1969 White/Blue/Red',NULL,NULL),(452,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(452,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(452,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(466,1,1,'<p>About Air Jordan X:</p>\r\n<p>Year of release of OG model: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>AJ X could have been the last Air Jordan. In 1994, Jordan had already retired from the NBA (following the murder of his father during summer ’93) and had decided to start a new career in baseball with the Chicago White Sox.  This explains the presence of the 10 lines of MJ’s main achievements on the sole of the shoe. After suffering a failure in baseball, MJ decides to make his come back in the NBA in march 1995. He’s back, wearing the AJX on court, with the Bulls but without his #23  (which had been retired). His come back is a success as he helps the Bulls qualify for the Playoffs. They finally lose against Shaq’s Orlando Magic which will then be swept by the Houston Rockets in the ’95 NBA Finals.</p>','<p>Year of release: 2012</p>','air-jordan-x-stealth','Nike Air Jordan X Stealth Black/White/Grey Retro AJ 10 2012',NULL,'Air Jordan X Stealth','Air Jordan X Stealth',NULL,NULL),(466,1,2,'<p>A propos de la Air Jordan X:</p>\r\n<p>Date de sortie du modèle original: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La AJ X a bien failli être la dernière de la série. En 1994, Jordan, retraité de la NBA à la suite de l’assassinat de son père, décida de tenter une carrière professionnelle dans le baseball en intégrant les Chicago White Sox. Ceci explique que la semelle du modèle porte, sur 10 lignes, le palmarès <br />de MJ. Après avoir essuyé un échec au baseball, il décide de revenir aux affaires en NBA en mars 1995. Il est donc de retour, avec les Bulls, Jordan X aux pieds, mais sans son numéro 23 (qui avait été retiré lors de sa retraite). Son retour est un succès, il aide les Bulls à se qualifier pour les <br />Playoffs. Ils perdent finalement face aux Orlando Magic de Shaquille O’Neal qui seront à leur tour balayés par les Houston Rockets en finale NBA.</p>','<p>Année de sortie: 2012</p>','air-jordan-x-stealth','Nike Air Jordan X Stealth Black/White/Grey Retro AJ 10 2012',NULL,'Air Jordan X Stealth','Air Jordan X Stealth',NULL,NULL),(466,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(466,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(466,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(467,1,1,'<p style=\"text-align: justify;\">The Air Jordan II \"QF\" (for Quarter Finals) is the retro version of the pair worn by Michael Jordan during NBA season 1986/87, when the Bulls reached the Quarter Finals for the first time (Eastern Conference Semi Final lost against the Detroit Pistons). This was also the pair he rocked during \'87 All Star Game when he won his first Slam Dunk Contest.</p>\r\n<p> </p>\r\n<p>About Air Jordan II:</p>\r\n<p>Year of release of OG model: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p style=\"text-align: justify;\">In the 86-87 season, MJ scored an average 37.1 points per game and became the first player since Wilt Chamberlain to top 3,000 points in a season. Michael also played in the All-Star Game and won the Slam-Dunk Contest. <br />The Air Jordan II was designed by Bruce Kilgore and just as its predecessor it showed a great innovative design. Surprisingly, this is the only Air Jordan ever that has not been made in a black version (except retro versions). Nike swoosh logo disappears. Full-grain leather upper. Polyurethane midsole, encapsulated Air-Sole® unit in heel. Rubber outsole.</p>','<p>Year of release: 2010</p>','air-jordan-ii-qf-white-black-varsity-red','Nike Air Jordan II QF White/Black/Varsity Red 2010 Slam Dunk Contest',NULL,'Air Jordan II QF White/Black/Varsity Red','Air Jordan II QF White/Black/Varsity Red',NULL,NULL),(467,1,2,'<p style=\"text-align: justify;\">La Air Jordan 2 \"QF\" (pour Quarts de Finale) est une réédition du modèle porté par Michael Jordan lors de la saison NBA 1986/87, lors de laquelle les Bulls sont parvenus en quarts de finale pour la première fois sous l\'ère Jordan (Demi-finale de conférence perdue contre les Detroit Pistons). Il portait également cette paire lors du All Star Game 1987, quand il a remporté son premier Slam Dunk Contest.</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan II:</p>\r\n<p>Date de sortie du modèle original: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p style=\"text-align: justify;\">Durant la saison 86-87, Jordan marqua 37.1 points de moyenne par match et devint le premier joueur depuis Wilt Chamberlian a dépasser les 3000 points marqués dans une saison. Michael Jordan fut sélectionné pour son 2éme All-star game et remporta le slam-dunk contest. La Air <br />Jordan II a été dessinée par Bruce Kilgore et, comme la Jordan I, son design est particulièrement novateur.<br />Ce sera la seule Air Jordan à ne pas posséder de version noire (modèles retro exceptés). Coté design, le swoosh disparaît. Cuir supérieur veiné, semelle intermédaire en polyuréthane, système air dans la semelle au niveau du talon. Semelle en caoutchouc.</p>','<p>Année de sortie: 2010</p>','air-jordan-ii-qf-white-black-varsity-red','Nike Air Jordan II QF White/Black/Varsity Red 2010 Slam Dunk Contest',NULL,'Air Jordan II QF White/Black/Varsity Red','Air Jordan II QF White/Black/Varsity Red',NULL,NULL),(467,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(467,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(467,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(468,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-year-of-the-snake','Air Max 1 Year of the Snake YOTS limited edition 2013 ladies women WMN',NULL,'Air Max 1 Year of the Snake','Air Max 1 Year of the Snake',NULL,NULL),(468,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-year-of-the-snake','Air Max 1 Year of the Snake YOTS limited edition 2013 ladies women WMN',NULL,'Air Max 1 Year of the Snake','Air Max 1 Year of the Snake',NULL,NULL),(468,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(468,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(468,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(469,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-thunder','Nike Air Jordan IV Thunder retro AJ 4 2012',NULL,'Air Jordan IV Thunder','Air Jordan IV Thunder',NULL,NULL),(469,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-thunder','Nike Air Jordan IV Thunder retro AJ 4 2012',NULL,'Air Jordan IV Thunder','Air Jordan IV Thunder',NULL,NULL),(469,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(469,1,4,NULL,NULL,'air-jordan