and fresh colors made it one of the most popular running shoes.</div>','<p>Year of release: 2008</p>','adidas-torsion-zx7000-white-purple-green','Adidas Torsion ZX7000 White/Purple/Green 2008 running',NULL,'Adidas Torsion ZX7000 White/Purple/Green','Adidas Torsion ZX7000 White/Purple/Green',NULL,NULL),(481,1,2,'<p>Année de sortie: 2008</p>\r\n<p> </p>\r\n<div id=\"product-description\">\r\n<p style=\"text-align: justify;\">A propos de la ZX 7000:</p>\r\n<p>Année de sortie du modèle original: 1988</p>\r\nLa ZX 7000 représente l’évolution des chaussures de course à pied à partir du début des années 80, mais cette chaussure est probablement la plus connue de la gamme ZX. Elle a été lancée en 1988, avec des couleurs flamboyantes, des technologies telles que « Soft Cell » et le désormais bien connu système TORSION. Les matériaux techniques et les nouveaux coloris ont fait de ce modèle un des plus populaires parmi les chaussures de course à pied.</div>','<p>Année de sortie: 2008</p>','adidas-torsion-zx7000-white-purple-green','Adidas Torsion ZX7000 White/Purple/Green 2008 running',NULL,'Adidas Torsion ZX7000 White/Purple/Green','Adidas Torsion ZX7000 White/Purple/Green',NULL,NULL),(481,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(481,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(481,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(485,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-cavs-gs','Nike Air Jordan IV Cherry GS retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Cherry GS','Air Jordan IV Cherry GS',NULL,NULL),(485,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-cherry-gs','Nike Air Jordan IV Cherry GS retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Cherry GS','Air Jordan IV Cherry GS',NULL,NULL),(485,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(485,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(485,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(486,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','adidas-rivalry-low-ny-knicks','Adidas Rivalry Low NY Knicks 2012 Bulls vs versus Knicks pack New York retro white/Blue/Orange Patrick Ewing NBA Basketball',NULL,'Adidas Rivalry Low NY Knicks','Adidas Rivalry Low NY Knicks',NULL,NULL),(486,1,2,'<p>Année de sortie: 2012</p>','<p>Année de sortie: 2012</p>','adidas-rivalry-low-ny-knicks','Adidas Rivalry Low NY Knicks 2012 Bulls vs versus Knicks pack New York retro white/Blue/Orange Patrick Ewing NBA Basketball',NULL,'Adidas Rivalry Low NY Knicks','Adidas Rivalry Low NY Knicks',NULL,NULL),(486,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(486,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(486,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(488,1,1,'<p>Year of release: 2006</p>\r\n<p> </p>\r\n<p>About Zoom Spiridon:</p>\r\n<p><br />Year of release of OG model: 1997</p>\r\n<p style=\"text-align: justify;\"><br />Named after Spiridon Louis, the winner of the first Olympic Marathon in the Summer of 1896, the Nike Air Zoom Spiridon represents a new emphasis on Nike’s lightweight category. To obtain its high comfort and lightweight, a technological innovation called “Caged Zoom” was used for this model. “Caged Zoom” is a Zoom Air bag inside of a plastic cage designed for protection and function. To improve its stability, the thickness of the sides of the cage is varied which keeps the weight down. The Air Zoom Spiridon is revered to be an ideal shoe for what it was exactly designed for: running. <br />By using the name Spiridon, it creates the idea that anyone can go out and train to be an Olympic marathon runner wearing Air Zoom Spiridons. Five colourways were produced. The royal blue/black is the rarest.</p>','<p>Year of release: 2006</p>','air-zoom-spiridon-black-patent-white-silver','Nike Air Zoom Spiridon Black Patent/White/Silver 2006 running deadstock',NULL,'Air Zoom Spiridon Black Patent/White/Silver','Air Zoom Spiridon Black Patent/White/Silver',NULL,NULL),(488,1,2,'<p>Année de sortie: 2006</p>\r\n<p> </p>\r\n<p>A propos de la Zoom Spiridon:</p>\r\n<p><br />Date de sortie du modèle original: 1997</p>\r\n<p style=\"text-align: justify;\"><br />Baptisée du même nom que le premier vainqueur du marathon des Jeux Olympiques d’été de 1896 (Louis Spiridon), la Nike Air Zoom Spiridon représente une nouvelle évolution dans la gamme running de Nike. Pour obtenir un plus grand confort et plus de légèreté, une innovation technologique appelée « Caged Zoom » a été utilisée. La « Caged Zoom », conçue pour protéger le pied, est une poche Air Zoom placée à l\'intérieur d\'une cage en plastique. Afin d\'améliorer sa stabilité, l\'épaisseur des paroies de la cage varie, permettant également de réduire le poids. <br />La Air Zoom Spiridon est reconnue comme une chaussure idéale pour la pratique de la course <br />à pied. En utilisant le nom « Spiridon », Nike crée l\'idée qu’en portant ce modèle, n\'importe qui peut aller s’entraîner et devenir coureur de marathon Olympique. Cinq coloris ont été produits. Le bleu royal/noir est le plus rare.</p>','<p>Année de sortie: 2006</p>','air-zoom-spiridon-black-patent-white-silver','Nike Air Zoom Spiridon Black Patent/White/Silver 2006 running deadstock',NULL,'Air Zoom Spiridon Black Patent/White/Silver','Air Zoom Spiridon Black Patent/White/Silver',NULL,NULL),(488,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(488,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(488,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(489,1,1,'<p>Year of release: 2005</p>\r\n<p> </p>\r\n<p>