NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(500,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(501,1,1,'<p>Plastic made mini sneaker, laces and tongue are in fabric.</p>\r\n<p>Length: 5cm</p>',NULL,'mini-sneaker-nike-air-trainer-1','Mini sneaker Nike Air Trainer 1',NULL,'Mini sneaker Nike Air Trainer 1','Mini sneaker Nike Air Trainer 1',NULL,NULL),(501,1,2,'<p>Mini sneaker en plastique, lacets et languette en tissu.</p>\r\n<p>Longueur: 5cm</p>',NULL,'mini-sneaker-nike-air-trainer-1','Mini sneaker Nike Air Trainer 1',NULL,'Mini sneaker Nike Air Trainer 1','Mini sneaker Nike Air Trainer 1',NULL,NULL),(501,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(501,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(501,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(502,1,1,'<p>Year of release: 2006</p>\r\n<p>Air Max 1 Premium \"Hold Tight\" Ben Drury (\"Air U Breathe\" pack)</p>\r\n<p style=\"text-align: justify;\">This model is part of Nike \"Air U Breathe\" pack released in 2006, which contained a Air Stab, a Air Max 360 and this Air Max 1. The Air Max 1 was designed by Ben Drury, who\'s a british designer who also worked in the music industry.</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2006</p>','air-max-1-prm-black-grey-air-u-breathe-pack','Nike Air Max 1 PRM Black/Grey Hold Tight Ben Drury \"Air U Breathe Pack\" 2006 Deadstock',NULL,'Air Max 1 PRM Black/Grey \"Air U Breathe Pack\"','Air Max 1 PRM Black/Grey \"Air U Breathe\"',NULL,NULL),(502,1,2,'<p>Année de sortie: 2006</p>\r\n<p style=\"text-align: justify;\">Air Max 1 Premium \"Hold Tight\" Ben Drury (\"Air U Breathe\" pack)</p>\r\n<p style=\"text-align: justify;\">Ce modèle fait partie du pack Nike \"Air U Breathe\" de 2006, composé d\'une Air Stab, d\'une Air Max 360 et donc de cette Air Max 1. La Air Max 1 a été dessinée par Ben Drury, designer britannique.</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2006</p>','air-max-1-prm-black-grey-air-u-breathe-pack','Nike Air Max 1 PRM Black/Grey Hold Tight Ben Drury \"Air U Breathe Pack\" 2006 Deadstock',NULL,'Air Max 1 PRM Black/Grey \"Air U Breathe Pack\"','Air Max 1 PRM Black/Grey \"Air U Breathe\"',NULL,NULL),(502,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(502,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(502,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(503,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2012</p>','air-max-1-og-white-sail-red','Nike Air Max 1 OG White/Sail Red 2012 Retro',NULL,'Air Max 1 OG White/Sail Red','Air Max 1 OG White/Sail Red',NULL,NULL),(503,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2012</p>','air-max-1-og-white-sail-red','Nike Air Max 1 OG White/Sail Red 2012 Retro',NULL,'Air Max 1 OG White/Sail Red','Air Max 1 OG White/Sail Red',NULL,NULL),(503,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(503,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(503,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(504,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Force 1:</p>\r\n<p style=\"text-align: justify;\">The original version of this model was inspired by hiking shoes. It was developed to be a very functional basketball shoe and it was the first Nike basketball shoe to feature the full-length Nike Air Sole. The strap made the fit secure and was used to prevent ankle injury. At first, this model was only produced in high and low; the mid version was produced later. The Air Force 1 has become popular on the hip-hop scene, partly owing to the huge range of colorways that have been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2013</p>','air-force-1-low-blazer-pack-red','nike Air Force 1 Low \"Blazer Pack\" White/Red 2013 Suede downtown',NULL,'Air Force 1 Low \"Blazer Pack\" Red','Air Force 1 Low \"Blazer Pack\" Red',NULL,NULL),(504,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Force 1:</p>\r\n<p style=\"text-align: justify;\">La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard.<br />La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2013</p>','air-force-1-low-blazer-pack-red','nike Air Force 1 Low \"Blazer Pack\" White/Red 2013 Suede downtown',NULL,'Air Force 1 Low \"Blazer Pack\" Red','Air Force 1 Low \"Blazer Pack\" Red',NULL,NULL),(504,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(504,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(504,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(505,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-thunder-gs','Nike Air Jordan IV Thunder GS retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Thunder GS','Air Jordan IV Thunder GS',NULL,NULL),(505,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-thunder-gs','Nike Air Jordan IV Thunder GS retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Thunder GS','Air Jordan IV Thunder GS',NULL,NULL),(505,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(505,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(505,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(506,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','flyknit-racer-red-white-black','Nike Air Flyknit Racer Red/White/Black Technology 2013',NULL,'Flyknit Racer Red/White/Black','Flyknit Racer Red/White/Black',NULL,NULL),(506,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','flyknit-racer-red-white-black','Nike Air Flyknit Racer Red/White/Black Technology 2013',NULL,'Flyknit Racer Red/White/Black','Flyknit Racer Red/White/Black',NULL,NULL),(506,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(506,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(506,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(507,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','flyknit-trainer-royal-blue-electric-green','Nike Air Flyknit Trainer+ Royal Blue/Electric Green Technology 2013',NULL,'Flyknit Trainer+ Royal Blue/Electric Green','Flyknit Trainer+ Royal Blue/Electric Green',NULL,NULL),(507,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','flyknit-trainer-royal-blue-electric-green','Nike Air Flyknit Trainer+ Royal Blue/Electric Green Technology 2013',NULL,'Flyknit Trainer+ Royal Blue/Electric Green','Flyknit Trainer+ Royal Blue/Electric Green',NULL,NULL),(507,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(507,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(507,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(509,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">Reissue of the Reebok Pump \"Shaq One\" released in 1992, signature shoe of Shaquille O\'neal when he entered the NBA, as a member of the Orlando Magic. This pair, using franchise\'s official colors, became iconic not only because of its agressive and innovative design but also thanks to O\'Neal physical abilities and power in the paint. During all his Rookie season, he delighted fans with spectacular blocks, dunks and alley oops. Besides, several plexiglass boards were victims of his \"Shaq Attaqs\".<br />Shaq finished 1992/93 season with a scoring average of 23 points per game and won the title of Rookie of the year.</p>','<p>Year of release: 2013</p>','reebok-pump-shaq-attaq-white-black-azure','Reebok Pump Shaq Attaq White/Black/Azure 1992 2013 Shaquille O\'neal Orlando Magic Rookie',NULL,'Reebok Pump Shaq Attaq White/Black/Azure','Reebok Pump Shaq Attaq White/Black/Azure',NULL,NULL),(509,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\">Réédition de la Reebok Pump \"Shaq One\" créée en 1992 exclusivement pour Shaquille O\'neal à son arrivée en NBA, chez les Orlando Magic. Cette paire aux couleurs de la franchise floridienne est restée emblématique notamment par son design agressif et novateur mais surtout grâce à O\'Neal, qui, dès cette année en tant que Rookie a marqué la NBA de son empreinte avec son physique hors norme, son explosivité et son jeu spectaculaire dans la raquette. Il régale les fans de contres, dunks et alley oops surpuissants. D\'ailleurs, plusieurs paniers et plexiglass ne résisteront pas à ses \"attaques\".</p>\r\n<p style=\"text-align: justify;\">Shaq terminera la saison 1992/93 à 23 points de moyenne par match et remportera le titre de Rookie de l\'année.</p>','<p>Année de sortie: 2013</p>','reebok-pump-shaq-attaq-white-black-azure','Reebok Pump Shaq Attaq White/Black/Azure 1992 2013 Shaquille O\'neal Orlando Magic Rookie',NULL,'Reebok Pump Shaq Attaq White/Black/Azure','Reebok Pump Shaq Attaq White/Black/Azure',NULL,NULL),(509,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(509,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(509,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(510,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Jordan IX:</p>\r\n<p>Year of release of OG model: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This pair was released in late 1993. Some weeks before its release, MJ had announced his retirement from the NBA at 30 (following the death of his father, murdered in North <br />Carolina). Therefore, this is the first shoe he did not wear in an NBA season game, but some other players did, such as Penny Hardaway, Kendall Gill or Mitch Richmond. As MJ then decided to start a new career in Baseball, Nike created a version of the model with cleats.</p>\r\n<p>The shoe uses advanced technology: dynamic-Fit inner bootie, encapsulated Air-Sole unit (forefoot), large volume Air-Sole unit (heel), polyurethane midsole and “one-pull” lacing system. Tinker Hatfield said he was inspired by Japanese design to create this model, a way for him to <br />show that MJ had become a worldwide icon. This is also shown on the soles that feature words like « freedom », « independance », « force » and « athletic » in several languages from every continent.</p>','<p>Year of release: 2012</p>','air-jordan-ix-johnny-kilroy-gs','Nike Air Jordan IX Johnny Kilroy Pack GS AJ 9 2012 platinum gym red metallic',NULL,'Air Jordan IX Johnny Kilroy GS','Air Jordan IX Johnny Kilroy',NULL,NULL),(510,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IX:</p>\r\n<p>Date de sortie du modèle original: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan IX est sortie fin 1993. Quelques semaines avant sa sortie, MJ avait annoncé sa retraite à l’âge de 30 ans (après le décès de son père, assassiné en Caroline du Nord). Par conséquent, il s\'agit de la première Air Jordan qu’il n’ait pas portée lors d’un match officiel, mais d’autres joueurs, tels que Penny Hardaway, Kendall Gill ou Mitch Richmond, l’ont étrennée sur les parquets NBA. Comme MJ avait alors décidé de se lancer dans le baseball, Nike a spécialement créé une version du modèle avec des crampons. La chaussure utilise des technologies avancées: chausson interne « dynamique-Fit », double système Air-Sole intégré (un à l’avant-pied et un grand au talon), midsole en polyuréthanne et système de laçage \"one pull\". Tinker Hatfield a dit s’être inspiré du design japonais pour la conception de ce modèle, une façon pour lui de montrer que MJ était devenu une icône dans le monde entier. Ceci est également mis en avant sur les semelles qui comportent des mots comme «liberté», «indépendance», «force» et «athlétique» dans différentes langues venues des quatre coins du monde.</p>','<p>Année de sortie: 2012</p>','air-jordan-ix-johnny-kilroy-gs','Nike Air Jordan IX Johnny Kilroy Pack GS AJ 9 2012 platinum gym red metallic',NULL,'Air Jordan IX Johnny Kilroy GS','Air Jordan IX Johnny Kilroy GS',NULL,NULL),(510,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(510,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(510,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(514,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','roshe-run-montreal-blue-red','Air Roshe Run Montreal Blue/Red Suede Leather Premium Dark Navy Sunburst 2012',NULL,'Roshe Run Montreal Blue/Red','Roshe Run Montreal Blue/Red',NULL,NULL),(514,1,2,'<p>Année de sortie: 2012</p>','<p>Année de sortie: 2012</p>','roshe-run-montreal-blue-red','Air Roshe Run Montreal Blue/Red Suede Leather Premium Dark Navy Sunburst 2012',NULL,'Roshe Run Montreal Blue/Red','Roshe Run Montreal Blue/Red',NULL,NULL),(514,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(514,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(514,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(522,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','air-safari-nrg-qs','Air Safari NRG QS tan/beige/black-charcoal Windrunner Leather Brown premium 2012 limited edition Quickstrike',NULL,'Air Safari NRG QS','Air Safari NRG QS',NULL,NULL),(522,1,2,'<p>Année de sortie: 2012</p>','<p>Année de sortie: 2012</p>','air-safari-nrg-qs','Air Safari NRG QS tan/beige/black-charcoal Windrunner Leather Brown premium 2012 limited edition Quickstrike',NULL,'Air Safari NRG QS','Air Safari NRG QS',NULL,NULL),(522,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(522,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(522,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(523,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Trainer 1:</p>\r\n<p>Year of release of OG Model: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>The Air Trainer 1 is a multipurpose sneaker created by Tinker Hatfield. He was inspired to create this model when he noticed people in his local gym using two pairs of sneakers, one for running and one for weightlifting.</p>\r\n<p>The Nike Air Trainer 1 is well known for being worn by tennis star John McEnroe and NBA players in the late 80’s.</p>','<p>Year of release: 2012</p>','air-trainer-1-safari-nrg-qs','Nike Air Trainer 1 Safari NRG QS 2012 Safari Pack limited edition Quickstrike',NULL,'Air Trainer 1 Safari NRG QS','Air Trainer 1 Safari NRG QS',NULL,NULL),(523,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Trainer 1:</p>\r\n<p>Année de sortie du modèle original: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>La Air Trainer 1 est une paire multi-usages dessinée par Tinker Hatfield. Il a eu l’idée de créer ce modèle en voyant, dans la salle de sport de son quartier, que les clients apportaient deux paires de chaussures, une pour courir et une pour soulever des poids.</p>\r\n<p>La Air Trainer 1 a été rendue célèbre pour avoir été portée par John McEnroe et des joueurs NBA à la fin des années 80.</p>','<p>Année de sortie: 2012</p>','air-trainer-1-safari-nrg-qs','Nike Air Trainer 1 Safari NRG QS 2012 Safari Pack limited edition Quickstrike',NULL,'Air Trainer 1 Safari NRG QS','Air Trainer 1 Safari NRG QS',NULL,NULL),(523,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(523,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(523,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(524,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Trainer 1:</p>\r\n<p>Year of release of OG Model: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>The Air Trainer 1 is a multipurpose sneaker created by Tinker Hatfield. He was inspired to create this model when he noticed people in his local gym using two pairs of sneakers, one for running and one for weightlifting.</p>\r\n<p>The Nike Air Trainer 1 is well known for being worn by tennis star John McEnroe and NBA players in the late 80’s.</p>','<p>Year of release: 2012</p>','air-trainer-1-mid-premium-chlorophyll','Nike Air Trainer 1 Mid Premium “Chlorophyll” White / Grey / Black / Green 2012 McEnroe Agassi',NULL,'Air Trainer 1 Mid Premium “Chlorophyll”','Air Trainer 1 Mid Premium “Chlorophyll”',NULL,NULL),(524,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Trainer 1:</p>\r\n<p>Année de sortie du modèle original: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>La Air Trainer 1 est une paire multi-usages dessinée par Tinker Hatfield. Il a eu l’idée de créer ce modèle en voyant, dans la salle de sport de son quartier, que les clients apportaient deux paires de chaussures, une pour courir et une pour soulever des poids.</p>\r\n<p>La Air Trainer 1 a été rendue célèbre pour avoir été portée par John McEnroe et des joueurs NBA à la fin des années 80.</p>','<p>Année de sortie: 2012</p>','air-trainer-1-mid-premium-chlorophyll','Nike Air Trainer 1 Mid Premium “Chlorophyll” White / Grey / Black / Green 2012 McEnroe Agassi',NULL,'Air Trainer 1 Mid Premium “Chlorophyll\"','Air Trainer 1 Mid Premium “Chlorophyll”',NULL,NULL),(524,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(524,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(524,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(525,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-em-sunset-pack','Nike Air Max 1 EM Sunset Pack 2013 Engineered Mesh Reinvented',NULL,'Air Max 1 EM Sunset Pack','Air Max 1 EM Sunset Pack',NULL,NULL),(525,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-em-sunset-pack','Nike Air Max 1 EM Sunset Pack 2013 Engineered Mesh Reinvented',NULL,'Air Max 1 EM Sunset Pack','Air Max 1 EM Sunset Pack',NULL,NULL),(525,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(525,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(525,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(526,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan V:</p>\r\n<p>Year of release of OG model: 1989</p>\r\n<p style=\"text-align: justify;\">Designer: Tinker Hatfield<br />Phil Jackson took over as head coach for the Bulls in the 89-90 season. This gave the Bull\'s an extra boost and everything was flying. Jordan kept on playing his game and set a personal best when scoring 69 points in a game against the Cleveland Cavaliers. Once again Hatfield came up with a revolutionary design for the new shoe.</p>\r\n<p style=\"text-align: justify;\">The AJ5 was inspired by World War II Fighter planes (Spitfire WWII) brought to light by The \"reverse flames\". The clear outsole was inspired by the clear panels of Marty MacFly\'s Back to the Future II boots which Tinker had designed for the movie. Tinker put a reflective 3M tongue with Jumpman embroidery. Whenever a photograph flash goes off, the tongue would light up and the tiny Jumpman would be highlighted in the background.</p>','<p>Year of release: 2013</p>','air-jordan-v-citrus-floridians-gs','Nike Air Jordan V Citrus Floridians GS women ladies AJ 5 2013 Retro ',NULL,'Air Jordan V Citrus Floridians GS','Air Jordan V Citrus Floridians GS',NULL,NULL),(526,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan V:</p>\r\n<p>Date de sortie du modèle original: 1989</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Phil Jackson arrive à la tête des Bulls en 1989-90. Ce renfort donne des ailes à l’équipe. Michael Jordan établit un nouveau record personnel de 69 points marqués durant un match, contre les Cleveland Cavaliers. Tinker Hatfield puise cette fois son inspiration dans un avion de combat (le Spitfire WWII ), laissant apparaître des flammes inversées sur le côté de la chaussure. La semelle transparente a été inspirée par la paire de chaussure révolutionnaire (dessinée par Tinker hatfield) portée par Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2013</p>','air-jordan-v-citrus-floridians-gs','Nike Air Jordan V Citrus Floridians GS women ladies AJ 5 2013 Retro ',NULL,'Air Jordan V Citrus Floridians GS','Air Jordan V Citrus Floridians GS',NULL,NULL),(526,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(526,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(526,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(527,1,1,NULL,'<p>Year of release: 2012</p>','lebron-9-ps-elite-away-black-metallic-gold','Nike Air Lebron 9 P.S. Elite \"Away\" Black/Metallic Gold 2012 LBJ Lebron James',NULL,'Lebron 9 P.S. Elite \"Away\" Black/Metallic Gold','Lebron 9 P.S. Elite \"Away\" Black/Metallic Gold',NULL,NULL),(527,1,2,NULL,'<p>Année de sortie: 2012</p>','lebron-9-ps-elite-away-black-metallic-gold','Nike Air Lebron 9 P.S. Elite \"Away\" Black/Metallic Gold 2012 LBJ