t was <br />made up of a total of 5 different Air Jordans, the Jordan III(midsole), Jordan IV(Wings), Jordan <br />V(Uppers), Jordan VI(Tongue) &amp; Jordan IX (Pull Tab). <br />The Spiz’ike already released in dozens of colorways and more are yet to come. The cement colorway, released in 2008, is after the Air Jordan IV colorway, which was also featured in Spike Lee’s movie “Do the Right Thing” where Buggin’ Out had his brand new Air Jordan’s scuffed by a pedestrian walking his bike.</p>','<p>Year of release: 2012</p>','air-jordan-spizike-toro-bravo-gym-red-gs','Nike Air Jordan Spizike Toro Bravo Gym Red GS Raging Bull AJ 2012',NULL,'Air Jordan Spizike Toro Bravo Gym Red GS','Air Jordan Spizike Toro Bravo Gym Red GS',NULL,NULL),(543,1,2,'<p>A propos de la Air Jordan Spizike:</p>\r\n<p>Date de sortie du modèle original: 2006</p>\r\n<p>La Air Jordan Spiz’ike a été créée pour rendre hommage à Spike Lee tant pour son rôle primordial <br />dans le succès planétaire des Air Jordan que pour sa collaboration avec Nike et MJ. Nombreux sont ceux qui se rappellent ses spots publicitaires comiques tournés avec Jordan pour Nike mettant en scène son personnage « Mars Blackman » (tiré de son film : « She’s Gotta Have it »). <br />Après la Jordan Dub-Zero, la Spiz’ike a été le deuxième modèle « fusion » sorti par Jordan Brand. <br />La Spiz’ike est faite d’éléments inspirés de 5 Jordan différentes :les Jordan III (semelle intermédiaire), IV (passants pour lacets), V (col), VI (languette) &amp; IX (languette arrière). La Spiz’ike existe déja en de nombreux coloris qui sont parfois inspirés de Jordan emblématiques comme le modèle « Cement » qui reprend les couleurs de la Jordan IV vue dans une scène culte de « Do the Right Thing » où un passant à vélo souille la Jordan IV de Buggin’ Out.</p>','<p>Année de sortie: 2012</p>','air-jordan-spizike-gym-red-gs','Nike Air Jordan Spizike Toro Bravo Gym Red GS Raging Bull AJ 2012',NULL,'Air Jordan Spizike Toro Bravo Gym Red GS','Air Jordan Spizike Toro Bravo Gym Red GS',NULL,NULL),(543,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(543,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(543,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(544,1,1,'<p>T-shirt Throwback Sneakers (silkcreen printed)</p>\r\n<p>100% Cotton, 190gr</p>\r\n<p>Style: classic</p>\r\n<p>Measurments (in cm):</p>\r\n<div class=\"guide-taille\"><img src=\"http://s7v3.scene7.com/is/image/soloinvest/icon-guide-taille-tshirt\" alt=\"\" border=\"0\" /></div>\r\n<div class=\"guide-taille\"> </div>\r\n<div class=\"guide-taille\">X-Small: 62/49     </div>\r\n<div class=\"guide-taille\">Small: 69/50</div>\r\n<div class=\"guide-taille\">Medium: 72/53</div>\r\n<div class=\"guide-taille\">Large: 74/56</div>\r\n<div class=\"guide-taille\">X-Large: 76/58</div>','<p>T-shirt Throwback Sneakers White</p>','t-shirt-throwback-sneakers-white','T-shirt Throwback Sneakers White logo serigraphie',NULL,'T-shirt Throwback Sneakers White','T-shirt Throwback Sneakers White',NULL,NULL),(544,1,2,'<p>T-shirt Throwback Sneakers (logo sérigraphié)</p>\r\n<p>100% Coton, 190gr</p>\r\n<p>Coupe classique</p>\r\n<p>Mesures (en cm):</p>\r\n<div class=\"guide-taille\"><img src=\"http://s7v3.scene7.com/is/image/soloinvest/icon-guide-taille-tshirt\" alt=\"\" border=\"0\" /></div>\r\n<div class=\"guide-taille\"> </div>\r\n<div class=\"guide-taille\">X-Small: 62/49     </div>\r\n<div class=\"guide-taille\">Small: 69/50</div>\r\n<div class=\"guide-taille\">Medium: 72/53</div>\r\n<div class=\"guide-taille\">Large: 74/56</div>\r\n<div class=\"guide-taille\">X-Large: 76/58</div>','<p>T-shirt Throwback blanc</p>','t-shirt-throwback-sneakers-blanc','T-shirt Throwback Sneakers Blanc logo serigraphie',NULL,'T-shirt Throwback Sneakers Blanc','T-shirt Throwback Sneakers Blanc',NULL,NULL),(544,1,3,NULL,NULL,'a