e révolutionnaire (dessinée par Tinker hatfield) portée par Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2013</p>','air-jordan-v-black-grape','Nike Air Jordan V Black Grape AJ 5 2013 QS',NULL,'Air Jordan V Black Grape','Air Jordan V Black Grape',NULL,NULL),(546,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(546,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(546,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(549,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','air-penny-v-total-crimson-black-sunburst','Nike Air Penny V \"Total Crimson\" Black/Sunburst 2013 infrared fluo Anfernee Hardaway Retro',NULL,'Air Penny V \"Total Crimson\" Black/Sunburst','Air Penny V \"Total Crimson\" Black/Sunburst',NULL,NULL),(549,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','air-penny-v-total-crimson-black-sunburst','Nike Air Penny V \"Total Crimson\" Black/Sunburst 2013 infrared fluo Anfernee Hardaway Retro',NULL,'Air Penny V \"Total Crimson\" Black/Sunburst','Air Penny V \"Total Crimson\" Black/Sunburst',NULL,NULL),(549,1,3,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(549,1,4,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(549,1,5,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(550,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','roshe-run-black-atomic-red','Nike Air Roshe Run Black/Atomic Red Premium Crimson Infrared Summer été 2013',NULL,'Roshe Run Black/Atomic Red','Roshe Run Black/Atomic Red',NULL,NULL),(550