/Blue 2012',NULL,'Air Zoom Vapor Tour 9 White/Black/Blue','Air Zoom Vapor Tour 9 White/Black/Blue',NULL,NULL),(554,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Zoom Vapor 9:</p>\r\n<p>Date de sortie du modèle original: 2011</p>\r\n<p>Design: Tinker Hatfield</p>','<p>Année de sortie: 2012</p>','air-zoom-vapor-tour-9-white-black-blue','nike Air Zoom Vapor Tour 9 White/Black/Blue 2012',NULL,'Air Zoom Vapor Tour 9 White/Black/Blue','Air Zoom Vapor Tour 9 White/Black/Blue',NULL,NULL),(554,1,3,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(554,1,4,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(554,1,5,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(555,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Zoom Vapor 9:</p>\r\n<p>Year of release of OG model: 2011</p>\r\n<p>Design: Tinker Hatfield</p>','<p>Year of release: 2012</p>','air-zoom-vapor-tour-9-sl-white-green-yellow','nike Air Zoom Vapor Tour 9 White/Green/Yellow 2012 Wimbledon RF Roger Federer',NULL,'Air Zoom Vapor Tour 9 White/Green/Yellow','Air Zoom Vapor Tour 9 SL White/Green/Yellow',NULL,NULL),(555,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Zoom Vapor 9:</p>\r\n<p>Date de sortie du modèle original: 2011</p>\r\n<p>Design: Tinker Hatfield</p>','<p>Année de sortie: 2012</p>','air-zoom-vapor-tour-9-white-green-yellow','nike Air Zoom Vapor Tour 9 White/Green/Yellow 2012 Wimbledon RF Roger Federer',NULL,'Air Zoom Vapor Tour 9 White/Green/Yellow','Air Zoom Vapor Tour 9 SL White/Green/Yellow',NULL,NULL),(555,1,3,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(555,1,4,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(555,1,5,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(557,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan XIII:</p>\r\n<p>Year of release of OG model: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">The Air Jordan XIII features quilted leather upper with suede trim and unique hidden lacing system. Low-profile leather wrapped Phylon™ midsole with heel and forefoot Zoom Air™ units. Midfoot carbon fiber composite plate. Tinker Hatfield kept on making original designs. <br />The AJXIII featured a nice hologram on the ankle and the design was inspired by a panther (one of MJ’s nicknames). The outsole with pads like a paw and circles representing whiskers. The hologram shows a basketball; the number 23 &amp; the jumpman logo. On December 30th 1997, Jordan broke Kareem Abdul-Jabbar\'s NBA record, by scoring in double-digits for the 788th consecutive game. He also led the Bulls to their sixth NBA Championship title before retiring from the game (for the second time). We must precise that during the 1998 NBA Finals, which were his last games with the Bulls, MJ was (already) wearing the new Air Jordan XIV.</p>','<p>Year of release: 2013</p>','air-jordan-xiii-black-true-red','Nike Air Jordan XIII Black/True Red AJ 13 2013 Retro',NULL,'Air Jordan XIII Black/True Red','Air Jordan XIII Black/True Red',NULL,NULL),(557,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan XIII:</p>\r\n<p>Date de sortie du modèle original: 1996</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">La Air Jordan XIII est composée de cuir moltoné et de parties latérales en daim ainsi que d’un système unique dissimulant le laçage. La semelle intermédiaire en Phylon ™, englobe un double système Zoom Air ™ (talon et semelle avant). La partie centrale de la semelle est faite d’une plaque en fibre de carbone composite. Tinker Hatfield continue de proposer des concepts originaux. Le design de la AJXIII s’inspire de l’un des surnoms de Jordan : « the black cat » (la panthère noire). La semelle extérieure rappelle les coussinets et les cercles représentant les moustaches de la panthère. Au niveau de la cheville figure un hologramme faisant apparaître un ballon de basket ; le numéro 23&amp; le logo Jumpman. <br />Le 30 Décembre 1997, Jordan a battu le record de Kareem Abdul-Jabbar en devenant le premier joueur NBA à marquer plus de 10 points au cours de 788 matchs consécutifs. En 1998, il a également emmené les Bulls jusqu’à leur sixième titre de champion NBA avant de prendre sa retraite sportive (pour la deuxième fois). Il faut préciser que lors de son dernier match avec les Bulls, en Finale NBA, MJ portait (déjà) la future Air Jordan XIV.</p>','<p>Année de sortie: 2013</p>','air-jordan-xiii-black-true-red','Nike Air Jordan XIII Black/True Red AJ 13 2013 Retro',NULL,'Air Jordan XIII Black/True Red','Air Jordan XIII Black/True Red',NULL,NULL),(557,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(557,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(557,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(558,1,1,'<p>Year of release: 2013</p>\r\n<p>About Air 180:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p style=\"text-align: justify;\">This revolutionary shoe contained fifty per cent more air than previous Air Max models. During 1991 – 92, a variety of colourways was produced. A basketball version of this model, the Air Force 180, was worn by NBA star Charles Barkley at the 1992 Barcelona Olympics.</p>','<p>Year of release: 2013</p>','air-180-urban-safari-white-orange-green','Nike Air 180 Urban Safari White/Orange/Green 2013 Size?',NULL,'Air 180 Urban Safari White/Orange/Green','Air 180 Urban Safari White/Orange/Green',NULL,NULL),(558,1,2,'<p>Année de sortie: 2013</p>\r\n<p><br />A propos de la Air 180: </p>\r\n<p>Date de sortie du modèle original: 1991 </p>\r\n<p style=\"text-align: justify;\">Cette chaussure révolutionnaire contient 50 % d’air de plus que les autres modèles Air Max de l\'époque. Ce modèle a été produit durant la saison 1991 – 92 dans une grande variété de couleurs. Une version basketball portant ce même système air, la Air force 180, a été rendue célèbre par le basketteur Charles Barkley, star de la NBA (notamment durant les jeux olympiques de Barcelone en 1992). <br /><br /></p>','<p>Année de sortie: 2013</p>','air-180-urban-safari-white-orange-green','Nike Air 180 Urban Safari White/Orange/Green 2013 Size?',NULL,'Air 180 Urban Safari White/Orange/Green','Air 180 Urban Safari White/Orange/Green',NULL,NULL),(558,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(558,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(558,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(560,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','roshe-run-fb-yeezy-black-fresh-mint-pink','Nike Air Roshe Run FB \"Yeezy\" Black/Fresh Mint/Pink Football 2013',NULL,'Roshe Run FB \"Yeezy\" Black/Fresh Mint/Pink','Roshe Run FB \"Yeezy\" Black/Fresh Mint/Pink',NULL,NULL),(560,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','roshe-run-fb-yeezy-black-fresh-mint-pink','Nike Air Roshe Run FB \"Yeezy\" Black/Fresh Mint/Pink Football 2013',NULL,'Roshe Run FB \"Yeezy\" Black/Fresh Mint/Pink','Roshe Run FB \"Yeezy\" Black/Fresh Mint/Pink',NULL,NULL),(560,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(560,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(560,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(561,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Flight ‘89:</p>\r\n<p>Year of release of OG Model: 1989</p>\r\n<p>The Nike Air Flight is easily considered as a classic Nike, releasing in 1989 in a ton of different color combinations. This basketball shoe is a prime example of why some designs are meant to last forever. Terms like « throwback », « retro », and « old-school » are all applicable here. Timeless style gives respect, visible air unit in the heel delivers quality comfort and cushioning, famous Air Flight logo on the tongue.</p>','<p>Year of release: 2012</p>','air-flight-89-wolf-grey-black-white','Nike Air Flight \'89 Wolf Grey/Black/White 2012',NULL,'Air Flight \'89 Wolf Grey/Black/White','Air Flight \'89 Wolf Grey/Black/White',NULL,NULL),(561,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Flight ‘89:</p>\r\n<p>Année de sortie du modèle original: 1989</p>\r\n<p>La Nike Air Flight est un véritable classique de chez Nike, lancée en 1989 dans une grande variété de combinaisons de couleurs. Cette chaussure, produite pour la pratique du Basketball, est un bon exemple pour comprendre comment certains designs sont faits pour durer éternellement. Les termes comme  « throwback », « retro », et « old-school » sont tous applicables à ce modèle. Un style indémodable composé d’un système air visible au talon offrant confort et amorti, et de la présence du fameux logo Air Flight sur la languette.</p>','<p>Année de sortie: 2012</p>','air-flight-89-wolf-grey-black-white','Nike Air Flight \'89 Wolf Grey/Black/White 2012',NULL,'Air Flight \'89 Wolf Grey/Black/White','Air Flight \'89 Wolf Grey/Black/White',NULL,NULL),(561,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(561,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(561,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(563,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Flight ‘89:</p>\r\n<p>Year of release of OG Model: 1989</p>\r\n<p>The Nike Air Flight is easily considered as a classic Nike, releasing in 1989 in a ton of different color combinations. This basketball shoe is a prime example of why some designs are meant to last forever. Terms like « throwback », « retro », and « old-school » are all applicable here. Timeless style gives respect, visible air unit in the heel delivers quality comfort and cushioning, famous Air Flight logo on the tongue.</p>','<p>Year of release: 2012</p>','air-flight-89-white-true-blue','Nike Air Flight \'89 White/True Blue 2012',NULL,'Air Flight \'89 White/True Blue','Air Flight \'89 White/True Blue',NULL,NULL),(563,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Flight ‘89:</p>\r\n<p>Année de sortie du modèle original: 1989</p>\r\n<p>La Nike Air Flight est un véritable classique de chez Nike, lancée en 1989 dans une grande variété de combinaisons de couleurs. Cette chaussure, produite pour la pratique du Basketball, est un bon exemple pour comprendre comment certains designs sont faits pour durer éternellement. Les termes comme  « throwback », « retro », et « old-school » sont tous applicables à ce modèle. Un style indémodable composé d’un système air visible au talon offrant confort et amorti, et de la présence du fameux logo Air Flight sur la languette.</p>','<p>Année de sortie: 2012</p>','air-flight-89-white-true-blue','Nike Air Flight \'89 White/True Blue 2012',NULL,'Air Flight \'89 White/True Blue','Air Flight \'89 White/True Blue',NULL,NULL),(563,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(563,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(563,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(571,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2013</p>','asics-gel-lyte-iii-black-tan','Asics Gel Lyte III Black/Tan GL3 Retro 2013 Black Yellow red',NULL,'Asics Gel Lyte III Black/Tan','Asics Gel Lyte III Black/Tan',NULL,NULL),(571,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2013</p>','asics-gel-lyte-iii-black-tan','Asics Gel Lyte III Black/Tan GL3 Retro 2013 Black Yellow red',NULL,'Asics Gel Lyte III Black/Tan','Asics Gel Lyte III Black/Tan',NULL,NULL),(571,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(571,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(571,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL)