I White/Blue/Orange',NULL,NULL),(578,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(578,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(578,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(579,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','air-force-max-white-black-red',' Nike Air Force Max White/Black/Red 2013 Basketball CB Charles Barkley 1993',NULL,'Air Force Max White/Black/Red','Air Force Max White/Black/Red',NULL,NULL),(579,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','air-force-max-white-black-red','Nike Air Force Max White/Black/Red 2013 Basketball CB Charles Barkley 1993',NULL,'Air Force Max White/Black/Red','Air Force Max White/Black/Red',NULL,NULL),(579,1,3,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(579,1,4,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(579,1,5,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(580,1,1,'<p>Year of release: 2013</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Warning: This model cuts short, consider one size bigger than your usual Nike sizing.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Huarache:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>The \"Huarache\" was named after a Native American sandal. Its main particularity is a neoprene and spandex sock contained within the upper. The sock strongly holds the foot. Coupled with Nike’s trademark air unit, the Huarache pushed Nike running shoes one step forward in terms of comfort, performance and design.</p>','<p>Year of release: 2013</p>','air-huarache-qs-white-turquoise-yellow','Nike Air Huarache QS White/Turquoise/Yellow quickstrike running 1991 2013 Retro',NULL,'Air Huarache QS White/Turquoise/Yellow','Air Huarache QS White/Turquoise/Yellow',NULL,NULL),(580,1,2,'<p>Année de sortie: 2013</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: ce modèle taille petit, compter une taille de plus que votre taille Nike habituelle.</strong></span></p>\r\n<p> </p>\r\n<p>A propos de la Air Huarache:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>La \"Huarache\" tire son nom d\'une sandale portée par les Indiens d\'Amérique. Sa principale particularité est son chausson fait de neoprene et Spandex qui recouvre toute la partie supérieure de la chaussure. Ce chausson épouse complètement la forme du pied. Son association avec le système Air a fait de la Huarache une paire révolutionnaire en terme de confort, performance et design.</p>','<p>Année de sortie: 2013</p>','air-huarache-qs-white-turquoise-yellow','Nike Air Huarache QS White/Turquoise/Yellow quickstrike running 1991 2013 Retro',NULL,'Air Huarache QS White/Turquoise/Yellow','Air Huarache QS White/Turquoise/Yellow',NULL,NULL),(580,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(580,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(580,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(582,1,1,'<p><span style=\"color: #ff0000;\"><strong>Pre-order:</strong></span> delivery beginning of September 2013</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2013</p>','pre-order-asics-gel-lyte-iii-black-tan','PRE-ORDER: Asics Gel Lyte III Black/Tan GL3 Retro 2013 Black Yellow red',NULL,'PRE-ORDER: Asics Gel Lyte III Black/Tan','PRE-ORDER: Asics Gel Lyte III Black/Tan',NULL,NULL),(582,1,2,'<p><span style=\"color: #ff0000;\"><strong>Pré-commande:</strong></span> expédition début septembre 2013</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2013</p>','pre-order-asics-gel-lyte-iii-black-tan','PRE-ORDER: Asics Gel Lyte III Black/Tan GL3 Retro 2013 Black Yellow red',NULL,'PRE-ORDER: Asics Gel Lyte III Black/Tan','PRE-ORDER: Asics Gel Lyte III Black/Tan',NULL,NULL),(582,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(582,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(582,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(583,1,1,'<p>Year of release: 2006</p>\r\n<p> </p>\r\n<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2006</p>','air-jordan-iv-mars-blackmon','Nike Air Jordan IV \"Mars Blackmon\" Fire Red retro AJ 4 2006 Spike Lee',NULL,'Air Jordan IV \"Mars Blackmon\"','Air Jordan IV \"Mars Blackmon\"',NULL,NULL),(583,1,2,'<p>Année de sortie: 2006</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2006</p>','air-jordan-iv-mars-blackmon','Nike Air Jordan IV \"Mars Blackmon\" Fire Red retro AJ 4 2006 Spike Lee',NULL,'Air Jordan IV \"Mars Blackmon\"','Air Jordan IV \"Mars Blackmon\"',NULL,NULL),(583,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(583,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(583,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(584,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2012</p>','air-jordan-vii-raptor','Nike Air Jordan VII Raptor AJ 7 2012 Charcoal',NULL,'Air Jordan VII Raptor','Air Jordan VII Raptor',NULL,NULL),(584,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2012</p>','air-jordan-vii-raptor','Nike Air Jordan VII Raptor AJ 7 2012 Charcoal',NULL,'Air Jordan VII Raptor','Air Jordan VII Raptor',NULL,NULL),(584,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(584,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(584,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(586,1,1,'<p><span style=\"color: #ff0000;\"><strong>Pre-order:</strong></span> delivery mid-September 2013</p>','<p>Year of release: 2013</p>','pre-order-asics-gel-saga-brown-green','PRE-ORDER: Asics Gel Saga Brown/Green Camo Pack 2013 Running retro',NULL,'PRE-ORDER: Asics Gel Saga Brown/Green Camo Pack','PRE-ORDER: Asics Gel Saga Brown/Green',NULL,NULL),(586,1,2,'<p><strong></strong><strong><span style=\"color: #ff0000;\"><strong>Pré-commande:</strong></span> expédition mi-septembre 2013</strong></p>','<p>Année de sortie: 2013</p>','pre-order-asics-gel-saga-brown-green','PRE-ORDER: Asics Gel Saga Brown/Green Camo Pack 2013 Running retro',NULL,'PRE-ORDER: Asics Gel Saga Brown/Green Camo Pack','PRE-ORDER: Asics Gel Saga Brown/Green',NULL,NULL),(586,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(586,1,4,NULL,NULL,'air-jordan-i-low-phat-black-re