another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2013</p>','air-jordan-iv-fear-gs','Nike Air Jordan IV Fear GS Black/White/Cool Grey Nubuck Suede retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Fear GS','Air Jordan IV Thunder GS',NULL,NULL),(606,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2013</p>','air-jordan-iv-fear-gs','Nike Air Jordan IV Fear GS Black/White/Cool Grey Nubuck Suede retro ladies AJ 4 2012 women',NULL,'Air Jordan IV Fear GS','Air Jordan IV Fear GS',NULL,NULL),(606,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(606,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(606,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(607,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','le-coq-sportif-r1000-lily-white-alloy-black','Le Coq Sportif R1000 Lily White/Alloy/Black 2013 Citrus Lime',NULL,'Le Coq Sportif R1000 Lily White/Alloy/Black','Le Coq Sportif R1000 Lily White/Alloy/Black',NULL,NULL),(607,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','le-coq-sportif-r1000-lily-white-alloy-black','Le Coq Sportif R1000 Lily White/Alloy/Black 2013 Citrus Lime',NULL,'Le Coq Sportif R1000 Lily White/Alloy/Black','Le Coq Sportif R1000 Lily White/Alloy/Black',NULL,NULL),(607,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(607,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(607,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(608,1,1,'<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-gucci','Nike Air Jordan I Gucci Limited edition AJ 1 2012',NULL,'Air Jordan I Gucci','Air Jordan I Gucci',NULL,NULL),(608,1,2,'<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2012</p>','air-jordan-i-gucci','Nike Air Jordan I Gucci Limited edition AJ 1 2012',NULL,'Air Jordan I Gucci','Air Jordan I Gucci',NULL,NULL),(608,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(608,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(608,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(609,1,1,'<p>The first edition of Air Jordan I designed by Dave White was limited to 23 pairs worldwide and auctioned in 2011 to raise funds for a charity called \"Wings for the Future\".</p>\r\n<p>In 2012, Jordan Brand released this other colorway from Dave White, in stores this time, and in limited quantites. In addition to its design, major particularities of this Air Jordan 1 are that it does no show the Nike logo (the swoosh) and it comes in a special box with the \"Jordan wings\" logo.</p>\r\n<p> </p>\r\n<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-dave-white','Nike Air Jordan I x Dave White Wings for the Future White/Black/Red AJ1 2012 limited',NULL,'Air Jordan I x Dave White \"Wings for the Future\" White/Black/Red','Air Jordan I x Dave White \"Wings for the Future\" White/Black/Red',NULL,NULL),(609,1,2,'<p>Le premier modèle de Air Jordan I dessiné par Dave White était limité à 23 paires dans le monde vendues aux enchères en 2011 afin de collecter des fonds pour une assocition caritative appelée \"Wings for the Future\".</p>\r\n<p>En 2012, Jordan Brand a sorti ce nouveau colori, toujours dessiné par Dave White et distribué en quantités limitées. En plus de son design original, les principales particularités de cette Air Jordan 1 sont qu\'elle ne fait pas apparaître le logo Nike (le fameux swoosh) et qu\'elle est fournie dans une boîte spéciale portant le logo \"Jordan wings\".</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Date de sortie: 2012</p>','air-jordan-i-dave-white','Nike Air Jordan I x Dave White Wings for the Future White/Black/Red AJ1 2012 limited',NULL,'Air Jordan I x Dave White \"Wings for the Future\" White/Black/Red','Air Jordan I x Dave White \"Wings for the Future\" White/Black/Red',NULL,NULL),(609,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(609,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(609,1,5,NU