r />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2013</p>','air-jordan-i-ny-knicks','Nike Air Jordan I \"NY Knicks\" New York AJ 1 2013',NULL,'Air Jordan I \"NY Knicks\"','Air Jordan I \"NY Knicks\"',NULL,NULL),(610,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(610,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(610,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(611,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2012</p>','air-jordan-i-road-to-the-gold-las-vegas','Nike Air Jordan I \"Road to the Gold\" Las Vegas AJ 1 2012',NULL,'Air Jordan I \"Road to the Gold\" Las Vegas','Air Jordan I \"Road to the Gold\" Las Vegas',NULL,NULL),(611,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2012</p>','air-jordan-i-road-to-the-gold-las-vegas','Nike Air Jordan I \"Road to the Gold\" Las Vegas AJ 1 2012',NULL,'Air Jordan I \"Road to the Gold\" Las Vegas','Air Jordan I \"Road to the Gold\" Las Vegas',NULL,NULL),(611,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(611,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(611,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(613,1,1,'<p>Year of release: 2012</p>','<p>Year of release: 2012</p>','asics-gel-saga-orange-blaze-pack','Asics Gel Saga Orange Blaze Pack 2012 White/Black/Infrared',NULL,'Asics Gel Saga Orange Blaze Pack','Asics Gel Saga Orange Blaze Pack',NULL,NULL),(613,1,2,'<p>Année de sortie: 2012</p>','<p>Année de sortie: 2012</p>','asics-gel-saga-orange-blaze-pack','Asics Gel Saga Orange Blaze Pack 2012 White/Black/Infrared',NULL,'Asics Gel Saga Orange Blaze Pack','Asics Gel Saga Orange Blaze Pack',NULL,NULL),(613,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(613,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(613,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(614,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2013</p>','asics-gel-lyte-iii-captain-blue-white-navy-blue-grey','Asics Gel Lyte III \"Captain Blue\" Camo pack White/Navy/Blue/Grey GL3 2013 Retro',NULL,'Asics Gel Lyte III \"Captain Blue\" Camo pack White/Navy/Blue/Grey','Asics Gel Lyte III \"Captain Blue\" White/Navy/Blue/Grey',NULL,NULL),(614,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2013</p>','asics-gel-lyte-iii-captain-blue-white-navy-blue-grey','Asics Gel Lyte III \"Captain Blue\" Camo pack White/Navy/Blue/Grey GL3 2013 Retro',NULL,'Asics Gel Lyte III \"Captain Blue\" Camo pack White/Navy/Blue/Grey','Asics Gel Lyte III \"Captain Blue\" White/Navy/Blue/Grey',NULL,NULL),(614,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(614,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(614,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(615,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p style=\"text-align: justify;\">The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2012</p>','dunk-skinny-leopard','Nike Dunk Skinny Leopard Women Hi Black/White 2012',NULL,'Dunk Skinny Leopard','Dunk Skinny Leopard',NULL,NULL),(615,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p style=\"text-align: justify;\">La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>\r\n<p> </p>','<p>Année de sortie: 2012</p>','dunk-skinny-leopard','Nike Dunk Skinny Leopard Women Hi Black/White 2012',NULL,'Dunk Skinny Leopard','Dunk Skinny Leopard',NULL,NULL),(615,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(615,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(615,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(616,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2012</p>','air-max-1-leopard','Air Max 1 Leopard Black/White/Sandtrap/Dark Gold Leaf/Sunburst 2012',NULL,'Air Max 1 Leopard','Air Max 1 Leopard',NULL,NULL),(616,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2012</p>','air-max-1-leopard','Air Max 1 Leopard Black/White/Sandtrap/Dark Gold Leaf/Sunburst 2012',NULL,'Air Max 1 Leopard','Air Max 1 Leopard',NULL,NULL),(616,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(616,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(616,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(617,1,1,'<p>About Air Jordan XI:</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan was back for real and led the Bulls to another NBA victory. What a come back! If Jordan was back, so was Tinker Hatfield. A terrific design with a new patent leather and the return of the clear rubber sole made the Air Jordan XI the most appreciated Air Jordan model ever released. <br />With the XI\'s we also saw the return of low-tops. Something that would follow the Air Jordan\'s all the way to the XVI\'s (though skipping the XII\'s).</p>','<p>Year of release: 2012</p>','air-jordan-xi-bred','Nike Air Jordan XI Bred AJ 11 Black/Red/White Retro 2012',NULL,'Air Jordan XI Bred','Air Jordan XI Bred',NULL,NULL),(617,1,2,'<p>A propos de la Air Jordan XI:</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan est de retour et il conduit les Bulls à un nouveau titre NBA. Quel retour! Tinker Hatfield est aussi de retour. Un design superbe avec un nouveau cuir verni, on note le retour de la semelle transparente qui fait de la Air Jordan XI le modèle le plus apprécié des Air Jordan. <br />Avec la Jordan XI on remarque aussi  le retour des baskets semi-montantes.  Une forme qui allait perdurer jusque la Jordan XVI (excepté la XII).</p>','<p>Année de sortie: 2012</p>','air-jordan-xi-bred','Nike Air Jordan XI Bred AJ 11 Black/Red/White Retro 2012',NULL,'Air Jordan XI Bred','Air Jordan XI Bred',NULL,NULL),(617,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(617,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(617,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(618,1,1,'<p>About Air Jordan XI:</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan was back for real and led the Bulls to another NBA victory. What a come back! If Jordan was back, so was Tinker Hatfield. A terrific design with a new patent leather and the return of the clear rubber sole made the Air Jordan XI the most appreciated Air Jordan model ever released. <br />With the XI\'s we also saw the return of low-tops. Something that would follow the Air Jordan\'s all the way to the XVI\'s (though skipping the XII\'s).</p>','<p>Year of release: 2012</p>','air-jordan-xi-bred-gs','Nike Air Jordan XI Bred GS AJ 11 Black/Red/White Women Ladies Retro 2012',NULL,'Air Jordan XI Bred GS','Air Jordan XI Bred GS',NULL,NULL),(618,1,2,'<p>A propos de la Air Jordan XI:</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan est de retour et il conduit les Bulls à un nouveau titre NBA. Quel retour! Tinker Hatfield est aussi de retour. Un design superbe avec un nouveau cuir verni, on note le retour de la semelle transpare