,'<p>Année de sortie: 2013</p>','roshe-run-gs-brave-blue-orange','Air Roshe Run GS Brave Blue/Orange Suede Premium 2013',NULL,'Roshe Run GS Brave Blue/Orange','Roshe Run GS Brave Blue/Orange',NULL,NULL),(629,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(629,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(629,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(631,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','roshe-run-two-toned-suede-black-grey','Roshe Run \"Two Toned\" Suede Black/Grey Perforated swoosh pack Premium 2013',NULL,'Roshe Run \"Two Toned\" Suede Black/Grey','Roshe Run \"Two Toned\" Suede Black/Grey',NULL,NULL),(631,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','roshe-run-two-toned-suede-black-grey','Roshe Run \"Two Toned\" Suede Black/Grey Perforated swoosh pack Premium 2013',NULL,'Roshe Run \"Two Toned\" Suede Black/Grey','Roshe Run \"Two Toned\" Suede Black/Grey',NULL,NULL),(631,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(631,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(631,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(632,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','air-max-thea-grey-lime','Nike Air Max Thea Grey/Lime 2013 Women',NULL,'Air Max Thea Grey/Lime','Air Max Thea Grey/Lime',NULL,NULL),(632,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','air-max-thea-grey-lime','Nike Air Max Thea Grey/Lime 2013 Women',NULL,'Air Max Thea Grey/Lime','Air Max Thea Grey/Lime',NULL,NULL),(632,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(632,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(632,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(633,1,1,'<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2012</p>','air-jordan-vi-olympic','Nike Air Jordan VI Olympic AJ 6 2012',NULL,'Air Jordan VI Olympic','Air Jordan VI Olympic',NULL,NULL),(633,1,2,'<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2012</p>','air-jordan-vi-olympic','Nike Air Jordan VI Olympic AJ 6 2012',NULL,'Air Jordan VI Olympic','Air Jordan VI Olympic',NULL,NULL),(633,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(633,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(633,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(634,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2013</p>','air-jordan-iv-green-glow-baby-beanie','Nike Air Jordan IV \"Green Glow\" GP Baby + Beanie + Beanie AJ 4 2013',NULL,'Air Jordan IV \"Green Glow\" GP Baby + Beanie','Air Jordan IV \"Green Glow\" GP Baby + Beanie',NULL,NULL),(634,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2013</p>','air-jordan-iv-green-glow-baby-beanie','Nike Air Jordan IV \"Green Glow\" GP Baby + Beanie bonnet bébé AJ 4 2013',NULL,'Air Jordan IV \"Green Glow\" GP Baby + Beanie','Air Jordan IV \"Green Glow\" GP Baby + Beanie',NULL,NULL),(634,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(634,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(634,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(635,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan V:</p>\r\n<p>Year of release of OG model: 1989</p>\r\n<p style=\"text-align: justify;\">Designer: Tinker Hatfield<br />Phil Jackson took over as head coach for the Bulls in the 89-90 season. This gave the Bull\'s an extra boost and everything was flying. Jordan kept on playing his game and set a personal best when scoring 69 points in a game against the Cleveland Cavaliers. Once again Hatfield came up with a revolutionary design for the new shoe.</p>\r\n<p style=\"text-align: justify;\">The AJ5 was inspired by World War II Fighter planes (Spitfire WWII) brought to light by The \"reverse flames\". The clear outsole was inspired by the clear panels of Marty MacFly\'s Back to the Future II boots which Tinker had designed for the movie. Tinker put a reflective 3M tongue with Jumpman embroidery. Whenever a photograph flash goes off, the tongue would light up and the tiny Jumpman would be highlighted in the background.</p>','<p>Year of release: 2013</p>','air-jordan-v-fire-red-gp-baby-beanie','Nike Air Jordan V \"Fire Red\" GP Baby + Beanie AJ 5 2013',NULL,'Air Jordan V \"Fire Red\" GP Baby + Beanie','Air Jordan V \"Fire Red\" GP Baby + Beanie',NULL,NULL),(635,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan V:</p>\r\n<p>Date de sortie du modèle original: 1989</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Phil Jackson arrive à la tête des Bulls en 1989-90. Ce renfort donne des ailes à l’équipe. Michael Jordan établit un nouveau record personnel de 69 points marqués durant un match, contre les Cleveland Cavaliers. Tinker Hatfield puise cette fois son inspiration dans un avion de combat (le Spitfire WWII ), laissant apparaître des flammes inversées sur le côté de la chaussure. La semelle transparente a été inspirée par la paire de chaussure révolutionnaire (dessinée par Tinker hatfield) portée par Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2013</p>','air-jordan-v-fire-red-gp-baby-beanie','Nike Air Jordan V \"Fire Red\" GP Baby + Beanie bonnet bébé AJ 5 2013',NULL,'Air Jordan V \"Fire Red\" GP Baby + Beanie','Air Jordan V \"Fire Red\" GP Baby + Beanie',NULL,NULL),(635,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(635,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(635,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(636,1,1,'<p>Year of release: 2012</p>\r\n<p>Retro model of the Air Jordan VII only worn by Michael Jordan during the 1992 Olympic Games in Barcelona. The shoe bears the number 9 on the heel, which was Jordan\'s jersey number in the \"Dream team\".</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>\r\n<p> </p>','<p>Year of release: 2012</p>','air-jordan-vii-olympic','Nike Air Jordan VII Olympic AJ 7 2012',NULL,'Air Jordan VII Olympic','Air Jordan VII Olympic',NULL,NULL),(636,1,2,'<p>Année de sortie: 2012</p>\r\n<p>Modèle Retro de la Air Jordan VII portée par Michael Jordan exclusivement durant le tournoi Olympique de Barcelone. Sur chaque talon, la paire est frappée du numéro 9, qui était le numéro de Jordan au sein de la \"Dream Team\".</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2012</p>','air-jordan-vii-olympic','Nike Air Jordan VII Olympic AJ 7 2012',NULL,'Air Jordan VII Olympic','Air Jordan VII Olympic',NULL,NULL),(636,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(636,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(636,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(637,1,1,'<p>Year of release: 2012</p>\r\n<p>This model was reissued in 2012 to celebrate the 20th anniversary of Barcelona Olympics.</p>\r\n<p> </p>\r\n<p>About Air Force 180:</p>\r\n<p>Year of release of OG Model: 1991</p>\r\n<p>The Nike Air Force 180 is usually considered as one of the best CB shoes ever made. The Air Force 180 was exclusively worn by Charles Barkley. As he was a member of the original “Dream Team” Nike had the excellent idea to create an exclusive model for the 1992 Olympics.</p>\r\n<p>This classic basketball shoe has a synthetic upper with chunky outsole, velcro support and embroidered detail on heel and tongue. A unique 180 system that makes this Air Force look super-stylish.</p>','<p>Year of release: 2012</p>','air-force-180-olympic','Nike Air Force 180 Olympic 2012 CB Charles Barkley 1992',NULL,'Air Force 180 Olympic','Air Force 180 Olympic',NULL,NULL),(637,1,2,'<p>Année de sortie: 2012</p>\r\n<p>Paire rééditée à l\'occasion des 20 ans des Jeux Olympiques de Barcelone.</p>\r\n<p> </p>\r\n<p>A propos de la Air Force 180:</p>\r\n<p>Année de sortie du modèle original: 1991</p>\r\n<p>La Nike Air Force 180 est considérée comme l\'un des modèles les plus emblématiques de la gamme Charles Barkley. Lors de sa participation aux Jeux Olympiques de Barcelone de 1992 au sein de la fameuse « Dream Team », Nike eut l’excellente idée de lui fournir un modèle exclusif pour l’événement.</p>\r\n<p>Ce classique de basketball se compose d’un cuir synthétique, avec soutien velcro de la cheville et détail brodé sur le talon et la languette. Ce modèle est également reconnaissable par sa semelle proéminente, avec son système air visible à 180 degré, ce qui donne à la Air Force 180 un look très agressif.</p>','<p>Année de sortie: 2012</p>','air-force-180-olympic','Nike Air Force 180 Olympic 2012 CB Charles Barkley 1992',NULL,'Air Force 180 Olympic','Air Force 180 Olympic',NULL,NULL),(637,1,3,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(637,1,4,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(637,1,5,NULL,NULL,'nike-air-lebron-9-ps-elite-south-beach',NULL,NULL,NULL,'Nike air Lebron 9 P.S Elite South Beach',NULL,NULL),(642,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-black-white-university-red-women','Nike Air Max 1 Black/White/University Red Women OG GS WMN 2012',NULL,'Air Max 1 Black/White/University Red Women','Air Max 1 Black/White/University Red Women',NULL,NULL),(642,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-black-white-university-red-women','Nike Air Max 1 Black/White/University Red Women OG GS WMN 2012',NULL,'Air Max 1 Black/White/University Red Women','Air Max 1 Black/White/University Red Women',NULL,NULL),(642,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(642,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(642,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(649,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-fb-yeezy-black-fresh-mint-pink','Nike Air Max 1 FB \"Yeezy\" Black/Fresh Mint/Pink limited edition 2013',NULL,'Air Max 1 FB \"Yeezy\" Black/Fresh Mint/Pink','Air Max 1 FB \"Yeezy\" Black/Fresh Mint/Pink',NULL,NULL),(649,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-fb-yeezy-black-fresh-mint-pink','Nike Air Max 1 FB \"Yeezy\" Black/Fresh Mint/Pink limited edition 2013',NULL,'Air Max 1 FB \"Yeezy\" Black/Fresh Mint/Pink','Air Max 1 FB \"Yeezy\" Black/Fresh Mint/Pink',NULL,NULL),(649,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(649,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(649,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(651,1,1,'<p>About Air Jordan IX:</p>\r\n<p>Year of release of OG model: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This pair was released in late 1993. Some weeks before its release, MJ had announced his retirement from the NBA at 30 (following the death of his father, murdered in North <br />Carolina). Therefore, this is the first shoe he did not wear in an NBA season game, but some other players did, such as Penny Hardaway, Kendall Gill or Mitch Richmond. As MJ then decided to start a new career in Baseball, Nike created a version of the model with cleats.</p>\r\n<p>The shoe uses advanced technology: dynamic-Fit inner bootie, encapsulated Air-Sole unit (forefoot), large volume Air-Sole unit (heel), polyurethane midsole and “one-pull” lacing system. Tinker Hatfield said he was inspired by Japanese design to create this model, a way for him to <br />show that MJ had become a worldwide icon. This is also shown on the soles that feature words like « freedom », « independance », « force » and « athletic » in several languages from every continent.</p>','<p>Year of release: 2012</p>','air-jordan-ix-fontay-montana','Nike Air Jordan IX Fontay Montana Johnny Kilroy Pack AJ 9 2012',NULL,'Air Jordan IX Fontay Montana','Air Jordan IX Fontay Montana',NULL,NULL),(651,1,2,'<p>A propos de la Air Jordan IX:</p>\r\n<p>Date de sortie du modèle original: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan IX est sortie fin 1993. Quelques semaines avant sa sortie, MJ avait annoncé sa retraite à l’âge de 30 ans (après le décès de son père, assassiné en Caroline du Nord). Par conséquent, il s\'agit de la première Air Jordan qu’il n’ait pas portée lors d’un match officiel, mais d’autres joueurs, tels que Penny Hardaway, Kendall Gill ou Mitch Richmond, l’ont étrennée sur les parquets NBA. Comme MJ avait alors décidé de se lancer dans le baseball, Nike a spécialement créé une version du modèle avec des crampons. La chaussure utilise des technologies avancées: chausson interne « dynamique-Fit », double système Air-Sole intégré (un à l’avant-pied et un grand au talon), midsole en polyuréthanne et système de laçage \"one pull\". Tinker Hatfield a dit s’être inspiré du design japonais pour la conception de ce modèle, une façon pour lui de montrer que MJ était devenu une icône dans le monde entier. Ceci est également mis en avant sur les semelles qui comportent des mots comme «liberté», «indépendance», «force» et «athlétique» dans différentes langues venues des quatre coins du monde.</p>','<p>Année de sortie: 2012</p>','air-jordan-ix-fontay-montana','Nike Air Jordan IX Fontay Montana Johnny Kilroy Pack AJ 9 2012',NULL,'Air Jordan IX Fontay Montana','Air Jordan IX Fontay Montana',NULL,NULL),(651,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(651,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(651,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(652,1,1,'<p>About Air Jordan IX:</p>\r