 model, a way for him to <br />show that MJ had become a worldwide icon. This is also shown on the soles that feature words like « freedom », « independance », « force » and « athletic » in several languages from every continent.</p>','<p>Year of release: 2012</p>','air-jordan-ix-olive','Nike Air Jordan IX Olive AJ 9 Retro 2012',NULL,'Air Jordan IX Olive','Air Jordan IX Olive',NULL,NULL),(655,1,2,'<p>A propos de la Air Jordan IX:</p>\r\n<p>Date de sortie du modèle original: 1993</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La Air Jordan IX est sortie fin 1993. Quelques semaines avant sa sortie, MJ avait annoncé sa retraite à l’âge de 30 ans (après le décès de son père, assassiné en Caroline du Nord). Par conséquent, il s\'agit de la première Air Jordan qu’il n’ait pas portée lors d’un match officiel, mais d’autres joueurs, tels que Penny Hardaway, Kendall Gill ou Mitch Richmond, l’ont étrennée sur les parquets NBA. Comme MJ avait alors décidé de se lancer dans le baseball, Nike a spécialement créé une version du modèle avec des crampons. La chaussure utilise des technologies avancées: chausson interne « dynamique-Fit », double système Air-Sole intégré (un à l’avant-pied et un grand au talon), midsole en polyuréthanne et système de laçage \"one pull\". Tinker Hatfield a dit s’être inspiré du design japonais pour la conception de ce modèle, une façon pour lui de montrer que MJ était devenu une icône dans le monde entier. Ceci est également mis en avant sur les semelles qui comportent des mots comme «liberté», «indépendance», «force» et «athlétique» dans différentes langues venues des quatre coins du monde.</p>','<p>Année de sortie: 2012</p>','air-jordan-ix-olive','Nike Air Jordan IX Olive AJ 9 Retro 2012',NULL,'Air Jordan IX Olive','Air Jordan IX Olive',NULL,NULL),(655,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(655,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(655,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(656,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2013</p>','air-jordan-iv-fear','Nike Air Jordan IV Fear Black/White/Cool Grey Nubuck Suede retro AJ 4 2013',NULL,'Air Jordan IV Fear','Air Jordan IV Fear',NULL,NULL),(656,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2013</p>','air-jordan-iv-fear','Nike Air Jordan IV Fear Black/White/Cool Grey Nubuck Suede retro AJ 4 2013',NULL,'Air Jordan IV Fear','Air Jordan IV Fear',NULL,NULL),(656,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(656,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(656,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(661,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>Retro version of the 33 Hi worn by Patrick Ewing in 1990.</p>','<p>Year of release: 2013</p>','ewing-33-hi-purple-black','Ewing 33 Hi Purple/Black Patrick Ewing Retro NBA Basketball 1990',NULL,'Ewing 33 Hi Purple/Black','Ewing 33 Hi Purple/Black',NULL,NULL),(661,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>Réédition du modèle 33 Hi porté par Patrick Ewing en 1990.</p>','<p>Année de sortie: 2013</p>','ewing-33-hi-purple-black','Ewing 33 Hi Purple/Black Patrick Ewing Retro NBA Basketball 1990',NULL,'Ewing 33 Hi Purple/Black','Ewing 33 Hi Purple/Black',NULL,NULL),(661,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(661,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(661,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(665,1,1,'<p>About Air Max 90:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Introduced in 1990 as the Nike Air Max III, the Air Max 90 turned more heads with an even larger visible Air unit and greater stability and cushioning. It has been re-released as a retro version with an unmeasurable amount of colorways and themes. The Air Max 90 was referred to as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2013</p>','air-max-90-og-infrared','Nike Air Max 90 OG Infrared Vintage White/Red/Black/Grey 2013 Retro',NULL,'Air Max 90 OG Infrared','Air Max 90 OG Infrared',NULL,NULL),(665,1,2,'<p>A propos de la Air Max 90:</p>\r\n<p> </p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2013</p>','air-max-90-og-infrared','Nike Air Max 90 OG Infrared Vintage White/Red/Black/Grey 2013 Retro',NULL,'Air Max 90 OG Infrared','Air Max 90 OG Infrared',NULL,NULL),(665,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(665,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(665,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(666,1,1,'<p><span style=\"color: #ff0000;\"><strong>Pre-order:</strong></span> delivery planned late December 2013</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2014</p>','pre-order-asics-gel-lyte-iii-green-glow-white-grey','PRE-ORDER: Asics Gel Lyte III Green Glow/White/Grey GL3 Retro 2013 SS14',NULL,'PRE-ORDER: Asics Gel Lyte III Green Glow/White/Grey','PRE-ORDER: Asics Gel Lyte III Green Glow/White/Grey',NULL,NULL),(666,1,2,'<p><span style=\"color: #ff0000;\"><strong>Pré-commande:</strong></span> expédition fin décembre 2013</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2014</p>','pre-order-asics-gel-lyte-iii-green-glow-white-grey','PRE-ORDER: Asics Gel Lyte III Green Glow/White/Grey GL3 Retro 2013 SS14',NULL,'PRE-ORDER: Asics Gel Lyte III Green Glow/White/Grey','PRE-ORDER: Asics Gel Lyte III Green Glow/White/Grey',NULL,NULL),(666,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(666,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(666,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(667,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2014</p>','asics-gel-lyte-iii-print-pack-aztec','Asics Gel Lyte III Print Pack \"Aztec\" GL3 Retro 2013 SS14',NULL,'Asics Gel Lyte III Print Pack \"Aztec\"','Asics Gel Lyte III Print Pack \"Aztec\"',NULL,NULL),(667,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-iii-print-pack-aztec','Asics Gel Lyte III Print Pack \"Aztec\" GL3 Retro 2013 SS14',NULL,'Asics Gel Lyte III Print Pack \"Aztec\"','Asics Gel Lyte III Print Pack \"Aztec\"',NULL,NULL),(667,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(667,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(667,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(675,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','roshe-run-mid-black-atomic-red','Nike Roshe Run Mid Black/Atomic Red Premium 2013',NULL,'Roshe Run Mid Black/Atomic Red','Roshe Run Mid Black/Atomic Red',NULL,NULL),(675,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','roshe-run-mid-black-atomic-red','Nike Roshe Run Mid Black/Atomic Red Premium 2013',NULL,'Roshe Run Mid Black/Atomic Red Premium 2013','Roshe Run Mid Black/Atomic Red',NULL,NULL),(675,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(675,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(675,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(676,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','roshe-run-gs-black-metallic-silver','Air Roshe Run GS Black/Metallic Silver Premium 2013',NULL,'Roshe Run GS Black/Metallic Silver','Roshe Run GS Black/Metallic Silver',NULL,NULL),(676,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','roshe-run-gs-black-metallic-silver','Air Roshe Run GS Black/Metallic Silver Premium 2013',NULL,'Roshe Run GS Black/Metallic Silver','Roshe Run GS Black/Metallic Silver',NULL,NULL),(676,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(676,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(676,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(678,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2013</p>','air-jordan-iii-fire-red-gs','Nike Air Jordan III Fire Red GS retro AJ 3 2011',NULL,'Air Jordan III Fire Red GS','Air Jordan III Fire Red GS',NULL,NULL),(678,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2013</p>','air-jordan-iii-fire-red-gs','Nike Air Jordan III Fire Red GS retro AJ 3 2011',NULL,'Air Jordan III Fire Red GS','Air Jordan III Fire Red GS',NULL,NULL),(678,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(678,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(678,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(680,1,1,'<p>T-shirt Throwback Sneakers (silkcreen printed), colorway inspired from the legendary Andre Agassi shoe: the Nike Air Tech Challenge II \"Hot Lava\" (released in 1990)</p>\r\n<p>100% Cotton, 190gr</p>\r\n<p>Style: classic</p>\r\n<p>Measurments (in cm):</p>\r\n<div class=\"guide-taille\"><img src=\"http://s7v3.scene7.com/is/image/soloinvest/icon-guide-taille-tshirt\" alt=\"\" border=\"0\" /></div>\r\n<div class=\"guide-taille\"> </div>\r\n<div class=\"guide-taille\">X-Small: 62/49     </div>\r\n<div class=\"guide-taille\">Small: 69/50</div>\r\n<div class=\"guide-taille\">Medium: 72/53</div>\r\n<div class=\"guide-taille\">Large: 74/56</div>\r\n<div class=\"guide-taille\">X-Large: 76/58</div>','<p>T-shirt Throwback Sneakers White</p>','t-shirt-throwback-sneakers-hot-lava-white','T-shirt Throwback Sneakers \"Hot Lava\" White logo serigraphie Andre Agassi Air Tech Challenge 2 1989',NULL,'T-shirt Throwback Sneakers \"Hot Lava\" White','T-shirt Throwback Sneakers \"Hot Lava\" White',NULL,NULL),(680,1,2,'<p>T-shirt Throwback Sneakers (logo sérigraphié), colori inspiré du modèle mythique porté par André Agassi: la Nike Air Tech Challenge II \"Hot Lava\" (sortie en 1990)</p>\r\n<p>100% Coton, 190gr</p>\r\n<p>Coupe classique</p>\r\n<p>Mesures (en cm):</p>\r\n<div class=\"guide-taille\"><img src=\"http://s7v3.scene7.com/is/image/soloinvest/icon-guide-taille-tshirt\" alt=\"\" border=\"0\" /></div>\r\n<div class=\"guide-taille\"> </div>\r\n<div class=\"guide-taille\">X-Small: 62/49     </div>\r\n<div class=\"guide-taille\">Small: 69/50</div>\r\n<div class=\"guide-taille\">Medium: 72/53</div>\r\n<div class=\"guide-taille\">Large: 74/56</div>\r\n<div class=\"guide-taille\">X-Large: 76/58</div>','<p>T-shirt Throwback blanc</p>','t-shirt-throwback-sneakers-hot-lava-blanc','T-shirt Throwback Sneakers \"Hot Lava\" Blanc Andre Agassi Air tech challenge 2 1989 logo serigraphie',NULL,'T-shirt Throwback Sneakers \"Hot Lava\" Blanc','T-shirt Throwback Sneakers \"Hot Lava\" Blanc',NULL,NULL),(680,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(680,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(680,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(684,1,1,'<p>Year of release: 2013</p>\r\n<p>Limited Air Tech Challenge II edition release especially for Wimbledon Tournament 2013.</p>\r\n<p> </p>\r\n<p>About Air Tech Challenge II:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>There has been a lot of anticipation and discussion around this Nike Collector shoe release.</p>\r\n<p>This Andre Agassi classic first hit the scene in 1990. That year Andre Agassi lost 2 grand slams finals. The first in Roland Garros against the Ecuadorian Andres Gomez and the second at the U.S. Open against Pete Sampras. The Hot LAVA ATC II is probably the most sought after model in the entire Air Tech line. Nike did an excellent job on this retro which is almost identical to the original model.</p>','<p>Year of release: 2013</p>','air-tech-challenge-ii-hot-lava','Nike Air Tech Challenge II \"Hot Lava\" Agassi Retro 1990',NULL,'Air Tech Challenge II \"Wimbledon\"','Air Tech Challenge II \"Wimbledon\"',NULL,NULL),(684,1,2,'<p>Année de sortie: 2013</p>\r\n<p>Edition limitée de la Air Tech Challenge II sortie spécialement pour le tournoi de Wimbledon 2013.</p>\r\n<p> </p>\r\n<p>A propos de la Air Tech Challenge II:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Il y a eu beaucoup de discussions autour de la sortie de ce modèle emblématique de chez Nike.</p>\r\n<p>Ce grand classique fut porté par Andre Agassi en 1990. Cette année-là, Agassi perdit 2 finales de Grand Chelem. La première à Roland Garros contre l\'Équatorien Andres Gomez et la deuxième à l\'US Open contre Pete Sampras. La Hot Lava est probablement le modèle le plus recherché dans la gamme Air Tech. Nike a fait un excellent travail sur cette rétro, en effet, la chaussure est quasi-identique à l\'originale.</p>','<p>Année de sortie: 2013</p>','air-tech-challenge-ii-wimbledon','Nike Air Tech Challenge II \"Wimbledon\" Agassi Retro 1990 hot lava',NULL,'Air Tech Challenge II \"Wimbledon\"','Air Tech Challenge II \"Wimbledon\"',NULL,NULL),(684,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(684,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(684,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(685,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan V:</p>\r\n<p>Year of release of OG model: 1989</p>\r\n<p>Designer: Tinker Hatfield<br />Phil Jackson took over as head coach for the Bulls in the 89-90 season. This gave the Bull\'s an extra boost and everything was flying. Jordan kept on playing his game and set a personal best when scoring 69 points in a game against the Cleveland Cavaliers. Once again Hatfield came up with a revolutionary design for the new shoe.</p>\r\n<p>The AJ5 was inspired by World War II Fighter planes (Spitfire WWII) brought to light by The \"reverse flames\". The clear outsole was inspired by the clear panels of Marty MacFly\'s Back to the Future II boots which Tinker had designed for the movie. Tinker put a reflective 3M tongue with Jumpman embroidery. Whenever a photograph flash goes off, the tongue would light up and the tiny Jumpman would be highlighted in the background.</p>','<p>Year of release: 2013</p>','air-jordan-v-3lab5','Nike Air Jordan V \"3LAB5\" AJ 5 2013 QS Elephant print grey',NULL,'Air Jordan V \"3LAB5\"','Air Jordan V \"3LAB5\"',NULL,NULL),(685,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan V:</p>\r\n<p>Date de sortie du modèle original: 1989</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Phil Jackson arrive à la tête des Bulls en 1989-90. Ce renfort donne des ailes à l’équipe. Michael Jordan établit un nouveau record personnel de 69 points marqués durant un match, contre les Cleveland Cavaliers. Tinker Hatfield puise cette fois son inspiration dans un avion de combat (le Spitfire WWII ), laissant apparaître des flammes inversées sur le côté de la chaussure. La semelle transparente a été inspirée par la paire de chaussure révolutionnaire (dessinée par Tinker hatfield) portée par Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2013</p>','air-jordan-v-3lab5','Nike Air Jordan V \"3LAB5\" AJ 5 2013 QS Elephant print grey',NULL,'Air Jordan V \"3LAB5\"','Air Jordan V \"3LAB5\"',NULL,NULL),(685,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(685,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(685,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(686,1,1,'<p>Year of release: 2013</p>\r\n<p>This extremely limited pack is the result of a collaboration between Rudnes Custom &amp; Throwback Sneakers.</p>\r\n<p>Its colorway is inspired from the legendary Andre Agassi shoe: the Nike Air Tech Challenge II \"Hot Lava\" (released in 1990). It\'s composed of:</p>\r\n<p>-a pair of Roshe Run \"Roshe Lava\" custom by Rudnes Custom</p>\r\n<p>-a matching shoebag made of cotton</p>\r\n<p>-a Throwback Sneakers \"Hot Lava\" t-shirt</p>\r\n<p>-a transparente box showing both Rudnes &amp; Throwback Sneakers logos</p>\r\n<p> </p>\r\n<p>While ordering, please precise the equested size for your t-shirt, by adding a comment to your payment, or by sending us a message via our <a href=\"http://throwback-sneakers.com/fr/contactez-nous\">contact form</a> precising your order number.</p>','<p>Year of release: 2013</p>','roshe-run-roshe-lava-pack-throwback-sneakers-x-rudnes-custom','Roshe Run \"Roshe Lava\" Pack - Throwback Sneakers x Rudnes Custom Agassi Hot Lava collab',NULL,'Roshe Run \"Roshe Lava\" Pack - Throwback Sneakers x Rudnes Custom','Roshe Run \"Roshe Lava\" Pack - Throwback Sneakers x Rudnes Custom',NULL,NULL),(686,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>Ce pack ultra limité est le fruit d\'une collaboration entre Rudnes Custom &amp; Throwback Sneakers.</p>\r\n<p>Il s\'inspire du colori du modèle mythique porté par André Agassi: la Nike Air Tech Challenge II \"Hot Lava\" (sortie en 1990). Il se compose:</p>\r\n<p>-d\'une paire de Roshe Run \"Roshe Lava\" custom par Rudnes Custom</p>\r\n<p>-d\'un sac en coton assorti</p>\r\n<p>-d\'un t-shirt Throwback Sneakers \"Hot Lava\"</p>\r\n<p>-d\'une boîte transparente portant les logos Rudnes &amp; Throwback Sneakers</p>\r\n<p> </p>\r\n<p>Lors de la commande, merci de nous préciser la taille souhaitée pour votre t-shirt, soit par un commentaire attaché à votre paiement, soit par envoi d\'un message via notre <a href=\"http://throwback-sneakers.com/fr/contactez-nous\">formulaire de contact</a> en précisant votre numéro de commande.</p>','<p>Année de sortie: 2013</p>','roshe-run-roshe-lava-pack-throwback-sneakers-x-rudnes-custom','Roshe Run \"Roshe Lava\" Pack - Throwback Sneakers x Rudnes Custom Agassi Hot Lava collab',NULL,'Roshe Run \"Roshe Lava\" Pack - Throwback Sneakers x Rudnes Custom','Roshe Run \"Roshe Lava\" Pack - Throwback Sneakers x Rudnes Custom',NULL,NULL),(686,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(686,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(686,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(687,1,1,'<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2013</p>','asics-gel-lyte-iii-black-white-green','Asics Gel Lyte III Black/White/Green GL3 Retro 2013 SS14',NULL,'Asics Gel Lyte III Black/White/Green','Asics Gel Lyte III Black/White/Green',NULL,NULL),(687,1,2,'<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2013</p>','asics-gel-lyte-iii-black-white-green','Asics Gel Lyte III Black/White/Green GL3 Retro 2013 SS14',NULL,'Asics Gel Lyte III Black/White/Green','Asics Gel Lyte III Black/White/Green',NULL,NULL),(687,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(687,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(687,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(688,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','asics-gel-saga-brown-green','Asics Gel Saga Brown/Green Camo Pack 2013 Running retro',NULL,'Asics Gel Saga Brown/Green Camo Pack','Asics Gel Saga Brown/Green',NULL,NULL),(688,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','asics-gel-saga-brown-green','Asics Gel Saga Brown/Green Camo Pack 2013 Running retro',NULL,'Asics Gel Saga Brown/Green Camo Pack','Asics Gel Saga Brown/Green',NULL,NULL),(688,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(688,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(688,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(690,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mi