',NULL,NULL),(763,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(763,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(764,1,1,'<p><span style=\"color: #ff0000;\"><span style=\"color: #000000;\">The iconic ZX 8000 takes on a twist in </span></span>this collaboration with Japanese retailer MITA.  Inspiration for this collab is taken from the original color palette of the EQT Support and the use of premium suedes and ballistic mesh</p>','<p>Year of release: 2013</p>','adidas-torsion-zx8000-eqt-support-x-mita-white-black-green','Adidas Torsion ZX8000 EQT Support x Mita White/Black/Green 2013 collab equipment retro running',NULL,'Adidas Torsion ZX8000 EQT Support x Mita White/Black/Green','Adidas Torsion ZX8000 EQT Support x Mita White/Black/Green',NULL,NULL),(764,1,2,'<p>Mita Sneakers est un shop habitué au collaborations avec de nombreuses marques de running. En 2013, le shop japonais nous présente une ZX8000 avec un coloris très inspiré par la <a title=\"Adidas EQT\" href=\"http://onemesh.fr/?portfolio=adidas-equipment-support\">Adidas EQT</a>. Mita reprend donc le coloris de la Adidas EQT avec du vert foncé, gris, noir et blanc. Les matériaux sont de qualité et on retrouve du mesh, du cuir et du cuir suédé sur cette paire de ZX8000.</p>','<p>Année de sortie: 2013</p>','adidas-torsion-zx8000-eqt-support-x-mita','Adidas Torsion ZX8000 EQT Support x Mita White/Black/Green 2013 collab equipment retro running',NULL,'Adidas Torsion ZX8000 EQT Support x Mita White/Black/Green','Adidas Torsion ZX8000 EQT Support x Mita',NULL,NULL),(764,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(764,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(764,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(768,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>This limited edition was released especially for London Masters 2013 and worn by Roger Federer during the competition. It\'s called \"Savile Row\" in reference to a street of London where are located the most famous british tailors.</p>\r\n<p> </p>\r\n<p>About Zoom Vapor 9:</p>\r\n<p>Year of release of OG model: 2011</p>\r\n<p>Design: Tinker Hatfield</p>','<p>Year of release: 2013</p>','air-zoom-vapor-tour-9-savile-row-le','nike Air Zoom Vapor Tour 9 \"Savile Row\" LE Master London 2013',NULL,'Air Zoom Vapor Tour 9 \"Savile Row\" LE','Air Zoom Vapor Tour 9 \"Savile Row\" LE',NULL,NULL),(768,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>Cette édition limitée est sortie spécialement à l\'occasion du Masters de Londres 2013 et a été portée par Roger Federer pendant la compétition. Son nom de \"Savile Row\" fait référence à une rue de Londres réputée pour regrouper les tailleurs les plus prisés de la capitale britannique.</p>\r\n<p> </p>\r\n<p>A propos de la Zoom Vapor 9:</p>\r\n<p>Date de sortie du modèle original: 2011</p>\r\n<p>Design: Tinker Hatfield</p>','<p>Année de sortie: 2013</p>','air-zoom-vapor-tour-9-savile-row-le','nike Air Zoom Vapor Tour 9 \"Savile Row\" LE Master London 2013',NULL,'Air Zoom Vapor Tour 9 \"Savile Row\" LE','Air Zoom Vapor Tour 9 \"Savile Row\" LE',NULL,NULL),(768,1,3,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(768,1,4,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(768,1,5,NULL,NULL,'nike-air-zoom-vapor-tour-9-nyc',NULL,NULL,NULL,'nike air zoom vapor tour 9 NYC',NULL,NULL),(772,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>Retro version of the 33 Hi worn by Patrick Ewing in 1990.</p>','<p>Year of release: 2014</p>','ewing-33-hi-st-patrick-s-day','Ewing 33 Hi \"St. Patrick\'s Day\" Patrick Ewing Retro NBA Basketball 1990',NULL,'Ewing 33 Hi \"St. Patrick\'s Day\"','Ewing 33 Hi \"St. Patrick\'s Day\"',NULL,NULL),(772,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>Réédition du modèle 33 Hi porté par Patrick Ewing en 1990.</p>','<p>Année de sortie: 2014</p>','ewing-33-hi-st-patrick-s-day','Ewing 33 Hi \"St. Patrick\'s Day\" Patrick Ewing Retro NBA Basketball 1990',NULL,'Ewing 33 Hi \"St. Patrick\'s Day\"','Ewing 33 Hi \"St. Patrick\'s Day\"',NULL,NULL),(772,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(772,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(772,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(774,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','air-max-1-kids-white-blue-grey','Nike Air Max 1 Kids White/Blue/Grey Navy Blue Running',NULL,'Air Max 1 Kids White/Blue/Grey','Air Max 1 Kids White/Blue/Grey',NULL,NULL),(774,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','air-max-1-kids-white-blue-grey','Nike Air Max 1 Kids White/Blue/Grey Navy Blue Running',NULL,'Air Max 1 Kids White/Blue/Grey','Air Max 1 Kids White/Blue/Grey',NULL,NULL),(774,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(774,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(774,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(776,1,1,'<p>Year of release: 2014</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Warning: This model cuts short, consider one size bigger than your usual Nike sizing.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Huarache:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>The \"Huarache\" was named after a Native American sandal. Its main particularity is a neoprene and spandex sock contained within the upper. The sock strongly holds the foot. Coupled with Nike’s trademark air unit, the Huarache pushed Nike running shoes one step forward in terms of comfort, performance and design.</p>','<p>Year of release: 2014</p>','air-huarache-cargo-khaki-sequoia','Nike Air Huarache Cargo Khaki/Sequoïa running 1991 2014 Retro',NULL,'Air Huarache Cargo Khaki/Sequoïa','Air Huarache Cargo Khaki/Sequoïa',NULL,NULL),(776,1,2,'<p>Année de sortie: 2014</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: ce modèle taille petit, compter une taille de plus que votre taille Nike habituelle.</strong></span></p>\r\n<p> </p>\r\n<p>A propos de la Air Huarache:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>La \"Huarache\" tire son nom d\'une sandale portée par les Indiens d\'Amérique. Sa principale particularité est son chausson fait de neoprene et Spandex qui recouvre toute la partie supérieure de la chaussure. Ce chausson épouse complètement la forme du pied. Son association avec le système Air a fait de la Huarache une paire révolutionnaire en terme de confort, performance et design.</p>','<p>Année de sortie: 2014</p>','air-huarache-cargo-khaki-sequoia','Nike Air Huarache Cargo Khaki/Sequoïa running 1991 2014 Retro',NULL,'Air Huarache Cargo Khaki/Sequoïa','Air Huarache Cargo Khaki/Sequoïa',NULL,NULL),(776,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(776,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(776,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(777,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-white-grey-volt-women','Nike Air Max 1 White/Grey/Volt Women GS WMN 2013',NULL,'Air Max 1 White/Grey/Volt Women','Air Max 1 White/Grey/Volt Women',NULL,NULL),(777,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-white-grey-volt-women','Nike Air Max 1 White/Grey/Volt Women GS WMN 2013',NULL,'Air Max 1 White/Grey/Volt Women','Air Max 1 White/Grey/Volt Women',NULL,NULL),(777,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(777,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(777,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(778,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Trainer 1:</p>\r\n<p>Year of release of OG Model: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>The Air Trainer 1 is a multipurpose sneaker created by Tinker Hatfield. He was inspired to create this model when he noticed people in his local gym using two pairs of sneakers, one for running and one for weightlifting.</p>\r\n<p>The Nike Air Trainer 1 is well known for being worn by tennis star John McEnroe and NBA players in the late 80’s.</p>','<p>Year of release: 2014</p>','air-trainer-1-qs-superbowl','Nike Air Trainer 1 QS Superbowl 2014 limited edition Nike Knows Quickstrike',NULL,'Air Trainer 1 QS Superbowl','Air Trainer 1 QS \"Superbowl\"',NULL,NULL),(778,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Trainer 1:</p>\r\n<p>Année de sortie du modèle original: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>La Air Trainer 1 est une paire multi-usages dessinée par Tinker Hatfield. Il a eu l’idée de créer ce modèle en voyant, dans la salle de sport de son quartier, que les clients apportaient deux paires de chaussures, une pour courir et une pour soulever des poids.</p>\r\n<p>La Air Trainer 1 a été rendue célèbre pour avoir été portée par John McEnroe et des joueurs NBA à la fin des années 80.</p>','<p>Année de sortie: 2014</p>','air-trainer-1-qs-superbowl','Nike Air Trainer 1 QS Superbowl 2014 limited edition Nike Knows Quickstrike',NULL,'Air Trainer 1 QS \"Superbowl\"','Air Trainer 1 QS \"Superbowl\"',NULL,NULL),(778,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(778,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(778,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(779,1,1,'<p>Year of release: 2013</p>\r\n<p>About Air 180:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p style=\"text-align: justify;\">This revolutionary shoe contained fifty per cent more air than previous Air Max models. During 1991 – 92, a variety of colourways was produced. A basketball version of this model, the Air Force 180, was worn by NBA star Charles Barkley at the 1992 Barcelona Olympics.</p>','<p>Year of release: 2013</p>','air-180-og-ultramarine','Nike Air 180 OG Ultramarine White/Navy/Infrared 2013',NULL,'Air 180 OG Ultramarine','Air 180 OG Ultramarine',NULL,NULL),(779,1,2,'<p>Année de sortie: 2013</p>\r\n<p><br />A propos de la Air 180: </p>\r\n<p>Date de sortie du modèle original: 1991 </p>\r\n<p style=\"text-align: justify;\">Cette chaussure révolutionnaire contient 50 % d’air de plus que les autres modèles Air Max de l\'époque. Ce modèle a été produit durant la saison 1991 – 92 dans une grande variété de couleurs. Une version basketball portant ce même système air, la Air force 180, a été rendue célèbre par le basketteur Charles Barkley, star de la NBA (notamment durant les jeux olympiques de Barcelone en 1992). <br /><br /></p>','<p>Année de sortie: 2013</p>','air-180-og-ultramarine','Nike Air 180 OG Ultramarine White/Navy/Infrared 2013',NULL,'Air 180 OG Ultramarine','Air 180 OG Ultramarine',NULL,NULL),(779,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(779,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(779,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(789,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>The Elite Edition of the 580 comes with a black suede upper, tonal leather detailing and perforated toe piece.<br /><br />Produced for the Asian market, the 580 features both the ENCAP® midsole and ROLLBAR® technology for ultimate motion control, making this shoes a piece of technical brilliance...</p>','<p>Year of release: 2013</p>','new-balance-mt580-mbk-black-grey-white','New Balance MT580 MBK Black/Grey/White 2013',NULL,'New Balance MT580 MBK Black/Grey/White','New Balance MT580 MBK Black/Grey/White',NULL,NULL),(789,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p><span id=\"result_box\" lang=\"fr\"><span class=\"hps atn\">L\'</span><span> Edition Elite</span> <span class=\"hps\">de la</span> <span class=\"hps\">NB580</span> <span class=\"hps\">est proposée avec un</span> <span class=\"hps\">daim noir</span> <span class=\"hps\">supérieure</span><span>,</span> <span class=\"hps\">en cuir</span> <span class=\"hps\">sur ton,</span> <span class=\"hps\">détaillé </span><span class=\"hps\">et</span> <span class=\"hps\">perforé</span><span>.</span> <br /><br /><span class=\"hps\">Produit pour le</span> <span class=\"hps\">marché asiatique</span><span>,</span> <span class=\"hps\">la</span> <span class=\"hps\">580</span> <span class=\"hps\">offre</span> <span class=\"hps\">à la fois</span> <span class=\"hps\">la semelle</span> <span class=\"hps\">ENCAP</span> <span class=\"hps\">®</span> <span class=\"hps\">et la technologie</span> <span class=\"hps\">ROLLBAR</span> <span class=\"hps\">®</span> <span class=\"hps\">pour le contrôle</span> <span class=\"hps\">du mouvement.</span> </span></p>','<p>Année de sortie: 2013</p>','new-balance-mt580-mbk-black-grey-white','New Balance MT580 MBK Black/Grey/White 2013',NULL,'New Balance MT580 MBK Black/Grey/White','New Balance MT580 MBK Black/Grey/White',NULL,NULL),(789,1,3,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(789,1,4,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(789,1,5,NULL,NULL,'new-balance-cm996-undefeated-stussy-hectic',NULL,NULL,NULL,'new balance CM996 undefeated stussy hectic',NULL,NULL),(794,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-liberty-qs-black-solar-red','Nike Air Max 1 Liberty QS Black/Solar Red Women GS WMN 2013 Quickstrike Pink Infrared',NULL,'Air Max 1 Liberty QS Black/Solar Red','Air Max 1 Liberty QS Black/Solar Red',NULL,NULL),(794,1,2,'<p>A