abriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-liberty-qs-armory-navy','Nike Air Max 1 Liberty QS Armory Navy Women GS WMN 2013 Quickstrike Blue Brown London',NULL,'Air Max 1 Liberty QS Armory Navy','Air Max 1 Liberty QS Armory Navy',NULL,NULL),(795,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(795,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(795,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(796,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>The original version of this model was inspired by hiking shoes. It was developed to be a very functional basketball shoe and it was the first Nike basketball shoe to feature the full-length Nike Air Sole. The strap made the fit secure and was used to prevent ankle injury. At first, this model was only produced in high and low; the mid version was produced later. The Air Force 1 has become popular on the hip-hop scene, partly owing to the huge range of colorways that have been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2014</p>','lunar-force-1-sp-low-x-undefeated','nike Air Lunar Force 1 SP Low x Undefeated 2014 TZ Tier Zero',NULL,'Lunar Force 1 SP Low x Undefeated','Lunar Force 1 SP Low x Undefeated',NULL,NULL),(796,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard. La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2014</p>','lunar-force-1-sp-low-x-undefeated','nike Air Lunar Force 1 SP Low x Undefeated 2014 TZ Tier Zero',NULL,'Lunar Force 1 SP Low x Undefeated 2014','Lunar Force 1 SP Low x Undefeated',NULL,NULL),(796,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(796,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(796,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(802,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2014</p>','asics-gel-lyte-iii-print-pack-aztec','Asics Gel Lyte III Print Pack \"Aztec\" GL3 Retro 2013 SS14',NULL,'Asics Gel Lyte III Print Pack \"Aztec\"','Asics Gel Lyte III Print Pack \"Aztec\"',NULL,NULL),(802,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-iii-print-pack-aztec','Asics Gel Lyte III Print Pack \"Aztec\" GL3 Retro 2013 SS14',NULL,'Asics Gel Lyte III Print Pack \"Aztec\"','Asics Gel Lyte III Print Pack \"Aztec\"',NULL,NULL),(802,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(802,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(802,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(803,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2012</p>','air-jordan-vii-raptor','Nike Air Jordan VII Raptor AJ 7 2012 Charcoal',NULL,'Air Jordan VII Raptor','Air Jordan VII Raptor',NULL,NULL),(803,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2012</p>','air-jordan-vii-raptor','Nike Air Jordan VII Raptor AJ 7 2012 Charcoal',NULL,'Air Jordan VII Raptor','Air Jordan VII Raptor',NULL,NULL),(803,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(803,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(803,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(807,1,1,'<p><span style=\"color: #ff0000;\"><strong>Pre-order:</strong></span> delivery planned in February 2014</p>\r\n<p> </p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design w