esh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-og-white-navy-red','Nike Air Max 1 OG White/Navy/Red 2013 Retro',NULL,'Air Max 1 OG White/Navy/Red','Air Max 1 OG White/Navy/Red',NULL,NULL),(811,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-og-white-navy-red','Nike Air Max 1 OG White/Navy/Red 2013 Retro',NULL,'Air Max 1 OG White/Navy/Red','Air Max 1 OG White/Navy/Red',NULL,NULL),(811,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(811,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(811,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(812,1,1,'<p><span style=\"color: #000000;\">Year of release: 2013<br /></span></p>\r\n<p> </p>\r\n<p>About Air Jordan VIII:</p>\r\n<p>Year of release of OG model: 1992</p>\r\n<p>In 1993, Michael Jordan and the Bulls win their 3rd NBA title in a row against Charles Barkley’s Phoenix Suns. MJ is once again MVP of the NBA finals.</p>\r\n<p>The most popular colorway of Air Jordan VIII, called « Aqua », was only worn once by MJ : during ’93 NBA All Star Game in Salt Lake City.<br />The shoe uses advanced technology, anti-inversion straps, soles in polycarbonate. The colors are even more aggressive. The Air Jordan VIII changed the way high performance shoes were designed technologically and aesthetically. High-top sneaker made of black velours with diagonal <br />applications allover the lacing parts and an additional slim velcro. Perforations on the side parts.</p>','<p>Year of release: 2013</p>','air-jordan-viii-playoffs','Nike Air Jordan VIII Playoffs AJ 8 Retro 2013',NULL,'Air Jordan VIII Playoffs','Air Jordan VIII Playoffs',NULL,NULL),(812,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VIII:</p>\r\n<p>Date de sortie du modèle original: 1992</p>\r\n<p>A l’issue de la saison 1992-93, Micheal Jordan et les Bulls remportent leur 3ème titre NBA consécutif, face aux Phoenix Suns emmenés par Charles Barkley. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Le colori le plus populaire parmi les Air Jordan VIII, appelé « Aqua », a été porté une seule fois par MJ lors du NBA All Star Game ’93 à Salt Lake City. <br />La chaussure emploie des technologies de pointe pour l\'époque : des straps inédits et une semelle en polycarbonate. Les couleurs sont encore plus agressives. La Air Jordan VIII a changé la façon dont les chaussures de haute performance étaient conçues, techniquement et esthétiquement.</p>','<p>Année de sortie: 2013</p>','air-jordan-viii-playoffs','Nike Air Jordan VIII Playoffs AJ 8 Retro 2013',NULL,'Air Jordan VIII Playoffs','Air Jordan VIII Playoffs',NULL,NULL),(812,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(812,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(812,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(814,1,1,'<p><span style=\"color: #ff0000;\"><strong>Pre-order:</strong></span> delivery planned in May 2014</p>\r\n<p> </p>','<p>Year of release: 2014</p>','pre-order-asics-gel-lyte-v-brazil-pack-green-blue-yellow','PRE-ORDER: Asics Gel Lyte V \"Brazil Pack\" Green/Blue/Yellow 2014 World Cup',NULL,'PRE-ORDER: Asics Gel Lyt