L,'Nike Air Alarm OG White/Navy/Grey','Air Alarm OG White/Navy/Grey',NULL,NULL),(837,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(837,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(837,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(838,1,1,'<p><span style=\"color: #000000;\">Year of release: 1995</span></p>\r\n<p><span style=\"color: #000000;\">Made in Korea</span></p>\r\n<p><span style=\"color: #000000;\">second hand , very good condition, wearable ! Original box missing<br /></span></p>\r\n<p><span style=\"color: #000000;\"><br /></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong><br /></strong></span></p>\r\n<p><span style=\"color: #ff0000;\"><span style=\"color: #000000;\">This shoe was worn by André Agassi in 1995. This year, Agassi won the Australian Open, became number 1 at the ATP Tour for the first time of his career, but he lost the same year the US Open final against Pete Sampras. This model was the last of the Air Challenge series to feature the famous \"flaming tennis ball\". Never retroed, but maybe in a near future, as Agassi is now back with a new Nike collaboration.</span></span></p>','<p>Year of release: 1995</p>\r\n<p><span style=\"color: #000000;\">second hand , very good condition, wearable ! Original box missing</span></p>','air-tech-challenge-lwp-black-dark-teal','Nike Air Tech Challenge LWP Black/Dark Teal Lightweight Performance Agassi Vintage 1995',NULL,'Air Tech Challenge LWP Black/Dark Teal','Air Tech Challenge LWP Black/Dark Teal',NULL,NULL),(838,1,2,'<p>Année de sortie: 1995</p>\r\n<p><span style=\"color: #000000;\">Made in Korea</span></p>\r\n<p><span style=\"color: #0