 Agassi Retro 1990 hot lava limited edition 2014',NULL,'Air Tech Challenge II SP \"Australian Open\"','Air Tech Challenge II SP \"Australian Open\"',NULL,NULL),(850,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(850,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(850,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(851,1,1,'<p>Year of release: 2014</p>\r\n<p>This book presents a selection of the most famous and hard to find sneaker collabs of the past few years.</p>\r\n<p><span class=\"Style8\">256 pages</span></p>\r\n<p><span class=\"Style8\">Language: English</span></p>\r\n<p><span class=\"Style8\">Author: Unorthodox Styles</span></p>\r\n<p>Editor: Thames &amp; Hudson</p>',NULL,'sneakers-the-complete-limited-editions-guide','Sneakers: The Complete Limited Editions Guide 2014',NULL,'Sneakers: The Complete Limited Editions Guide','Sneakers: The Complete Limited Editions Guide',NULL,NULL),(851,1,2,'<p>Année de sortie: 2014</p>\r\n<p><span class=\"Style8\">Ce livre présente une sélection des plus mémorables collaborations (entre marques et artistes/personnalités) de ces dernières années.</span></p>\r\n<p><span class=\"Style8\">256 pages</span></p>\r\n<p><span class=\"Style8\">Langue: Anglais</span></p>\r\n<p><span class=\"Style8\">Auteur: Unorthodox Styles</span></p>\r\n<p>Editions: Thames &amp; Hudson</p>',NULL,'sneakers-the-complete-limited-editions-guide','Sneakers: The Complete Limited Editions Guide 2014',NULL,'Sneakers: The Complete Limited Editions Guide','Sneakers: The Complete Limited Editions Guide',NULL,NULL),(851,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(851,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(851,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(865,1,1,'<p>About Air Jordan X:</p>\r\n<p>Year of release of OG model: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>AJ X could have been the last Air Jordan. In 1994, Jordan had already retired from the NBA (following the murder of his father during summer ’93) and had decided to start a new career in baseball with the Chicago White Sox.  This explains the presence of the 10 lines of MJ’s main achievements on the sole of the shoe. After suffering a failure in baseball, MJ decides to make his come back in the NBA in march 1995. He’s back, wearing the AJX on court, with the Bulls but without his #23  (which had been retired). His come back is a success as he helps the Bulls qualify for the Playoffs. They finally lose against Shaq’s Orlando Magic which will then be swept by the Houston Rockets in the ’95 NBA Finals.</p>','<p>Year of release: 2013</p>','air-jordan-x-stealth-gs','Nike Air Jordan X Stealth GS AJ 10 2013 women ladies',NULL,'Air Jordan X Stealth GS','Air Jordan X Stealth GS',NULL,NULL),(865,1,2,'<p>A propos de la Air Jordan X:</p>\r\n<p>Date de sortie du modèle original: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La AJ X a bien failli être la dernière de la série. En 1994, Jordan, retraité de la NBA à la suite de l’assassinat de son père, décida de tenter une carrière professionnelle dans le baseball en intégrant les Chicago White Sox. Ceci explique que la semelle du modèle porte, sur 10 lignes, le palmarès <br />de MJ. Après avoir essuyé un échec au baseball, il décide de revenir aux affaires en NBA en mars 1995. Il est donc de retour, avec les Bulls, Jordan X aux pieds, mais sans son numéro 23 (qui avait été retiré lors de sa retraite). Son retour est un succès, il aide les Bulls à se qualifier pour les <br />Playoffs. Ils perdent finalement face aux Orlando Magic de Shaquille O’Neal qui seront à leur tour balayés par les Houston Rockets en finale NBA.</p>','<p>Année de sortie: 2013</p>','air-jordan-x-stealth-gs','Nike Air Jordan X Stealth GS AJ 10 2012 women ladies',NULL,'Air Jordan X Stealth GS','Air Jordan X Stealth GS',NULL,NULL),(865,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(865,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(865,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(867,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan X:</p>\r\n<p>Year of release of OG model: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>AJ X could have been the last Air Jordan. In 1994, Jordan had already retired from the NBA (following the murder of his father during summer ’93) and had decided to start a new career in baseball with the Chicago White Sox.  This explains the presence of the 10 lines of MJ’s main achievements on the sole of the shoe. After suffering a failure in baseball, MJ decides to make his come back in the NBA in march 1995. He’s back, wearing the AJX on court, with the Bulls but without his #23  (which had been retired). His come back is a success as he helps the Bulls qualify for the Playoffs. They finally lose against Shaq’s Orlando Magic which will then be swept by the Houston Rockets in the ’95 NBA Finals.</p>','<p>Year of release: 2013</p>','air-jordan-x-stealth-baby','Nike Air Jordan X Stealth Baby AJ 10 2013 kids toddler infant',NULL,'Air Jordan X Stealth Baby','Air Jordan X Stealth Baby',NULL,NULL),(867,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan X:</p>\r\n<p>Date de sortie du modèle original: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La AJ X a bien failli être la dernière de la série. En 1994, Jordan, retraité de la NBA à la suite de l’assassinat de son père, décida de tenter une carrière professionnelle dans le baseball en intégrant les Chicago W