Black/Red',NULL,NULL),(884,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','asics-gel-lyte-v-brazil-pack','Asics Gel Lyte V \"Brazil Pack\"',NULL,'Asics Gel Lyte V \"Brazil Pack\"','Asics Gel Lyte V \"Brazil Pack\"',NULL,NULL),(884,1,2,'<p>Année de sortie: 2014</p>\r\n<p>La Asics Gel Lyte 5 se compose d\'un upper mixant du cuir suedé et du mesh verts ainsi que plusieurs touches de bleu et de jaune pour rappeler le code couleur de la Seleção (équipe du brésil de football).</p>\r\n<p>Une seconde paire de lacets jaunes est livrée avec ces sneakers.</p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-v-brazil-pack','Asics Gel Lyte V \"Brazil Pack\"',NULL,'Asics Gel Lyte V \"Brazil Pack\"','Asics Gel Lyte V \"Brazil Pack\"',NULL,NULL),(884,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(884,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(884,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(887,1,1,'<p>Limited edition unveiled by Nike on March 26 2014 to commemorate the 27th Anniversary of the release of the first Air Max 1 model.</p>\r\n<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-premium-qs-26-03-air-max-day','Nike Air Max 1 Premium QS 26/03 \"Air Max Day\" 2014 anniversary Quickstrike',NULL,'Air Max 1 Premium QS 26/03 \"Air Max Day\"','Air Max 1 Premium QS 26/03 \"Air Max Day\"',NULL,NULL),(887,1,2,'<p>Edition limitée dévoilée par Nike le 26 Mars 2014 à l\'occasion du 27ème anniversaire de la sortie de la première Air Max 1.</p>\r\n<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2014</p>','air-max-1-premium-qs-26-03-air-max-day','Nike Air Max 1 Premium QS 26/03 \"Air Max Day\" 2014 anniversary Quickstrike',NULL,'Air Max 1 Premium QS 26/03 \"Air Max Day\"','Air Max 1 Premium QS 26/03 \"Air Max Day\"',NULL,NULL),(887,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(887,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(887,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(888,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2014</p>','air-jordan-vi-infrared-23-toro-gs','Nike Air Jordan VI Infrared 23 Toro GS AJ 6 2014 raging bull',NULL,'Air Jordan VI Infrared 23 \"Toro\" GS','Air Jordan VI Infrared 23 \"Toro\" GS',NULL,NULL),(888,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2014</p>','air-jordan-vi-infrared-23-toro-gs','Nike Air Jordan VI Infrared 23 Toro GS AJ 6 2014 raging bull',NULL,'Air Jordan VI Infrared 23 \"Toro\" GS','Air Jordan VI Infrared 23 \"Toro\" GS',NULL,NULL),(888,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(888,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(888,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(891,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-essential-white-black-grey-blue','Nike Air Max 1 Essential White/Black/Grey/Blue AM1 2014',NULL,'Air Max 1 Essential White/Black/Grey/Blue','Air Max 1 Essential White/Black/Grey/Blue',NULL,NULL),(891,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2014</p>','air-max-1-essential-white-black-grey-blue','Nike Air Max 1 Essential White/Black/Grey/Blue AM1 2014',NULL,'Air Max 1 Essential White/Black/Grey/Blue','Air Max 1 Essential White/Black/Grey/Blue',NULL,NULL),(891,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(891,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(891,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(896,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','air-python-sp','Nike Air Python SP snake jordan II AJ2 retro 2013',NULL,'Air Python SP','Air Python SP',NULL,NULL),(896,1,2,'<p>Année de sortie: 2013</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p style=\"text-align: justify;\">La Nike Air Python fut introduite en 1987, ce modèle combine les designs de la Air Jordan II et de la Nike Air Force II. La Nike Air Python SP White Brown dispose d’une empeigne en cuir blanc contrasté par des touches de marron et du snakeskin marron.</p>','<p>Année de sortie: 2013</p>','air-python-sp','Nike Air Python SP snake jordan II AJ2 retro 2013',NULL,'Air Python SP','Air Python SP',NULL,NULL),(896,1,3,NULL,NULL,'nike-air-foamposite-pro-crimson',NULL,NULL,NULL,'nike air foamposite pro crimson',NULL,NULL),(896,1,4,NULL,NULL,'nike-air-foamposite-pro-crimson',NULL,NULL,NULL,'nike air foamposite pro crimson',NULL,NULL),(896,1,5,NULL,NULL,'nike-air-foamposite-pro-crimson',NULL,NULL,NULL,'nike air foamposite pro crimson',NULL,NULL),(898,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2014</p>','air-jordan-iii-5lab3-silver','Nike Air Jordan III \"5LAB3\" Silver Retro AJ 3 2014 Reflective 3M',NULL,'Air Jordan III \"5LAB3\" Silver','Air Jordan III \"5LAB3\" Silver',NULL,NULL),(898,1,2,'<p>Année de sortie: 2014</p>\r\n<p>Les Air Jordan 5LAB3 sont inspirées de la Air Jordan 5 reprenant l’aspect réfléchissant de la languette du modèle.</p>\r\n<p>Le dessus de la Air Jordan 5LAB3 Reflect Silver est entièrement en cuir argenté réfléchissant contrasté par des accents de noir, de blanc et par une semelle extérieure translucide.</p>\r\n<p>Le concept ’5LAB3′ est l’alliance du design de la Air Jordan 3 avec l’ADN de la Air Jordan 5, soit le contraire de la 3Lab5 qui prend le design de la Air Jordan 5 avec l’elephant print de la Air Jordan 3.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2014</p>','air-jordan-iii-5lab3-silver','Nike Air Jordan III \"5LAB3\" Silver Retro AJ 3 2014 Reflective 3M',NULL,'Air Jordan III \"5LAB3\" Silver','Air Jordan III \"5LAB3\" Silver',NULL,NULL),(898,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(898,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(898,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(899,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan V:</p>\r\n<p>Year of release of OG model: 1989</p>\r\n<p>Designer: Tinker Hatfield<br />Phil Jackson took over as head coach for the Bulls in the 89-90 season. This gave the Bull\'s an extra boost and everything was flying. Jordan kept on playing his game and set a personal best when scoring 69 points in a game against the Cleveland Cavaliers. Once again Hatfield came up with a revolutionary design for the new shoe.</p>\r\n<p>The AJ5 was inspired by World War II Fighter planes (Spitfire WWII) brought to light by The \"reverse flames\". The clear outsole was inspired by the clear panels of Marty MacFly\'s Back to the Future II boots which Tinker had designed for the movie. Tinker put a reflective 3M tongue with Jumpman embroidery. Whenever a photograph flash goes off, the tongue would light up and the tiny Jumpman would be highlighted in the background.</p>','<p>Year of release: 2013</p>','air-jordan-v-valentines-gs','Nike Air Jordan V Valentines GS AJ 5 2013',NULL,'Air Jordan V Valentines GS','Air Jordan V Valentines GS',NULL,NULL),(899,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan V:</p>\r\n<p>Date de sortie du modèle original: 1989</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Phil Jackson arrive à la tête des Bulls en 1989-90. Ce renfort donne des ailes à l’équipe. Michael Jordan établit un nouveau record personnel de 69 points marqués durant un match, contre les Cleveland Cavaliers. Tinker Hatfield puise cette fois son inspiration dans un avion de combat (le Spitfire WWII ), laissant apparaître des flammes inversées sur le côté de la chaussure. La semelle transparente a été inspirée par la paire de chaussure révolutionnaire (dessinée par Tinker hatfield) portée par Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2013</p>','air-jordan-v-valentines-gs','Nike Air Jordan V Valentines GS AJ 5 2013',NULL,'Air Jordan V Valentines GS','Air Jordan V Valentines GS',NULL,NULL),(899,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(899,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(899,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(906,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','flyknit-lunar-one-black-dark-grey-volt','Nike Flyknit Lunar One Black/Dark Grey/Volt Technology 2013',NULL,'Flyknit Lunar One Black/Dark Grey/Volt','Flyknit Lunar One Black/Dark Grey/Volt',NULL,NULL),(906,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','flyknit-lunar-one-black-dark-grey-volt','Nike Air Flyknit Lunar One Black/Dark Grey/Volt Technology 2013',NULL,'Flyknit Lunar One Black/Dark Grey/Volt','Flyknit Lunar One Black/Dark Grey/Volt',NULL,NULL),(906,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(906,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(906,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(907,1,1,'<p>About Air Max 90:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Introduced in 1990 as the Nike Air Max III, the Air Max 90 turned more heads with an even larger visible Air unit and greater stability and cushioning. It has been re-released as a retro version with an unmeasurable amount of colorways and themes. The Air Max 90 was referred to as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2013</p>','air-max-90-prm-tape-og-qs','Nike Air Max 90 PRM Tape OG QS Infrared Vintage White/Red/Black/Grey 2013 Retro',NULL,'Air Max 90 PRM Tape OG QS','Air Max 90 PRM Tape OG QS',NULL,NULL),(907,1,2,'<p>A propos de la Air Max 90:</p>\r\n<p> </p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2013</p>','air-max-90-prm-tape-og-qs','Nike Air Max 90 PRM Tape OG QS Infrared Vintage White/Red/Black/Grey 2013 Retro premium quickstrike',NULL,'Air Max 90 PRM Tape OG QS','Air Max 90 PRM Tape OG QS',NULL,NULL),(907,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(907,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(907,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(908,1,1,'<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2012</p>','air-jordan-vi-olympic-gs','Nike Air Jordan VI Olympic GS AJ 6 2012',NULL,'Air Jordan VI Olympic GS','Air Jordan VI Olympic GS',NULL,NULL),(908,1,2,'<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2012</p>','air-jordan-vi-olympic-gs','Nike Air Jordan VI Olympic GS AJ 6 2012',NULL,'Air Jordan VI Olympic GS','Air Jordan VI Olympic GS',NULL,NULL),(908,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(908,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(908,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(915,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2014</p>','air-jordan-iii-5lab3-black','Nike Air Jordan III \"5LAB3\" Black Retro AJ 3 2014 Reflective 3M',NULL,'Air Jordan III \"5LAB3\" Black','Air Jordan III \"5LAB3\" Black',NULL,NULL),(915,1,2,'<p>Année de sortie: 2014</p>\r\n<p>Les Air Jordan 5LAB3 sont inspirées de la Air Jordan 5 reprenant l’aspect réfléchissant de la languette du modèle.</p>\r\n<p>Le dessus de la Air Jordan 5LAB3 Reflect Silver est entièrement en cuir argenté réfléchissant contrasté par des accents de noir, de blanc et par une semelle extérieure translucide.</p>\r\n<p>Le concept ’5LAB3′ est l’alliance du design de la Air Jordan 3 avec l’ADN de la Air Jordan 5, soit le contraire de la 3Lab5 qui prend le design de la Air Jordan 5 avec l’elephant print de la Air Jordan 3.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2014</p>','air-jordan-iii-5lab3-black','Nike Air Jordan III \"5LAB3\" Black Retro AJ 3 2014 Reflective 3M',NULL,'Air Jordan III \"5LAB3\" Black','Air Jordan III \"5LAB3\" Black',NULL,NULL),(915,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(915,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(915,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(916,1,1,'<p><span style=\"color: #000000;\">Year of release: 1996</span></p>\r\n<p><span style=\"color: #000000;\">Made in Korea</span></p>\r\n<p><span style=\"color: #000000;\"><span style=\"color: #ff0000; background-color: #000000;\"><span lang=\"en\"><span class=\"hps\" lang=\"en\"><span class=\"hps\"><span style=\"color: #000000; background-color: #ffffff;\"><br /></span></span></span></span></span></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: these vintage sneakers are old and collector, wearing them could damage them.</strong></span></p>\r\n<p><span style=\"color: #ff0000;\"><span style=\"color: #000000; background-color: #ffffff;\"><span lang=\"en\"><span id=\"result_box\" class=\"hps\" lang=\"en\"><span class=\"hps\">Model</span> <span class=\"hps\">worn by</span> <span class=\"hps\">Andre Agassi</span> <span class=\"hps\">in 1996.</span></span></span></span></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong><br /></strong></span></p>\r\n<p><span style=\"color: #ff0000; background-color: #000000;\"><span lang=\"en\"><span id=\"result_box\" class=\"hps\" lang=\"en\"><span class=\"hps\"><br class=\"hps\" /></span></span></span></span></p>','<p>Year of release: 1996</p>\r\n<p><span style=\"color: #ff0000; background-color: #000000;\"><span lang=\"en\"><span id=\"result_box\" class=\"hps\" lang=\"en\"><span class=\"hps\"><br class=\"hps\" /></span></span></span></span></p>','air-zoom-challenge-og-white-ultramarine-black','Nike Air Zoom Challenge OG White/Ultramarine/Black Agassi Vintage 1996',NULL,'Air Zoom Challenge OG White/Ultramarine/Black','Air Zoom Challenge OG White/Ultramarine/Black',NULL,NULL),(916,1,2,'<p>Année de sortie: 1996</p>\r\n<p><span style=\"color: #000000;\">Made in Korea</span></p>\r\n<p><span style=\"color: #000000;\"><br /></span></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: Ce modèle vintage est une paire de collection datant des années 90, la porter pourrait la détériorer.</strong></span> </p>\r\n<p>Modèle porté par André Agassi en 1996.</p>\r\n<p> </p>\r\n<p><span style=\"color: #000000; background-color: #ffffff;\"><span lang=\"en\"><span id=\"result_box\" class=\"hps\" lang=\"en\"><span class=\"hps\"><br class=\"hps\" /></span></span></span></span></p>','<p>Année de sortie: 1996</p>','air-zoom-challenge-og-white-ultramarine-black','Nike Air Zoom Challenge OG White/Ultramarine/Black Agassi Vintage 1996',NULL,'Air Zoom Challenge OG White/Ultramarine/Black','Air Zoom Challenge OG White/Ultramarine/Black',NULL,NULL),(916,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(916,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(916,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(917,1,1,'<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','flyknit-trainer-total-orange-blue','Nike Air Flyknit Trainer+ Total Orange/Blue Technology 2013',NULL,'Flyknit Trainer+ Total Orange/Blue','Flyknit Trainer+ Total Orange/Blue',NULL,NULL),(917,1,2,'<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','flyknit-trainer-total-orange-blue','Nike Air Flyknit Trainer+ Total Orange/Blue Technology 2013',NULL,'Flyknit Trainer+ Total Orange/Blue','Flyknit Trainer+ Total Orange/Blue',NULL,NULL),(917,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(917,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(917,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(918,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','roshe-run-print-fusion-red-camo','Nike Roshe Run Print Fusion Red Camo Premium Air 2014',NULL,'Roshe Run Print Fusion Red Camo','Roshe Run Print Fusion Red Camo',NULL,NULL),(918,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','roshe-run-print-fusion-red-camo','Nike Roshe Run Print Fusion Red Camo Premium Air 2014',NULL,'Roshe Run Print Fusion Red Camo','Roshe Run Print Fusion Red Camo',NULL,NULL),(918,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(918,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(918,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(920,1,1,'<p>Year of release: 2013</p>\r\n<p>Teaming up with <strong>Nike SB</strong> on the <strong>Nike SB Dunk Low, </strong>the saga continues for the elephant print paneled collection. Outfitted with a cool grey and bottomed in translucent volt, black chimes in on midsole mediation, in addition to Swoosh and tongue treatment.</p>\r\n<p> </p>\r\n<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2013</p>','dunk-sb-low-112-x-dj-clark-kent','Nike Dunk SB Low \"112\" x DJ Clark Kent QS 2013 quickstrike limited skateboard',NULL,'Dunk SB Low \"112\" x DJ Clark Kent','Dunk SB Low \"112\" x DJ Clark Kent',NULL,NULL),(920,1,2,'<p>Année de sortie: 2013</p>\r\n<p>Dj Clark Kent a travaillé sur cette collaboration avec Nike en 2008 pour célébrer son district d’origine : Brooklyn! D’où le 112, puisque les codes postaux de ce district New Yorkais commencent tous par « 112___ ». En sont sorties une AF1 (la première), une Air Max 1 (le plus réussie), des LeBron (7, 8 et 9 low) et bien d’autres encore. Ce coup ci c’est donc une SB Dunk Low qui a droit à son traitement « originel » 112 : gris 3M sur le garde bout, la toebox et les panneaux latéreaux, elephant print sur le talon, lacets, logos et semelle Volt, pour finir par un swoosh, une midsole et un intérieur noir.</p>\r\n<p> </p>\r\n<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>','<p>Année de sortie: 2013</p>','dunk-sb-low-112-x-dj-clark-kent','Nike Dunk SB Low \"112\" x DJ Clark Kent QS 2013 quickstrike limited skateboard',NULL,'Dunk SB Low \"112\" x DJ Clark Kent','Dunk SB Low \"112\" x DJ Clark Kent',NULL,NULL),(920,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(920,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(920,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(921,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2013</p>','air-jordan-iii-black-crimson','Nike Air Jordan III Black/Crimson AJ 3 2013',NULL,'Air Jordan III Black/Crimson','Air Jordan III Black/Crimson',NULL,NULL),(921,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2013</p>','air-jordan-iii-black-crimson','Nike Air Jordan III Black/Crimson AJ 3 2013',NULL,'Air Jordan III Black/Crimson','Air Jordan III Black/Crimson',NULL,NULL),(921,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(921,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(921,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(922,1,1,'<p>Year of release: 2012</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2012</p>','air-jordan-vii-raptor','Nike Air Jordan VII Raptor AJ 7 2012 Charcoal',NULL,'Air Jordan VII Raptor','Air Jordan VII Raptor',NULL,NULL),(922,1,2,'<p>Année de sortie: 2012</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2012</p>','air-jordan-vii-raptor','Nike Air Jordan VII Raptor AJ 7 2012 Charcoal',NULL,'Air Jordan VII Raptor','Air Jordan VII Raptor',NULL,NULL),(922,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(922,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(922,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(925,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Dunk:</p>\r\n<p>Year of release of OG Model: 1985</p>\r\n<p>The Dunk was first introduced by Nike in 1985 in Hi- and Low-Top version. The Nike Dunk has a lower profile outer sole than its parent shoes. The intent was a lighter weight and staying closer to the ground. The Dunk was used to spearhead what Nike called the « College Colors » program. They signed some college basketball teams to an exclusive Dunk sponsorship deal; in simple terms, the deal meant that each colored pair of Dunks matched their uniforms. <br />Since its reintroduction in 1998, the Dunk has transformed from a basic basketball shoe into a subcultural icon and an inspiration for fashion, culture, and art.  Special collaborations and regional releases have made the Dunk stronger than ever. In 2004, Nike released the first Dunk mid.</p>','<p>Year of release: 2014</p>','air-force-1-mid-white-gs','Nike Air Force 1 Mid White GS 2013 downtown white on white',NULL,'Air Force 1 Mid White GS','Air Force 1 Mid White GS',NULL,NULL),(925,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Dunk:</p>\r\n<p>Année de sortie du modèle original: 1985</p>\r\n<p>La Dunk a été lancée par Nike en 1985 dans sa version montante et basse. Le profil de la semelle extérieure est plus abaissé que pour les précédentes versions. Le but était d’obtenir plus de légèreté et de rester plus près du sol. La Dunk a été utilisée comme fer de lance de ce que Nike a appelé le programme « Collège Colors ». Nike a créé un accord exclusif de parrainage avec certaines équipes de basket-ball universitaires américaines; dans des termes simples, l\'accord était que la couleur de la Dunk corresponde à la couleur de l’uniforme de l’équipe universitaire. Depuis sa réintroduction en 1998, la Dunk a changé de statut et est devenue une icône culturelle, une source d\'inspiration pour la mode et l\'art. À cela s’ajoute de nombreuses collaborations et des lancements spécifiques aux différents marchés mondiaux. En 2004, est lancée la Nike Dunk Mid.</p>','<p>Année de sortie: 2014</p>','air-force-1-mid-white-gs','Nike Air Force 1 Mid White GS 2013 downtown white on white',NULL,'Air Force 1 Mid White GS','Air Force 1 Mid White GS',NULL,NULL),(925,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(925,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(925,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(928,1,1,'<p>Year of release: 2005</p>\r\n<p>This book presents the history of the most famous sneakers throughout the different brands<span class=\"Style8\"> (Nike, Reebok, Adidas, Pony, New Balance, Puma...). A must have for every sneaker addict.</span></p>\r\n<p><span class=\"Style8\">256 pages</span></p>\r\n<p><span class=\"Style8\">Language: English</span></p>\r\n<p><span class=\"Style8\">Author: Unorthodox Styles</span></p>\r\n<p>Editor: Thames &amp; Hudson</p>',NULL,'sneakers-the-complete-limited-editions-guide','Sneakers: The Complete Limited Editions Guide 2005',NULL,'Sneakers: The Complete Limited Editions Guide','Sneakers: The Complete Limited Editions Guide',NULL,NULL),(928,1,2,'<p>Année de sortie: 2005</p>\r\n<p><span class=\"Style8\">Ce livre parcours l\'histoire des sneakers en passant en revue les modèles les plus mythiques de chaque marque (Nike, Reebok, Adidas, Pony, New Balance, Puma...). Un livre référence pour tout \"sneaker addict\".</span></p>\r\n<p><span class=\"Style8\">256 pages</span></p>\r\n<p><span class=\"Style8\">Langue: Anglais</span></p>\r\n<p><span class=\"Style8\">Auteur: Unorthodox Styles</span></p>\r\n<p>Editions: Thames &amp; Hudson</p>',NULL,'sneakers-the-complete-collectors-guide','Sneakers: The Complete Collectors\' Guide 2005',NULL,'Sneakers: The Complete Collectors\' Guide','Sneakers: The Complete Collectors\' Guide',NULL,NULL),(928,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(928,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(928,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(930,1,1,'<p>Year of release: 2010</p>\r\n<p>This book is a collection of 100 black-and-white line drawings of the most iconic sneaker designs, shown in side view, to colour or customize. The 100 models featured are from 1916 to the present day from 18 major brands including Adidas, Converse, New Balance, Nike, Onitsuka Tiger, Puma, Reebok and Vans.</p>',NULL,'the-sneaker-colouring-book','The Sneaker Colouring Book 2010',NULL,'The Sneaker Colouring Book','The Sneaker Colouring Book',NULL,NULL),(930,1,2,'<p>Année de sortie: 2010</p>\r\n<p><span class=\"Style8\">Ce livre répertorie une centaine de modèles mythiques de sneakers dessinés en noir et blanc<span class=\"Style7\">, et présentés de coté (ce qui permet de les colorier et/ou les customiser). Les 100 modèles sélectionnés représentent des paires sorties entre 1916 et aujourd\'hui par 18 marques différentes dont Adidas, Converse, New Balance, Nike, Onitsuka Tiger, Puma, Reebok et Vans</span>.</span></p>',NULL,'the-sneaker-colouring-book','The Sneaker Colouring Book 2010',NULL,'The Sneaker Colouring Book','The Sneaker Colouring Book',NULL,NULL),(930,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(930,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(930,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(935,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan I:</p>\r\n<p>Year of release of OG model: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>In 1985, for his first year in the NBA, Michael Jordan was awarded rookie of the year and played in his first All-Star game. The Air Jordan I was the first shoe to be worn in the NBA with multiple colors. Soon after the release, the NBA banned the most popular shoe of the decade to be worn by MJ. Every time Michael stepped on the court with a pair he would have to pay a couple thousand<br />dollars. Nike loved this idea so much that they encouraged MJ to wear the shoes, and Nike would<br />pay the fees. In result, Nike gave the Air Jordan 1 “The shoe banned by the NBA” label. There was <br />23 different color variations released. <br />In 1994, Nike re-released the Air Jordan 1, but they sold terribly. Since 2001, the Air Jordan I is regularly re-released in several colorways. In 2004, the Air Jordan 1 Low appeared, followed in 2008 by the Low Phat.</p>','<p>Year of release: 2013</p>','air-jordan-i-black-shadow-grey','Nike Air Jordan I Black/Shadow Grey AJ 1 OG retro 2013',NULL,'Air Jordan I Black/Shadow Grey','Air Jordan I Black/Shadow Grey',NULL,NULL),(935,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan I:</p>\r\n<p>Date de sortie du modèle original: 1985</p>\r\n<p>Designer: Peter Moore</p>\r\n<p>En 1985, pour sa première année en NBA, Michael Jordan a reçu le titre de Rookie de l’année et a participé à son premier All Star Game. La Air Jordan I a été la première basket multicolore à être portée en NBA, ce qui a entraîné son interdiction par la ligue. Si bien que, à chaque match où Jordan la portait, la NBA lui adressait une amende de plusieurs milliers de dollars. Nike a sauté sur cette occasion pour promouvoir la Air Jordan 1 et a décidé de payer les amendes infligées à MJ. Ainsi, la paire a été surnommée “la paire interdite en NBA“. La Air Jordan est sortie dans 23 coloris. <br />En 1994, Nike a réédité le modèle mais il n’a pas eu le succès commercial escompté. Depuis 2001, <br />la Air Jordan I est régulièrement rééditée dans différents coloris. En 2004, le modèle Low est <br />apparu suivi en 2008 du modèle Low Phat.</p>','<p>Année de sortie: 2013</p>','air-jordan-i-black-shadow-grey','Nike Air Jordan I Black/Shadow Grey AJ 1 OG retro 2013',NULL,'Air Jordan I Black/Shadow Grey','Air Jordan I Black/Shadow Grey',NULL,NULL),(935,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(935,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(935,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(947,1,1,'<p>Year of release: 2009</p>\r\n<p> </p>\r\n<p>About Air Jordan III:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2009</p>','air-jordan-iii-true-blue-09','Nike Air Jordan III True Blue \'09 AJ 3 2009',NULL,'Air Jordan III True Blue \'09','Air Jordan III True Blue \'09',NULL,NULL),(947,1,2,'<p>Année de sortie: 2009</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2009</p>','air-jordan-iii-true-blue-09','Nike Air Jordan III True Blue \'09 AJ 3 2009',NULL,'Air Jordan III True Blue \'09','Air Jordan III True Blue \'09',NULL,NULL),(947,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(947,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(947,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(951,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','adidas-zx-flux-prism-multicolor','Adidas ZX Flux \"Prism\" Multicolor Arlequin 2014 running',NULL,'Adidas ZX Flux \"Prism\" Multicolor','Adidas ZX Flux \"Prism\" Multicolor',NULL,NULL),(951,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','adidas-zx-flux-prism-multicolor','Adidas ZX Flux \"Prism\" Multicolor Arlequin 2014 running',NULL,'Adidas ZX Flux \"Prism\" Multicolor','Adidas ZX Flux \"Prism\" Multicolor',NULL,NULL),(951,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(951,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(951,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red'