imal. Sa construction tubulaire permet une meilleure circulation de l\'air sous le pied pour encourager les transitions du talon jusqu\'au bout des orteils.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 8pt;\">La technologie Nike Flyknit s\'inspire des indications des coureurs désireux de posséder une chaussure aussi confortable qu\'une chaussette et procurant la sensation de courir pieds nus.</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><br /></span></p>','<p>Année de sortie: 2014</p>','flyknit-air-max-black-orange-volt','Nike Air Flyknit Air Max Black/Orange/Volt Technology 2014',NULL,'Flyknit Air Max Black/Orange/Volt','Flyknit Air Max Black/Orange/Volt',NULL,NULL),(959,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(959,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(959,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(966,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','air-footscape-desert-chukka-qs-curry','Nike Air Footscape Desert Chukka QS Curry 2014 quickstrike',NULL,'Air Footscape Desert Chukka QS Curry','Air Footscape Desert Chukka QS Curry',NULL,NULL),(966,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','air-footscape-desert-chukka-qs-curry','Nike Air Footscape Desert Chukka QS Curry 2014 quickstrike',NULL,'Air Footscape Desert Chukka QS Curry','Air Footscape Desert Chukka QS Curry',NULL,NULL),(966,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(966,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(966,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(969,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','air-footscape-desert-chukka-qs-burgundy','Nike Air Footscape Desert Chukka QS Burgundy 2014 quickstrike',NULL,'Air Footscape Desert Chukka QS Burgundy','Air Footscape Desert Chukka QS Burgundy',NULL,NULL),(969,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','air-footscape-desert-chukka-qs-burgundy','Nike Air Footscape Desert Chukka QS Burgundy 2014 quickstrike',NULL,'Air Footscape Desert Chukka QS Burgundy','Air Footscape Desert Chukka QS Burgundy',NULL,NULL),(969,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(969,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(969,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(973,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','asics-gel-lyte-iii-black-white','Asics Gel Lyte III Black/White GL3 Purple Orange mesh 2014 k S14',NULL,'Asics Gel Lyte III Black/White','Asics Gel Lyte III Black/White',NULL,NULL),(973,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-iii-black-white','Asics Gel Lyte III Black/White GL3 Purple Orange mesh 2014 k S14',NULL,'Asics Gel Lyte III Black/White','Asics Gel Lyte III Black/White',NULL,NULL),(973,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(973,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(973,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(974,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','asics-gel-lyte-iii-honey-outdoor-pack','Asics Gel Lyte III Honey \"Outdoor Pack\" mustard curry moutarde pack GL3 Yellow red mesh 2014 k S14',NULL,'Asics Gel Lyte III Honey \"Outdoor Pack\"','Asics Gel Lyte III Honey \"Outdoor Pack\"',NULL,NULL),(974,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-iii-honey-outdoor-pack','Asics Gel Lyte III Honey \"Outdoor Pack\" mustard curry moutarde pack GL3 Yellow red mesh 2014 k S14',NULL,'Asics Gel Lyte III Honey \"Outdoor Pack\"','Asics Gel Lyte III Honey \"Outdoor Pack\"',NULL,NULL),(974,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(974,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(974,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(975,1,1,'<p><span>Year of release: 2014</span></p>\r\n<p><span><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">One pair of matching \"ropelaces\" by Throwback Sneakers offered with this sneaker.</span></strong></span></span></p>\r\n<p><span><br /></span></p>','<p>Year of release: 2014</p>','asics-gel-lyte-v-white-purple-orange','Asics Gel Lyte V White/Purple/Orange GL5 Retro 2014 lakers black SS14',NULL,'Asics Gel Lyte V White/Purple/Orange','Asics Gel Lyte V White/Purple/Orange',NULL,NULL),(975,1,2,'<p><span>Année de sortie: 2014</span></p>\r\n<p><span><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">Une paire de \"ropelaces\" Throwback Sneakers assortie offerte avec ce modèle. </span></strong></span></strong></span></p>\r\n<p><span>également lacet blanc et violet fournis avec la paire.<br /></span></p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-v-white-purple-orange','Asics Gel Lyte V White/Purple/Orange GL5 Retro 2014 lakers black SS14',NULL,'Asics Gel Lyte V White/Purple/Orange','Asics Gel Lyte V White/Purple/Orange',NULL,NULL),(975,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(975,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(975,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(978,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-essential-dark-grey-laser-orange','Nike Air Max 1 Essential Dark Grey/Laser Orange AM1 2013 Petra',NULL,'Air Max 1 Essential Dark Grey/Laser Orange','Air Max 1 Essential Dark Grey/Laser Orange',NULL,NULL),(978,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-essential-dark-grey-laser-orange','Nike Air Max 1 Essential Dark Grey/Laser Orange AM1 2013 Petra',NULL,'Air Max 1 Essential Dark Grey/Laser Orange','Air Max 1 Essential Dark Grey/Laser Orange',NULL,NULL),(978,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(978,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(978,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(979,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Force 1:</p>\r\n<p style=\"text-align: justify;\">The original version of this model was inspired by hiking shoes. It was developed to be a very functional basketball shoe and it was the first Nike basketball shoe to feature the full-length Nike Air Sole. The strap made the fit secure and was used to prevent ankle injury. At first, this model was only produced in high and low; the mid version was produced later. The Air Force 1 has become popular on the hip-hop scene, partly owing to the huge range of colorways that have been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2013</p>','air-force-1-low-blazer-pack-red','nike Air Force 1 Low \"Blazer Pack\" White/Red 2013 Suede downtown',NULL,'Air Force 1 Low \"Blazer Pack\" Red','Air Force 1 Low \"Blazer Pack\" Red',NULL,NULL),(979,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Force 1:</p>\r\n<p style=\"text-align: justify;\">La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard.<br />La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2013</p>','air-force-1-low-blazer-pack-red','nike Air Force 1 Low \"Blazer Pack\" White/Red 2013 Suede downtown',NULL,'Air Force 1 Low \"Blazer Pack\" Red','Air Force 1 Low \"Blazer Pack\" Red',NULL,NULL),(979,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(979,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(979,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(981,1,1,'<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2012</p>','air-jordan-iv-white-cement','Nike Air Jordan IV White/Cement retro AJ 4 2012',NULL,'Air Jordan IV White/Cement','Air Jordan IV White/Cement',NULL,NULL),(981,1,2,'<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2012</p>','air-jordan-iv-white-cement','Nike Air Jordan IV White/Cement retro AJ 4 2012',NULL,'Air Jordan IV White/Cement','Air Jordan IV White/Cement',NULL,NULL),(981,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(981,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(981,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(989,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">One pair of matching \"ropelaces\" by Throwback Sneakers offered with this sneaker.</span></strong></span></p>\r\n<p> </p>','<p>Year of release: 2014</p>','puma-trinomic-xt1-plus-black-turbulence-blue','Puma Trinomic XT1 Plus Black/Turbulence Blue running',NULL,'Puma Trinomic XT1 Plus Black/Turbulence Blue','Puma Trinomic XT1 Plus 