t Ocean Mint SF 2013 collab retro running adi archive',NULL,'Adidas Torsion Integral S x Sneaker Freaker Black/Light Ocean Mint','Adidas Torsion Integral S x Sneaker Freaker Black/Ocean Mint',NULL,NULL),(1003,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1003,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1003,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1004,1,1,'<p><strong>Women sizes</strong></p>\r\n<p><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">One pair of matching \"ropelaces\" by Throwback Sneakers offered with this sneaker.</span></strong></span></strong></p>\r\n<p><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\"><br /></span></strong></span></strong></p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2014</p>','asics-gel-lyte-iii-blue-tint-white','Asics Gel Lyte III Blue Tint/White Turquoise mint cove GL3 Retro 2014 ladies women',NULL,'Asics Gel Lyte III Blue Tint/White','Asics Gel Lyte III Blue Tint/White \"Snowflake\"',NULL,NULL),(1004,1,2,'<p><span style=\"color: #000000;\"><strong>Tailles femme</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">Une paire de \"ropelaces\" Throwback Sneakers assortie offerte avec ce modèle. </span></strong></span></strong></strong></span></p>\r\n<p> </p>\r\n<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-iii-blue-tint-white','Asics Gel Lyte III Blue Tint/White Turquoise mint cove GL3 Retro 2014 ladies women',NULL,'Asics Gel Lyte III Blue Tint/White','Asics Gel Lyte III Blue Tint/White \"Snowflake\"',NULL,NULL),(1004,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1004,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1004,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1005,1,1,'<p>Year of release: 2014</p>\r\n<p><strong>Women sizes</strong></p>\r\n<p><strong><br /></strong></p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desire