lack-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1036,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','asics-gel-kayano-trainer-soft-grey-black-volt','Asics Gel Kayano Trainer Soft Grey/Black \"Volt\" running retro',NULL,'Asics Gel Kayano Trainer Soft Grey/Black \"Volt\"','Asics Gel Kayano Trainer Soft Grey/Black \"Volt\"',NULL,NULL),(1036,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','asics-gel-kayano-trainer-soft-grey-black-volt','Asics Gel Kayano Trainer Soft Grey/Black \"Volt\" running retro',NULL,'Asics Gel Kayano Trainer Soft Grey/Black \"Volt\"','Asics Gel Kayano Trainer Soft Grey/Black \"Volt\"',NULL,NULL),(1036,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1036,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1036,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1042,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2013</p>','air-jordan-iv-toro-bravo','Nike Air Jordan IV \"Toro Bravo\" retro AJ 4 2013 raging bull red october',NULL,'Air Jordan IV \"Toro Bravo\"','Air Jordan IV \"Toro Bravo\"',NULL,NULL),(1042,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2013</p>','air-jordan-iv-toro-bravo','Nike Air Jordan IV \"Toro Bravo\" retro AJ 4 2013 raging bull red october',NULL,'Air Jordan IV \"Toro Bravo\"','Air Jordan IV \"Toro Bravo\"',NULL,NULL),(1042,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1042,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1042,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1046,1,1,'<p><span>Year of release: 2014</span></p>\r\n<p><span><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">One pair of matching \"ropelaces\" by Throwback Sneakers offered with this sneaker</span></strong></span>.</span></p>','<p>Year of release: 2014</p>','asics-gel-saga-wmn-teal-leopard','Asics Gel Saga WMN \"Teal Leopard\" turquoise brown beige 2014 ladies women girls Running retro',NULL,'Asics Gel Saga WMN \"Teal Leopard\"','Asics Gel Saga WMN \"Teal Leopard\"',NULL,NULL),(1046,1,2,'<p><span>Année de sortie: 2014</span></p>\r\n<p><span><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">Une paire de \"ropelaces\" Throwback Sneakers assortie offerte avec ce modèle. </span></strong></span></strong></span></p>','<p>Année de sortie: 2014</p>','asics-gel-saga-wmn-teal-leopard','Asics Gel Saga WMN \"Teal Leopard\" turquoise brown beige 2014 ladies women girls Running retro',NULL,'Asics Gel Saga WMN \"Teal Leopard\"','Asics Gel Saga WMN \"Teal Leopard\"',NULL,NULL),(1046,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1046,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1046,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1047,1,1,'<p><strong>Women sizes</strong></p>\r\n<p><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">One pair of matching \"ropelaces\" by Throwback Sneakers offered with this sneaker.</span></strong></span></strong></p>\r\n<p><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\"><br /></span></strong></span></strong></p>\r\n<p>About Gel Lyte III:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>This Asics classic model has been given a unique and modern twist, a special split-tongue design which prevented the tongue from moving from side to side. ASICS GEL was placed in the rear foot of the tri-density compression molded mid-sole for excellent shock absorption. It also has an external PVC counter for additional motion control. This shoe has been produced for high mileage runners who desired an extremely lightweight shoe.</p>','<p>Year of release: 2014</p>','asics-gel-lyte-iii-blue-tint-white','Asics Gel Lyte III Blue Tint/White Turquoise mint cove GL3 Retro 2014 ladies women',NULL,'Asics Gel Lyte III Blue Tint/White','Asics Gel Lyte III Blue Tint/White \"Snowflake\"',NULL,NULL),(1047,1,2,'<p><span style=\"color: #000000;\"><strong>Tailles femme</strong></span></p>\r\n<p><span style=\"color: #000000;\"><strong><strong><span style=\"background-color: #ffffff;\"><strong><span style=\"color: #000000;\">Une paire de \"ropelaces\" Throwback Sneakers assortie offerte avec ce modèle. </span></strong></span></strong></strong></span></p>\r\n<p> </p>\r\n<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Gel Lyte III:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Ce grand classique de Asics a été conçu de façon unique et moderne, le design de la languette en fente permet d’empêcher le déplacement de la languette d’un côté à l’autre.</p>\r\n<p>Le système Gel Lyte a été placé sous le talon, moulé par compression jusqu’au milieu du pied pour obtenir une meilleure absorption des chocs. Il y a également une partie externe en PVC pour contrôler l’apparition de mouvements supplémentaires. Cette chaussure a été conçue pour des joggeurs réalisant un fort kilométrage et qui désirent courir avec une chaussure extrêmement légère.</p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-iii-blue-tint-white','Asics Gel Lyte III Blue Tint/White Turquoise mint cove GL3 Retro 2014 ladies women',NULL,'Asics Gel Lyte III Blue Tint/White','Asics Gel Lyte III Blue Tint/White \"Snowflake\"',NULL,NULL),(1047,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1047,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1047,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1049,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2014</p>','air-jordan-vi-infrared-23-toro','Nike Air Jordan VI Infrared 23 Toro AJ 6 2014 raging bull',NULL,'Air Jordan VI Infrared 23 \"Toro\"','Air Jordan VI Infrared 23 \"Toro\"',NULL,NULL),(1049,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2014</p>','air-jordan-vi-infrared-23-toro','Nike Air Jordan VI Infrared 23 Toro AJ 6 2014 raging bull',NULL,'Air Jordan VI Infrared 23 \"Toro\"','Air Jordan VI Infrared 23 \"Toro\"',NULL,NULL),(1049,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1049,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1049,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1052,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-leather-black-white','Nike Air Max 1 Leather Black/White premium AM1 2014',NULL,'Air Max 1 Leather Black/White','Air Max 1 Leather Black/White',NULL,NULL),(1052,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2014</p>','air-max-1-leather-black-white','Nike Air Max 1 Leather Black/White premium AM1 2014',NULL,'Air Max 1 Leather Black/White','Air Max 1 Leather Black/White',NULL,NULL),(1052,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1052,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',