rk\" GL3 Blue mesh polka dot 2014 k S14',NULL,'Asics Gel Lyte III \"Glow in the Dark\"','Asics Gel Lyte III \"Glow in the Dark\"',NULL,NULL),(1071,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1071,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1071,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1072,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2014</p>','air-jordan-vi-spiz-ike-history-of-jordan','Nike Air Jordan VI Spiz\'ike \"History of Jordan\" AJ 6 2014 raging bull red spike',NULL,'Air Jordan VI Spiz\'ike \"History of Jordan\"','Air Jordan VI Spiz\'ike \"History of Jordan\"',NULL,NULL),(1072,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2014</p>','air-jordan-vi-spiz-ike-history-of-jordan','Nike Air Jordan VI Spiz\'ike \"History of Jordan\" AJ 6 2014 raging bull red spike',NULL,'Air Jordan VI Spiz\'ike \"History of Jordan\"','Air Jordan VI Spiz\'ike \"History of Jordan\"',NULL,NULL),(1072,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1072,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1072,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1075,1,1,'<p>Year of release: 2014</p>\r\n<p>This sneaker was part of a collection designed by Riccardo Tisci, artistic director of Givenchy.</p>\r\n<p> </p>\r\n<p>About Air Force 1:</p>\r\n<p>The original version of this model was inspired by hiking shoes. It was developed to be a very functional basketball shoe and it was the first Nike basketball shoe to feature the full-length Nike Air Sole. The strap made the fit secure and was used to prevent ankle injury. At first, this model was only produced in high and low; the mid version was produced later. The Air Force 1 has become popular on the hip-hop scene, partly owing to the huge range of colorways that have been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2014</p>','air-force-1-low-riccardo-tisci-white-baroque-brown','nike Air Force 1 Low Riccardo Tisci White/Baroque Brown Givenchy AF1 Downtown',NULL,'Air Force 1 Low Riccardo Tisci White/Baroque Brown','Air Force 1 Low Riccardo Tisci White/Baroque Brown',NULL,NULL),(1075,1,2,'<p>Année de sortie: 2014</p>\r\n<p>Modèle issu d\'une collection dessinée par Riccardo Tisci, directeur artistique de la maison Givenchy.</p>\r\n<p> </p>\r\n<p>A propos de la Air Force 1:</p>\r\n<p>La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard. La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2014</p>','air-force-1-low-riccardo-tisci-white-baroque-brown','nike Air Force 1 Low Riccardo Tisci White/Baroque Brown Givenchy AF1 Downtown',NULL,'Air Force 1 Low Riccardo Tisci White/Baroque Brown','Air Force 1 Low Riccardo Tisci White/Baroque Brown',NULL,NULL),(1075,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(1075,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(1075,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(1076,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Zoom Flight \"The Glove\":</p>\r\n<p>Year of release of OG Model: 1998</p>\r\n<p>The Zoom Flight \"The Glove\" is an iconic basketball sneaker of the 90\'s. It was worn by \"All Star\" Gary Payton when he was still playing for Seattle Supersonics.</p>','<p>Year of release: 2013</p>','air-zoom-flight-98-the-glove-black-white-red','Nike Air Zoom Flight 98 “The Glove” Black/White/Red 2013 1998 Gary Payton Bred',NULL,'Air Zoom Flight 98 “The Glove” Black/White/Red','Air Zoom Flight 98 “The Glove” Black/White/Red',NULL,NULL),(1076,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la \"Zoom Flight The Glove\":</p>\r\n<p>Année de sortie du modèle original: 1998</p>\r\n<p>Modèle mythique des années 90, porté par le \"All Star\" Gary Payton lorsqu\'il était joueur des Seattle Supersonics.</p>','<p>Année de sortie: 2013</p>','air-zoom-flight-98-the-glove-black-white-red','Nike Air Zoom Flight 98 “The Glove” Black/White/Red 2013 1998 Gary Payton Bred',NULL,'Air Zoom Flight 98 “The Glove” Black/White/Red','Air Zoom Flight 98 “The Glove” Black/White/Red',NULL,NULL),(1076,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1076,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1076,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1083,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-fb-anthracite-team-orange','Nike Air Max 1 FB Anthracite/Team Orange AM1 2014',NULL,'Air Max 1 FB Anthracite/Team Orange','Air Max 1 FB Anthracite/Team Orange',NULL,NULL),(1083,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2014</p>','air-max-1-fb-anthracite-team-orange','Nike Air Max 1 FB Anthracite/Team Orange AM1 2014',NULL,'Air Max 1 FB Anthracite/Team Orange','Air Max 1 FB Anthracite/Team Orange',NULL,NULL),(1083,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1083,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1083,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1093,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','air-max-1-kids-white-red-grey','Nike Air Max 1 Kids White/Red/Grey Pimento OG Running',NULL,'Air Max 1 Kids White/Red/Grey','Air Max 1 Kids White/Red/Grey',NULL,NULL),(1093,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','air-max-1-kids-white-red-grey','Nike Air Max 1 Kids White/Red/Grey Pimento OG Running',NULL,'Air Max 1 Kids White/Red/Grey','Air Max 1 Kids White/Red/Grey',NULL,NULL),(1093,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1093,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1093,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1094,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','air-max-90-kids-white-black-blue','Nike Air Max 90 Kids White/Black/Blue Running',NULL,'Air Max 90 Kids White/Black/Blue','Air Max 90 Kids White/Black/Blue',NULL,NULL),(1094,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','a