iberty of London\" Pack','Roshe Run \"Liberty of London\" Pack',NULL,NULL),(1121,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1121,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1121,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1122,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-liberty-of-london-pack','Nike Air Max 1 \"Liberty of London\" Pack Premium Air 2014 linen atomic mango qs quickstrike',NULL,'Air Max 1 \"Liberty of London\" Pack','Air Max 1 \"Liberty of London\" Pack',NULL,NULL),(1122,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2014</p>','air-max-1-liberty-of-london-pack','Nike Air Max 1 \"Liberty of London\" Pack Premium Air 2014 linen atomic mango qs quickstrike',NULL,'Air Max 1 \"Liberty of London\" Pack','Air Max 1 \"Liberty of London\" Pack',NULL,NULL),(1122,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1122,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1122,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1123,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Tech Challenge II:</p>\r\n<p>Year of release of OG Model: 1990</p>\r\n<p>There has been a lot of anticipation and discussion around this Nike Collector shoe release.</p>\r\n<p>This Andre Agassi classic first hit the scene in 1990. That year Andre Agassi lost 2 grand slams finals. The first in Roland Garros against the Ecuadorian Andres Gomez and the second at the U.S. Open against Pete Sampras. The Hot LAVA ATC II is probably the most sought after model in the entire Air Tech line. Nike did an excellent job on this retro which is almost identical to the original model.</p>','<p>Year of release: 2014</p>','air-tech-challenge-ii-waterproof','Nike Air Tech Challenge II \"Waterproof\" black winter suede leather Agassi Retro 1990',NULL,'Air Tech Challenge II \"Waterproof\"','Air Tech Challenge II \"Waterproof\"',NULL,NULL),(1123,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Tech Challenge II:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Il y a eu beaucoup de discussions autour de la sortie de ce modèle emblématique de chez Nike.</p>\r\n<p>Ce grand classique fut porté par Andre Agassi en 1990. Cette année-là, Agassi perdit 2 finales de Grand Chelem. La première à Roland Garros contre l\'Équatorien Andres Gomez et la deuxième à l\'US Open contre Pete Sampras. La Hot Lava est probablement le modèle le plus recherché dans la gamme Air Tech. Nike a fait un excellent travail sur cette rétro, en effet, la chaussure est quasi-identique à l\'originale.</p>','<p>Année de sortie: 2014</p>','air-tech-challenge-ii-waterproof','Nike Air Tech Challenge II \"Waterproof\" black winter suede leather Agassi Retro 1990',NULL,'Air Tech Challenge II \"Waterproof\"','Air Tech Challenge II \"Waterproof\"',NULL,NULL),(1123,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1123,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1123,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1124,1,1,'<p>Year of release: 2014</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Warning: This model cuts short, consider one size bigger than your usual Nike sizing.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Huarache:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>The \"Huarache\" was named after a Native American sandal. Its main particularity is a neoprene and spandex sock contained within the upper. The sock strongly holds the foot. Coupled with Nike’s trademark air unit, the Huarache pushed Nike running shoes one step forward in terms of comfort, performance and design.</p>','<p>Year of release: 2014</p>','air-huarache-ash-grey','Nike Air Huarache Ash/Grey running 1991 2014 Retro',NULL,'Air Huarache Ash/Grey','Air Huarache Ash/Grey',NULL,NULL),(1124,1,2,'<p>Année de sortie: 2014</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: ce modèle taille petit, compter une taille de plus que votre taille Nike habituelle.</strong></span></p>\r\n<p> </p>\r\n<p>A propos de la Air Huarache:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>La \"Huarache\" tire son nom d\'une sandale portée par les Indiens d\'Amérique. Sa principale particularité est son chausson fait de neoprene et Spandex qui recouvre toute la partie supérieure de la chaussure. Ce chausson épouse complètement la forme du pied. Son association avec le système Air a fait de la Huarache une paire révolutionnaire en terme de confort, performance et design.</p>','<p>Année de sortie: 2014</p>','air-huarache-ash-grey','Nike Air Huarache Ash/Grey running 1991 2014 Retro',NULL,'Air Huarache Ash/Grey','Air Huarache Ash/Grey',NULL,NULL),(1124,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1124,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1124,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1126,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','roshe-run-midnight-navy-dark-obsidian','Roshe Run midnight navy/dark obsidian Premium Air 2014',NULL,'Roshe Run midnight navy/dark obsidian','Roshe Run midnight navy/dark obsidian',NULL,NULL),(1126,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','roshe-run-midnight-navy-dark-obsidian','Roshe Run midnight navy/dark obsidian Premium Air 2014',NULL,'Roshe Run midnight navy/dark obsidian','Roshe Run midnight navy/dark obsidian',NULL,NULL),(1126,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1126,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1126,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1127,1,1,'<p>AIR MAX 93 \"SIZE? EXCLUSIVE\"</p>\r\n<p>Year of release: 2013</p>','<p>Year of release: 2013</p>','air-max-93-x-size-beige-orange-pink','Nike Air Max 93 x Size? Beige/Orange/Pink 2013 Retro',NULL,'Air Max 93 x Size? Beige/Orange/Pink','Air Max 93 x Size? Beige/Orange/Pink',NULL,NULL),(1127,1,2,'<p>AIR MAX 93 \"SIZE? EXCLUSIVE\"</p>\r\n<p>Année de sortie: 2013</p>','<p>Année de sortie: 2013</p>','air-max-93-x-size-beige-orange-pink','Nike Air Max 93 x Size? Beige/Orange/Pink 2013 Retro',NULL,'Air Max 93 x Size? Beige/Orange/Pink','Air Max 93 x Size? Beige/Orange/Pink',NULL,NULL),(1127,1,3,NULL,NULL,'air-jordan-i-low-p