met une meilleure circulation de l\'air sous le pied pour encourager les transitions du talon jusqu\'au bout des orteils.</span></p>\r\n<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 8pt;\">La technologie Nike Flyknit s\'inspire des indications des coureurs désireux de posséder une chaussure aussi confortable qu\'une chaussette et procurant la sensation de courir pieds nus.</span></p>\r\n<p><span style=\"font-family: arial,helvetica,sans-serif;\"><br /></span></p>','<p>Année de sortie: 2014</p>','flyknit-max-hyper-crimson-volcano','Nike Flyknit Max Hyper Crimson \"Volcano\" Technology 2014',NULL,'Flyknit Max Hyper Crimson \"Volcano\"','Flyknit Max Hyper Crimson \"Volcano\"',NULL,NULL),(1156,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1156,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1156,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1160,1,1,'<p>Year of release: 2014</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Warning: This model cuts short, consider one size bigger than your usual Nike sizing.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Huarache:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>The \"Huarache\" was named after a Native American sandal. Its main particularity is a neoprene and spandex sock contained within the upper. The sock strongly holds the foot. Coupled with Nike’s trademark air unit, the Huarache pushed Nike running shoes one step forward in terms of comfort, performance and design.</p>','<p>Year of release: 2014</p>','air-huarache-cargo-kaki-white','Nike Air Huarache Cargo Kaki/White running 1991 2014 Retro',NULL,'Air Huarache Cargo Kaki/White','Air Huarache Cargo Kaki/White',NULL,NULL),(1160,1,2,'<p>Année de sortie: 2014</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: ce modèle taille petit, compter une taille de plus que votre taille Nike habituelle.</strong></span></p>\r\n<p> </p>\r\n<p>A propos de la Air Huarache:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>La \"Huarache\" tire son nom d\'une sandale portée par les Indiens d\'Amérique. Sa principale particularité est son chausson fait de neoprene et Spandex qui recouvre toute la partie supérieure de la chaussure. Ce chausson épouse complètement la forme du pied. Son association avec le système Air a fait de la Huarache une paire révolutionnaire en terme de confort, performance et design.</p>','<p>Année de sortie: 2014</p>','air-huarache-cargo-kaki-white','Nike Air Huarache Cargo Kaki/White running 1991 2014 Retro',NULL,'Air Huarache Cargo Kaki/White','Air Huarache Cargo Kaki/White',NULL,NULL),(1160,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1160,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1160,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1161,1,1,'<p>Year of release: 2014</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Warning: This model cuts short, consider one size bigger than your usual Nike sizing.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Huarache:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>The \"Huarache\" was named after a Native American sandal. Its main particularity is a neoprene and spandex sock contained within the upper. The sock strongly holds the foot. Coupled with Nike’s trademark air unit, the Huarache pushed Nike running shoes one step forward in terms of comfort, performance and design.</p>','<p>Year of release: 2014</p>','air-huarache-hyper-pink','Nike Air Huarache Hyper Pink running 1991 2014 Retro',NULL,'Air Huarache Hyper Pink','Air Huarache Hyper Pink',NULL,NU