'Air Jordan I Low Phat Black/Red',NULL,NULL),(1164,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1166,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','asics-gel-lyte-iii-triple-black','Asics Gel Lyte III \"Triple Black\" All BLK Cat Retro GL3 2014',NULL,'Asics Gel Lyte III \"Triple Black\"','Asics Gel Lyte III \"Triple Black\"',NULL,NULL),(1166,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>','<p>Année de sortie: 2014</p>','asics-gel-lyte-iii-triple-black','Asics Gel Lyte III \"Triple Black\" All BLK Cat Retro GL3 2014',NULL,'Asics Gel Lyte III \"Triple Black\"','Asics Gel Lyte III \"Triple Black\"',NULL,NULL),(1166,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1166,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1166,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1169,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-v-dark-grey','Asics Gel Lyte V Dark Grey GL5 Retro 2015 PE15',NULL,'Asics Gel Lyte V Dark Grey','Asics Gel Lyte V Dark Grey',NULL,NULL),(1169,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-v-dark-grey','Asics Gel Lyte V Dark Grey GL5 Retro 2015 PE15',NULL,'Asics Gel Lyte V Dark Grey','Asics Gel Lyte V Dark Grey',NULL,NULL),(1169,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1169,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1169,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1175,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Adidas Stan Smith:</p>\r\n<p>Year of release of OG Model: 1964</p>\r\n<p>The earliest version of this shoe was produced in 1964 with the coopeartion of French player Robert Haillet. In 1965, American tennis pro Stan Smith came to the attention of Adidas. Haillet’s name was replaced with Smith’s, and subsequent models had his face and signature on the tongue. Over the years, the Stan Smith has been a constant presence in the Adidas catalogue. The sneakerhead’s favourite is the original Robert Haillet version.</p>','<p>Year of release: 2014</p>','adidas-stan-smith-white-green','Adidas Stan Smith White/Green OG colorway vintage 2014 Retro',NULL,'Adidas Stan Smith White/Green','Adidas Stan Smith White/Green',NULL,NULL),(1175,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Adidas Stan Smith:</p>\r\n<p>Année de sortie du modèle original: 1964</p>\r\n<p>La première version de cette chaussure a été produite en 1964 en coopération avec le joueur de tennis français Robert Haillet. En 1965, le joueur de tennis américain Stan Smith est remarqué par Adidas. Le visage et la signature de Haillet sur la languette disparaissent et sont remplacés par ceux de Stan Smith. Au fil des ans, la Stan Smith est restée présente dans le catalogue Adidas. Le modèle original de Robert Haillet est la version la plus recherchée par les sneakerheads.</p>','<p>Année de sortie: 2014</p>','adidas-stan-smith-white-green','Adidas Stan Smith White/Green OG colorway vintage 2014 Retro',NULL,'Adidas Stan Smith White/Green','Adidas Stan Smith White/Green',NULL,NULL),(1175,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1175,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1175,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1179,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 90:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Introduced in 1990 as the Nike Air Max III, the Air Max 90 turned more heads with an even larger visible Air unit and greater stability and cushioning. It has been re-released as a retro version with an unmeasurable amount of colorways and themes. The Air Max 90 was referred to as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2014</p>','air-max-90-essential-triple-black','Nike Air Max 90 Essential \"Triple Black\" Black/Black 2014 Retro',NULL,'Air Max 90 Essential \"Triple Black\"','Air Max 90 Essential \"Triple Black\"',NULL,NULL),(1179,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 90:</p>\r\n<p> </p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2014</p>','air-max-90-essential-triple-black','Nike Air Max 90 Essential \"Triple Black\" Black/Black 2014 Retro',NULL,'Air Max 90 Essential \"Triple Black\"','Air Max 90 Essential \"Triple Black\"',NULL,NULL),(1179,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1179,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1179,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1181,1,1,'<p style=\"text-align: justify;\">Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan II:</p>\r\n<p>Year of release of OG model: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p style=\"text-align: justify;\">In the 86-87 season, MJ scored an average 37.1 points per game and became the first player since Wilt Chamberlain to top 3,000 points in a season. Michael also played in the All-Star Game and won the Slam-Dunk Contest. <br />The Air Jordan II was designed by Bruce Kilgore and just as its predecessor it showed a great innovative design. Surprisingly, this is the only Air Jordan ever that has not been made in a black version (except retro versions). Nike swoosh logo disappears. Full-grain leather upper. Polyurethane midsole, encapsulated Air-Sole® unit in heel. Rubber outsole.</p>','<p>Year of release: 2014</p>','air-jordan-ii-white-red-grey-gs','Nike Air Jordan II White/Red/Grey GS 2014 women girls ladies Slam Dunk Contest',NULL,'Air Jordan II White/Red/Grey GS','Air Jordan II White/Red/Grey GS',NULL,NULL),(1181,1,2,'<p style=\"text-align: justify;\">Année de sortie: 2014</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p>A propos de la Air Jordan II:</p>\r\n<p>Date de sortie du modèle original: 1986</p>\r\n<p>Designer: Bruce Kilgore</p>\r\n<p style=\"text-align: justify;\">Durant la saison 86-87, Jordan marqua 37.1 points de moyenne par match et devint le premier joueur depuis Wilt Chamberlian a dépasser les 3000 points marqués dans une saison. Michael Jordan fut sélectionné pour son 2éme All-star game et remporta le slam-dunk contest. La Air <br />Jordan II a été dessinée par Bruce Kilgore et, comme la Jordan I, son design est particulièrement novateur.<br />Ce sera la seule Air Jordan à ne pas posséder de version noire (modèles retro exceptés). Coté design, le swoosh disparaît. Cuir supérieur veiné, semelle intermédaire en polyuréthane, système air dans la semelle au niveau du talon. Semelle en caoutchouc.</p>','<p>Année de sortie: 2014</p>','air-jordan-ii-white-red-grey-gs','Nike Air Jordan II QF White/Black/Varsity Red 2010 Slam Dunk Contest',NULL,'Air Jordan II White/Red/Grey GS','Air Jordan II White/Red/Grey GS',NULL,NULL),(1181,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1181,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1181,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1183,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-v-tropical-green-black-yellow','Asics Gel Lyte V Tropical Green/Black/Yellow GL5 Retro 2015 PE15 mint cove brazil',NULL,'Asics Gel Lyte V Tropical Green/Black/Yellow','Asics Gel Lyte V Tropical Green/Black/Yellow',NULL,NULL),(1183,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-v-tropical-green-black-yellow','Asics Gel Lyte V Tropical Green/Black/Yellow GL5 Retro 2015 PE15 mint cove brazil',NULL,'Asics Gel Lyte V Tropical Green/Black/Yellow','Asics Gel Lyte V Tropical Green/Black/Yellow',NULL,NULL),(1183,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1183,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1183,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan 