\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-essential-triple-black','Nike Air Max 1 Essential \"Triple Black\" AM1 2014',NULL,'Air Max 1 Essential \"Triple Black\"','Air Max 1 Essential \"Triple Black\"',NULL,NULL),(1213,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2014</p>','air-max-1-essential-triple-black','Nike Air Max 1 Essential \"Triple Black\" AM1 2014',NULL,'Air Max 1 Essential \"Triple Black\"','Air Max 1 Essential \"Triple Black\"',NULL,NULL),(1213,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1213,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1213,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1214,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>','<p>Year of release: 2015</p>','puma-trinomic-disc-crackle-pack-black-infrared','Puma Trinomic Disc \"Crackle Pack\" Black/Infrared',NULL,'Puma Trinomic Disc \"Crackle Pack\" Black/Infrared','Puma Trinomic Disc \"Crackle Pack\" Black/Infrared',NULL,NU