been produced over the years. There have also been numerous limited edition collaborative models and countless colorways variations.</p>','<p>Year of release: 2013</p>','air-force-1-low-iron-man','Nike Air Force 1 Low \"Iron Man\" Downtown 2013 AF1',NULL,'Air Force 1 Low \"Iron Man\"','Air Force 1 Low \"Iron Man\"',NULL,NULL),(1219,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Force 1:</p>\r\n<p>La toute première version de cette chaussure a été inspirée des modèles de randonnée. La Air Force 1 fut conçue pour être fonctionnelle et a été la première Basket Nike à utiliser la technologie Air. Le strap fut conçu pour améliorer le maintien de la cheville et prévenir les blessures. Au début, il n’a été produit que la version montante et basse, la version mid n’a été produite que plus tard. La Air Force 1 est devenue populaire sur la scène Hip-Hop principalement grâce à la grande variété de couleurs qui a été produite. Il existe également un grand nombre de séries limitées et collaborations sans compter les variations de couleurs et matières.</p>','<p>Année de sortie: 2013</p>','air-force-1-low-iron-man','Nike Air Force 1 Low \"Iron Man\" Downtown 2013 AF1',NULL,'Air Force 1 Low \"Iron Man\"','Air Force 1 Low \"Iron Man\"',NULL,NULL),(1219,1,3,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(1219,1,4,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(1219,1,5,NULL,NULL,'nike-air-force-1-low-white-green',NULL,NULL,NULL,'nike air force 1 Low White/green',NULL,NULL),(1220,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','flyknit-max-black-turbo-green-volt','Nike Air Flyknit Max Black/Turbo Green/Volt Technology 2014',NULL,'Flyknit Max Black/Turbo Green/Volt','Flyknit Max Black/Turbo Green/Volt',NULL,NULL),(1220,1,2,'<p><span style=\"font-family: arial, helvetica, sans-serif; font-size: 8pt;\">Année de sortie: 2014</span>