 Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2013</p>','air-jordan-v-black-white-oreo','Nike Air Jordan V Black/White \"Oreo\" AJ 5 2013 3M',NULL,'Air Jordan V Black/White \"Oreo\"','Air Jordan V Black/White \"Oreo\"',NULL,NULL),(1238,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1238,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1238,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1239,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-v-light-grey','Asics Gel Lyte V Light Grey gris wolf grey GL5 Retro 2015 PE15',NULL,'Asics Gel Lyte V Light Grey','Asics Gel Lyte V Light Grey',NULL,NULL),(1239,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-v-light-grey','Asics Gel Lyte V Light Grey gris wolf grey GL5 Retro 2015 PE15',NULL,'Asics Gel Lyte V Light Grey','Asics Gel Lyte V Light Grey',NULL,NULL),(1239,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1239,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1239,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1240,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-v-dark-green','Asics Gel Lyte V Dark Green GL5 Retro 2015 PE15',NULL,'Asics Gel Lyte V Dark Green','Asics Gel Lyte V Dark Green',NULL,NULL),(1240,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-v-dark-green','Asics Gel Lyte V Dark Green GL5 Retro 2015 PE15',NULL,'Asics Gel Lyte V Dark Green','Asics Gel Lyte V Dark Green',NULL,NULL),(1240,1,3,NULL,NULL