-monochromatic-white','Asics Gel Kayano Trainer \"Monochromatic\" White pure triple 2015 Running retro',NULL,'Asics Gel Kayano Trainer \"Monochromatic\" White','Asics Gel Kayano Trainer \"Monochromatic\" White',NULL,NULL),(1257,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','asics-gel-kayano-trainer-monochromatic-white','Asics Gel Kayano Trainer \"Monochromatic\" White pure triple 2015 Running retro',NULL,'Asics Gel Kayano Trainer \"Monochromatic\" White','Asics Gel Kayano Trainer \"Monochromatic\" White',NULL,NULL),(1257,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1257,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1257,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1261,1,1,'<p>Year of release: 2015</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Warning: This model cuts short, consider one size bigger than your usual Nike sizing.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Huarache:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>The \"Huarache\" was named after a Native American sandal. Its main particularity is a neoprene and spandex sock contained within the upper. The sock strongly holds the foot. Coupled with Nike’s trademark air unit, the Huarache pushed Nike running shoes one step forward in terms of comfort, performance and design.</p>','<p>Year of release: 2015</p>','air-huarache-anthracite-brown','Nike Air Huarache Anthracite/Brown running 1991 2015 Retro',NULL,'Air Huarache Anthracite/Brown','Air Huarache Anthracite/Brown',NULL,NULL),(1261,1,2,'<p>Année de sortie: 2015</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: ce modèle taille petit, compter une taille de plus que votre taille Nike habituelle.</strong></span></p>\r\n<p> </p>\r\n<p>A propos de la Air Huarache:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>La \"Huarache\" tire son nom d\'une sandale portée par les Indiens d\'Amérique. Sa principale particularité est son chausson fait de neoprene et Spandex qui recouvre toute la partie supérieure de la chaussure. Ce chausson épouse complètement la forme du pied. Son association avec le système Air a fait de la Huarache une paire révolutionnaire en terme de confort, performance et design.</p>','<p>Année de sortie: 2015</p>','air-huarache-anthracite-brown','Nike Air Huarache Anthracite/Brown running 1991 2015 Retro',NULL,'Air Huarache Anthracite/Brown','Air Huarache Anthracite/Brown',NULL,NULL),(1261,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1261,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1261,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1262,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 90:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Introduced in 1990 as the Nike Air Max III, the Air Max 90 turned more heads with an even larger visible Air unit and greater stability and cushioning. It has been re-released as a retro version with an unmeasurable amount of colorways and themes. The Air Max 90 was referred to as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2014</p>','air-max-90-leather-black','Nike Air Max 90 Leather Black 2014 Retro cuir',NULL,'Air Max 90 Leather Black','Air Max 90 Leather Black',NULL,NULL),(1262,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 90:</p>\r\n<p> </p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2014</p>','air-max-90-leather-black','Nike Air Max 90 Leather Black 2014 Retro cuir',NULL,'Air Max 90 Leather Black','Air Max 90 Leather Black',NULL,NULL),(1262,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1262,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1262,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1265,1,1,'<p>Year of release: 2015</p>\r\n<p><span><strong><span>One pair of matching \"ropelaces\" by Throwback Sneakers provided with this sneaker</span></strong></span><span>.</span></p>','<p>Year of release: 2015</p>','asics-gel-lyte-v-coral-reef','Asics Gel Lyte V Coral Reef clear water GL5 Retro 2015 ladies women',NULL,'Asics Gel Lyte V \"Coral Reef\"','Asics Gel Lyte 