 of release of OG model: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>This is the season Michael Jordan won all the personal accolades an NBA player could possibly win (Chicago’s 1988 All-Star Game MVP, winner of his second Slam Dunk Contest in a row, 1987-88 Scoring Champion and Defensive player award) and he did this while wearing the Air Jordan 3. The air unit is now visible through a sidehole in the shoes. The famous JUMPMAN replaces the AIR JORDAN wings logo. A unique elephant print trim around the shoe. Spike Lee\'s MARS BLACKMON ads for Jordan 3\'s were funny and innovative. Combined with Jordan\'s performance in the NBA, it made both Jordan and Air Jordan\'s very famous onto the USA and Japanese markets. <br /><br /></p>','<p>Year of release: 2014</p>','air-jordan-iii-powder-blue-gs','Nike Air Jordan III Powder Blue GS Retro AJ 3 2014 women ladies BG',NULL,'Air Jordan III Powder Blue GS','Air Jordan III Powder Blue GS',NULL,NULL),(1289,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan III:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Cette saison a été marquée par la consécration personnelle de Michael Jordan en NBA (MVP du All-star game qui se tenait à Chicago cette année là, vainqueur de son deuxième Slam Dunk <br />Contest consécutif, meilleur marqueur et défenseur de la saison 1987-88), tout cela en portant les Air Jordan 3. Le système air est dorénavant visible au niveau du talon. Le fameux <br />“Jumpman” remplace l’ancien logo “Air Jordan wings”. À noter aussi l’empreinte à l’origine en cuir d’éléphant qui se découpe autour de la chaussure. Le talent de Jordan, le design novateur, <br />combinés aux publicités originales réalisées par Spike Lee alias “MARS BLACKMAN” populariseront ce modèle aux Etats-unis ainsi que sur le marché Japonais.</p>','<p>Année de sortie: 2014</p>','air-jordan-iii-powder-blue-gs','Nike Air Jordan III Powder Blue GS Retro AJ 3 2014 women ladie