spectaculaire dans la raquette. Il régale les fans de contres, dunks et alley oops surpuissants. D\'ailleurs, plusieurs paniers et plexiglass ne résisteront pas à ses \"attaques\".</p>\r\n<p style=\"text-align: justify;\">Shaq terminera la saison 1992/93 à 23 points de moyenne par match et remportera le titre de Rookie de l\'année.</p>','<p>Année de sortie: 2013</p>','reebok-pump-shaq-attaq-black-azure','Reebok Pump Shaq Attaq Black/Azure 1992 2013 Shaquille O\'neal Orlando Magic Rookie',NULL,'Reebok Pump Shaq Attaq Black/Azure','Reebok Pump Shaq Attaq Black/Azure',NULL,NULL),(1322,1,3,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(1322,1,4,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(1322,1,5,NULL,NULL,'reebok-pump-court-victory-x-kicks-hawaii',NULL,NULL,NULL,'Reebok Pump Court Victory x Kicks Hawaii',NULL,NULL),(1323,1,1,'<p>Year of release: 2013</p>\r\n<p>About Air 180:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p style=\"text-align: justify;\">This revolutionary shoe contained fifty per cent more air than previous Air Max models. During 1991 – 92, a variety of colourways was produced. A basketball version of this model, the Air Force 180, was worn by NBA star Charles Barkley at the 1992 Barcelona Olympics.</p>','<p>Year of release: 2013</p>','air-180-white-laser-crimson-qs','Nike Air 180 White/Laser Crimson QS 2013 Quickstrike',NULL,'Air 180 White/Laser Crimson QS','Air 180 White/Laser Crimson QS',NULL,NULL),(1323,1,2,'<p>Année de sortie: 2013</p>\r\n<p><br />A propos de la Air 180: </p>\r\n<p>Date de sortie du modèle original: 1991 </p>\r\n<p style=\"text-align: justify;\">Cette chaussure révolutionnaire contient 50 % d’air de plus que les autres modèles Air Max de l\'époque. Ce modèle a été produit durant la saison 1991 – 92 dans une grande variété de couleurs. Une version basketball portant ce même 