hite/Concord/Gold QS 2013 Quickstrike',NULL,'Air 180 White/Concord/Gold QS','Air 180 White/Concord/Gold QS',NULL,NULL),(1324,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1324,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1324,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1326,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-3-crane-grey-white-red','Asics Gel Lyte 3 \"Crane\" Grey/White/Red GL3 Retro 2015 Gris Rouge',NULL,'Asics Gel Lyte 3 \"Crane\" Grey/White/Red','Asics Gel Lyte 3 \"Crane\" Grey/White/Red',NULL,NULL),(1326,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-3-crane-grey-white-red','Asics Gel Lyte 3 \"Crane\" Grey/White/Red GL3 Retro 2015 Gris Rouge',NULL,'Asics Gel Lyte 3 \"Crane\" Grey/White/Red','Asics Gel Lyte 3 \"Crane\" Grey/White/Red',NULL,NULL),(1326,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1326,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1326,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1327,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan XI:</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan was back for real and led the Bulls to another NBA victory. What a come back! If Jordan was back, so was Tinker Hatfield. A terrific design with a new patent leather and the return of the clear rubber sole made the Air Jordan XI the most appreciated Air Jordan model ever released. <br />With the XI\'s we also saw the return of low-tops. Something that would follow the Air Jordan\'s all the way to the XVI\'s (though skipping the XII\'s).</p>','<p>Year of release: 2014</p>','air-jordan-xi-concord-low','Nike Air Jordan XI Concord Low AJ 11 2014',NULL,'Air Jordan XI Concord Low','Air Jordan XI Concord Low',NULL,NULL),(1327,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan XI:</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan est de retour et il conduit les Bulls à un nouveau titre NBA. Quel retour! Tinker Hatfield est aussi de retour. Un design superbe avec un nouveau cuir verni, on note le retour de la semelle transparente qui fait de la Air Jordan XI le modèle le plus apprécié des Air Jordan. <br />Avec la Jordan XI on remarque aussi  le retour des baskets semi-montantes.  Une forme qui allait perdurer jusque la Jordan XVI (excepté la XII).</p>','<p>Année de sortie: 2014</p>','air-jordan-xi-concord-low','Nike Air Jordan XI Concord Low AJ 11 2014',NULL,'Air Jordan XI Concord Low','Air Jordan XI Concord Low',NULL,NULL),(1327,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1327,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1327,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1328,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan XI:</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan was back for real and led the Bulls to another NBA victory. What a come back! If Jordan was back, so was Tinker Hatfield. A terrific design with a new patent leather and the return of the clear rubber sole made the Air Jordan XI the most appreciated Air Jordan model ever released. <br />With the XI\'s we also saw the return of low-tops. Something that would follow the Air Jordan\'s all the way to the XVI\'s (though skipping the XII\'s).</p>','<p>Year of release: 2014</p>','air-jordan-xi-concord-low-gs','Nike Air Jordan XI Concord Low GS AJ 11 2014',NULL,'Air Jordan XI Concord Low GS','Air Jordan XI Concord Low GS',NULL,NULL),(1328,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan XI:</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan est de retour et il conduit les Bulls à un nouveau titre NBA. Quel retour! Tinker Hatfield est aussi de retour. Un design superbe avec un nouveau cuir verni, on note le retour de la semelle transparente qui fait de la Air Jordan XI le modèle le plus apprécié des Air Jordan. <br />Avec la Jordan XI on remarque aussi  le retour des baskets semi-montantes.  Une forme qui allait perdurer jusque la Jordan XVI (excepté la XII).</p>','<p>Année de sortie: 2014</p>','air-jordan-xi-concord-low-gs','Nike Air Jordan XI Concord Low GS AJ 11 2014',NULL,'Air Jordan XI Concord Low GS','Air Jordan XI Concord Low GS',NULL,NULL),(1328,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1328,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1328,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1329,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Trainer 1:</p>\r\n<p>Year of release of OG Model: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>The Air Trainer 1 is a multipurpose sneaker created by Tinker Hatfield. He was inspired to create this model when he noticed people in his local gym using two pairs of sneakers, one for running and one for weightlifting.</p>\r\n<p>The Nike Air Trainer 1 is well known for being worn by tennis star John McEnroe and NBA players in the late 80’s.</p>','<p>Year of release: 2013</p>','air-trainer-1-mid-prm-qs-infrared','Nike Air Trainer 1 Mid PRM QS Infrared 2013 Retro Quickstrike',NULL,'Air Trainer 1 Mid PRM QS Infrared','Air Trainer 1 Mid PRM QS Infrared',NULL,NULL),(1329,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Trainer 1:</p>\r\n<p>Année de sortie du modèle original: 1987</p>\r\n<p>Design : Tinker Hatfield</p>\r\n<p>La Air Trainer 1 est une paire multi-usages dessinée par Tinker Hatfield. Il a eu l’idée de créer ce modèle en voyant, dans la salle de sport de son quartier, que les clients apportaient deux paires de chaussures, une pour courir et une pour soulever des poids.</p>\r\n<p>La Air Trainer 1 a été rendue célèbre pour avoir été portée par John McEnroe et des joueurs NBA à la fin des années 80.</p>','<p>Année de sortie: 2013</p>','air-trainer-1-mid-prm-qs-infrared','Nike Air Trainer 1 Mid PRM QS Infrared 2013 Retro Quickstrike',NULL,'Air Trainer 1 Mid PRM QS Infrared','Air Trainer 1 Mid PRM QS Infrared',NULL,NULL),(1329,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1329,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1329,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1330,1,1,'<p>Year of release: 2013</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2013</p>','air-max-1-fb-woven-white-metallic-gold-gum','Nike Air Max 1 FB Woven White/Metallic Gold/Gum 2013 QS pack premium',NULL,'Air Max 1 FB Woven White/Metallic Gold/Gum','Air Max 1 FB Woven White/Metallic Gold/Gum',NULL,NULL),(1330,1,2,'<p>Année de sortie: 2013</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2013</p>','air-max-1-fb-woven-white-metallic-gold-gum','Nike Air Max 1 FB Woven White/Metallic Gold/Gum 2013 QS pack premium',NULL,'Air Max 1 FB Woven White/Metallic Gold/Gum','Air Max 1 FB Woven White/Metallic Gold/Gum',NULL,NULL),(1330,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1330,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1330,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1331,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-3-grey-mint','Asics Gel Lyte 3 Grey/Mint GL3 Retro 2015 Gris Vert Ronnie Fieg Collab',NULL,'Asics Gel Lyte 3 Grey/Mint','Asics Gel Lyte 3 Grey/Mint',NULL,NULL),(1331,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-3-grey-mint','Asics Gel Lyte 3 Grey/Mint GL3 Retro 2015 Gris Vert Ronnie Fieg Collab',NULL,'Asics Gel Lyte 3 Grey/Mint','Asics Gel Lyte 3 Grey/Mint',NULL,NULL),(1331,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1331,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1331,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1332,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-5-tan-tan','Asics Gel Lyte 5 Tan/Tan GL5 Retro 2015 Yellow Red Gold',NULL,'Asics Gel Lyte 5 Tan/Tan','Asics G