ink','Puma Trinomic R698 x Va$htie Black/Grey/Pink',NULL,NULL),(1338,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1338,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1338,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1339,1,1,'<p>Year of release: 2008</p>\r\n<p> </p>\r\n<div id=\"product-description\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\">About ZX 7000:</p>\r\n<p>Year of release of OG Model: 1988</p>\r\nThe ZX 7000 was the evolution of the running shoes from the early 80s, but this shoe is probably the best known ZX model today. Originally launched in 1988 with flamboyant colors and loaded with technologies like Soft Cell and the now well-known TORSION Technology. Luxury material and fresh colors made it one of the most popular running shoes.</div>','<p>Year of release: 2008</p>','adidas-torsion-zx7000-white-purple-green','Adidas Torsion ZX7000 White/Purple/Green 2008 running',NULL,'Adidas Torsion ZX7000 White/Purple/Green','Adidas Torsion ZX7000 White/Purple/Green',NULL,NULL),(1339,1,2,'<p>Année de sortie: 2008</p>\r\n<p> </p>\r\n<div id=\"product-description\">\r\n<p style=\"text-align: justify;\">A propos de la ZX 7000:</p>\r\n<p>Année de sortie du modèle original: 1988</p>\r\nLa ZX 7000 représente l’évolution des chaussures de course à pied à partir du début des années 80, mais cette chaussure est probablement la plus connue de la gamme ZX. Elle a été lancée en 1988, avec des couleurs flamboyantes, des technologies telles que « Soft Cell » et le désormais bien connu système TORSION. Les matériaux techniques et les nouveaux coloris ont fait de ce modèle un des plus populaires parmi les chaussures de course à pied.</div>','<p>Année de sortie: 2008</p>','adidas-torsion-zx7000-white-purple-green','Adidas Torsion ZX7000 White/Purple/Green 2008 running',NULL,'Adidas Torsion ZX7000 White/Purple/Green','Adidas Torsion ZX7000 White/Purple/Green',NULL,NULL),(1339,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1339,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1339,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1340,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<div id=\"product-description\" style=\"text-align: justify;\">\r\n<p style=\"text-align: justify;\">About ZX 7000:</p>\r\n<p>Year of release of OG Model: 1988</p>\r\nThe ZX 7000 was the evolution of the running shoes from the early 80s, but this shoe is probably the best known ZX model today. Originally launched in 1988 with flamboyant colors and loaded with technologies like Soft Cell and the now well-known TORSION Technology. Luxury material and fresh colors made it one of the most popular running shoes.</div>','<p>Year of release: 2014</p>','adidas-torsion-zx7000-white-purple-green','Adidas Torsion ZX7000 White/Purple/Green 2014 retro running',NULL,'Adidas Torsion ZX7000 White/Purple/Green','Adidas Torsion ZX7000 White/Purple/Green',NULL,NULL),(1340,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<div id=\"product-description\">\r\n<p style=\"text-align: justify;\">A propos de la ZX 7000:</p>\r\n<p>Année de sortie du modèle original: 1988</p>\r\nLa ZX 7000 représente l’évolution des chaussures de course à pied à partir du début des années 80, mais cette chaussure est probablement la plus connue de la gamme ZX. Elle a été lancée en 1988, avec des couleurs flamboyantes, des technologies telles que « Soft Cell » et le désormais bien connu système TORSION. Les matériaux techniques et les nouveaux coloris ont fait de ce modèle un des plus populaires parmi les chaussures de course à pied.</div>','<p>Année de sortie: 2014</p>','adidas-torsion-zx7000-white-purple-green','Adidas Torsion ZX7000 White/Purple/Green 2014 retro running',NULL,'Adidas Torsion ZX7000 White/Purple/Green','Adidas Torsion ZX7000 White/Purple/Green',NULL,NULL),(1340,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1340,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1340,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1341,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Adidas Stan Smith:</p>\r\n<p>Year of release of OG Model: 1964</p>\r\n<p>The earliest version of this shoe was produced in 1964 with the coopeartion of French player Robert Haillet. In 1965, American tennis pro Stan Smith came to the attention of Adidas. Haillet’s name was replaced with Smith’s, and subsequent models had his face and signature on the tongue. Over the years, the Stan Smith has been a constant presence in the Adidas catalogue. The sneakerhead’s favourite is the original Robert Haillet version.</p>','<p>Year of release: 2014</p>','adidas-stan-smith-black-x-pharrell-williams-solid-pack','Adidas Stan Smith Black x Pharrell Williams - Solid Pack 2014 Retro limited edition',NULL,'Adidas Stan Smith Black x Pharrell Williams - Solid Pack','Adidas Stan Smith Black x Pharrell Williams - Solid Pack',NULL,NULL),(1341,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Adidas Stan Smith:</p>\r\n<p>Année de sortie du modèle original: 1964</p>\r\n<p>La première version de cette chaussure a été produite en 1964 en coopération avec le joueur de tennis français Robert Haillet. En 1965, le joueur de tennis américain Stan Smith est remarqué par Adidas. Le visage et la signature de Haillet sur la languette disparaissent et sont remplacés par ceux de Stan Smith. Au fil des ans, la Stan Smith est restée présente dans le catalogue Adidas. Le modèle original de Robert Haillet est la version la plus recherchée par les sneakerheads.</p>','<p>Année de sortie: 2014</p>','adidas-stan-smith-black-x-pharrell-williams-solid-pack','Adidas Stan Smith Black x Pharrell Williams - Solid Pack 2014 Retro limited edition',NULL,'Adidas Stan Smith Black x Pharrell Williams - Solid Pack','Adidas Stan Smith Black x Pharrell Williams - Solid Pack',NULL,NULL),(1341,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1341,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1341,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1343,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','puma-trinomic-r698-speckle-black-silver','Puma Trinomic R698 \"Speckle\" Black/Silver running',NULL,'Puma Trinomic R698 \"Speckle\" Black/Silver','Puma Trinomic R698 \"Speckle\" Black/Silver',NULL,NULL),(1343,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>1 paire de lacet noir &amp; 1 paire de lacet noire reflective !</p>','<p>Année de sortie: 2015</p>','puma-trinomic-r698-speckle-black-silver','Puma Trinomic R698 \"Speckle\" Black/Silver running',NULL,'Puma Trinomic R698 \"Speckle\" Black/Silver','Puma Trinomic R698 \"Speckle\" Black/Silver',NULL,NULL),(1343,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1343,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1343,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1345,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Puma Suede:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Puma Suede is typically a classic model that stood the test of time, it has now become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and custo