eaner cleaning',NULL,'Lingettes Jason Markk Quick Wipes','Lingettes Jason Markk Quick Wipes',NULL,NULL),(1358,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1358,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1358,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1359,1,1,'<p>The Jason Markk Premium Brush is made from a hand crafted walnut wood handle and is made of soft hog\'s hair for delicate materials like suede, mesh, cotton canvas and more. Some materials just need some extra lovin.</p>\r\n<p> </p>\r\n<div class=\"product__short-description\">\r\n<ul>\r\n<li>Softer hog bristle</li>\r\n<li>Handcrafted walnut wood handle</li>\r\n<li>Heat-stamped Jason Markk logo on handle</li>\r\n<li>Ideal on delicate materials such as premium leather, suede or cotton mesh</li>\r\n</ul>\r\n<p> </p>\r\n<p>NB: When cleaning premium leather, suede, cotton mesh and other delicate materials take extra care and be gentle. We highly recommend using our Premium Shoe Cleaning Brush. The softer hog bristles are better suited for use on delicate surfaces.</p>\r\n</div>',NULL,'jason-markk-premium-shoe-cleaning-brush','Jason Markk Premium Shoe Cleaning Brush JM Premium cleaner cleaning',NULL,'Jason Markk Premium Shoe Cleaning Brush','Jason Markk Premium Shoe Cleaning Brush',NULL,NULL),(1359,1,2,NULL,NULL,'brosse-jason-markk-premium','Brosse Jason Markk Premium JM Premium cleaner cleaning',NULL,'Brosse Jason Markk Premium','Brosse Premium Jason Markk',NULL,NULL),(1359,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1359,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1359,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1360,1,1,'<p>The Standard Brush is made of synthetic bristles for great all-around cleaning and works well for areas like midsoles.</p>\r\n<p> </p>\r\n<div class=\"product__short-description\">\r\n<ul>\r\n<li>Synthetic bristle</li>\r\n<li>Handcrafted wood handle</li>\r\n<li>Heat-stamped Jason Markk logo on handle</li>\r\n<li>Excellent for tackling dirt on midsoles</li>\r\n<li>Great for all-around cleaning</li>\r\n<li>Tough on stubborn stains</li>\r\n</ul>\r\n<p> </p>\r\n<p>NOTE: When cleaning premium leather, suede, cotton mesh and other delicate materials take extra care and be gentle. For these sensitive materials, it\'s highly recommended to use the Premium Jason Markk cleaning brush. The softer hog bristles are better suited for use on delicate surfaces.</p>\r\n</div>',NULL,'jason-markk-premium-shoe-cleaning-brush','Jason Markk Premium Shoe Cleaning Brush JM Premium cleaner cleaning',NULL,'Jason Markk Premium Shoe Cleaning Brush','Jason Markk Standard Shoe Cleaning Brush',NULL,NULL),(1360,1,2,'<p><span style=\"display: block; text-align: left;\"><span style=\"display: block; text-align: left;\">Brosse de nettoyage Jason Markk standard.<br /><br /></span></span></p>\r\n<ul>\r\n<li>poils synthétiques</li>\r\n<li>poignée en bois fait main</li>\r\n<li>compatible sur quasiment toute les surfaces</li>\r\n<li>parfait pour le nettoyage des semelles</li>\r\n<li>recommandé pour les tâches persistantes</li>\r\n</ul>\r\n<p><span id=\"texte_description_fiche_produit\" style=\"display: block; text-align: left;\">NB : Lors du nettoyage des cuirs premium, daim, mesh ou autres surface fragiles, soyez très prudent et précautionneux. Il est recommandé d\'utiliser la brosse \"Premium cleaning brush\" qui possède des poils naturels plus doux.</span></p>',NULL,'brosse-jason-markk-premium','Brosse Jason Markk Premium JM Premium cleaner cleaning',NULL,'Brosse Jason Markk Premium','Brosse Standard Jason Markk',NULL,NULL),(1360,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1360,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1360,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1361,1,1,'<p>Premium Shoe Cleaner is a gentle foaming solution that effectively cleans and conditions. It doesn’t contain any harsh chemicals, is 98.3% natural, completely biodegradeable and safe to use on all colors and materials including leather, suede, nubuck, canvas, vinyl, nylon, cotton mesh and more.</p>\r\n<p> </p>\r\n<ul>\r\n<li>8 oz. Premium Sneaker Solution</li>\r\n<li>Does not contain any harsh chemicals or abrasives</li>\r\n<li>98.3% Natural and completely biodegradable</li>\r\n<li>Safe on all colors and materials</li>\r\n<li>Effectively cleans and conditions</li>\r\n<li>Cleans up to 200 pairs of sneakers</li>\r\n</ul>',NULL,'jason-markk-premium-shoe-cleaner-8oz','Jason Markk Premium shoe cleaner 8oz',NULL,'Jason Markk Premium shoe cleaner 8oz','Jason Markk Premium shoe cleaner 8oz',NULL,NULL),(1361,1,2,'<p><span style=\"display: block; text-align: left;\"><span style=\"display: block; text-align: left;\">Flacon 8 oz. de lotion nettoyante \"Premium shoe cleaner\" .<br /><br /></span></span></p>\r\n<ul>\r\n<li>Ne contient pas de produit chimiques ou abrasifs</li>\r\n<li>98,3% naturel et complétement biodégradable</li>\r\n<li>n’altère pas les couleurs</li>\r\n<li>capacité de 200 paires de chaussures</li>\r\n</ul>',NULL,'jason-markk-premium-shoe-cleaner-8oz','Jason Markk Premium shoe cleaner 8oz',NULL,'Jason Markk Premium shoe cleaner 8oz','Jason Markk Premium shoe cleaner 8oz',NULL,NULL),(1361,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1361,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1361,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1362,1,1,'<p>Repel creates a durable, breathable barrier that effectively repels liquids and stains. Repel\'s water-based formula is safe to use on all materials like suede, nubuck, leather, nylon and canvas.</p>\r\n<p> </p>\r\n<ul>\r\n<li>Water based</li>\r\n<li>Odorless and colorless</li>\r\n<li>Will not alter the look or feel of material</li>\r\n<li>Excellent durability</li>\r\n<li>Made in the USA</li>\r\n</ul>',NULL,'jason-markk-repel','Jason Markk Repel Premium shoe cleaner',NULL,'Jason Markk Repel','Jason Markk Repel',NULL,NULL),(1362,1,2,'<p><span id=\"texte_description_fiche_produit\" style=\"display: block; text-align: left;\">Repel crée une barrière respirante durable qui repousse efficacement les liquides et les taches. La formule à base d\'eau du Repel est sur à utiliser sur tous les matériaux, y compris en daim, nubuck, cuir, nylon et toile.</span></p>\r\n<p><span id=\"texte_description_fiche_produit\" style=\"display: block; text-align: left;\"><span id=\"result_box\" lang=\"fr\"><br /> <span class=\"hps\">-</span> <span class=\"hps\">À base d\'eau</span><span>.</span> <span class=\"hps\">Inodore</span> <span class=\"hps\">et incolore</span><br /> <span class=\"hps\">-</span> <span class=\"hps\">Ne</span> <span class=\"hps\">modifie pas l\'apparence</span> <span class=\"hps\">ni l\'odeur</span> <span class=\"hps\">du matériel</span><br /> <span class=\"hps\">-</span> <span class=\"hps\">Excellente durabilité</span><br /> <span class=\"hps\">-</span> <span class=\"hps\">Made in USA</span></span></span></p>',NULL,'jason-markk-repel','Jason Markk Repel Premium shoe cleaner 8oz',NULL,'Jason Markk Repel','Jason Markk Repel',NULL,NULL),(1362,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1362,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1362,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1363,1,1,'<p>Jason Markk Microfiber Towel is extremely absorbent, quick drying, lint free and non-abrasive, which makes it the perfect material for wiping off excess liquid from shoes.</p>\r\n<p> </p>\r\n<div class=\"container\"> </div>\r\n<div class=\"left\"> </div>\r\n<div class=\"right\">\r\n<div class=\"product__name\">Premium Microfiber Towel</div>\r\n<div class=\"product__description\">Our Microfiber Towel is extremely absorbent, quick drying, lint free and non-abrasive, which makes it the perfect material for wiping off excess liquid from shoes.</div>\r\n<div class=\"atc__wrapper\">\r\n<div class=\"atc__button\"> </div>\r\n</div>\r\n</div>\r\n<div class=\"atc__wrapper\"> </div>\r\n<div class=\"product__short-description\">\r\n<ul>\r\n<li>Dimensions: 12” x 12”</li>\r\n<li>Each microfiber is finer than a human hair and is sliced 16 times, resulting in millions of microscopic hooks on each cloth to capture dirt and dust</li>\r\n<li>Absorbs up to 7 times its weight in water</li>\r\n<li>Extremely absorbent, quick drying, lint free and non-abrasive</li>\r\n<li>Machine washable. Wash hot. Do not use bleach or fabric softener. Low heat tumble dry.</li>\r\n</ul>\r\n</div>',NULL,'microfiber-towel-jason-markk','Microfiber Towel Jason Markk JM Premium cleaner cleaning',NULL,'Microfiber Towel Jason Markk','Jason Markk Quick Wipes',NULL,NULL),(1363,1,2,'<div align=\"justify\">Serviette en microfibre garantie sans peluche, non abrasive et hypoallergénique.</div>\r\n<p> </p>\r\n<ul>\r\n<li>Dimensions: 30,5 x 30,5 cm</li>\r\n<li>Chaque fibre et pus fine q\'un cheveux humain et découpée en 16. Il en résulte des millions de microscopiques boucles pouvant capter tout les salissures et poussières</li>\r\n<li>Haut pouvoir d\'absorption, jusqu\'à 7 fois son poids en eau</li>\r\n<li>Lavable en machine</li>\r\n</ul>',NULL,'serviette-microfibre-jason-markk','Serviette Microfibre Jason Markk JM Premium cleaner cleaning',NULL,'Serviette Microfibre Jason Markk','Serviette Microfibre Jason Markk',NULL,NULL),(1363,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1363,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1363,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1366,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-iii-burgundy-white','Asics Gel Lyte III Burgundy/White Bordeaux White Retro GL3 2015',NULL,'Asics Gel Lyte III Burgundy/White','Asics Gel Lyte III Burgundy/White',NULL,NULL),(1366,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-iii-burgundy-white','Asics Gel Lyte III Burgundy/White Bordeaux White Retro GL3 2015',NULL,'Asics Gel Lyte III Burgundy/White','Asics Gel Lyte III Burgundy/White',NULL,NULL),(1366,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1366,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1366,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1367,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-iii-burgundy-white','Asics Gel Lyte III Burgundy/White Bordeaux White Retro GL3 2015',NULL,'Asics Gel Lyte III Burgundy/White','Asics Gel Lyte III Navy/White',NULL,NULL),(1367,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-iii-burgundy-white','Asics Gel Lyte III Burgundy/White Bordeaux White Retro GL3 2015',NULL,'Asics Gel Lyte III Burgundy/White','Asics Gel Lyte III Navy/White',NULL,NULL),(1367,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1367,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air J