d',NULL,NULL),(1394,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1394,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1395,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2015</p>','air-jordan-vii-bordeaux-gs','Nike Air Jordan VII Bordeaux GS Retro ladies women girls AJ 7 2015',NULL,'Air Jordan VII Bordeaux GS','Air Jordan VII Bordeaux GS',NULL,NULL),(1395,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2015</p>','air-jordan-vii-bordeaux-gs','Nike Air Jordan VII Bordeaux GS Retro ladies women girls AJ 7 2015',NULL,'Air Jordan VII Bordeaux GS','Air Jordan VII Bordeaux GS',NULL,NULL),(1395,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1395,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1395,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1396,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Air Jordan VII:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>At the end of NBA season 1991/92, Michael Jordan and the Bulls win their 2nd championship title in a row against Clyde Drexler and Cliff Robinson’s Portland Trail Blazers. MJ is once again NBA finals MVP. <br />The Air Jordan VII was inspired by some African art festival poster that Tinker Hatfield (head designer) saw in Portland. A full-length Huarache inner bootie fits like a sock around the foot. The shoes are light. Minimal padding and support around the ankle. They are very comfortable to wear <br />but only suitable for point-guards and light forwards because of the lack of support. MJ, with the USA \"Dream Team\", won the Olympic games this year in Barcelona with the famous Jordan VII \"olympic\" colorway White/Midnight Navy/True Red bearing #9 on the back.</p>','<p>Year of release: 2015</p>','air-jordan-vii-hare-gs','Nike Air Jordan VII Hare GS Retro ladies women girls AJ 7 2015',NULL,'Air Jordan VII Hare GS','Air Jordan VII Hare GS',NULL,NULL),(1396,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VII:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>A l’issue de la saison 1991-92, Michael Jordan et les Bulls remportent leur 2ème titre NBA d’affilée, cette fois face aux Portland Trail Blazers de Clyde Drexler et Cliff Robinson. Jordan est à nouveau désigné MVP de la finale NBA.</p>\r\n<p>Alliant les capacités des chaussures de course et de nouvelles matières plus légères et plus confortables (néoprène), la Air Jordan VII tient son design de la culture tribale. Le système Huarache, qui maintient le pied comme dans un chausson, est la grande évolution. Il permet au <br />pied d\'épouser parfaitement la semelle. Un modèle spécial blanc/bleu/rouge/argent a été créé pour les JO de Barcelone, avec le n°9 (numéro de Michael Jordan au sein de la \"Dream Team\") imprimé au niveau du talon.</p>','<p>Année de sortie: 2015</p>','air-jordan-vii-hare-gs','Nike Air Jordan VII Hare GS Retro ladies women girls AJ 7 2015',NULL,'Air Jordan VII Hare GS','Air Jordan VII Hare GS',NULL,NULL),(1396,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1396,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1396,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1397,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2015</p>','air-jordan-vi-low-black-silver-gs','Nike Air Jordan VI Low Black/Silver GS AJ 6 2015',NULL,'Air Jordan VI Low Black/Silver GS','Air Jordan VI Low Black/Silver GS',NULL,NULL),(1397,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2015</p>','air-jordan-vi-low-black-silver-gs','Nike Air Jordan VI Low Black/Silver GS AJ 6 2015',NULL,'Air Jordan VI Low Black/Silver GS','Air Jordan VI Low Black/Silver GS',NULL,NULL),(1397,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1397,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1397,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1398,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','flyknit-racer-blue-lago