odèle en voyant, dans la salle de sport de son quartier, que les clients apportaient deux paires de chaussures, une pour courir et une pour soulever des poids.</p>\r\n<p>La Air Trainer 1 a été rendue célèbre pour avoir été portée par John McEnroe et des joueurs NBA à la fin des années 80.</p>','<p>Année de sortie: 2013</p>','air-trainer-1-mid-prm-qs-brogue','Nike Air Trainer 1 Safari NRG QS 2012 Safari Pack limited edition Quickstrike',NULL,'Air Trainer 1 Mid PRM QS \"Brogue\"','Air Trainer 1 Mid PRM QS \"Brogue\"',NULL,NULL),(1467,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1467,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1467,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1469,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','asics-gel-lyte-v-black-suede','Asics Gel Lyte V Black Suede Triple Black Dark Noir Retro GL5 2015',NULL,'Asics Gel Lyte V Black Suede','Asics Gel Lyte V Black Suede',NULL,NULL),(1469,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>','<p>Année de sortie: 2015</p>','asics-gel-lyte-v-black-suede','Asics Gel Lyte V Black Suede Triple Black Dark Noir Retro GL5 2015',NULL,'Asics Gel Lyte V Black Suede','Asics Gel Lyte V Black Suede',NULL,NULL),(1469,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1469,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1469,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1470,1,1,'<p><span>Year of release: 2015</span></p>','<p>Year of release: 2015</p>','asics-gel-lyte-v-gore-tex-soft-grey-light-blue','Asics Gel Lyte V \"Gore-Tex\" Soft Grey/Light Blue GL5 White Grey Retro 2015 purple',NULL,'Asics Gel Lyte V \"Gore-Tex\" Soft Grey/Light 