lassic first hit the scene in 1990. That year Andre Agassi lost 2 grand slams finals. The first in Roland Garros against the Ecuadorian Andres Gomez and the second at the U.S. Open against Pete Sampras. The Hot LAVA ATC II is probably the most sought after model in the entire Air Tech line. Nike did an excellent job on this retro which is almost identical to the original model.</p>','<p>Year of release: 2014</p>','air-tech-challenge-ii-poison-green','Nike Air Tech Challenge II \"Poison Green\" Agassi Retro 2014 1990',NULL,'Air Tech Challenge II \"Poison Green\"','Air Tech Challenge II \"Poison Green\"',NULL,NULL),(1473,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Tech Challenge II:</p>\r\n<p>Année de sortie du modèle original: 1990</p>\r\n<p>Il y a eu beaucoup de discussions autour de la sortie de ce modèle emblématique de chez Nike.</p>\r\n<p>Ce grand classique fut porté par Andre Agassi en 1990. Cette année-là, Agassi perdit 2 finales de Grand Chelem. La première à Roland Garros contre l\'Équatorien Andres Gomez et la deuxième à l\'US Open contre Pete Sampras. La Hot Lava est probablement le modèle le plus recherché dans la gamme Air Tech. Nike a fait un excellent travail sur cette rétro, en effet, la chaussure est quasi-identique à l\'originale.</p>','<p>Année de sortie: 2014</p>','air-tech-challenge-ii-poison-green','Nike Air Tech Challenge II \"Poison Green\" Agassi Retro 2014 1990',NULL,'Air Tech Challenge II \"Poison Green\"','Air Tech Challenge II \"Poison Green\"',NULL,NULL),(1473,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1473,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1473,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1474,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Tech Challenge II:</p>\r\n<p>Ye