ch challenge II hot lava',NULL,NULL),(1476,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1477,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','air-zoom-streak-5-hyper-punch-black','Nike Air Zoom Streak 5 Hyper Punch/Black orange green volt Technology 2014 running',NULL,'Air Zoom Streak 5 Hyper Punch/Black','Air Zoom Streak 5 Hyper Punch/Black',NULL,NULL),(1477,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','air-zoom-streak-5-hyper-punch-black','Nike Air Zoom Streak 5 Hyper Punch/Black orange green volt Technology 2014 running',NULL,'Air Zoom Streak 5 Hyper Punch/Black','Air Zoom Streak 5 Hyper Punch/Black',NULL,NULL),(1477,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1477,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1477,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1478,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2015</p>','air-max-1-patch-white-navy-red','Nike Air Max 1 FB Woven White/Metallic Gold/Gum 2013 QS pack premium',NULL,'Air Max 1 FB Woven White/Metallic Gold/Gum','Air Max 1 \"Patch\" White/Navy/Red',NULL,NULL),(1478,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2015</p>','air-max-1-patch-white-navy-red','Nike Air Max 1 \"Patch\" White/Navy/Red 2015 QS pack premium',NULL,'Air Max 1 \"Patch\" White/Navy/Red','Air Max 1 \"Patch\" White/Navy/Red',NULL,NULL),(1478,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1478,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1478,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1479,1,1,'<p>Year of release: 2015</p>','<p>Year of release: 2015</p>','arkk-raven-coal-black','ARKK Raven Coal Black Copenahgen Denmark Speckle',NULL,'ARKK Raven Coal Black','ARKK Raven Coal Black',NULL,NULL),(1479,1,2,'<p>Année de sortie: 2015</p>','<p>Année de sortie: 2015</p>','arkk-raven-coal-black','ARKK Raven Coal Black Copenahgen Denmark Speckle',NULL,'ARKK Raven Coal Black','ARKK Raven Coal Black',NULL,NULL),(1479,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1479,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1479,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1480,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 90:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p style=\"text-align: justify;\">Introduced in 1990 as the Nike Air Max III, the Air Max 90 turned more heads with an even larger visible Air unit and greater stability and cushioning. It has been re-released as a retro version with an unmeasurable amount of colorways and themes. The Air Max 90 was referred to as the Air Max or the Air Max III until 2000, when it was reissued. It takes its current name from its launch year, 1990. The first colourway produced was the men’s white/ black/ cool grey/ red. It was striking to say the least: the radiant red around the visible Air window exaggerated the thickness of the midsole. The upper was made of Duromesh, synthetic suede and synthetic leather. The clean lines and dazzling colours made the Air Max a highly sought-after.</p>','<p>Year of release: 2014</p>','air-max-90-washed-denim','Nike Air Max 90 Washed Denim 2014 Retro blue jean',NULL,'Air Max 90 Washed Denim','Air Max 90 Washed Denim',NULL,NULL),(1480,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 90:</p>\r\n<p> </p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Lancée en 1990 sous le nom Nike Air Max III, la Air Max 90 fait tourner les têtes avec une unité d’air encore plus visible et une plus grande stabilité et amorti. Ce modèle a été réédité dans une très grande variété de couleurs et de thèmes. La Air Max 90 a été dénommée Air Max ou Air Max III jusqu\'en 2000, quand elle a été rééditée. Son nom actuel vient de l’année de son lancement : 1990. Le colori de la première production pour homme est blanc/ noir/ gris/ rouge. Ce qui frappe sur ce modèle est le rouge rayonnant autour du système air  qui exagère l\'épaisseur de la semelle. La partie supérieure est faite en Duromesh, daim synthétique et cuir synthétique. Les lignes épurées et les couleurs éblouissantes font de la Air Max 90 un modèle particulièrement recherché.</p>','<p>Année de sortie: 2014</p>','air-max-90-washed-denim','Nike Air Max 90 Washed Denim 2014 Retro blue jean',NULL,'Air Max 90 Washed Denim','Air Max 90 Washed Denim',NULL,NULL),(1480,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1480,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1480,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1481,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2014</p>','air-jordan-vi-carmine','Nike Air Jordan VI Carmine AJ 6 2014',NULL,'Air Jordan VI Carmine','Air Jordan VI Carmine',NULL,NULL),(1481,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus facilement. C’est pourquoi Tinker dessina pour cette chaussure une languette avec 2 trous et un « spoiler » au niveau supérieur du talon. Le spoiler a été inspiré par la Porsche 930 Turbo \"Flachbau\" de Michael Jordan. La Air Jordan VI Carmine, avec sa semelle transparente, son cuir blanc et rouge carmine est considérée par beaucoup de collectionneurs comme l’une des plus belles paires de Air Jordan.</p>','<p>Année de sortie: 2014</p>','air-jordan-vi-carmine','Nike Air Jordan VI Carmine AJ 6 2014',NULL,'Air Jordan VI Carmine','Air Jordan VI Carmine',NULL,NULL),(1481,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1481,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1481,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1482,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan VI:</p>\r\n<p>Year of release of OG model: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>After seven years in the league, Michael leads Chicago to a 4-1 victory over the Lakers for their first NBA Championship. Tinker Hatfield asked Michael Jordan what he would like in the Air Jordan VI. MJ said he\'d like it to be easy to get into, so Tinker designed 2 holes in the tongue and a \"spoiler\" heel tab in the back heel. The spoiler/heel tab was inspired by MJ\'s rare black slant-nosed or \"Flachbau\" Porsche 930 Turbo. The Air Jordan VI « Carmine », with its transparent sole, white leather and red carmine is considered by many collectors as one of the most beautiful pair of Air Jordan.</p>','<p>Year of release: 2014</p>','air-jordan-vi-carmine-gs','Nike Air Jordan VI Carmine GS AJ 6 2014 ladies women girls',NULL,'Air Jordan VI Carmine GS','Air Jordan VI Carmine GS',NULL,NULL),(1482,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan VI:</p>\r\n<p>Date de sortie du modèle original: 1990</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 1990-91, après 7 saisons en NBA, Michael Jordan mena Chicago à la victoire face aux Lakers (4 victoires à 1) pour le premier titre NBA de l’histoire du club. Tinker Hatfield demanda à Michael Jordan ce qu’il désirait pour la Air Jordan VI. Le souhait de MJ était de pouvoir enfiler la chaussure plus f