ce High Kids White/Black/Truroy Navy Blue Vintage Air Basketball',NULL,'Contingent Force Hi Kids White/Black/Truroy','OG Contingent Force Hi Kids White/Black/Truroy',NULL,NULL),(1496,1,2,'<p>Année de sortie: 1991</p>','<p>Année de sortie: 1991</p>','contingent-force-hi-kids-white-black-truroy','Nike Contingent Force High Kids White/Black/Truroy Navy Blue Vintage Air Basketball',NULL,'Contingent Force Hi Kids White/Black/Truroy','OG Contingent Force Hi Kids White/Black/Truroy',NULL,NULL),(1496,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1496,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1496,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1497,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2015</p>','air-max-1-leather-prm-wheat','Nike Air Max 1 Leather PRM \"Wheat\" Pack curry premium AM1 2015',NULL,'Air Max 1 Leather PRM \"Wheat\"','Air Max 1 Leather PRM \"Wheat\"',NULL,NULL),(1497,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2015</p>','air-max-1-leather-prm-wheat','Nike Air Max 1 Leather PRM \"Wheat\" Pack curry premium AM1 2015',NULL,'Air Max 1 Leather PRM \"Wheat\"','Air Max 1 Leather PRM \"Wheat\"',NULL,NULL),(1497,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1497,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1497,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1499,1,1,'<p>Year of release: 2015</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Warning: This model cuts short, consider one size bigger than your usual Nike sizing.</strong></span></p>\r\n<p> </p>\r\n<p>About Air Huarache:</p>\r\n<p>Year of release of OG model: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>The \"Huarache\" was named after a Native American sandal. Its main particularity is a neoprene and spandex sock contained within the upper. The sock strongly holds the foot. Coupled with Nike’s trademark air unit, the Huarache pushed Nike running shoes one step forward in terms of comfort, performance and design.</p>','<p>Year of release: 2015</p>','air-huarache-run-print-black-grey-camo','Nike Air Huarache Run Print Black/Grey Camo running 1991 2014 Retro ladies women',NULL,'Air Huarache Run Print Black/Grey Camo','Air Huarache Run Print Black/Grey Camo',NULL,NULL),(1499,1,2,'<p>Année de sortie: 2015</p>\r\n<p><span style=\"color: #ff0000;\"><strong>Attention: ce modèle taille petit, compter une taille de plus que votre taille Nike habituelle.</strong></span></p>\r\n<p> </p>\r\n<p>A propos de la Air Huarache:</p>\r\n<p>Date de sortie du modèle original: 1991</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>La \"Huarache\" tire son nom d\'une sandale portée par les Indiens d\'Amérique. Sa principale particularité est son chausson fait de neoprene et Spandex qui recouvre toute la partie supérieure de la chaussure. Ce chausson épouse complètement la forme du pied. Son association avec le système Air a fait de la Huarache une paire révolutionnaire en terme de confort, performance et design.</p>','<p>Année de sortie: 2015</p>','air-huarache-run-print-black-grey-camo','Nike Air Huarache Run Print Black/Grey Camo running 1991 2014 Retro ladies women',NULL,'Air Huarache Run Print Black/Grey Camo','Air Huarache Run Print Black/Grey Camo',NULL,NULL),(1499,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1499,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1499,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1503,1,1,NULL,NULL,'stance-socks-x-star-wars-force-luke-skywalker-darth-vader','Stance Socks x Star Wars \"Force\" Luke Skywalker & Darth Vader White Black the uncommon force pack',NULL,'Stance Socks x Star Wars \"Force\" Luke Skywalker & Darth Vader','Stance Socks x Star Wars \"Force\" Luke Skywalker & Darth Vader',NULL,NULL),(1503,1,2,NULL,NULL,'stance-socks-x-star-wars-force-luke-skywalker-darth-vader','Stance Socks x Star Wars \"Force\" Luke Skywalker & Darth Vader White Black the uncommon force pack',NULL,'Stance Socks x Star Wars \"Force\" Luke Skywalker & Darth Vader','Stance Socks x Star Wars \"Force\" Luke Skywalker & Darth Vader',NULL,NULL),(1503,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1503,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1503,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1504,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Adidas Superstar:</p>\r\n<p>Year of release of OG Model: 1969</p>\r\n<p>The Superstar was produced in 1969 as a low Pro Model version and was the first basketball sneaker made of leather. Unmistakable because of the shelltop made of rubber.</p>\r\n<p>With his typical styling and his bulky looking. Hip Hop artists like RUN-DMC made it to an icon. Their track My Adidas paid tribute to the brand and let the group have their own personalized Adidas shoes and clothing.</p>','<p>Year of release: 2015</p>','adidas-superstar-foundation-white','Adidas Superstar Foundation White 2015 ladies girls women GS',NULL,'Adidas Superstar Foundation White','Adidas Superstar Foundation White',NULL,NULL),(1504,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Adidas Superstar:</p>\r\n<p>Année de sortie du modèle original: 1969</p>\r\n<p>La superstar a été produite en 1969 comme une version basse de la Pro Model et a été la première chaussure de basket-ball toute en cuir. Cette chaussure est incomparable en raison de sa coque en caoutchouc renforcée à l’avant du pied. Avec son style atypique et sa forme volumineuse.</p>\r\n<p>Des artistes Hip Hop comme RUN-DMC ont fait de cette chaussure un phénomène. Leur chanson « My Adidas » a rendu hommage à la marque et a conduit le groupe à avoir leur propre ligne de vêtements et de chaussures Adidas.</p>','<p>Année de sortie: 2015</p>','adidas-superstar-foundation-white','Adidas Superstar Foundation White 2015 ladies girls women GS',NULL,'Adidas Superstar Foundation White','Adidas Superstar Foundation White',NULL,NULL),(1504,1,3,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1504,1,4,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1504,1,5,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1505,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Adidas Superstar:</p>\r\n<p>Year of release of OG Model: 1969</p>\r\n<p>The Superstar was produced