 challenge II hot lava',NULL,NULL),(1512,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1512,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1513,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','air-tech-challenge-hybrid-chilling-red-black','Nike Air Tech Challenge Hybrid Chilling Red/Black Agassi Retro 2014 ATC',NULL,'Air Tech Challenge Hybrid Chilling Red/Black','Air Tech Challenge Hybrid Chilling Red/Black',NULL,NULL),(1513,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','air-tech-challenge-hybrid-chilling-red-black','Nike Air Tech Challenge Hybrid Chilling Red/Black Agassi Retro 2014 ATC',NULL,'Air Tech Challenge Hybrid Chilling Red/Black','Air Tech Challenge Hybrid Chilling Red/Black',NULL,NULL),(1513,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1513,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1513,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1514,1,1,'<p>Year of release: 2014</p>','<p>Year of release: 2014</p>','air-tech-challenge-hybrid-qs-black-pink-purple','Nike Air Tech Challenge Hybrid QS Black/Pink/Purple Agassi Retro 2014 ATC',NULL,'Air Tech Challenge Hybrid QS Black/Pink/Purple','Air Tech Challenge Hybrid QS Black/Pink/Purple',NULL,NULL),(1514,1,2,'<p>Année de sortie: 2014</p>','<p>Année de sortie: 2014</p>','air-tech-challenge-hybrid-qs-black-pink-purple','Nike Air Tech Challenge Hybrid QS Black/Pink/Purple Agassi Retro 2014 ATC',NULL,'Air Tech Challenge Hybrid QS Black/Pink/Purple','Air Tech Challenge Hybrid QS Black/Pink/Purple',NULL,NULL),(1514,1,3,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1514,1,4,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1514,1,5,NULL,NULL,'nike-air-tech-challenge-ii-hot-lava',NULL,NULL,NULL,'nike air tech challenge II hot lava',NULL,NULL),(1515,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Max 1:</p>\r\n<p>Year of release of OG model: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>First visible air unit system (originally developped by NASA) ever made by NIKE.  Since 1987, the Air Max has been produced in a variety of colourways and fabric combinations. The sneaker’s upper was made of nylon mesh and synthetic suede. The first leather edition was released in 1988.</p>','<p>Year of release: 2014</p>','air-max-1-essential-grey-suede','Nike Air Max 1 Essential Grey Suede Pack AM1 2014',NULL,'Air Max 1 Essential Grey Suede','Air Max 1 Essential Grey Suede',NULL,NULL),(1515,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Max 1:</p>\r\n<p>Date de sortie du modèle original: 1987</p>\r\n<p>Design: Tinker Hatfield</p>\r\n<p>Premier système à coussin d’air visible fabriqué par NIKE (développé par la NASA). Depuis 1987 l’Air Max a été produit dans un très large choix de couleurs et de variétés de matières. La première version tout en cuir fut lancée en 1988. Auparavant, les éléments de fabrication utilisés étaient le nylon et le daim synthétiques.</p>','<p>Année de sortie: 2014</p>','air-max-1-essential-grey-suede','Nike Air Max 1 Essential Grey Suede Pack AM1 2014',NULL,'Air Max 1 Essential Grey Suede','Air Max 1 Essential Grey Suede',NULL,NULL),(1515,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1515,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1515,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1528,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Air Jordan V:</p>\r\n<p>Year of release of OG model: 1989</p>\r\n<p>Designer: Tinker Hatfield<br />Phil Jackson took over as head coach for the Bulls in the 89-90 season. This gave the Bull\'s an extra boost and everything was flying. Jordan kept on playing his game and set a personal best when scoring 69 points in a game against the Cleveland Cavaliers. Once again Hatfield came up with a revolutionary design for the new shoe.</p>\r\n<p>The AJ5 was inspired by World War II Fighter planes (Spitfire WWII) brought to light by The \"reverse flames\". The clear outsole was inspired by the clear panels of Marty MacFly\'s Back to the Future II boots which Tinker had designed for the movie. Tinker put a reflective 3M tongue with Jumpman embroidery. Whenever a photograph flash goes off, the tongue would light up and the tiny Jumpman would be highlighted in the background.</p>','<p>Year of release: 2015</p>','air-jordan-v-white-metallic-silver','Nike Air Jordan V White/Metallic Silver AJ 5 2015 3M',NULL,'Air Jordan V White/Metallic Silver','Air Jordan V White/Metallic Silver',NULL,NULL),(1528,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan V:</p>\r\n<p>Date de sortie du modèle original: 1989</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Phil Jackson arrive à la tête des Bulls en 1989-90. Ce renfort donne des ailes à l’équipe. Michael Jordan établit un nouveau record personnel de 69 points marqués durant un match, contre les Cleveland Cavaliers. Tinker Hatfield puise cette fois son inspiration dans un avion de combat (le Spitfire WWII ), laissant apparaître des flammes inversées sur le côté de la chaussure. La semelle transparente a été inspirée par la paire de chaussure révolutionnaire (dessinée par Tinker hatfield) portée par Michael J Fox dans le film Retour vers le Futur II. La languette est réfléchissante à la <br />lumière, ce qui fait ressortir le Jumpman brodé.</p>','<p>Année de sortie: 2015</p>','air-jordan-v-white-metallic-silver','Nike Air Jordan V White/Metallic Silver AJ 5 2015 3M',NULL,'Air Jordan V White/Metallic Silver','Air Jordan V White/Metallic Silver',NULL,NULL),(1528,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1528,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1528,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1529,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan XI:</p>\r\n<p>Year of release of OG model: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan was back for real and led the Bulls to another NBA victory. What a come back! If Jordan was back, so was Tinker Hatfield. A terrific design with a new patent leather and the return of the clear rubber sole made the Air Jordan XI the most appreciated Air Jordan model ever released. <br />With the XI\'s we also saw the return of low-tops. Something that would follow the Air Jordan\'s all the way to the XVI\'s (though skipping the XII\'s).</p>','<p>Year of release: 2014</p>','air-jordan-xi-legend-blue','Nike Air Jordan XI Legend Blue retro AJ 11 2014',NULL,'Air Jordan XI Legend Blue','Air Jordan XI Legend Blue',NULL,NULL),(1529,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan XI:</p>\r\n<p>Date de sortie du modèle original: 1995</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>Jordan est de retour et il conduit les Bulls à un nouveau titre NBA. Quel retour! Tinker Hatfield est aussi de retour. Un design superbe avec un nouveau cuir verni, on note le retour de la semelle transparente qui fait de la Air Jordan XI le modèle le plus apprécié des Air Jordan. <br />Avec la Jordan XI on remarque aussi  le retour des baskets semi-montantes.  Une forme qui allait perdurer jusque la Jordan XVI (excepté la XII).</p>','<p>Année de sortie: 2014</p>','air-jordan-xi-legend-blue','Nike Air Jordan XI Legend Blue retro AJ 11 2014',NULL,'Air Jordan XI Legend Blue','Air Jordan XI Legend Blue',NULL,NULL),(1529,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1529,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1529,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1530,1,1,'<p>Year of release: 2015</p>\r\n<p> </p>\r\n<p>About Air Jordan IV:</p>\r\n<p>Year of release of OG model: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>In 88-89, Michael Jordan earns another All-Star selection and his 3<sup>rd</sup> consecutive scoring title. The design of the Air Jordan IV wasn\'t as revolutionary as the previous designs and kept a lot of the feeling from the Air Jordan III. Air Jordans had started to get major popularity. Nike continued with Mars Blackmon (Spike Lee) and created the famous « Can/Can\'t » TV commercial. Spike Lee really liked these shoes personally and gave them some extra promotion in his movie Do The Right Thing.</p>\r\n<p>Using an over-molded mesh to improve breathability and reduce weight, plastic stabilisation lace straps and  \"trapezoidal\" multi-port lace-locking system. visible Air Sole® unit in heel, encapsulated forefoot Air-Sole® unit.</p>','<p>Year of release: 2015</p>','air-jordan-iv-columbia','Nike Air Jordan IV Columbia retro AJ 4 2015',NULL,'Air Jordan IV Columbia','Air Jordan IV Columbia',NULL,NULL),(1530,1,2,'<p>Année de sortie: 2015</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan IV:</p>\r\n<p>Date de sortie du modèle original: 1988</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>En 88-89, Michael Jordan est sélectionné pour son 3<sup>éme</sup> All-Star Game consécutif et obtient son troisième titre de meilleur marqueur de la saison régulière. Le design de la Air Jordan IV n’est pas aussi révolutionnaire que celui du modèle précédent et garde l’esprit de la Air Jordan III. Avec ce modèle, les Air Jordan commencent à connaître un succès populaire important. Spike Lee (Mars Blackman) continue à collaborer avec Nike et crée des publicités comme la célèbre « Can/ Can’t » et utilise la Jordan IV dans son film Do The Right Thing.<em> </em></p>\r\n<p>Utilisation de mailles moulées pour améliorer la respiration du pied et pour réduire le poids.</p>\r\n<p>Système de stabilisation en plastique.</p>\r\n<p>Système de verrouillage de lacets de forme trapézoïdale.</p>\r\n<p>Système air visible dans le talon, bulle d’air dissimulée à l’avant du pied</p>','<p>Année de sortie: 2015</p>','air-jordan-iv-columbia','Nike Air Jordan IV Columbia retro AJ 4 2015',NULL,'Air Jordan IV Columbia','Air Jordan IV Columbia',NULL,NULL),(1530,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1530,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1530,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1531,1,1,'<p>Year of release: 2014</p>\r\n<p> </p>\r\n<p>About Air Jordan X:</p>\r\n<p>Year of release of OG model: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>AJ X could have been the last Air Jordan. In 1994, Jordan had already retired from the NBA (following the murder of his father during summer ’93) and had decided to start a new career in baseball with the Chicago White Sox.  This explains the presence of the 10 lines of MJ’s main achievements on the sole of the shoe. After suffering a failure in baseball, MJ decides to make his come back in the NBA in march 1995. He’s back, wearing the AJX on court, with the Bulls but without his #23  (which had been retired). His come back is a success as he helps the Bulls qualify for the Playoffs. They finally lose against Shaq’s Orlando Magic which will then be swept by the Houston Rockets in the ’95 NBA Finals.</p>','<p>Year of release: 2014</p>','air-jordan-x-powder-blue','Nike Air Jordan X Powder Blue AJ 10 2014 university blue',NULL,'Air Jordan X Powder Blue','Air Jordan X Powder Blue',NULL,NULL),(1531,1,2,'<p>Année de sortie: 2014</p>\r\n<p> </p>\r\n<p>A propos de la Air Jordan X:</p>\r\n<p>Date de sortie du modèle original: 1994</p>\r\n<p>Designer: Tinker Hatfield</p>\r\n<p>La AJ X a bien failli être la dernière de la série. En 1994, Jordan, retraité de la NBA à la suite de l’assassinat de son père, décida de tenter une carrière professionnelle dans le baseball en intégrant les Chicago White Sox. Ceci explique que la semelle du modèle porte, sur 10 lignes, le palmarès <br />de MJ. Après avoir essuyé un échec au baseball, il décide de revenir aux affaires en NBA en mars 1995. Il est donc de retour, avec les Bulls, Jordan X aux pieds, mais sans son numéro 23 (qui avait été retiré lors de sa retraite). Son retour est un succès, il aide les Bulls à se qualifier pour les <br />Playoffs. Ils perdent finalement face aux Orlando Magic de Shaquille O’Neal qui seront à leur tour balayés par les Houston Rockets en finale NBA.</p>','<p>Année de sortie: 2014</p>','air-jordan-x-powder-blue','Nike Air Jordan X Powder Blue AJ 10 2014 university blue',NULL,'Air Jordan X Powder Blue','Air Jordan X Powder Blue',NULL,NULL),(1531,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1531,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1531,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1535,1,1,'<p>Year of release: 2016</p>\r\n<p> </p>','<p>Year of release: 2016</p>','asics-gel-lyte-iii-marble-pack-black','Asics Gel Lyte III \"Marble Pack\" Black',NULL,'Asics Gel Lyte III \"Marble Pack\" Black','Asics Gel Lyte III \"Marble Pack\" Black',NULL,NULL),(1535,1,2,'<p>Année de sortie: 2016<span style=\"color: #ff0000;\"><strong><br /></strong></span>