, AKA « the Ice Man ». The Blazer didn’t have great technology, but the process of fusing the outsole to the upper was pretty extreme.</p>','<p>Year of release: 2015</p>','blazer-mid-prm-grey-white','Nike Blazer Mid PRM Grey/White 2015 Vintage Suede',NULL,'Blazer Mid PRM Grey/White Women','Blazer Mid PRM Grey/White Women',NULL,NULL),(1566,1,2,'<p>A propos de la Blazer:</p>\r\n<p>Date de sortie du modèle original: 1972</p>\r\n<p>Ce qui caractérise ce modèle à l’époque c’est l’énorme « swoosh », la virgule devait être la plus grosse possible pour que tout le monde puisse la remarquer. Le basketteur associé à la Blazer était George Gervin alias « the Ice Man ». Ce modèle n’avait rien de révolutionnaire, mais le fait de fusionner la semelle avec le bout renforcé était assez innovant pour l’époque.</p>','<p>Année de sortie: 2015</p>','blazer-mid-prm-grey-white','Nike Blazer Mid PRM Grey/White 2015 Vintage Suede',NULL,'Blazer Mid PRM Grey/White Women','Blazer Mid PRM Grey/White Women',NULL,NULL),(1566,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1566,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1566,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1569,1,1,'<p>Year of release: 2016</p>','<p>Year of release: 2016</p>','puma-trinomic-r698-knit-mesh-v2-black','Puma Trinomic R698 Knit Mesh V2 Black running retro',NULL,'Puma Trinomic R698 Knit Mesh V2 Black','Puma Trinomic R698 Knit Mesh V2 Black',NULL,NULL),(1569,1,2,'<p>Année de sortie: 2016</p>','<p>Année de sortie: 2016</p>','puma-trinomic-r698-knit-mesh-v2-black','Puma Trinomic R698 Knit Mesh V2 Black running retro',NULL,'Puma Trinomic R698 Knit Mesh V2 Black','Puma Trinomic R698 Knit Mesh V2 Black',NULL,NULL),(1569,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1569,1,4,NULL,