p><span>Année de sortie: 2016</span></p>','<p>Année de sortie: 2016</p>','adidas-gazelle-20-kids-pink-white','Adidas Gazelle 2.0 Kids Pink/White PS boys',NULL,'Adidas Gazelle 2.0 Kids Pink/White','Adidas Gazelle 2.0 Kids Pink/White',NULL,NULL),(1808,1,3,NULL,NULL,'adidas-campus',NULL,NULL,NULL,'Adidas Campus',NULL,NULL),(1808,1,4,NULL,NULL,'adidas-campus',NULL,NULL,NULL,'Adidas Campus',NULL,NULL),(1808,1,5,NULL,NULL,'adidas-campus',NULL,NULL,NULL,'Adidas Campus',NULL,NULL),(1809,1,1,'<p>Year of release: 2016</p>\r\n<p> </p>\r\n<p>About Adidas Superstar:</p>\r\n<p>Year of release of OG Model: 1969</p>\r\n<p>The Superstar was produced in 1969 as a low Pro Model version and was the first basketball sneaker made of leather. Unmistakable because of the shelltop made of rubber.</p>\r\n<p>With his typical styling and his bulky looking. Hip Hop artists like RUN-DMC made it to an icon. Their track My Adidas paid tribute to the brand and let the group have their own personalized Adidas shoes and clothing.</p>','<p>Year of release: 2016</p>','adidas-superstar-foundation-white-black-kids','Adidas Superstar Foundation White/Black Kids 2016 PS boys',NULL,'Adidas Superstar Foundation White/Black Kids','Adidas Superstar Foundation White/Black Kids',NULL,NULL),(1809,1,2,'<p>Année de sortie: 2016</p>\r\n<p> </p>\r\n<p>A propos de la Adidas Superstar:</p>\r\n<p>Année de sortie du modèle original: 1969</p>\r\n<p>La superstar a été produite en 1969 comme une version basse de la Pro Model et a été la première chaussure de basket-ball toute en cuir. Cette chaussure est incomparable en raison de sa coque en caoutchouc renforcée à l’avant du pied. Avec son style atypique et sa forme volumineuse.</p>\r\n<p>Des artistes Hip Hop comme RUN-DMC ont fait de cette chaussure un phénomène. Leur chanson « My Adidas » a rendu hommage à la marque et a conduit le groupe à avoir leur propre ligne de vêtements et de chaussures Adidas.</p>','<p>Année de sortie: 2016</p>','adidas-superstar-foundation-white-black-kids','Adidas Superstar Foundation White/Black Kids 2016 PS boys',NULL,'Adidas Superstar Foundation White/Black Kids','Adidas Superstar Foundation White/Black Kids',NULL,NULL),(1809,1,3,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1809,1,4,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1809,1,5,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1810,1,1,'<p>Year of release: 2016</p>','<p>Year of release: 2016</p>','adidas-stan-smith-white-pink-kids','Adidas Stan Smith White/Pink Kids 2016 PS boys',NULL,'Adidas Stan Smith White/Pink Kids','Adidas Stan Smith White/Pink Kids',NULL,NULL),(1810,1,2,'<p>Année de sortie: 2016</p>','<p>Année de sortie: 2016</p>','adidas-stan-smith-white-pink-kids','Adidas Stan Smith White/Pink Kids 2016 PS boys',NULL,'Adidas Stan Smith White/Pink Kids','Adidas Stan Smith White/Pink Kids',NULL,NULL),(1810,1,3,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1810,1,4,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1810,1,5,NULL,NULL,'adidas-superstar-run-dmc-25th-anniversary',NULL,NULL,NULL,'Adidas Superstar Run DMC 25th Anniversary',NULL,NULL),(1811,1,1,'<p>Year of release: 2016</p>','<p>Year of release: 2016</p>','arkk-raven-black','ARKK Raven Black Copenhagen Denmark 2016',NULL,'ARKK Raven Black','ARKK Raven Black',NULL,NULL),(1811,1,2,'<p>Année de sortie: 2016</p>','<p>Année de sortie: 2016</p>','arkk-raven-black','ARKK Raven Black Copenhagen Denmark 2016 women ladies',NULL,'ARKK Raven Black','ARKK Raven Black',NULL,NULL),(1811,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1811,1,4,NULL,NULL,'