\n<p> </p>\r\n<p>About Puma Suede:</p>\r\n<p>Year of release of OG Model: 1968</p>\r\n<p>Puma Suede is typically a classic model that stood the test of time, it has now become one of the best-loved sneakers. A basic design with clean styling was counterbalanced by a whole series of colours and customized with fat laces. Along with the Adidas Superstar and Puma Clyde, the Suede was the staple of every b-boy’s daily outfit. <br /><br /></p>\r\n<p> </p>','<p>Release date: 8/12/2016</p>','puma-suede-creepers-by-rihanna-velvet-glacier-grey','Puma Suede Creepers by Rihanna Velvet Glacier Grey 1968 2016 ',NULL,'Puma Suede Creepers by Rihanna Velvet Glacier Grey','Puma Suede Creepers by Rihanna Velvet Glacier Grey',NULL,NULL),(1827,1,2,'<p>Date de sortie: 8/12/2016</p>\r\n<p> </p>\r\n<p>A propos de la Puma Suede:</p>\r\n<p>Année de sortie du modèle original: 1968</p>\r\n<p>La Puma Suede est l’archétype du modèle classique dont le style a traversé les époques sans jamais prendre une ride. Elle fait désormais partie des modèles les plus appréciés internationalement. Une conception classique, un style sobre, contrebalancés par toute une série de couleurs et personnalisables notamment avec des Fat Laces. Tout comme la Adidas Superstar et la Puma Clyde, la Suede était l\'accessoire de base des B-Boy\'s.</p>','<p>Date de sortie: 8/12/2016</p>','puma-suede-creepers-by-rihanna-velvet-glacier-grey','Puma Suede Creepers by Rihanna Velvet Glacier Grey 1968 2016 ladies wmn women girls',NULL,'Puma Suede Creepers by Rihanna Velvet Glacier Grey','Puma Suede Creepers by Rihanna Velvet Glacier Grey',NULL,NULL),(1827,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1827,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1827,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1828,1,1,'<p>Release date: 8/12/2016</p>\r\n