out Adidas Stan Smith:</p>\r\n<p>Year of release of OG Model: 1964</p>\r\n<p>The earliest version of this shoe was produced in 1964 with the coopeartion of French player Robert Haillet. In 1965, American tennis pro Stan Smith came to the attention of Adidas. Haillet’s name was replaced with Smith’s, and subsequent models had his face and signature on the tongue. Over the years, the Stan Smith has been a constant presence in the Adidas catalogue. The sneakerhead’s favourite is the original Robert Haillet version.</p>','<p>Year of release: 2016</p>','adidas-stan-smith-white-green','Adidas Stan Smith White/Green OG colorway vintage 2014 Retro',NULL,'Adidas Stan Smith White/Green','Adidas Stan Smith White/Green',NULL,NULL),(1898,1,2,'<p>Année de sortie: 2016</p>\r\n<p> </p>\r\n<p>A propos de la Adidas Stan Smith:</p>\r\n<p>Année de sortie du modèle original: 1964</p>\r\n<p>La première version de cette chaussure a été produite en 1964 en coopération avec le joueur de tennis français Robert Haillet. En 1965, le joueur de tennis américain Stan Smith est remarqué par Adidas. Le visage et la signature de Haillet sur la languette disparaissent et sont remplacés par ceux de Stan Smith. Au fil des ans, la Stan Smith est restée présente dans le catalogue Adidas. Le modèle original de Robert Haillet est la version la plus recherchée par les sneakerheads.</p>','<p>Année de sortie: 2016</p>','adidas-stan-smith-white-green','Adidas Stan Smith White/Green OG colorway vintage 2014 Retro',NULL,'Adidas Stan Smith White/Green','Adidas Stan Smith White/Green',NULL,NULL),(1898,1,3,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1898,1,4,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1898,1,5,NULL,NULL,'air-jordan-i-low-phat-black-red',NULL,NULL,NULL,'Air Jordan I Low Phat Black/Red',NULL,NULL),(1899,1,1,'<p>Year of release: 2016</p>\r\n<p> </p>\r\n<p>About Adidas Stan Smith:</